nnot be activated because required plugins are missing or inactive.'=>'ಅಗತ್ಯವಿರುವ ಪ್ಲಗಿನ್‌ಗಳು ಕಾಣೆಯಾಗಿರುವುದರಿಂದ ಅಥವಾ ನಿಷ್ಕ್ರಿಯವಾಗಿರುವ ಕಾರಣ ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲಾಗುವುದಿಲ್ಲ.','This plugin is active but may not function correctly because required plugins are missing or inactive.'=>'ಈ ಪ್ಲಗಿನ್ ಸಕ್ರಿಯವಾಗಿದೆ ಆದರೆ ಅಗತ್ಯವಿರುವ ಪ್ಲಗಿನ್‌ಗಳು ಕಾಣೆಯಾಗಿವೆ ಅಥವಾ ನಿಷ್ಕ್ರಿಯವಾಗಿರುವ ಕಾರಣ ಸರಿಯಾಗಿ ಕಾರ್ಯನಿರ್ವಹಿಸದೇ ಇರಬಹುದು.','<strong>Requires:</strong> %s'=>'<strong>ಅಗತ್ಯವಿದೆ:</strong> %s','<strong>Required by:</strong> %s'=>'%s <strong>ಮೂಲಕ ಅಗತ್ಯವಿದೆ</strong>','Note: This plugin cannot be deactivated or deleted until the plugins that require it are deactivated or deleted.'=>'ಗಮನಿಸಿ: ಅಗತ್ಯವಿರುವ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸುವವರೆಗೆ ಅಥವಾ ಅಳಿಸುವವರೆಗೆ ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗುವುದಿಲ್ಲ ಅಥವಾ ಅಳಿಸಲಾಗುವುದಿಲ್ಲ.','You cannot deactivate this plugin as other plugins depend on it.'=>'ಇತರ ಪ್ಲಗಿನ್‌ಗಳು ಇದನ್ನು ಅವಲಂಬಿಸಿರುವುದರಿಂದ ನೀವು ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','You cannot delete this plugin as other plugins require it.'=>'ಇತರ ಪ್ಲಗಿನ್‌ಗಳು ಇದನ್ನು ಅವಲಂಬಿಸಿರುವುದರಿಂದ ನೀವು ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','You cannot activate this plugin as it has unmet requirements.'=>'ನೀವು ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ ಏಕೆಂದರೆ ಇದು ಪೂರೈಸದ ಅವಶ್ಯಕತೆಗಳನ್ನು ಹೊಂದಿದೆ.','pluginDeactivate'=>'ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಿ','pluginNetwork Deactivate'=>'ನೆಟ್‌ವರ್ಕ್ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಿ','pluginActivate'=>'ಸಕ್ರಿಯಗೊಳಿಸಿ','Additional plugins are required'=>'ಹೆಚ್ಚುವರಿ ಪ್ಲಗಿನ್‌ಗಳ ಅಗತ್ಯವಿದೆ','Site ID'=>'ಸೈಟ್ ID','The PHP version on your server is %1$s, however the new theme version requires %2$s.'=>'ನಿಮ್ಮ ಸರ್ವರ್‌ನಲ್ಲಿರುವ PHP ಆವೃತ್ತಿಯು %1$s ಆಗಿದೆ, ಆದಾಗ್ಯೂ ಹೊಸ ಥೀಮ್ ಆವೃತ್ತಿಗೆ %2$s ಅಗತ್ಯವಿದೆ.','Your WordPress version is %1$s, however the new theme version requires %2$s.'=>'ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿಯು %1$s ಆಗಿದೆ, ಆದಾಗ್ಯೂ ಹೊಸ ಥೀಮ್ ಆವೃತ್ತಿಗೆ %2$s ಅಗತ್ಯವಿದೆ.','pluginNetwork Activate'=>'ನೆಟ್‌ವರ್ಕ್ ಸಕ್ರಿಯಗೊಳಿಸಿ','%s is already active.'=>'%s ಈಗಾಗಲೇ ಸಕ್ರಿಯವಾಗಿದೆ.','pluginInstall Now'=>'ಈಗ ಸ್ಥಾಪಿಸಿ','Created by a worl