ು. 5 ನಿಮಿಷಗಳ ನಂತರ ಯಾವುದೇ ಪ್ರತಿಕ್ರಿಯೆ ಇಲ್ಲದಿದ್ದರೆ ಅಥವಾ ದೋಷಗಳಿದ್ದರೆ ದಯವಿಟ್ಟು ಮೇಲಿನ ಸಹಾಯ ವಿಭಾಗವನ್ನು ನೋಡಿ.','On systems with fewer resources, this may lead to server timeouts or resource limits being reached. If you encounter an issue during the update process, please create a support forum topic and reference <strong>Rollback</strong> in the issue title.'=>'ಕಡಿಮೆ ಸಂಪನ್ಮೂಲಗಳನ್ನು ಹೊಂದಿರುವ ಸಿಸ್ಟಂಗಳಲ್ಲಿ, ಇದು ಸರ್ವರ್ ಕಾಲಾವಧಿ ಅಥವಾ ಸಂಪನ್ಮೂಲ ಮಿತಿಗಳನ್ನು ತಲುಪಲು ಕಾರಣವಾಗಬಹುದು. ನವೀಕರಣ ಪ್ರಕ್ರಿಯೆಯಲ್ಲಿ ನೀವು ಸಮಸ್ಯೆಯನ್ನು ಎದುರಿಸಿದರೆ, ದಯವಿಟ್ಟು ಬೆಂಬಲ ಫೋರಮ್ ವಿಷಯವನ್ನು ರಚಿಸಿ ಮತ್ತು ಸಮಸ್ಯೆಯ ಶೀರ್ಷಿಕೆಯಲ್ಲಿ <strong>ರೋಲ್‌ಬ್ಯಾಕ್</strong> ಅನ್ನು ಉಲ್ಲೇಖಿಸಿ.','This feature will create a temporary backup of a plugin or theme before it is upgraded. This backup is used to restore the plugin or theme back to its previous state if there is an error during the update process.'=>'ಈ ವೈಶಿಷ್ಟ್ಯವು ಅಪ್‌ಗ್ರೇಡ್ ಮಾಡುವ ಮೊದಲು ಪ್ಲಗಿನ್ ಅಥವಾ ಥೀಮ್‌ನ ತಾತ್ಕಾಲಿಕ ಬ್ಯಾಕಪ್ ಅನ್ನು ರಚಿಸುತ್ತದೆ. ನವೀಕರಣ ಪ್ರಕ್ರಿಯೆಯಲ್ಲಿ ದೋಷವಿದ್ದಲ್ಲಿ ಪ್ಲಗಿನ್ ಅಥವಾ ಥೀಮ್ ಅನ್ನು ಅದರ ಹಿಂದಿನ ಸ್ಥಿತಿಗೆ ಮರುಸ್ಥಾಪಿಸಲು ಈ ಬ್ಯಾಕಪ್ ಅನ್ನು ಬಳಸಲಾಗುತ್ತದೆ.','https://wordpress.org/documentation/article/customize-permalinks/'=>'https://wordpress.org/documentation/article/customize-permalinks/','Images cannot be scaled to a size larger than the original.'=>'ಚಿತ್ರಗಳನ್ನು ಮೂಲಕ್ಕಿಂತ ದೊಡ್ಡ ಗಾತ್ರಕ್ಕೆ ಅಳೆಯಲಾಗುವುದಿಲ್ಲ.','Crop Image'=>'ಚಿತ್ರವನ್ನು ಕ್ರಾಪ್ ಮಾಡಿ','Starting Coordinates:'=>'ಆರಂಭಿಕ ನಿರ್ದೇಶಾಂಕಗಳು:','horizontal start position'=>'ಸಮತಲ ಪ್ರಾರಂಭದ ಸ್ಥಾನ','vertical start position'=>'ಲಂಬ ಆರಂಭಿಕ ಸ್ಥಾನ','Cancel Editing'=>'ಸಂಪಾದನೆ ರದ್ದುಮಾಡಿ','New custom field name'=>'ಹೊಸ ಕಸ್ಟಮ್ ಕ್ಷೇತ್ರದ ಹೆಸರು','Table ordered by E-mail.'=>'ಇ-ಮೇಲ್ ಮೂಲಕ ಟೇಬಲ್ ಆರ್ಡರ್ ಮಾಡಲಾಗಿದೆ.','Table ordered by Username.'=>'ಬಳಕೆದಾರಹೆಸರಿನಿಂದ ಆದೇಶಿಸಿದ ಟೇಬಲ್.','Could not create the destination directory.'=>'ಗಮ್ಯಸ್ಥಾನ ಡೈರೆಕ್ಟರಿಯನ್ನು ರಚಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','The site editor requires JavaScript. Please enable JavaScript in your browser settings.'=>'ಸೈಟ್ ಸಂಪಾದಕಕ್ಕೆ JavaScript ಅಗತ್ಯವಿದೆ. ದಯವಿಟ್ಟು ನಿಮ್ಮ ಬ್ರೌಸರ್ ಸೆಟ್ಟಿಂಗ್‌ಗಳಲ್ಲಿ JavaScript ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿ.','In a few words, explain what this site is about. Example: &#8220;%s.&#8221;'=>'ಕೆಲವು ಪದಗಳಲ್ಲಿ, ಈ ಸೈಟ್ ಬಗ್ಗೆ ವಿವರಿಸಿ. ಉದಾಹರಣೆ: &#8220;%s.&#8221;','Note: Discouraging search engines does not block access to your site &mdash; it is up to search engines to honor your request.'=>'ಗಮನಿಸಿ: ಸರ್ಚ್ ಎಂಜಿನ್‌ಗಳನ್ನು ನಿರುತ್ಸಾಹಗೊಳಿಸುವುದರಿಂದ ನಿಮ್ಮ ಸೈಟ್‌ಗೆ ಪ್ರವೇಶವನ್ನು ನಿರ್ಬಂಧಿಸುವುದಿಲ್ಲ &mdash; ನಿಮ್ಮ ವಿನಂತಿಯನ್ನು ಗೌರವಿಸಲು ಸರ್ಚ್ ಎಂಜಿನ್‌ಗಳಿಗೆ ಬಿಟ್ಟದ್ದು.','Save Edits'=>'ಸಂಪಾದನೆಗಳನ್ನು ಉಳಿಸಿ','Could not delete the temporary backup directory for %s.'=>'%s ಗಾಗಿ ತಾತ್ಕಾಲಿಕ ಬ್ಯಾಕಪ್ ಡೈರೆಕ್ಟರಿಯನ್ನು ಅಳಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Available disk space'=>'ಲಭ್ಯವಿರುವ ಡಿಸ್ಕ್ ಸ್ಥಳ','Plugin and theme temporary backup directory access'=>'ಪ್ಲಗಿನ್ ಮತ್ತು ಥೀಮ್ ತಾತ್ಕಾಲಿಕ ಬ್ಯಾಕಪ್ ಡೈರೆಕ್ಟರಿ ಪ್ರವೇಶ','Could not restore the original version of %s.'=>'%s ನ ಮೂಲ ಆವೃತ್ತಿಯನ್ನು ಮರುಸ್ಥಾಪಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Could not move the old version to the %s directory.'=>'ಹಳೆಯ ಆವೃತ್ತಿಯನ್ನು %s ಡೈರೆಕ್ಟರಿಗೆ ಸರಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Could not create the %s directory.'=>'%s ಡೈರೆಕ್ಟರಿಯನ್ನು ರಚಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','The upgrade directory exists but is not writable'=>'ಅಪ್‌ಗ್ರೇಡ್ ಡೈರೆಕ್ಟರಿ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ ಆದರೆ ಬರೆಯಲಾಗುವುದಿಲ್ಲ','The temporary backup directory exists but is not writable'=>'ತಾತ್ಕಾಲಿಕ ಬ್ಯಾಕಪ್ ಡೈರೆಕ್ಟರಿ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ ಆದರೆ ಬರೆಯಲಾಗುವುದಿಲ್ಲ','The upgrade directory cannot be created'=>'ಅಪ್‌ಗ್ರೇಡ್ ಡೈರೆಕ್ಟರಿಯನ್ನು ರಚಿಸಲಾಗುವುದಿಲ್ಲ','Plugin temporary backup directory exists but is not writable'=>'ಪ್ಲಗಿನ್ ತಾತ್ಕಾಲಿಕ ಬ್ಯಾಕಪ್ ಡೈರೆಕ್ಟರಿ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ ಆದರೆ ಬರೆಯಲಾಗುವುದಿಲ್ಲ','Theme temporary backup directory exists but is not writable'=>'ಥೀಮ್ ತಾತ್ಕಾಲಿಕ ಬ್ಯಾಕಪ್ ಡೈರೆಕ್ಟರಿ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ ಆದರೆ ಬರೆಯಲಾಗುವುದಿಲ್ಲ','Could not determine available disk space for updates.'=>'ನವೀಕರಣಗಳಿಗಾಗಿ ಲಭ್ಯವಿರುವ ಡಿಸ್ಕ್ ಸ್ಥಳವನ್ನು ನಿರ್ಧರಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','%s available disk space was detected, update routines can be performed safely.'=>'%s ಲಭ್ಯವಿರುವ ಡಿಸ್ಕ್ ಸ್ಥಳವನ್ನು ಪತ್ತೆಹಚ್ಚಲಾಗಿದೆ, ನವೀಕರಣ ದಿನಚರಿಗಳನ್ನು ಸುರಕ್ಷಿತವಾಗಿ ನಿರ್ವಹಿಸಬಹುದು.','Disk space available to safely perform updates'=>'ನವೀಕರಣಗಳನ್ನು ಸುರಕ್ಷಿತವಾಗಿ ನಿರ್ವಹಿಸಲು ಡಿಸ್ಕ್ ಸ್ಪೇಸ್ ಲಭ್ಯವಿದೆ','Plugin and theme temporary backup directory is writable'=>'ಪ್ಲಗಿನ್ ಮತ್ತು ಥೀಮ್ ತಾತ್ಕಾಲಿಕ ಬ್ಯಾಕಪ್ ಡೈರೆಕ್ಟರಿಯನ್ನು ಬರೆಯಬಹುದಾಗಿದೆ','Current time'=>'ಪ್ರಸ್ತುತ ಸಮಯ','Plugin and theme temporary backup directories exist but are not writable'=>'ಪ್ಲಗಿನ್ ಮತ್ತು ಥೀಮ್ ತಾತ್ಕಾಲಿಕ ಬ್ಯಾಕಪ್ ಡೈರೆಕ್ಟರಿಗಳು ಅಸ್ತಿತ್ವದಲ್ಲಿವೆ ಆದರೆ ಬರೆಯಲಾಗುವುದಿಲ್ಲ','Current Server time'=>'ಪ್ರಸ್ತುತ ಸರ್ವರ್ ಸಮಯ','Current UTC time'=>'ಪ್ರಸ್ತುತ UTC ಸಮಯ','Descending.'=>'ಅವರೋಹಣ.','Ascending.'=>'ಆರೋಹಣ.','The %s directory cannot be located.'=>'%s ಡೈರೆಕ್ಟರಿಯನ್ನು ಪತ್ತೆಹಚ್ಚಲು ಸಾಧ್ಯವಿಲ್ಲ.','The %s directory used to improve the stability of plugin and theme updates is writable.'=>'ಪ್ಲಗಿನ್ ಮತ್ತು ಥೀಮ್ ನವೀಕರಣಗಳ ಸ್ಥಿರತೆಯನ್ನು ಸುಧಾರಿಸಲು %s ಡೈರೆಕ್ಟರಿಯನ್ನು ಬರೆಯಬಹುದಾಗಿದೆ.','Available disk space is critically low, less than %s available. Proceed with caution, updates may fail.'=>'ಲಭ್ಯವಿರುವ ಡಿಸ್ಕ್ ಸ್ಥಳವು ವಿಮರ್ಶಾತ್ಮಕವಾಗಿ ಕಡಿಮೆಯಾಗಿದೆ, %s ಗಿಂತ ಕಡಿಮೆ ಲಭ್ಯವಿದೆ. ಎಚ್ಚರಿಕೆಯಿಂದ ಮುಂದುವರಿಯಿರಿ, ನವೀಕರಣಗಳು ವಿಫಲವಾಗಬಹುದು.','Available disk space is low, less than %s available.'=>'ಲಭ್ಯವಿರುವ ಡಿಸ್ಕ್ ಸ್ಥಳಾವಕಾಶ ಕಡಿಮೆ, %s ಗಿಂತ ಕಡಿಮೆ ಲಭ್ಯವಿದೆ.','More details.'=>'ಹೆಚ್ಚಿನ ವಿವರಗಳು.','Attempting to restore the previous version.'=>'ಹಿಂದಿನ ಆವೃತ್ತಿಯನ್ನು ಮರುಸ್ಥಾಪಿಸಲು ಪ್ರಯತ್ನಿಸಲಾಗುತ್ತಿದೆ.','If you do code, or want to learn how, you can contribute technically in numerous ways:'=>'ನೀವು ಕೋಡ್ ಮಾಡಿದರೆ ಅಥವಾ ಹೇಗೆಂದು ತಿಳಿಯಲು ಬಯಸಿದರೆ, ನೀವು ತಾಂತ್ರಿಕವಾಗಿ ಹಲವಾರು ರೀತಿಯಲ್ಲಿ ಕೊಡುಗೆ ನೀಡಬಹುದು:','Shape the future of the web with WordPress'=>'ವರ್ಡ್ಪ್ರೆಸ್‌ನೊಂದಿಗೆ ವೆಬ್‌ನ ಭವಿಷ್ಯವನ್ನು ರೂಪಿಸಿ','WordPress embraces new technologies, while being committed to backward compatibility. The WordPress project uses the following languages and libraries:'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಹೊಸ ತಂತ್ರಜ್ಞಾನಗಳನ್ನು ಅಳವಡಿಸಿಕೊಳ್ಳುತ್ತದೆ, ಆದರೆ ಹಿಂದುಳಿದ ಹೊಂದಾಣಿಕೆಗೆ ಬದ್ಧವಾಗಿದೆ. ವರ್ಡ್ಪ್ರೆಸ್ ಯೋಜನೆಯು ಈ ಕೆಳಗಿನ ಭಾಷೆಗಳು ಮತ್ತು ಗ್ರಂಥಾಲಯಗಳನ್ನು ಬಳಸುತ್ತದೆ:','<strong>Contribute</strong> to the code, improve the UX, and test the WordPress app.'=>'ಕೋಡ್‌ಗೆ <strong>ಕೊಡುಗೆ ನೀಡಿ</strong>, UX ಅನ್ನು ಸುಧಾರಿಸಿ ಮತ್ತು ವರ್ಡ್ಪ್ರೆಸ್ ಅಪ್ಲಿಕೇಶನ್ ಅನ್ನು ಪರೀಕ್ಷಿಸಿ.','Code-based contribution'=>'ಕೋಡ್ ಆಧಾರಿತ ಕೊಡುಗೆ','<strong>Translate</strong> WordPress into your local language.'=>'ನಿಮ್ಮ ಸ್ಥಳೀಯ ಭಾಷೆಗೆ ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು <strong>ಭಾಷಾಂತರಿಸಿ</strong>.','Grow your network and make friends.'=>'ನಿಮ್ಮ ನೆಟ್ವರ್ಕ್ ಅನ್ನು ಬೆಳೆಸಿಕೊಳ್ಳಿ ಮತ್ತು ಸ್ನೇಹಿತರನ್ನು ಮಾಡಿ.','Join the diverse WordPress contributor community and connect with other people who are passionate about maintaining a free and open web.'=>'ವೈವಿಧ್ಯಮಯ ವರ್ಡ್ಪ್ರೆಸ್ ಕೊಡುಗೆದಾರರ ಸಮುದಾಯವನ್ನು ಸೇರಿ ಮತ್ತು ಉಚಿತ ಮತ್ತು ಮುಕ್ತ ವೆಬ್ ಅನ್ನು ನಿರ್ವಹಿಸುವ ಬಗ್ಗೆ ಉತ್ಸಾಹ ಹೊಂದಿರುವ ಇತರ ಜನರೊಂದಿಗೆ ಸಂಪರ್ಕ ಸಾಧಿಸಿ.','Apply your skills or learn new ones.'=>'ನಿಮ್ಮ ಕೌಶಲ್ಯಗಳನ್ನು ಅನ್ವಯಿಸಿ ಅಥವಾ ಹೊಸದನ್ನು ಕಲಿಯಿರಿ.','Be part of a global open source community.'=>'ಜಾಗತಿಕ ಓಪನ್ ಸೊರ್ಸ್ ಸಮುದಾಯದ ಭಾಗವಾಗಿರಿ.','Do you use WordPress for work, for personal projects, or even just for fun? You can help shape the long-term success of the open source project that powers millions of websites around the world.'=>'ನೀವು ಕೆಲಸಕ್ಕಾಗಿ, ವೈಯಕ್ತಿಕ ಯೋಜನೆಗಳಿಗಾಗಿ ಅಥವಾ ವಿನೋದಕ್ಕಾಗಿ ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ಬಳಸುತ್ತೀರಾ? ಪ್ರಪಂಚದಾದ್ಯಂತ ಲಕ್ಷಾಂತರ ವೆಬ್‌ಸೈಟ್‌ಗಳಿಗೆ ಶಕ್ತಿ ತುಂಬುವ ಮುಕ್ತ ಮೂಲ ಯೋಜನೆಯ ದೀರ್ಘಾವಧಿಯ ಯಶಸ್ಸನ್ನು ರೂಪಿಸಲು ನೀವು ಸಹಾಯ ಮಾಡಬಹುದು.','No-code contribution'=>'ನೋ-ಕೋಡ್ ಕೊಡುಗೆ','Be the future of WordPress'=>'ವರ್ಡ್ಪ್ರೆಸ್ನ ಭವಿಷ್ಯವಾಗಿರಿ','<a href="https://wordpress.org/support/forums/">Support forums</a>'=>'<a href="https://wordpress.org/support/forums/">ಬೆಂಬಲ ವೇದಿಕೆಗಳು</a>','<a href="https://wordpress.org/documentation/article/appearance-widgets-screen-classic-editor/">Documentation on Widgets</a>'=>'<a href="https://wordpress.org/documentation/article/appearance-widgets-screen-classic-editor/">ವಿಜೆಟ್‌ಗಳ ಮೇಲೆ ದಾಖಲೆ</a>','<strong>Download file</strong> downloads the original media file to your device.'=>'<strong>ಡೌನ್‌ಲೋಡ್ ಫೈಲ್</strong> ನಿಮ್ಮ ಸಾಧನಕ್ಕೆ ಮೂಲ ಮಾಧ್ಯಮ ಫೈಲ್ ಅನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡುತ್ತದೆ.','site editor title tagEditor'=>'‍ಸಂಪಾದಕ','<a href="https://wordpress.org/documentation/article/plugins-themes-auto-updates/">Documentation on Auto-updates</a>'=>'<a href="https://wordpress.org/documentation/article/plugins-themes-auto-updates/">ಸ್ವಯಂ-ನವೀಕರಣಗಳ ಮೇಲೆ ದಾಖಲೆ</a>','<a href="https://wordpress.org/documentation/article/customize-date-and-time-format/">Documentation on date and time formatting</a>.'=>'<a href="https://wordpress.org/documentation/article/customize-date-and-time-format/">ದಿನಾಂಕ ಮತ್ತು ಸಮಯದ ಫಾರ್ಮ್ಯಾಟಿಂಗ್‌ನ ಕುರಿತು ದಾಖಲೀಕರಣ</a>.','You can set the language, and WordPress will automatically download and install the translation files (available if your filesystem is writable).'=>'ನೀವು ಭಾಷೆಯನ್ನು ಹೊಂದಿಸಬಹುದು ಮತ್ತು ವರ್ಡ್ಪ್ರೆಸ್ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಅನುವಾದ ಫೈಲ್‌ಗಳನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡುತ್ತದೆ ಮತ್ತು ಸ್ಥಾಪಿಸುತ್ತದೆ (ನಿಮ್ಮ ಫೈಲ್‌ಸಿಸ್ಟಮ್ ಬರೆಯಬಹುದಾದರೆ ಲಭ್ಯವಿದೆ).','RoboHash (Generated)'=>'RoboHash (ರಚಿತ)','site editor menu itemEditor'=>'‍ಸಂಪಾದಕ','https://wordpress.org/documentation/article/assign-custom-fields/'=>'https://wordpress.org/documentation/article/assign-custom-fields/','https://wordpress.org/documentation/article/what-is-an-excerpt-classic-editor/'=>'https://wordpress.org/documentation/article/what-is-an-excerpt-classic-editor/','The destination directory already exists and could not be removed.'=>'ಗಮ್ಯಸ್ಥಾನ ಡೈರೆಕ್ಟರಿ ಈಗಾಗಲೇ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ ಮತ್ತು ತೆಗೆದುಹಾಕಲಾಗಲಿಲ್ಲ.','The destination folder already exists.'=>'ಗಮ್ಯಸ್ಥಾನ ಫೋಲ್ಡರ್ ಈಗಾಗಲೇ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ.','The source and destination are the same.'=>'ಮೂಲ ಮತ್ತು ಗಮ್ಯಸ್ಥಾನ ಒಂದೇ.','Allow <a href="%s">trackbacks and pingbacks</a>'=>'<a href="%s">ಟ್ರ್ಯಾಕ್‌ಬ್ಯಾಕ್‌ಗಳು ಮತ್ತು ಪಿಂಗ್‌ಬ್ಯಾಕ್‌ಗಳನ್ನು</a> ಅನುಮತಿಸಿ','Download &#8220;%s&#8221;'=>'ಡೌನ್‌ಲೋಡ್ &#8220;%s&#8221;','The "%s" argument must be a non-empty string.'=>'"%s" ಆರ್ಗ್ಯುಮೆಂಟ್ ಖಾಲಿ ಅಲ್ಲದ ಸ್ಟ್ರಿಂಗ್ ಆಗಿರಬೇಕು.','<a href="https://wordpress.org/documentation/article/understand-comment-spam/">Documentation on Comment Spam</a>'=>'<a href="https://wordpress.org/documentation/article/understand-comment-spam/">ಕಾಮೆಂಟ್ ಸ್ಪ್ಯಾಮ್ ಮೇಲೆ ದಾಖಲೆ</a>','<a href="https://wordpress.org/documentation/article/write-posts-classic-editor/">Documentation on Writing and Editing Posts</a>'=>'<a href="https://wordpress.org/documentation/article/write-posts-classic-editor/">ಪೋಸ್ಟ್‌ಗಳನ್ನು ಬರೆಯುವುದು ಮತ್ತು ಸಂಪಾದಿಸುವ ಕುರಿತು ದಾಖಲೀಕರಣ</a>','<a href="https://wordpress.org/documentation/article/keyboard-shortcuts-classic-editor/#keyboard-shortcuts-for-comments">Documentation on Keyboard Shortcuts</a>'=>'<a href="https://wordpress.org/documentation/article/keyboard-shortcuts-classic-editor/#keyboard-shortcuts-for-comments">ಕೀಬೋರ್ಡ್ ಶಾರ್ಟ್‌ಕಟ್‌ಗಳ ಕುರಿತು ದಾಖಲೀಕರಣ</a>','<a href="https://wordpress.org/documentation/article/customizer/">Documentation on Customizer</a>'=>'<a href="https://wordpress.org/documentation/article/customizer/">ಕಸ್ಟೊಮೈಜರ್ ಬಗ್ಗೆ ದಾಖಲೀಕರಣ</a>','https://wordpress.org/download/'=>'https://wordpress.org/download/','This is the final release of WordPress %s'=>'ಇದು ವರ್ಡ್ಪ್ರೆಸ್ %s ನ ಅಂತಿಮ ಬಿಡುಗಡೆಯಾಗಿದೆ','Site Editor'=>'ಸೈಟ್ ಸಂಪಾದಕ','https://developer.wordpress.org/apis/wp-config-php/#wp-environment-type'=>'https://developer.wordpress.org/apis/wp-config-php/#wp-environment-type','<a href="https://wordpress.org/documentation/article/block-themes/">Documentation on Block Themes</a>'=>'<a href="https://wordpress.org/documentation/article/block-themes/">ಬ್ಲಾಕ್ ಥೀಮ್‌ಗಳ ಮೇಲೆ ದಾಖಲೀಕರಣ</a>','Configuration rules for %s:'=>'%s ಗಾಗಿ ಕಾನ್ಫಿಗರೇಶನ್ ನಿಯಮಗಳು:','The theme you are currently using is not compatible with the Site Editor.'=>'ನೀವು ಪ್ರಸ್ತುತ ಬಳಸುತ್ತಿರುವ ಥೀಮ್ ಸೈಟ್ ಎಡಿಟರ್‌ಗೆ ಹೊಂದಿಕೆಯಾಗುವುದಿಲ್ಲ.','Customize permalink structure by selecting available tags'=>'ಲಭ್ಯವಿರುವ ಟ್ಯಾಗ್‌ಗಳನ್ನು ಆಯ್ಕೆ ಮಾಡುವ ಮೂಲಕ ಪರ್ಮಾಲಿಂಕ್ ರಚನೆಯನ್ನು ಕಸ್ಟಮೈಸ್ ಮಾಡಿ','%s removed from permalink structure'=>'ಪರ್ಮಾಲಿಂಕ್ ರಚನೆಯಿಂದ %s ತೆಗೆದುಹಾಕಲಾಗಿದೆ','Site Health %s'=>'ಸೈಟ್ ಆರೋಗ್ಯ %s','The minimum recommended version of PHP is %s.'=>'PHP ಯ ಕನಿಷ್ಠ ಶಿಫಾರಸು ಆವೃತ್ತಿಯು %s ಆಗಿದೆ.','Theme Styles & Block Settings'=>'ಥೀಮ್ ಶೈಲಿಗಳು ಮತ್ತು ಬ್ಲಾಕ್ ಸೆಟ್ಟಿಂಗ್‌ಗಳು','Server response time could not be determined. Verify that loopback requests are working.'=>'ಸರ್ವರ್ ಪ್ರತಿಕ್ರಿಯೆ ಸಮಯವನ್ನು ನಿರ್ಧರಿಸಲಾಗಲಿಲ್ಲ. ಲೂಪ್‌ಬ್ಯಾಕ್ ವಿನಂತಿಗಳು ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತಿವೆಯೇ ಎಂದು ಪರಿಶೀಲಿಸಿ.','Page cache is detected but the server response time is still slow'=>'ಪುಟ ಸಂಗ್ರಹವನ್ನು ಪತ್ತೆಹಚ್ಚಲಾಗಿದೆ ಆದರೆ ಸರ್ವರ್ ಪ್ರತಿಕ್ರಿಯೆ ಸಮಯ ಇನ್ನೂ ನಿಧಾನವಾಗಿದೆ','Median server response time was %1$s milliseconds. This is less than the recommended %2$s milliseconds threshold.'=>'ಮಧ್ಯದ ಸರ್ವರ್ ಪ್ರತಿಕ್ರಿಯೆ ಸಮಯ %1$s ಮಿಲಿಸೆಕೆಂಡುಗಳು. ಇದು ಶಿಫಾರಸು ಮಾಡಲಾದ %2$s ಮಿಲಿಸೆಕೆಂಡ್‌ಗಳ ಮಿತಿಗಿಂತ ಕಡಿಮೆಯಾಗಿದೆ.','When testing the REST API, an error was encountered:'=>'REST API ಅನ್ನು ಪರೀಕ್ಷಿಸುವಾಗ, ದೋಷ ಎದುರಾಗಿದೆ:','REST API Endpoint: %s'=>'REST API ಅಂತ್ಯಬಿಂದು: %s','REST API Response: (%1$s) %2$s'=>'REST API ಪ್ರತಿಕ್ರಿಯೆ: (%1$s) %2$s','When testing the REST API, an unexpected result was returned:'=>'REST API ಅನ್ನು ಪರೀಕ್ಷಿಸುತ್ತಿರುವಾಗ, ಅನಿರೀಕ್ಷಿತ ಫಲಿತಾಂಶವನ್ನು ಹಿಂತಿರುಗಿಸಲಾಗಿದೆ:','Requirements'=>'ಅವಶ್ಯಕತೆಗಳು','Your site is running on an outdated version of PHP (%s), which does not receive security updates. It should be updated.'=>'ನಿಮ್ಮ ಸೈಟ್ PHP (%s) ನ ಹಳೆಯ ಆವೃತ್ತಿಯಲ್ಲಿ ಚಾಲನೆಯಲ್ಲಿದೆ, ಇದು ಭದ್ರತಾ ನವೀಕರಣಗಳನ್ನು ಸ್ವೀಕರಿಸುವುದಿಲ್ಲ. ಅದನ್ನು ನವೀಕರಿಸಬೇಕು.','Your site is running on an outdated version of PHP (%s), which soon will not be supported by WordPress.'=>'ನಿಮ್ಮ ಸೈಟ್ PHP (%s) ನ ಹಳೆಯ ಆವೃತ್ತಿಯಲ್ಲಿ ಚಾಲನೆಯಲ್ಲಿದೆ, ಇದು ಶೀಘ್ರದಲ್ಲೇ ವರ್ಡ್ಪ್ರೆಸ್ ನಿಂದ ಬೆಂಬಲಿತವಾಗುವುದಿಲ್ಲ.','Your site is running on an outdated version of PHP (%s), which does not receive security updates and soon will not be supported by WordPress.'=>'ನಿಮ್ಮ ಸೈಟ್ PHP (%s) ನ ಹಳೆಯ ಆವೃತ್ತಿಯಲ್ಲಿ ಚಾಲನೆಯಲ್ಲಿದೆ, ಇದು ಭದ್ರತಾ ನವೀಕರಣಗಳನ್ನು ಸ್ವೀಕರಿಸುವುದಿಲ್ಲ ಮತ್ತು ಶೀಘ್ರದಲ್ಲೇ ವರ್ಡ್ಪ್ರೆಸ್ ನಿಂದ ಬೆಂಬಲಿತವಾಗುವುದಿಲ್ಲ.','PHP is one of the programming languages used to build WordPress. Newer versions of PHP receive regular security updates and may increase your site&#8217;s performance. The minimum recommended version of PHP is %s.'=>'PHP ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ನಿರ್ಮಿಸಲು ಬಳಸುವ ಪ್ರೋಗ್ರಾಮಿಂಗ್ ಭಾಷೆಗಳಲ್ಲಿ ಒಂದಾಗಿದೆ. PHP ಯ ಹೊಸ ಆವೃತ್ತಿಗಳು ನಿಯಮಿತ ಭದ್ರತಾ ನವೀಕರಣಗಳನ್ನು ಸ್ವೀಕರಿಸುತ್ತವೆ ಮತ್ತು ನಿಮ್ಮ ಸೈಟ್‌ನ ಕಾರ್ಯಕ್ಷಮತೆಯನ್ನು ಹೆಚ್ಚಿಸಬಹುದು. PHP ಯ ಕನಿಷ್ಠ ಶಿಫಾರಸು ಆವೃತ್ತಿಯು %s ಆಗಿದೆ.','Reach out to WordPress Core developers to ensure you\'ll never have this problem again.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಕೋರ್ ಡೆವಲಪರ್‌ಗಳನ್ನು ಸಂಪರ್ಕಿಸಿ, ನೀವು ಮತ್ತೆ ಈ ಸಮಸ್ಯೆಯನ್ನು ಎದುರಿಸುವುದಿಲ್ಲ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಲು.','Another attempt will be made with the next release.'=>'ಮುಂದಿನ ಬಿಡುಗಡೆಯೊಂದಿಗೆ ಮತ್ತೊಂದು ಪ್ರಯತ್ನವನ್ನು ಮಾಡಲಾಗುವುದು.','Your site does not have any active plugins.'=>'ನಿಮ್ಮ ಸೈಟ್ ಯಾವುದೇ ಸಕ್ರಿಯ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಹೊಂದಿಲ್ಲ.','Your site does not have any installed themes.'=>'ನಿಮ್ಮ ಸೈಟ್ ಯಾವುದೇ ಸ್ಥಾಪಿಸಲಾದ ಥೀಮ್‌ಗಳನ್ನು ಹೊಂದಿಲ್ಲ.','The %1$s constant is defined as %2$s'=>'%1$s ಸ್ಥಿರಾಂಕವನ್ನು %2$s ಎಂದು ವ್ಯಾಖ್ಯಾನಿಸಲಾಗಿದೆ','https://make.wordpress.org/core/wordpress-%s-field-guide/'=>'https://make.wordpress.org/core/wordpress-%s-field-guide/','Learn more about WordPress %s'=>'ವರ್ಡ್ಪ್ರೆಸ್ %s ಕುರಿತು ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ','Please type your comment text.'=>'ದಯವಿಟ್ಟು ನಿಮ್ಮ ಕಾಮೆಂಟ್ ಪಠ್ಯವನ್ನು ಟೈಪ್ ಮಾಡಿ.','You cannot remove users.'=>'ನೀವು ಬಳಕೆದಾರರನ್ನು ತೆಗೆದುಹಾಕಲು ಸಾಧ್ಯವಿಲ್ಲ.','WordPress has been updated! Next and final step is to update your database to the newest version.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ನವೀಕರಿಸಲಾಗಿದೆ! ನಿಮ್ಮ ಡೇಟಾಬೇಸ್ ಅನ್ನು ಹೊಸ ಆವೃತ್ತಿಗೆ ನವೀಕರಿಸುವುದು ಮುಂದಿನ ಮತ್ತು ಅಂತಿಮ ಹಂತವಾಗಿದೆ.','<a href="https://wordpress.org/documentation/article/appearance-themes-screen/">Documentation on Managing Themes</a>'=>'<a href="https://wordpress.org/documentation/article/appearance-themes-screen/">ಥೀಮ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸುವ ಕುರಿತು ದಾಖಲೆ</a>','Welcome to WordPress. Before getting started, you will need to know the following items.'=>'WordPress ಗೆ ಸುಸ್ವಾಗತ. ಪ್ರಾರಂಭಿಸುವ ಮೊದಲು, ನೀವು ಈ ಕೆಳಗಿನ ಅಂಶಗಳನ್ನು ತಿಳಿದುಕೊಳ್ಳಬೇಕು.','This information is being used to create a %s file.'=>'ಈ ಮಾಹಿತಿಯನ್ನು %s ಫೈಲ್ ರಚಿಸಲು ಬಳಸಲಾಗುತ್ತಿದೆ.','Settings save failed.'=>'ಸೆಟ್ಟಿಂಗ್‌ಗಳನ್ನು ಉಳಿಸಲು ವಿಫಲವಾಗಿದೆ.','After your Privacy Policy page is set, you should edit it.'=>'ನಿಮ್ಮ ಗೌಪ್ಯತೆ ನೀತಿ ಪುಟವನ್ನು ಹೊಂದಿಸಿದ ನಂತರ, ನೀವು ಅದನ್ನು ಸಂಪಾದಿಸಬೇಕು.','Change Permalink Structure'=>'ಪರ್ಮಾಲಿಂಕ್ ರಚನೆಯನ್ನು ಬದಲಾಯಿಸಿ','Where your data is sent'=>'ನಿಮ್ಮ ಡೇಟಾವನ್ನು ಎಲ್ಲಿ ಕಳುಹಿಸಲಾಗಿದೆ','Copy &#8220;%s&#8221; URL to clipboard'=>'&#8220;%s&#8221; URL ಅನ್ನು ಕ್ಲಿಪ್‌ಬೋರ್ಡ್‌ಗೆ ನಕಲಿಸಿ','Some data that describes the error your site encountered has been put together.'=>'ನಿಮ್ಮ ಸೈಟ್ ಎದುರಿಸಿದ ದೋಷವನ್ನು ವಿವರಿಸುವ ಕೆಲವು ಡೇಟಾವನ್ನು ಒಟ್ಟಿಗೆ ಸೇರಿಸಲಾಗಿದೆ.','An attempt was made, but your site could not be updated automatically.'=>'ಒಂದು ಪ್ರಯತ್ನವನ್ನು ಮಾಡಲಾಗಿದೆ, ಆದರೆ ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ನವೀಕರಿಸಲಾಗಲಿಲ್ಲ.','themeActive'=>'ಸಕ್ರಿಯವಾದ','The update cannot be installed because some files could not be copied. This is usually due to inconsistent file permissions.'=>'ಕೆಲವು ಫೈಲ್‌ಗಳನ್ನು ನಕಲಿಸಲು ಸಾಧ್ಯವಾಗದ ಕಾರಣ ನವೀಕರಣವನ್ನು ಸ್ಥಾಪಿಸಲಾಗುವುದಿಲ್ಲ. ಇದು ಸಾಮಾನ್ಯವಾಗಿ ಅಸಮಂಜಸವಾದ ಫೈಲ್ ಅನುಮತಿಗಳ ಕಾರಣದಿಂದಾಗಿರುತ್ತದೆ.','<strong>Media</strong> &mdash; A list of URLs for media files the user uploads.'=>'<strong>ಮಾಧ್ಯಮ</strong> &mdash; ಬಳಕೆದಾರರು ಅಪ್‌ಲೋಡ್ ಮಾಡುವ ಮಾಧ್ಯಮ ಫೈಲ್‌ಗಳಿಗಾಗಿ URL ಗಳ ಪಟ್ಟಿ.','Privacy Laws around the world require businesses and online services to delete, anonymize, or forget the data they collect about an individual. The rights those laws enshrine are sometimes called the "Right to be Forgotten".'=>'ಪ್ರಪಂಚದಾದ್ಯಂತದ ಗೌಪ್ಯತೆ ಕಾನೂನುಗಳಿಗೆ ವ್ಯವಹಾರಗಳು ಮತ್ತು ಆನ್‌ಲೈನ್ ಸೇವೆಗಳು ವ್ಯಕ್ತಿಯ ಕುರಿತು ಅವರು ಸಂಗ್ರಹಿಸುವ ಡೇಟಾವನ್ನು ಅಳಿಸಲು, ಅನಾಮಧೇಯಗೊಳಿಸಲು ಅಥವಾ ಮರೆತುಬಿಡುವ ಅಗತ್ಯವಿದೆ. ಆ ಕಾನೂನುಗಳು ಪ್ರತಿಪಾದಿಸುವ ಹಕ್ಕುಗಳನ್ನು ಕೆಲವೊಮ್ಮೆ "ಮರೆತುಹೋಗುವ ಹಕ್ಕು" ಎಂದು ಕರೆಯಲಾಗುತ್ತದೆ.','This screen is where you manage requests to erase personal data.'=>'ಈ ಪರದೆಯಲ್ಲಿ ನೀವು ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಅಳಿಸಲು ವಿನಂತಿಗಳನ್ನು ನಿರ್ವಹಿಸುತ್ತೀರಿ.','This post is being backed up in your browser, just in case.'=>'ಈ ಪೋಸ್ಟ್ ಅನ್ನು ನಿಮ್ಮ ಬ್ರೌಸರ್‌ನಲ್ಲಿ ಬ್ಯಾಕಪ್ ಮಾಡಲಾಗುತ್ತಿದೆ.','Learn about block themes'=>'ಬ್ಲಾಕ್ ಥೀಮ್‌ಗಳ ಬಗ್ಗೆ ತಿಳಿಯಿರಿ','There is a new kind of WordPress theme, called a block theme, that lets you build the site you&#8217;ve always wanted &#8212; with blocks and styles.'=>'ಬ್ಲಾಕ್ ಥೀಮ್ ಎಂದು ಕರೆಯಲ್ಪಡುವ ಒಂದು ಹೊಸ ರೀತಿಯ WordPress ಥೀಮ್ ಇದೆ, ಅದು ನೀವು ಯಾವಾಗಲೂ ಬಯಸುವ ಸೈಟ್ ಅನ್ನು ನಿರ್ಮಿಸಲು ಅನುಮತಿಸುತ್ತದೆ - ಬ್ಲಾಕ್‌ಗಳು ಮತ್ತು ಶೈಲಿಗಳೊಂದಿಗೆ.','Discover a new way to build your site.'=>'ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ನಿರ್ಮಿಸಲು ಹೊಸ ಮಾರ್ಗವನ್ನು ಅನ್ವೇಷಿಸಿ.','Tweak your site, or give it a whole new look! Get creative &#8212; how about a new color palette or font?'=>'ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಟ್ವೀಕ್ ಮಾಡಿ ಅಥವಾ ಅದಕ್ಕೆ ಸಂಪೂರ್ಣ ಹೊಸ ನೋಟವನ್ನು ನೀಡಿ! ಸೃಜನಶೀಲರಾಗಿರಿ - ಹೊಸ ಬಣ್ಣದ ಪ್ಯಾಲೆಟ್ ಅಥವಾ ಫಾಂಟ್ ಹೇಗೆ?','Switch up your site&#8217;s look & feel with Styles'=>'ಸ್ಟೈಲ್‌ಗಳೊಂದಿಗೆ ನಿಮ್ಮ ಸೈಟ್‌ನ ನೋಟ ಮತ್ತು ಭಾವನೆಯನ್ನು ಬದಲಾಯಿಸಿ','Open the Customizer'=>'ಕಸ್ಟಮೈಜರ್ ತೆರೆಯಿರಿ','Start Customizing'=>'ಕಸ್ಟಮೈಸ್ ಮಾಡಲು ಪ್ರಾರಂಭಿಸಿ','Open site editor'=>'ಸೈಟ್ ಸಂಪಾದಕವನ್ನು ತೆರೆಯಿರಿ','Design everything on your site &#8212; from the header down to the footer, all using blocks and patterns.'=>'ನಿಮ್ಮ ಸೈಟ್‌ನಲ್ಲಿ ಎಲ್ಲವನ್ನೂ ವಿನ್ಯಾಸಗೊಳಿಸಿ - ಹೆಡರ್‌ನಿಂದ ಅಡಿಟಿಪ್ಪಣಿವರೆಗೆ, ಎಲ್ಲಾ ಬ್ಲಾಕ್‌ಗಳು ಮತ್ತು ಪ್ಯಾಟರ್ನ್‌ಗಳನ್ನು ಬಳಸಿ.','Customize your entire site with block themes'=>'ಬ್ಲಾಕ್ ಥೀಮ್‌ಗಳೊಂದಿಗೆ ನಿಮ್ಮ ಸಂಪೂರ್ಣ ಸೈಟ್ ಅನ್ನು ಕಸ್ಟಮೈಸ್ ಮಾಡಿ','Add a new page'=>'ಹೊಸ ಪುಟವನ್ನು ಸೇರಿಸಿ','Block patterns are pre-configured block layouts. Use them to get inspired or create new pages in a flash.'=>'ಬ್ಲಾಕ್ ಪ್ಯಾಟರ್ನ್‌ಗಳು ಮೊದಲೇ ಕಾನ್ಫಿಗರ್ ಮಾಡಲಾದ ಬ್ಲಾಕ್ ಲೇಔಟ್‌ಗಳಾಗಿವೆ. ಸ್ಫೂರ್ತಿ ಪಡೆಯಲು ಅಥವಾ ಫ್ಲ್ಯಾಶ್‌ನಲ್ಲಿ ಹೊಸ ಪುಟಗಳನ್ನು ರಚಿಸಲು ಅವುಗಳನ್ನು ಬಳಸಿ.','Author rich content with blocks and patterns'=>'ಬ್ಲಾಕ್‌ಗಳು ಮತ್ತು ಮಾದರಿಗಳೊಂದಿಗೆ ಲೇಖಕ ಶ್ರೀಮಂತ ವಿಷಯ','Learn more about the %s version.'=>'%s ಆವೃತ್ತಿಯ ಕುರಿತು ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ.','Configure your site&#8217;s logo, header, menus, and more in the Customizer.'=>'ಕಸ್ಟಮೈಜರ್‌ನಲ್ಲಿ ನಿಮ್ಮ ಸೈಟ್‌ನ ಲೋಗೋ, ಹೆಡರ್, ಮೆನುಗಳು ಮತ್ತು ಹೆಚ್ಚಿನದನ್ನು ಕಾನ್ಫಿಗರ್ ಮಾಡಿ.','WordPress is free and open source software'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಉಚಿತ ಮತ್ತು ಮುಕ್ತ ಮೂಲ ಸಾಫ್ಟ್‌ವೇರ್ ಆಗಿದೆ','Plugin File Editor'=>'ಪ್ಲಗಿನ್ ಫೈಲ್ ಎಡಿಟರ್','Theme File Editor'=>'ಥೀಮ್ ಫೈಲ್ ಎಡಿಟರ್','If this is a development website, you can <a href="%s">set the environment type accordingly</a> to enable application passwords.'=>'ಇದು ಡೆವಲಪ್‌ಮೆಂಟ್ ವೆಬ್‌ಸೈಟ್ ಆಗಿದ್ದರೆ, ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು ನೀವು <a href="%s">ಪರಿಸರದ ಪ್ರಕಾರವನ್ನು ಹೊಂದಿಸಬಹುದು</a>.','The application password feature requires HTTPS, which is not enabled on this site.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ವೈಶಿಷ್ಟ್ಯಕ್ಕೆ HTTPS ಅಗತ್ಯವಿದೆ, ಅದನ್ನು ಈ ಸೈಟ್‌ನಲ್ಲಿ ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿಲ್ಲ.','g:i a T'=>'g:i a T','<a href="https://wordpress.org/documentation/article/appearance-theme-file-editor-screen/">Documentation on Editing Themes</a>'=>'<a href="https://wordpress.org/support/article/appearance-editor-screen/"> ಎಡಿಟಿಂಗ್ ಥೀಮ್‌ಗಳ ಕುರಿತು ದಾಖಲೆ </a>','<a href="https://wordpress.org/documentation/article/site-health-screen/">Documentation on Site Health tool</a>'=>'<a href="https://wordpress.org/support/article/site-health-screen/"> ಸೈಟ್ ಹೆಲ್ತ್ ಟೂಲ್‌ನಲ್ಲಿ ದಾಖಲಾತಿ </a>','In the Info tab, you will find all the details about the configuration of your WordPress site, server, and database. There is also an export feature that allows you to copy all of the information about your site to the clipboard, to help solve problems on your site when obtaining support.'=>'ಮಾಹಿತಿ ಟ್ಯಾಬ್‌ನಲ್ಲಿ, ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಸೈಟ್, ಸರ್ವರ್ ಮತ್ತು ಡೇಟಾಬೇಸ್‌ನ ಕಾನ್ಫಿಗರೇಶನ್ ಕುರಿತು ಎಲ್ಲಾ ವಿವರಗಳನ್ನು ನೀವು ಕಾಣಬಹುದು. ಬೆಂಬಲವನ್ನು ಪಡೆದುಕೊಳ್ಳುವಾಗ ನಿಮ್ಮ ಸೈಟ್‌ನಲ್ಲಿನ ಸಮಸ್ಯೆಗಳನ್ನು ಪರಿಹರಿಸಲು ಸಹಾಯ ಮಾಡಲು, ಕ್ಲಿಪ್‌ಬೋರ್ಡ್‌ಗೆ ನಿಮ್ಮ ಸೈಟ್‌ನ ಎಲ್ಲಾ ಮಾಹಿತಿಯನ್ನು ನಕಲಿಸಲು ನಿಮಗೆ ಅನುಮತಿಸುವ ರಫ್ತು ವೈಶಿಷ್ಟ್ಯವೂ ಸಹ ಇದೆ.','In the Status tab, you can see critical information about your WordPress configuration, along with anything else that requires your attention.'=>'ಸ್ಥಿತಿ ಟ್ಯಾಬ್‌ನಲ್ಲಿ, ನಿಮ್ಮ ಗಮನ ಅಗತ್ಯವಿರುವ ಯಾವುದಾದರೂ ಜೊತೆಗೆ ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಕಾನ್ಫಿಗರೇಶನ್‌ನ ಕುರಿತು ನಿರ್ಣಾಯಕ ಮಾಹಿತಿಯನ್ನು ನೀವು ನೋಡಬಹುದು.','This screen allows you to obtain a health diagnosis of your site, and displays an overall rating of the status of your installation.'=>'ಈ ಪರದೆಯು ನಿಮ್ಮ ಸೈಟ್‌ನ ಆರೋಗ್ಯ ರೋಗನಿರ್ಣಯವನ್ನು ಪಡೆಯಲು ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ ಮತ್ತು ನಿಮ್ಮ ಸ್ಥಾಪನೆಯ ಸ್ಥಿತಿಯ ಒಟ್ಟಾರೆ ರೇಟಿಂಗ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','<a href="https://wordpress.org/documentation/article/settings-privacy-screen/">Documentation on Privacy Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-privacy-screen/">ಗೌಪ್ಯತೆ ಸೆಟ್ಟಿಂಗ್‌ಗಳ ಮೇಲಿನ ದಾಖಲೆ</a>','This screen includes suggestions to help you write your own privacy policy. However, it is your responsibility to use these resources correctly, to provide the information required by your privacy policy, and to keep this information current and accurate.'=>'ನಿಮ್ಮ ಸ್ವಂತ ಗೌಪ್ಯತೆ ನೀತಿಯನ್ನು ಬರೆಯಲು ನಿಮಗೆ ಸಹಾಯ ಮಾಡಲು ಈ ಪರದೆಯು ಸಲಹೆಗಳನ್ನು ಒಳಗೊಂಡಿದೆ. ಆದಾಗ್ಯೂ, ಈ ಸಂಪನ್ಮೂಲಗಳನ್ನು ಸರಿಯಾಗಿ ಬಳಸುವುದು, ನಿಮ್ಮ ಗೌಪ್ಯತಾ ನೀತಿಯಿಂದ ಅಗತ್ಯವಿರುವ ಮಾಹಿತಿಯನ್ನು ಒದಗಿಸುವುದು ಮತ್ತು ಈ ಮಾಹಿತಿಯನ್ನು ಪ್ರಸ್ತುತ ಮತ್ತು ನಿಖರವಾಗಿರಿಸುವುದು ನಿಮ್ಮ ಜವಾಬ್ದಾರಿಯಾಗಿದೆ.','The Privacy screen lets you either build a new privacy-policy page or choose one you already have to show.'=>'ಹೊಸ ಗೌಪ್ಯತೆ-ನೀತಿ ಪುಟವನ್ನು ನಿರ್ಮಿಸಲು ಅಥವಾ ನೀವು ಈಗಾಗಲೇ ತೋರಿಸಬೇಕಾದ ಒಂದನ್ನು ಆಯ್ಕೆ ಮಾಡಲು ಗೌಪ್ಯತೆ ಪರದೆಯು ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ.','Individual posts may override these settings. Changes here will only be applied to new posts.'=>'ವೈಯಕ್ತಿಕ ಪೋಸ್ಟ್‌ಗಳು ಈ ಸೆಟ್ಟಿಂಗ್‌ಗಳನ್ನು ಅತಿಕ್ರಮಿಸಬಹುದು. ಇಲ್ಲಿ ಬದಲಾವಣೆಗಳನ್ನು ಹೊಸ ಪೋಸ್ಟ್‌ಗಳಿಗೆ ಮಾತ್ರ ಅನ್ವಯಿಸಲಾಗುತ್ತದೆ.','Menu item moved to the top'=>'ಮೆನು ಐಟಂ ಅನ್ನು ಮೇಲಕ್ಕೆ ಸರಿಸಲಾಗಿದೆ','Menu item removed'=>'ಮೆನು ಐಟಂ ತೆಗೆದುಹಾಕಲಾಗಿದೆ','The Dashboard is the first place you will come to every time you log into your site. It is where you will find all your WordPress tools. If you need help, just click the &#8220;Help&#8221; tab above the screen title.'=>'ನಿಮ್ಮ ಸೈಟ್‌ಗೆ ನೀವು ಲಾಗ್ ಇನ್ ಮಾಡಿದಾಗಲೆಲ್ಲಾ ನೀವು ಬರುವ ಮೊದಲ ಸ್ಥಳವೆಂದರೆ ಡ್ಯಾಶ್‌ಬೋರ್ಡ್. ನಿಮ್ಮ ಎಲ್ಲಾ ವರ್ಡ್ಪ್ರೆಸ್ ಪರಿಕರಗಳನ್ನು ನೀವು ಅಲ್ಲಿ ಕಾಣಬಹುದು. ನಿಮಗೆ ಸಹಾಯ ಬೇಕಾದರೆ, ಪರದೆಯ ಶೀರ್ಷಿಕೆಯ ಮೇಲಿರುವ \'ಸಹಾಯ\' ಟ್ಯಾಬ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ.','Welcome to your WordPress Dashboard!'=>'ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಡ್ಯಾಶ್‌ಬೋರ್ಡ್‌ಗೆ ಸುಸ್ವಾಗತ!','The application ID must be a UUID.'=>'ಅಪ್ಲಿಕೇಶನ್ ID ಯುಯುಐಡಿ ಆಗಿರಬೇಕು.','Select location'=>'ಸ್ಥಳವನ್ನು ಆಯ್ಕೆಮಾಡಿ','Visit plugin site for %s'=>'%s ಗಾಗಿ ಪ್ಲಗಿನ್ ಸೈಟ್‌ಗೆ ಭೇಟಿ ನೀಡಿ','pluginCannot Activate'=>'ಸಕ್ರಿಯಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ','Max connections number'=>'ಗರಿಷ್ಠ ಸಂಪರ್ಕಗಳ ಸಂಖ್ಯೆ','Max allowed packet size'=>'ಗರಿಷ್ಠ ಅನುಮತಿಸಲಾದ ಪ್ಯಾಕೆಟ್ ಗಾತ್ರ','Your website appears to use Basic Authentication, which is not currently compatible with application passwords.'=>'ನಿಮ್ಮ ವೆಬ್‌ಸೈಟ್ ಮೂಲಭೂತ ದೃಢೀಕರಣವನ್ನು ಬಳಸುತ್ತಿರುವಂತೆ ತೋರುತ್ತಿದೆ, ಇದು ಪ್ರಸ್ತುತ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳೊಂದಿಗೆ ಹೊಂದಿಕೆಯಾಗುವುದಿಲ್ಲ.','%1$s &#8220;%2$s&#8221;'=>'%1$s &#8220;%2$s&#8221;','Template Editing'=>'ಟೆಂಪ್ಲೆಟ್ ಸಂಪಾದನೆ','Get involved in WordPress.'=>'ವರ್ಡ್ಪ್ರೆಸ್ನಲ್ಲಿ ತೊಡಗಿಸಿಕೊಳ್ಳಿ.','WordPress is created by a <a href="%1$s">worldwide team</a> of passionate individuals.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ಭಾವೋದ್ರಿಕ್ತ ವ್ಯಕ್ತಿಗಳ <a href="%1$s">ವಿಶ್ವಾದ್ಯಂತ ತಂಡವು</a> ರಚಿಸಿದೆ.','Want to see your name in lights on this page?'=>'ಈ ಪುಟದಲ್ಲಿ ನಿಮ್ಮ ಹೆಸರನ್ನು ನೋಡಲು ಬಯಸುವಿರಾ?','WordPress comes with some awesome, worldview-changing rights courtesy of its <a href="%s">license</a>, the GPL.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ತನ್ನ <a href="%s">ಪರವಾನಗಿ</a> GPL ನ ಸೌಜನ್ಯದ, ವಿಶ್ವ ದೃಷ್ಟಿಕೋನವನ್ನು ಬದಲಾಯಿಸುವ ಹಕ್ಕುಗಳೊಂದಿಗೆ ಬರುತ್ತದೆ.','%s plugin deactivated during WordPress upgrade.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ನವೀಕರಿಸುವ ಸಮಯದಲ್ಲಿ %s ಪ್ಲಗಿನ್ ಅನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','%1$s %2$s was deactivated due to incompatibility with WordPress %3$s.'=>'%1$s %2$s ವರ್ಡ್ಪ್ರೆಸ್ %3$s ನೊಂದಿಗೆ ಹೊಂದಾಣಿಕೆಯಾಗದ ಕಾರಣ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','%1$s %2$s was deactivated due to incompatibility with WordPress %3$s, please upgrade to %1$s %4$s or later.'=>'%1$s %2$s  ವರ್ಡ್ಪ್ರೆಸ್ %3$s ನೊಂದಿಗೆ ಹೊಂದಾಣಿಕೆಯಾಗದ ಕಾರಣ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ, ದಯವಿಟ್ಟು %1$s %4$s ಅಥವಾ ನಂತರದ ಆವೃತ್ತಿಗೆ ನವೀಕರಣೆ ಮಾಡಿ.','We take privacy and transparency very seriously'=>'ನಾವು ಗೌಪ್ಯತೆ ಮತ್ತು ಪಾರದರ್ಶಕತೆಯನ್ನು ಬಹಳ ಗಂಭೀರವಾಗಿ ಪರಿಗಣಿಸುತ್ತೇವೆ','The Four Freedoms'=>'ನಾಲ್ಕು ಸ್ವಾತಂತ್ರ್ಯಗಳು','themeDelete %s'=>'%s ನ್ನು ಅಳಿಸಿ','themeLive Preview %s'=>'%s ನ ನೇರ ಪೂರ್ವವೀಕ್ಷಣೆ','themeCustomize %s'=>'%s ನ್ನು ಕಸ್ಟಮೈಸ್ ಮಾಡಿ','themeView Theme Details for %s'=>'%s ಗಾಗಿ ಥೀಮ್ ವಿವರಗಳನ್ನು ವೀಕ್ಷಿಸಿ','Toggle extra menu items'=>'ಹೆಚ್ಚುವರಿ ಮೆನು ಐಟಂಗಳನ್ನು ಟಾಗಲ್ ಮಾಡಿ','Site Health - %s'=>'ಸೈಟ್ ಆರೋಗ್ಯ - %s','You need to make the file %1$s writable before you can save your changes. See <a href="%2$s">Changing File Permissions</a> for more information.'=>'ನಿಮ್ಮ ಬದಲಾವಣೆಗಳನ್ನು ಉಳಿಸುವ ಮೊದಲು ನೀವು %1$s ಫೈಲ್ ಅನ್ನು ಬರೆಯುವಂತಾಗಿಸಬೇಕು. ಹೆಚ್ಚಿನ ಮಾಹಿತಿಗಾಗಿ <a href="%2$s"> ಫೈಲ್ ಅನುಮತಿಗಳನ್ನು ಬದಲಾಯಿಸುವುದು </a> ನೋಡಿ.','Rewrite rules:'=>'ನಿಯಮಗಳನ್ನು ಪುನಃ ಬರೆಯಿರಿ:','List of menu items selected for deletion:'=>'ಅಳಿಸಲು ಆಯ್ಕೆ ಮಾಡಿದ ಮೆನು ಐಟಂಗಳ ಪಟ್ಟಿ:','Remove Selected Items'=>'ಆಯ್ಕೆ ಮಾಡಿದ ಐಟಂಗಳನ್ನು ತೆಗೆಯಿರಿ','Deleted menu item: %s.'=>'ಅಳಿಸಲಾದ ಮೆನು ಐಟಂ: %s.','item %s'=>'ಐಟಂ %s','Themes %s'=>'ಥೀಮ್ಸ್ %s','Unable to encode the personal data for export. Error: %s'=>'ರಫ್ತುಗಾಗಿ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಎನ್ಕೋಡ್ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲ. ದೋಷ: %s','The %s post meta must be an array.'=>'ಪೋಸ್ಟ್ ಮೆಟಾ %s ಒಂದು ಅರೇ ಆಗಿರಬೇಕು...','Your site&#8217;s health is looking good, but there is still one thing you can do to improve its performance and security.'=>'ನಿಮ್ಮ ಸೈಟ್‌ನ ಆರೋಗ್ಯವು ಉತ್ತಮವಾಗಿ ಕಾಣುತ್ತಿದೆ, ಆದರೆ ನೀವು ಮಾಡಬಹುದಾದ ಮತ್ತೊಂದು ವಿಷಯವೆಂದರೆ, ಅದರ ಕಾರ್ಯಕ್ಷಮತೆ ಮತ್ತು ಭದ್ರತೆಯನ್ನು ಇನ್ನಷ್ಟು ಸುಧಾರಿಸುವುದು.','Your site has a critical issue that should be addressed as soon as possible to improve its performance and security.'=>'ನಿಮ್ಮ ಸೈಟ್ ತನ್ನ ಕಾರ್ಯಕ್ಷಮತೆ ಮತ್ತು ಭದ್ರತೆಯನ್ನು ಸುಧಾರಿಸಲು ಸಾಧ್ಯವಾದಷ್ಟು ಬೇಗ ಪರಿಹರಿಸಬೇಕಾದ ನಿರ್ಣಾಯಕ ಸಮಸ್ಯೆಯನ್ನು ಹೊಂದಿದೆ.','Internet Explorer does not give you the best WordPress experience. Switch to Microsoft Edge, or another more modern browser to get the most from your site.'=>'ಇಂಟರ್ನೆಟ್ ಎಕ್ಸ್‌ಪ್ಲೋರರ್ ನಿಮಗೆ ಅತ್ಯುತ್ತಮ ವರ್ಡ್ಪ್ರೆಸ್ ಅನುಭವವನ್ನು ನೀಡುವುದಿಲ್ಲ. ನಿಮ್ಮ ಸೈಟ್‌ನಿಂದ ಹೆಚ್ಚಿನದನ್ನು ಪಡೆಯಲು ಮೈಕ್ರೋಸಾಫ್ಟ್ ಎಡ್ಜ್ ಅಥವಾ ಇನ್ನೊಂದು ಆಧುನಿಕ ಬ್ರೌಸರ್‌ಗೆ ಬದಲಿಸಿ.','Learn how to <a href="%s" class="update-browser-link">browse happy</a>'=>'<a href="%s" class="update-browser-link"> ಸಂತೋಷದಿಂದ ಬ್ರೌಸ್ ಮಾಡುವುದು </a> ಹೇಗೆ ಎಂದು ತಿಳಿಯಿರಿ','Bulk Select'=>'ದೊಡ್ಡ ಪ್ರಮಾಣದಲ್ಲಿ ಆಯ್ಕೆಮಾಡಿ','Unable to determine'=>'ನಿರ್ಧರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ','themeUploaded'=>'ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ','pluginUploaded'=>'ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ','pluginCurrent'=>'ಪ್ರಸ್ತುತ','Please activate the <a href="%s">Link Manager plugin</a> to use the link manager.'=>'ಲಿಂಕ್ ಮ್ಯಾನೇಜರ್ ಅನ್ನು ಬಳಸಲು ದಯವಿಟ್ಟು <a href="%s"> ಲಿಂಕ್ ಮ್ಯಾನೇಜರ್ ಪ್ಲಗಿನ್ </a> ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿ.','pluginReplace current with uploaded'=>'ಪ್ರಸ್ತುತವನ್ನು ಅಪ್‌ಲೋಡ್‌ನೊಂದಿಗೆ ಬದಲಾಯಿಸಿ','GD supported file formats'=>'GD ಬೆಂಬಲಿತ ಫೈಲ್ ಫಾರ್ಮ್ಯಾಟ್‌ಗಳು','Imagick version'=>'‍Imagick ಆವೃತ್ತಿ','ImageMagick supported file formats'=>'ImageMagick ಬೆಂಬಲಿತ ಫೈಲ್ ಫಾರ್ಮ್ಯಾಟ್‌ಗಳು','Create a new Privacy Policy page'=>'ಹೊಸ ಗೌಪ್ಯತಾ ನೀತಿ ಪುಟವನ್ನು ರಚಿಸಿ','Send personal data export confirmation email.'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ರಫ್ತು ದೃಢೀಕರಣ ಇಮೇಲ್ ಕಳುಹಿಸಿ.','This tool helps site owners comply with local laws and regulations by exporting known data for a given user in a .zip file.'=>'ಈ ಉಪಕರಣವು ಸೈಟ್ ಮಾಲೀಕರಿಗೆ ಸ್ಥಳೀಯ ಕಾನೂನುಗಳು ಮತ್ತು ನಿಬಂಧನೆಗಳನ್ನು ಅನುಸರಿಸಲು ಸಹಾಯ ಮಾಡುತ್ತದೆ. ಜಿಪ್ ಫೈಲ್‌ನಲ್ಲಿ ನಿರ್ದಿಷ್ಟ ಬಳಕೆದಾರರಿಗೆ ತಿಳಿದಿರುವ ಡೇಟಾವನ್ನು ರಫ್ತು ಮಾಡುತ್ತದೆ.','<a href="https://wordpress.org/documentation/article/tools-export-personal-data-screen/">Documentation on Export Personal Data</a>'=>'<a href="https://wordpress.org/documentation/article/tools-export-personal-data-screen/">ವೈಯಕ್ತಿಕ ಡೇಟಾ ರಫ್ತು ಮೇಲೆ ದಾಖಲೆ</a>','Many plugins may collect or store personal data either in the WordPress database or remotely. Any Export Personal Data request should include data from plugins as well.'=>'ಅನೇಕ ಪ್ಲಗ್‌ಇನ್‌ಗಳು ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ವರ್ಡ್‌ಪ್ರೆಸ್ ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಅಥವಾ ರಿಮೋಟ್‌ನಲ್ಲಿ ಕೃೋಢೀಕರಿಸಬಹುದು ಅಥವಾ ಸಂಗ್ರಹಿಸಬಹುದು. ಯಾವುದೇ ರಫ್ತು ವೈಯಕ್ತಿಕ ಡೇಟಾ ವಿನಂತಿಯು ಪ್ಲಗಿನ್‌ಗಳಿಂದ ಡೇಟಾವನ್ನು ಒಳಗೊಂಡಿರಬೇಕು.','If you are not sure, check the plugin documentation or contact the plugin author to see if the plugin collects data and if it supports the Data Exporter tool. This information may be available in the <a href="%s">Privacy Policy Guide</a>.'=>'ನಿಮಗೆ ಖಚಿತವಿಲ್ಲದಿದ್ದರೆ, ಪ್ಲಗಿನ್ ದಸ್ತಾವೇಜನ್ನು ಪರಿಶೀಲಿಸಿ ಅಥವಾ ಪ್ಲಗಿನ್ ಡೇಟಾವನ್ನು ಸಂಗ್ರಹಿಸುತ್ತದೆಯೇ ಮತ್ತು ಅದು ಡೇಟಾ ರಫ್ತುದಾರ ಉಪಕರಣವನ್ನು ಬೆಂಬಲಿಸುತ್ತದೆಯೇ ಎಂದು ನೋಡಲು ಪ್ಲಗಿನ್ ಲೇಖಕರನ್ನು ಸಂಪರ್ಕಿಸಿ. ಈ ಮಾಹಿತಿಯು <a href="%s"> ಗೌಪ್ಯತೆ ನೀತಿ ಮಾರ್ಗದರ್ಶಿಯಲ್ಲಿ </a> ಲಭ್ಯವಿರಬಹುದು.','<strong>Comments</strong> &mdash; For user comments, Email Address, IP Address, User Agent (Browser/OS), Date/Time, Comment Content, and Content URL.'=>'<strong>ಕಾಮೆಂಟ್‌ಗಳು</strong> &mdash; ಬಳಕೆದಾರರ ಕಾಮೆಂಟ್‌ಗಳಿಗಾಗಿ, ಇಮೇಲ್ ವಿಳಾಸ, IP ವಿಳಾಸ, ಬಳಕೆದಾರ ಏಜೆಂಟ್ (ಬ್ರೌಸರ್/OS), ದಿನಾಂಕ/ಸಮಯ, ಕಾಮೆಂಟ್ ವಿಷಯ ಮತ್ತು ವಿಷಯ URL.','Site URLs could not be switched to HTTPS.'=>'ಸೈಟ್ URL ಗಳನ್ನು HTTPS ಗೆ ಬದಲಾಯಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Site URLs switched to HTTPS.'=>'ಸೈಟ್ URL ಗಳು HTTPS ಗೆ ಬದಲಾಗಿದೆ.','It looks like HTTPS is not supported for your website at this point.'=>'ಈ ಸಮಯದಲ್ಲಿ ನಿಮ್ಮ ವೆಬ್‌ಸೈಟ್‌ಗೆ HTTPS ಬೆಂಬಲಿತವಾಗಿಲ್ಲ ಎಂದು ತೋರುತ್ತಿದೆ.','Sorry, you are not allowed to update this site to HTTPS.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್ ಅನ್ನು HTTPS ಗೆ ನವೀಕರಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Password reset links sent to %s user.'=>'ಪಾಸ್‌ವರ್ಡ್ ಮರುಹೊಂದಿಸುವ ಲಿಂಕ್‌ಗಳನ್ನು %s ಬಳಕೆದಾರನಿಗೆ ಕಳುಹಿಸಲಾಗಿದೆ.' . "\0" . 'ಪಾಸ್‌ವರ್ಡ್ ಮರುಹೊಂದಿಸುವ ಲಿಂಕ್‌ಗಳನ್ನು %s ಬಳಕೆದಾರರಿಗೆ ಕಳುಹಿಸಲಾಗಿದೆ.','This screen is where you manage requests for an export of personal data.'=>'ಈ ಪರದೆಯಲ್ಲಿ ನೀವು ವೈಯಕ್ತಿಕ ಡೇಟಾದ ರಫ್ತಿಗಾಗಿ ವಿನಂತಿಗಳನ್ನು ನಿರ್ವಹಿಸುತ್ತೀರಿ.','Send Reset Link'=>'ಮರುಹೊಂದಿಸುವ ಲಿಂಕ್ ಕಳುಹಿಸಿ','Policies'=>'ನೀತಿಗಳು','The Privacy Settings require JavaScript.'=>'ಗೌಪ್ಯತೆ ಸೆಟ್ಟಿಂಗ್‌ಗಳಿಗೆ ಜಾವಾಸ್ಕ್ರಿಪ್ಟ್ ಅಗತ್ಯವಿದೆ.','Password reset link sent.'=>'ಗುಪ್ತಪದ ಮರುಹೊಂದಿಸುವ ಲಿಂಕ್ ಕಳುಹಿಸಲಾಗಿದೆ.','Send %s a link to reset their password. This will not change their password, nor will it force a change.'=>'ಅವರ ಪಾಸ್‌ವರ್ಡ್ ಮರುಹೊಂದಿಸಲು %s ಲಿಂಕ್ ಕಳುಹಿಸಿ. ಇದು ಅವರ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಬದಲಾಯಿಸುವುದಿಲ್ಲ, ಅಥವಾ ಬದಲಾವಣೆಯನ್ನು ಒತ್ತಾಯಿಸುವುದಿಲ್ಲ.','Privacy SettingsPolicy Guide'=>'ನೀತಿ ಮಾರ್ಗದರ್ಶಿ','Privacy SettingsSettings'=>'ಸೆಟ್ಟಿಂಗ್ ಗಳು','Re-install version %s'=>'%s ಆವೃತ್ತಿಯನ್ನು ಮರುಸ್ಥಾಪಿಸಿ','Update to latest %s nightly'=>'ಇತ್ತೀಚಿನ %s ನೈಟ್ಲಿಗೆ ನವೀಕರಿಸಿ','Send personal data erasure confirmation email.'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ಅಳಿಸುವಿಕೆ ದೃಢೀಕರಣ ಇಮೇಲ್ ಕಳುಹಿಸಿ.','Confirmation email'=>'ದೃಢೀಕರಣ ಇಮೇಲ್ ','This tool helps site owners comply with local laws and regulations by deleting or anonymizing known data for a given user.'=>'ನಿರ್ದಿಷ್ಟ ಬಳಕೆದಾರರಿಗೆ ತಿಳಿದಿರುವ ಡೇಟಾವನ್ನು ಅಳಿಸುವ ಅಥವಾ ಅನಾಮಧೇಯಗೊಳಿಸುವ ಮೂಲಕ ಸ್ಥಳೀಯ ಕಾನೂನುಗಳು ಮತ್ತು ನಿಬಂಧನೆಗಳನ್ನು ಅನುಸರಿಸಲು ಸೈಟ್ ಮಾಲೀಕರಿಗೆ ಈ ಟೂಲ್ ಸಹಾಯ ಮಾಡುತ್ತದೆ.','<a href="https://wordpress.org/documentation/article/tools-erase-personal-data-screen/">Documentation on Erase Personal Data</a>'=>'<a href="https://wordpress.org/documentation/article/tools-erase-personal-data-screen/">ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಅಳಿಸಲು ಡಾಕ್ಯುಮೆಂಟೇಶನ್</a>','Many plugins may collect or store personal data either in the WordPress database or remotely. Any Erase Personal Data request should delete data from plugins as well.'=>'ಅನೇಕ ಪ್ಲಗ್‌ಇನ್‌ಗಳು ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ವರ್ಡ್‌ಪ್ರೆಸ್ ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಅಥವಾ ರಿಮೋಟ್‌ನಲ್ಲಿ ಕ್ರೋಢೀಕರಿಸಬಹುದು ಅಥವಾ ಸಂಗ್ರಹಿಸಬಹುದು. ಯಾವುದೇ ವೈಯಕ್ತಿಕ ಡೇಟಾ ವಿನಂತಿಯನ್ನು ಪ್ಲಗಿನ್‌ಗಳಿಂದ ಡೇಟಾವನ್ನು ಅಳಿಸಬೇಕು.','Plugin Data'=>'ಪ್ಲಗಿನ್ ಡೇಟಾ','If you are not sure, check the plugin documentation or contact the plugin author to see if the plugin collects data and if it supports the Data Eraser tool. This information may be available in the <a href="%s">Privacy Policy Guide</a>.'=>'ನಿಮಗೆ ಖಚಿತವಿಲ್ಲದಿದ್ದರೆ, ಪ್ಲಗಿನ್ ದಸ್ತಾವೇಜನ್ನು ಪರಿಶೀಲಿಸಿ ಅಥವಾ ಪ್ಲಗಿನ್ ಡೇಟಾವನ್ನು ಸಂಗ್ರಹಿಸುತ್ತದೆಯೇ ಮತ್ತು ಅದು ಡೇಟಾ ಎರೇಸರ್ ಟೂಲನ್ನು ಬೆಂಬಲಿಸುತ್ತದೆಯೇ ಎಂದು ನೋಡಲು ಪ್ಲಗಿನ್ ಲೇಖಕರನ್ನು ಸಂಪರ್ಕಿಸಿ. ಈ ಮಾಹಿತಿಯು <a href="%s"> ಗೌಪ್ಯತೆ ನೀತಿ ಮಾರ್ಗದರ್ಶಿಯಲ್ಲಿ </a> ಲಭ್ಯವಿರಬಹುದು.','<strong>Media</strong> &mdash; A list of URLs for all media file uploads made by the user.'=>'<strong> ಮಾಧ್ಯಮ </strong> &mdash; ಬಳಕೆದಾರರು ಮಾಡಿದ ಎಲ್ಲಾ ಮಾಧ್ಯಮ ಫೈಲ್ ಅಪ್‌ಲೋಡ್‌ಗಳಿಗಾಗಿ URL ಗಳ ಪಟ್ಟಿ.','<strong>Session Tokens</strong> &mdash; User login information, IP Addresses, Expiration Date, User Agent (Browser/OS), and Last Login.'=>'<strong> ಸೆಷನ್ ಟೋಕನ್‌ಗಳು </strong> &mdash; ಬಳಕೆದಾರ ಲಾಗಿನ್ ಮಾಹಿತಿ, IP ವಿಳಾಸಗಳು, ಮುಕ್ತಾಯ ದಿನಾಂಕ, ಬಳಕೆದಾರ ಏಜೆಂಟ್ (ಬ್ರೌಸರ್/OS) ಮತ್ತು ಕೊನೆಯ ಲಾಗಿನ್.','<strong>Community Events Location</strong> &mdash; The IP Address of the user which is used for the Upcoming Community Events shown in the dashboard widget.'=>'<strong> ಸಮುದಾಯ ಘಟನೆಗಳ ಸ್ಥಳ </strong> &mdash; ಡ್ಯಾಶ್‌ಬೋರ್ಡ್ ವಿಜೆಟ್‌ನಲ್ಲಿ ತೋರಿಸಲಿರುವ ಮುಂಬರುವ ಸಮುದಾಯ ಈವೆಂಟ್‌ಗಳಿಗಾಗಿ ಬಳಸುವ ಬಳಕೆದಾರರ IP ವಿಳಾಸ.','<strong>Profile Information</strong> &mdash; user email address, username, display name, nickname, first name, last name, description/bio, and registration date.'=>'<strong> ಪ್ರೊಫೈಲ್ ಮಾಹಿತಿ </strong> &mdash; ಬಳಕೆದಾರ ಇಮೇಲ್ ವಿಳಾಸ, ಬಳಕೆದಾರ ಹೆಸರು, ಪ್ರದರ್ಶನ ಹೆಸರು, ಅಡ್ಡಹೆಸರು, ಮೊದಲ ಹೆಸರು, ಕೊನೆಯ ಹೆಸರು, ವಿವರಣೆ/ಬಯೋ, ಮತ್ತು ನೋಂದಣಿ ದಿನಾಂಕ.','Default Data'=>'ಡೀಫಾಲ್ಟ್ ಡೇಟಾ','The tool associates data stored in WordPress with a supplied email address, including profile data and comments.'=>'ಪರಿಕರವು ಪ್ರೊಫೈಲ್ ಡೇಟಾ ಮತ್ತು ಕಾಮೆಂಟ್‌ಗಳನ್ನು ಒಳಗೊಂಡಂತೆ ಒದಗಿಸಲಾದ ಇಮೇಲ್ ವಿಳಾಸದೊಂದಿಗೆ WordPress ನಲ್ಲಿ ಸಂಗ್ರಹಿಸಲಾದ ಡೇಟಾವನ್ನು ಸಂಯೋಜಿಸುತ್ತದೆ.','https://make.wordpress.org/community/organize-event-landing-page/'=>'https://make.wordpress.org/community/organize-event-landing-page/','A password reset link was emailed to %s.'=>'ಗುಪ್ತಪದ ಮರುಹೊಂದಿಸುವ ಲಿಂಕ್ ಅನ್ನು %s ಗೆ ಇಮೇಲ್ ಮಾಡಲಾಗಿದೆ.','Cannot send password reset, permission denied.'=>'ಗುಪ್ತಪದ ಮರುಹೊಂದಿಕೆಯನ್ನು ಕಳುಹಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ, ಅನುಮತಿಯನ್ನು ನಿರಾಕರಿಸಲಾಗಿದೆ.','Want more events? <a href="%s">Help organize the next one</a>!'=>'ಹೆಚ್ಚಿನ ಘಟನೆಗಳು ಬೇಕೇ? <a href="%s"> ಮುಂದಿನದನ್ನು ಸಂಘಟಿಸಲು ಸಹಾಯ ಮಾಡಿ </a>!','The setting for %1$s is currently configured as 0, this could cause some problems when trying to upload files through plugin or theme features that rely on various upload methods. It is recommended to configure this setting to a fixed value, ideally matching the value of %2$s, as some upload methods read the value 0 as either unlimited, or disabled.'=>'%1$s ಗಾಗಿ ಸೆಟ್ಟಿಂಗ್ ಅನ್ನು ಪ್ರಸ್ತುತ 0 ಎಂದು ಕಾನ್ಫಿಗರ್ ಮಾಡಲಾಗಿದೆ, ಇದು ಪ್ಲಗಿನ್ ಅಥವಾ ಥೀಮ್ ವೈಶಿಷ್ಟ್ಯಗಳ ಮೂಲಕ ಫೈಲ್‌ಗಳನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲು ಪ್ರಯತ್ನಿಸುವಾಗ ಕೆಲವು ಸಮಸ್ಯೆಗಳನ್ನು ಉಂಟುಮಾಡಬಹುದು ಅದು ವಿವಿಧ ಅಪ್‌ಲೋಡ್ ವಿಧಾನಗಳನ್ನು ಅವಲಂಬಿಸಿದೆ. ಈ ಸೆಟ್ಟಿಂಗ್ ಅನ್ನು ಒಂದು ಸ್ಥಿರ ಮೌಲ್ಯಕ್ಕೆ ಕಾನ್ಫಿಗರ್ ಮಾಡಲು ಶಿಫಾರಸು ಮಾಡಲಾಗಿದೆ, ಆದರ್ಶಪ್ರಾಯವಾಗಿ %2$s ಮೌಲ್ಯಕ್ಕೆ ಹೊಂದಿಕೆಯಾಗುತ್ತದೆ, ಏಕೆಂದರೆ ಕೆಲವು ಅಪ್‌ಲೋಡ್ ವಿಧಾನಗಳು 0 ಮೌಲ್ಯವನ್ನು ಅನಿಯಮಿತ ಅಥವಾ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ ಎಂದು ಓದುತ್ತವೆ.','Update your site to use HTTPS'=>'HTTPS ಬಳಸಲು ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಅಪ್‌ಡೇಟ್ ಮಾಡಿ','However, your WordPress Address is currently controlled by a PHP constant and therefore cannot be updated. You need to edit your %1$s and remove or update the definitions of %2$s and %3$s.'=>'ಆದಾಗ್ಯೂ, ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ವಿಳಾಸವನ್ನು ಪ್ರಸ್ತುತ ಪಿಎಚ್‌ಪಿ ಸ್ಥಿರಾಂಕದಿಂದ ನಿಯಂತ್ರಿಸಲಾಗುತ್ತದೆ ಮತ್ತು ಆದ್ದರಿಂದ ನವೀಕರಿಸಲಾಗುವುದಿಲ್ಲ. ನೀವು ನಿಮ್ಮ %1$s ಅನ್ನು ಸಂಪಾದಿಸಬೇಕು ಮತ್ತು %2$s ಮತ್ತು %3$s ನ ವ್ಯಾಖ್ಯಾನಗಳನ್ನು ತೆಗೆದುಹಾಕಬೇಕು ಅಥವಾ ನವೀಕರಿಸಬೇಕು.','Talk to your web host about supporting HTTPS for your website.'=>'ನಿಮ್ಮ ವೆಬ್‌ಸೈಟ್‌ಗಾಗಿ HTTPS ಅನ್ನು ಬೆಂಬಲಿಸುವ ಕುರಿತು ನಿಮ್ಮ ವೆಬ್ ಹೋಸ್ಟ್‌ನೊಂದಿಗೆ ಮಾತನಾಡಿ.','HTTPS is already supported for your website.'=>'HTTPS ಈಗಾಗಲೇ ನಿಮ್ಮ ವೆಬ್‌ಸೈಟ್‌ಗೆ ಬೆಂಬಲಿತವಾಗಿದೆ.','Your <a href="%1$s">WordPress Address</a> and <a href="%2$s">Site Address</a> are not set up to use HTTPS.'=>'ನಿಮ್ಮ <a href="%1$s"> ವರ್ಡ್ಪ್ರೆಸ್ ವಿಳಾಸ </a> ಮತ್ತು <a href="%2$s"> ಸೈಟ್ ವಿಳಾಸ </a> ವನ್ನು HTTPS ಬಳಸಲು ಹೊಂದಿಸಲಾಗಿಲ್ಲ.','You are accessing this website using HTTPS, but your <a href="%1$s">WordPress Address</a> and <a href="%2$s">Site Address</a> are not set up to use HTTPS by default.'=>'ನೀವು HTTPS ಬಳಸಿ ಈ ವೆಬ್‌ಸೈಟ್ ಅನ್ನು ಪ್ರವೇಶಿಸುತ್ತಿದ್ದೀರಿ, ಆದರೆ ನಿಮ್ಮ <a href="%1$s"> ವರ್ಡ್‌ಪ್ರೆಸ್ ವಿಳಾಸ </a> ಮತ್ತು <a href="%2$s"> ಸೈಟ್ ವಿಳಾಸ </a> ಇವುಗಳನ್ನು ಹೊಂದಿಸಲಾಗಿಲ್ಲ ಪೂರ್ವನಿಯೋಜಿತವಾಗಿ HTTPS ಬಳಸಿ.','Your <a href="%s">Site Address</a> is not set up to use HTTPS.'=>'ನಿಮ್ಮ <a href="%s"> ಸೈಟ್ ವಿಳಾಸ </a> ವನ್ನು HTTPS ಬಳಸಲು ಹೊಂದಿಸಲಾಗಿಲ್ಲ.','Learn more about debugging in WordPress.'=>'ವರ್ಡ್‌ಪ್ರೆಸ್‌ನಲ್ಲಿ ಡೀಬಗ್ ಮಾಡುವ ಕುರಿತು ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ.','Added'=>'ಸೇರಿಸಲಾಗಿದೆ','Contact information'=>'ಸಂಪರ್ಕ ಮಾಹಿತಿ','Copy suggested policy text to clipboard'=>'ಸೂಚಿಸಿದ ನೀತಿ ಪಠ್ಯವನ್ನು ಕ್ಲಿಪ್‌ಬೋರ್ಡ್‌ಗೆ ನಕಲಿಸಿ','Send password reset'=>'ಪಾಸ್ವರ್ಡ್ ರೀಸೆಟ್ ಕಳುಹಿಸಿ','Search Results'=>'ಹುಡುಕಾಟ ಫಲಿತಾಂಶಗಳು','Directory listing failed.'=>'ಡೈರೆಕ್ಟರಿ ಪಟ್ಟಿ ವಿಫಲವಾಗಿದೆ.','Invalid request ID when merging personal data to export.'=>'ರಫ್ತು ಮಾಡಲು ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ವಿಲೀನಗೊಳಿಸುವಾಗ ಅಮಾನ್ಯ ವಿನಂತಿ ID.','Invalid request ID when processing personal data to erase.'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಅಳಿಸುವ ಪ್ರಕ್ರಿಯೆಯಲ್ಲಿ ಅಮಾನ್ಯ ವಿನಂತಿ ID.','Unable to archive the personal data export file (JSON format).'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ರಫ್ತು ಫೈಲ್ ಅನ್ನು ಆರ್ಕೈವ್ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲ (JSON ಫಾರ್ಮ್ಯಾಟ್).','Unable to archive the personal data export file (HTML format).'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ರಫ್ತು ಫೈಲ್ ಅನ್ನು ಆರ್ಕೈವ್ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲ (HTML ಫಾರ್ಮ್ಯಾಟ್).','Unable to create personal data export folder.'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ರಫ್ತು ಫೋಲ್ಡರ್ ರಚಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Unable to open personal data export (HTML report) for writing.'=>'ಬರೆಯಲು ವೈಯಕ್ತಿಕ ಡೇಟಾ ರಫ್ತು (HTML ವರದಿ) ತೆರೆಯಲು ಸಾಧ್ಯವಿಲ್ಲ.','Request added successfully.'=>'ವಿನಂತಿಯನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಸೇರಿಸಲಾಗಿದೆ. ','Invalid personal data action.'=>'ಅಮಾನ್ಯ ವೈಯಕ್ತಿಕ ಡೇಟಾ ಕ್ರಿಯೆ.','Unable to initiate confirmation for personal data request.'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ವಿನಂತಿಗಾಗಿ ದೃಢೀಕರಣವನ್ನು ಆರಂಭಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','PHP Update Recommended'=>'PHP ನವೀಕರಣ ಶಿಫಾರಸು ಮಾಡಲಾಗಿದೆ','Your site is running on an outdated version of PHP (%s), which should be updated.'=>'ನಿಮ್ಮ ಸೈಟ್ PHP (%s) ನ ಹಳತಾದ ಆವೃತ್ತಿಯಲ್ಲಿ ಚಾಲನೆಯಲ್ಲಿದೆ, ಅದನ್ನು ನವೀಕರಿಸಬೇಕು.','Your website appears to use Basic Authentication, which is not currently compatible with Application Passwords.'=>'ನಿಮ್ಮ ವೆಬ್ಸೈಟ್ ಮೂಲ ದೃಢೀಕರಣವನ್ನು ಬಳಸುತ್ತಿರುವಂತೆ ಕಾಣುತ್ತದೆ, ಇದು ಪ್ರಸ್ತುತ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳಿಗೆ ಹೊಂದಿಕೆಯಾಗುವುದಿಲ್ಲ.','https://developer.wordpress.org/rest-api/frequently-asked-questions/#why-is-authentication-not-working'=>'https://developer.wordpress.org/rest-api/frequently-asked-questions/#why-is-authentication-not-working','You can update to the latest nightly build manually:'=>'ನೀವು ಇತ್ತೀಚಿನ ನೈಟ್ಲೀ ಬಿಲ್ಡ್ ಗೆ ಹಸ್ತಚಾಲಿತವಾಗಿ ನವೀಕರಿಸಬಹುದು:','You are using a development version of WordPress.'=>'ನೀವು ವರ್ಡ ಪ್ರೆಸ್ ನ ಅಭಿವೃದ್ಧಿ ಪಡಿಸಿದ ಆವೃತ್ತಿಯನ್ನು ಬಳಸುತ್ತಾ ಇದ್ದೀರ.','This site appears to be under version control. Automatic updates are disabled.'=>'ಈ ಸೈಟ್ ಆವೃತ್ತಿ ನಿಯಂತ್ರಣದಲ್ಲಿರುವಂತೆ ತೋರುತ್ತಿದೆ. ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','Switch to automatic updates for maintenance and security releases only.'=>'ನಿರ್ವಹಣೆ ಮತ್ತು ಭದ್ರತಾ ಬಿಡುಗಡೆಗಳಿಗಾಗಿ ಮಾತ್ರ ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣಗಳಿಗೆ ಬದಲಿಸಿ.','Enable automatic updates for all new versions of WordPress.'=>'ವರ್ಡ್ಪ್ರೆಸ್ನ ಎಲ್ಲಾ ಹೊಸ ಆವೃತ್ತಿಗಳಿಗೆ ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿ.','Current version: %s'=>'ಪ್ರಸ್ತುತ ಆವೃತ್ತಿ: %s','This site will not receive automatic updates for new versions of WordPress.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ನ ಹೊಸ ಆವೃತ್ತಿಗಳಿಗೆ ಈ ಸೈಟ್ ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣಗಳನ್ನು ಸ್ವೀಕರಿಸುವುದಿಲ್ಲ.','This site is automatically kept up to date with each new version of WordPress.'=>'ಈ ಸೈಟ್ ವರ್ಡ್ಪ್ರೆಸ್ ನ ಪ್ರತಿಯೊಂದು ಹೊಸ ಆವೃತ್ತಿಯೊಂದಿಗೆ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ನವೀಕರಿಸಲಾಗುತ್ತದೆ.','WordPress will only receive automatic security and maintenance releases from now on.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಇನ್ನು ಮುಂದೆ ಸ್ವಯಂಚಾಲಿತ ಭದ್ರತೆ ಮತ್ತು ನಿರ್ವಹಣೆ ಬಿಡುಗಡೆಗಳನ್ನು ಮಾತ್ರ ಸ್ವೀಕರಿಸುತ್ತದೆ.','Automatic updates for all WordPress versions have been enabled. Thank you!'=>'ಎಲ್ಲಾ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿಗಳಿಗೆ ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣಗಳನ್ನು ಕ್ರಿಯಾತ್ಮಕಗೊಳಿಸಲಾಗಿದೆ. ಧನ್ಯವಾದಗಳು!','This site is automatically kept up to date with maintenance and security releases of WordPress only.'=>'ವರ್ಡ್ಪ್ರೆಸ್ನ ನಿರ್ವಹಣೆ ಮತ್ತು ಭದ್ರತಾ ಬಿಡುಗಡೆಗಳೊಂದಿಗೆ ಮಾತ್ರ ಈ ಸೈಟ್ ಅನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ನವೀಕರಿಸಲಾಗುತ್ತದೆ.','<strong>Site Health Status</strong> &mdash; Informs you of any potential issues that should be addressed to improve the performance or security of your website.'=>'<strong> ಸೈಟ್ ಆರೋಗ್ಯ ಸ್ಥಿತಿ </strong> & mdash; ನಿಮ್ಮ ವೆಬ್‌ಸೈಟ್‌ನ ಕಾರ್ಯಕ್ಷಮತೆ ಅಥವಾ ಭದ್ರತೆಯನ್ನು ಸುಧಾರಿಸಲು ಯಾವುದೇ ಸಂಭಾವ್ಯ ಸಮಸ್ಯೆಗಳ ಕುರಿತು ನಿಮಗೆ ತಿಳಿಸುತ್ತದೆ.','Your new password for %s is:'=>'%s ಗಾಗಿ ನಿಮ್ಮ ಹೊಸ ಪಾಸ್‌ವರ್ಡ್:','Add New Application Password'=>'ಹೊಸ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ಸೇರಿಸಿ','Required to create an Application Password, but not to update the user.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್ ರಚಿಸಲು ಅಗತ್ಯ, ಆದರೆ ಬಳಕೆದಾರರನ್ನು ಅಪ್‌ಡೇಟ್ ಮಾಡಲು ಅಲ್ಲ.','Go to Updates'=>'ನವೀಕರಣಗಳಿಗೆ ಹೋಗಿ','Go to Plugin Installer'=>'ಪ್ಲಗಿನ್ ಸ್ಥಾಪಕಕ್ಕೆ ಹೋಗಿ','&larr; Go to Users'=>'&larr; ಬಳಕೆದಾರರ ಬಳಿಗೆ ಹೋಗಿ','&larr; Go to editor'=>'&larr; ಸಂಪಾದಕರ ಬಳಿಗೆ ಹೋಗಿ','Go to Importers'=>'ಆಮದುದಾರರಿಗೆ ಹೋಗಿ','Go to Theme Installer'=>'ಥೀಮ್ ಸ್ಥಾಪಕಕ್ಕೆ ಹೋಗಿ','Go to top'=>'ಮೇಲಕ್ಕೆ ಹೋಗಿ','You will be returned to the WordPress Dashboard, and no changes will be made.'=>'ನಿಮ್ಮನ್ನು ವರ್ಡ್ಪ್ರೆಸ್ ಡ್ಯಾಶ್ ಬೋರ್ಡ್ ಗೆ ಹಿಂದಿರುಗಿಸಲಾಗುತ್ತದೆ, ಮತ್ತು ಯಾವುದೇ ಬದಲಾವಣೆಗಳನ್ನು ಮಾಡಲಾಗುವುದಿಲ್ಲ.','You will be given a password to manually enter into the application in question.'=>'ಪ್ರಶ್ನಾನ್ವಯದ ಅಪ್ಲಿಕೇಶನ್ ನಲ್ಲಿ ಹಸ್ತಚಾಲಿತವಾಗಿ ನಮೂದಿಸಲು ನಿಮಗೆ ಪಾಸ್ ವರ್ಡ್ ನೀಡಲಾಗುತ್ತದೆ.','You will be sent to %s'=>'ನಿಮ್ಮನ್ನು %s ಗೆ ಕಳುಹಿಸಲಾಗುತ್ತದೆ','No, I do not approve of this connection'=>'ಇಲ್ಲ, ನಾನು ಈ ಸಂಪರ್ಕವನ್ನು ಒಪ್ಪುವುದಿಲ್ಲ','Yes, I approve of this connection'=>'ಹೌದು, ನಾನು ಈ ಸಂಪರ್ಕವನ್ನು ಅನುಮೋದಿಸುತ್ತೇನೆ','This will grant access to <a href="%1$s">the %2$s site in this installation that you have permissions on</a>.'=>'ಇದು <a href="%1$s"> ಈ ಅನುಸ್ಥಾಪನೆಯಲ್ಲಿ ನೀವು ಅನುಮತಿಗಳನ್ನು ಹೊಂದಿರುವ %2$s ಸೈಟ್‌ಗೆ </a> ಪ್ರವೇಶವನ್ನು ನೀಡುತ್ತದೆ.' . "\0" . 'ಇದು <a href="%1$s"> ಈ ಅನುಸ್ಥಾಪನೆಯಲ್ಲಿ ನೀವು ಅನುಮತಿಗಳನ್ನು ಹೊಂದಿರುವ %2$s ಸೈಟ್‌ಗಳಿಗೆ </a> ಪ್ರವೇಶವನ್ನು ನೀಡುತ್ತದೆ.','Would you like to give this application access to your account? You should only do this if you trust the application in question.'=>'ನಿಮ್ಮ ಖಾತೆಗೆ ಈ ಅಪ್ಲಿಕೇಶನ್ ಪ್ರವೇಶವನ್ನು ನೀಡಲು ನೀವು ಬಯಸುವಿರಾ? ಪ್ರಶ್ನೆಯಲ್ಲಿರುವ ಅಪ್ಲಿಕೇಶನ್ ಅನ್ನು ನೀವು ನಂಬಿದರೆ ಮಾತ್ರ ನೀವು ಇದನ್ನು ಮಾಡಬೇಕು.','Would you like to give the application identifying itself as %s access to your account? You should only do this if you trust the application in question.'=>'ನಿಮ್ಮ ಖಾತೆಗೆ ಪ್ರವೇಶವನ್ನು %s ಎಂದು ಗುರುತಿಸುವ ಅಪ್ಲಿಕೇಶನ್ ಅನ್ನು ನೀಡಲು ನೀವು ಬಯಸುವಿರಾ? ಪ್ರಶ್ನೆಯಲ್ಲಿರುವ ಅಪ್ಲಿಕೇಶನ್ ಅನ್ನು ನೀವು ನಂಬಿದರೆ ಮಾತ್ರ ನೀವು ಇದನ್ನು ಮಾಡಬೇಕು.','An application would like to connect to your account.'=>'ಅಪ್ಲಿಕೇಶನ್ ನಿಮ್ಮ ಖಾತೆಗೆ ಸಂಪರ್ಕಿಸಲು ಬಯಸುತ್ತದೆ.','Cannot Authorize Application'=>'ಅಪ್ಲಿಕೇಶನ್ ಅನ್ನು ಅಧಿಕೃತಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ','Authorize Application'=>'ಅಪ್ಲಿಕೇಶನ್ ಅಧಿಕೃತಗೊಳಿಸು','Be sure to save this in a safe location. You will not be able to retrieve it.'=>'ಇದನ್ನು ಸುರಕ್ಷಿತ ಸ್ಥಾನದಲ್ಲಿ ಉಳಿಸಲು ಮರೆಯದಿರಿ. ಅದನ್ನು ನೀವು ಮರಳಿ ಪಡೆಯಲು ಸಾಧ್ಯವಿಲ್ಲ.','The Authorize Application request is not allowed.'=>'ದೃಢೀಕರಣ ಅಪ್ಲಿಕೇಶನ್ ವಿನಂತಿಗೆ ಅನುಮತಿ ಇಲ್ಲ.','New Application Password Name'=>'ಹೊಸ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್ವರ್ಡ್ ಹೆಸರು','Application passwords grant access to <a href="%1$s">the %2$s site in this installation that you have permissions on</a>.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳು <a href="%1$s">ಈ ಅನುಸ್ಥಾಪನೆಯಲ್ಲಿ ನೀವು ಅನುಮತಿಗಳನ್ನು ಹೊಂದಿರುವ %2$s ಸೈಟ್‌ಗೆ</a> ಪ್ರವೇಶವನ್ನು ನೀಡುತ್ತದೆ.' . "\0" . 'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳು <a href="%1$s">ಈ ಅನುಸ್ಥಾಪನೆಯಲ್ಲಿ ನೀವು ಅನುಮತಿಗಳನ್ನು ಹೊಂದಿರುವ %2$s ಸೈಟ್‌ಗಳಿಗೆ</a> ಪ್ರವೇಶವನ್ನು ನೀಡುತ್ತದೆ','Application passwords allow authentication via non-interactive systems, such as XML-RPC or the REST API, without providing your actual password. Application passwords can be easily revoked. They cannot be used for traditional logins to your website.'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳು ನಿಮ್ಮ ನಿಜವಾದ ಪಾಸ್‌ವರ್ಡ್ ಒದಗಿಸದೆ, XML-RPC ಅಥವಾ REST API ನಂತಹ ಸಂವಾದಾತ್ಮಕವಲ್ಲದ ವ್ಯವಸ್ಥೆಗಳ ಮೂಲಕ ದೃಢೀಕರಣವನ್ನು ಅನುಮತಿಸುತ್ತವೆ. ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳನ್ನು ಸುಲಭವಾಗಿ ಹಿಂಪಡೆಯಬಹುದು. ನಿಮ್ಮ ವೆಬ್‌ಸೈಟ್‌ಗೆ ಸಾಂಪ್ರದಾಯಿಕ ಲಾಗಿನ್‌ಗಳಿಗಾಗಿ ಅವುಗಳನ್ನು ಬಳಸಲಾಗುವುದಿಲ್ಲ.','Set New Password'=>'ಹೊಸ ಗುಪ್ತಪದ ಹೊಂದಿಸಿ','Type the password again.'=>'ಗುಪ್ತಪದವನ್ನು ಇನ್ನೊಮ್ಮೆ ಟೈಪ್ ಮಾಡಿ.','Application Passwords'=>'ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳು','Type the new password again.'=>'ಹೊಸ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಮತ್ತೆ ಟೈಪ್ ಮಾಡಿ.','You can update from WordPress %1$s to <a href="%2$s">WordPress %3$s</a> manually:'=>'ನೀವು ವರ್ಡ್ಪ್ರೆಸ್ %1$s ನಿಂದ <a href="%2$s"> ವರ್ಡ್ಪ್ರೆಸ್ %3$s </a> ಗೆ ಹಸ್ತಚಾಲಿತವಾಗಿ ನವೀಕರಿಸಬಹುದು:','Last IP'=>'ಕೊನೆಯ IP','Last Used'=>'ಕೊನೆಯದಾಗಿ ಉಪಯೋಗಿಸಿದ','Erase personal data'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಅಳಿಸಿ','Revoke all application passwords'=>'ಎಲ್ಲಾ ಅಪ್ಲಿಕೇಶನ್ ಪಾಸ್‌ವರ್ಡ್‌ಗಳನ್ನು ಹಿಂತೆಗೆದುಕೊಳ್ಳಿ','Revoke "%s"'=>'"%s" ಅನ್ನು ಹಿಂತೆಗೆದುಕೊಳ್ಳಿ','Revoke'=>'ಹಿಂತೆಗೆದುಕೊಳ್ಳಿ','The Site Health check for %1$s has been replaced with %2$s.'=>'%1$s ಗಾಗಿ ಸೈಟ್ ಆರೋಗ್ಯ ಚೆಕ್ ಅನ್ನು %2$s ನೊಂದಿಗೆ ಬದಲಾಯಿಸಲಾಗಿದೆ.','Authorization header'=>'ದೃಢೀಕರಣ ಶೀರ್ಷಿಕೆ','Learn how to configure the Authorization header.'=>'ದೃಢೀಕರಣ ಶೀರ್ಷಿಕೆಯನ್ನು ಹೇಗೆ ಕಾನ್ಫಿಗರ್ ಮಾಡುವುದು ಎಂಬುದನ್ನು ಕಲಿಯಿರಿ.','Flush permalinks'=>'ಪರ್ಮಾಲಿಂಕ್‌ಗಳನ್ನು ಫ್ಲಶ್ ಮಾಡಿ ','Current Header Video'=>'ಪ್ರಸ್ತುತ ಶಿರೋಲೇಖ ವೀಡಿಯೊ','- %1$s (from version %2$s to %3$s)'=>'- %1$s (ಆವೃತ್ತಿ %2$s ನಿಂದ %3$s ವರೆಗೆ)','The authorization header is invalid'=>'ದೃಢೀಕರಣ ಶೀರ್ಷಿಕೆ ಅಮಾನ್ಯವಾಗಿದೆ','The authorization header is missing'=>'ದೃಢೀಕರಣ ಶೀರ್ಷಿಕೆ ಕಾಣೆಯಾಗಿದೆ','The Authorization header is working as expected'=>'ದೃಢೀಕರಣ ಶೀರ್ಷಿಕೆಯು ನಿರೀಕ್ಷೆಯಂತೆ ಕೆಲಸ ಮಾಡುತ್ತಿದೆ','Some screen elements can be shown or hidden by using the checkboxes.'=>'ಕೆಲವು ಸ್ಕ್ರೀನ್ ಅಂಶಗಳನ್ನು ಚೆಕ್ ಬಾಕ್ಸ್ ಗಳನ್ನು ಬಳಸಿ ತೋರಿಸಬಹುದು ಅಥವಾ ಮರೆಮಾಡಬಹುದು.','Screen elements'=>'ಪರದೆಯ ಅಂಶಗಳು','The URL must be served over a secure connection.'=>'URL ಅನ್ನು ಸುರಕ್ಷಿತ ಸಂಪರ್ಕದ ಮೂಲಕ ಒದಗಿಸಬೇಕು.','No plugins found for: %s.'=>'ಯಾವುದೇ ಪ್ಲಗಿನ್ಗಳು ಈ %s ಗಾಗಿ ಕಂಡುಬಂದಿಲ್ಲ.','If you request a password reset, your IP address will be included in the reset email.'=>'ನೀವು ಪಾಸ್ವರ್ಡ್ ಮರುಹೊಂದಿಕೆಯನ್ನು ವಿನಂತಿಸಿದರೆ, ನಿಮ್ಮ IP ವಿಳಾಸವನ್ನು ಮರುಹೊಂದಿಕೆ ಇಮೇಲ್ ನಲ್ಲಿ ಸೇರಿಸಲಾಗುತ್ತದೆ.','Complete request'=>'ವಿನಂತಿಯನ್ನು ಸಂಪೂರ್ಣಗೊಳಿಸಿ','Mark export request for &#8220;%s&#8221; as completed.'=>'ಪೂರ್ಣಗೊಂಡಂತೆ ರಫ್ತು ವಿನಂತಿಯನ್ನು ಗುರುತಿಸಿ &#8220;%s&#8221;.','%d request deleted successfully.'=>'%d ವಿನಂತಿಯನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಅಳಿಸಲಾಗಿದೆ.' . "\0" . '%d ವಿನಂತಿಗಳನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಅಳಿಸಲಾಗಿದೆ.','%d request failed to delete.'=>'%d ವಿನಂತಿಯನ್ನು ಅಳಿಸಲು ವಿಫಲವಾಗಿದೆ.' . "\0" . '%d ವಿನಂತಿಗಳನ್ನು ಅಳಿಸಲು ವಿಫಲವಾಗಿದೆ.','%d request marked as complete.'=>'%d ವಿನಂತಿಯನ್ನು ಪೂರ್ಣಗೊಳಿಸಲಾಗಿದೆ ಎಂದು ಗುರುತಿಸಲಾಗಿದೆ.' . "\0" . '%d ವಿನಂತಿಗಳನ್ನು ಪೂರ್ಣಗೊಳಿಸಲಾಗಿವೆ ಎಂದು ಗುರುತಿಸಲಾಗಿದೆ.','%d confirmation request re-sent successfully.'=>'%d ದೃಢೀಕರಣ ವಿನಂತಿಯನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಮರು ಕಳುಹಿಸಲಾಗಿದೆ.' . "\0" . '%d ದೃಢೀಕರಣ ವಿನಂತಿಗಳನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಮರು ಕಳುಹಿಸಲಾಗಿದೆ.','%d confirmation request failed to resend.'=>'%d ದೃಢೀಕರಣ ವಿನಂತಿಯನ್ನು ಮರು ಕಳುಹಿಸಲು ವಿಫಲವಾಗಿದೆ.' . "\0" . '%d ದೃಢೀಕರಣ ವಿನಂತಿಗಳನ್ನು ಮರು ಕಳುಹಿಸಲು ವಿಫಲವಾಗಿದೆ.','Unable to open personal data export file (JSON report) for writing.'=>'ಬರವಣಿಗೆಗಾಗಿ ಬಳಕೆದಾರ ಗೌಪ್ಯತೆ ರಫ್ತು ಫೈಲ್ (JSON ವರದಿ) ತೆರೆಯಲು ಸಾಧ್ಯವಾಗುತ್ತಿಲ್ಲ.','Mark requests as completed'=>'ವಿನಂತಿಗಳನ್ನು ಪೂರ್ಣಗೊಳಿಸಿದಂತೆ ಗುರುತಿಸಿ','Next steps'=>'ಮುಂದಿನ ಹಂತಗಳು','Unable to open personal data export file (archive) for writing.'=>'ಬರೆಯಲು ವೈಯಕ್ತಿಕ ಡೇಟಾ ರಫ್ತು ಫೈಲ್ (ಆರ್ಕೈವ್) ತೆರೆಯಲು ಸಾಧ್ಯವಿಲ್ಲ.','Unable to protect personal data export folder from browsing.'=>'ಬಳಕೆದಾರ ಗೌಪ್ಯತೆ ರಫ್ತು ಫೋಲ್ಡರ್ ಅನ್ನು ಬ್ರೌಸಿಂಗ್ ನಿಂದ ರಕ್ಷಿಸಲು ಅಸಮರ್ಥವಾಗಿದೆ.','Invalid request ID when generating personal data export file.'=>'ಬಳಕೆದಾರ ಗೌಪ್ಯತೆ ರಫ್ತು ಫೈಲ್ ಅನ್ನು ರಚಿಸುವಾಗ ಅಮಾನ್ಯ ವಿನಂತಿ ID.','Unable to generate personal data export file. ZipArchive not available.'=>'ಬಳಕೆದಾರ ಗೌಪ್ಯತೆ ರಫ್ತು ಫೈಲ್ ಅನ್ನು ರಚಿಸಲು ಅಸಮರ್ಥವಾಗಿದೆ. ZipArchive ಲಭ್ಯವಿಲ್ಲ.','Invalid email address when generating personal data export file.'=>'ಬಳಕೆದಾರ ಗೌಪ್ಯತೆ ರಫ್ತು ಫೈಲ್ ಅನ್ನು ರಚಿಸುವಾಗ ಅಮಾನ್ಯ ಇಮೇಲ್ ವಿಳಾಸ.','Search results for: %s'=>'%s ಗಾಗಿ ಶೋಧ ಫಲಿತಾಂಶಗಳು:','Note that even when set to discourage search engines, your site is still visible on the web and not all search engines adhere to this directive.'=>'ಸರ್ಚ್ ಎಂಜಿನ್ಗಳನ್ನು ನಿರುತ್ಸಾಹಗೊಳಿಸಲು ಹೊಂದಿಸುವಿಕೆ ಮಾಡಿದರೂ ಸಹ, ನಿಮ್ಮ ಜಾಲತಾಣವು ಇನ್ನೂ ವೆಬ್‌ನಲ್ಲಿ ಗೋಚರಿಸುತ್ತದೆ ಮತ್ತು ಎಲ್ಲಾ ಸರ್ಚ್ ಎಂಜಿನ್ಗಳು ಈ ನಿರ್ದೇಶನವನ್ನು ಅನುಸರಿಸುವುದಿಲ್ಲ ಎಂಬುದನ್ನು ಗಮನಿಸಿ.','You can choose whether or not your site will be crawled by robots, ping services, and spiders. If you want those services to ignore your site, click the checkbox next to &#8220;Discourage search engines from indexing this site&#8221; and click the Save Changes button at the bottom of the screen.'=>'ನಿಮ್ಮ ತಾಣವು ರೋಬೋಟ್‌ಗಳು, ಪಿಂಗ್ ಸೇವೆಗಳು ಮತ್ತು ಜೇಡಗಳಿಂದ ಕ್ರಾಲ್ ಆಗುತ್ತದೆಯೋ ಇಲ್ಲವೋ ಎಂಬುದನ್ನು ನೀವು ಆಯ್ಕೆ ಮಾಡಬಹುದು. ಆ ಸೇವೆಗಳು ನಿಮ್ಮ ತಾಣವನ್ನು ನಿರ್ಲಕ್ಷಿಸಬೇಕೆಂದು ನೀವು ಬಯಸಿದರೆ, &#8220;ಈ ತಾಣವನ್ನು ಸೂಚಿಕೆ ಮಾಡುವುದರಿಂದ ಸರ್ಚ್ ಇಂಜಿನ್ಗಳನ್ನು ನಿರುತ್ಸಾಹಗೊಳಿಸು&#8221; ಪಕ್ಕದಲ್ಲಿರುವ ಚೆಕ್ ಬಾಕ್ಸ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ ಮತ್ತು ಸ್ಕ್ರೀನ್ ನ ಕೆಳಭಾಗದಲ್ಲಿರುವ ಬದಲಾವಣೆಗಳನ್ನು ಉಳಿಸು ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಿ.','Environment type'=>'ಪರಿಸರ ಪ್ರಕಾರ','The "%1$s" value is smaller than "%2$s"'=>'"%1$s" ಮೌಲ್ಯವು "%2$s" ಗಿಂತ ಚಿಕ್ಕದಾಗಿದೆ.','Auto-updates are only available for plugins recognized by WordPress.org, or that include a compatible update system.'=>'WordPress.org ನಿಂದ ಗುರುತಿಸಲ್ಪಟ್ಟ ಅಥವಾ ಹೊಂದಾಣಿಕೆಯಾಗುವ ನವೀಕರಣ ವ್ಯವಸ್ಥೆಯನ್ನು ಒಳಗೊಂಡ ಪ್ಲಗ್‌ಇನ್‌ಗಳಿಗೆ ಮಾತ್ರ ಸ್ವಯಂ-ನವೀಕರಣಗಳು ಲಭ್ಯವಿರುತ್ತವೆ.','Update Incompatible'=>'ಅಪ್ಡೇಟ್ ಹೊಂದಾಣಿಕೆಯಾಗುವುದಿಲ್ಲ','This update does not work with your version of WordPress.'=>'ಈ ನವೀಕರಣವು ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿಯೊಂದಿಗೆ ಕಾರ್ಯನಿರ್ವಹಿಸುವುದಿಲ್ಲ.','This update does not work with your versions of WordPress and PHP.'=>'ಈ ನವೀಕರಣವು ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಮತ್ತು PHP ಆವೃತ್ತಿಗಳೊಂದಿಗೆ ಕಾರ್ಯನಿರ್ವಹಿಸುವುದಿಲ್ಲ.','Disallowed Comment Keys'=>'ಅನುಮತಿಸದ ಕಾಮೆಂಟ್ ಕೀಗಳು','Plugin and theme auto-updates'=>'ಪ್ಲಗಿನ್ ಮತ್ತು ಥೀಮ್ ಸ್ವಯಂ ನವೀಕರಣಗಳು','There appear to be no issues with plugin and theme auto-updates.'=>'ಪ್ಲಗಿನ್ ಮತ್ತು ಥೀಮ್ ಸ್ವಯಂ-ಅಪ್‌ಡೇಟ್‌ಗಳಲ್ಲಿ ಯಾವುದೇ ಸಮಸ್ಯೆಗಳಿಲ್ಲ.','Auto-updates for themes appear to be disabled. This will prevent your site from receiving new versions automatically when available.'=>'ಥೀಮ್‌ಗಳಿಗಾಗಿ ಸ್ವಯಂ-ಅಪ್‌ಡೇಟ್‌ಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ. ಲಭ್ಯವಿರುವಾಗ ನಿಮ್ಮ ಸೈಟ್ ಹೊಸ ಆವೃತ್ತಿಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಸ್ವೀಕರಿಸುವುದನ್ನು ಇದು ತಡೆಯುತ್ತದೆ','Auto-updates for plugins appear to be disabled. This will prevent your site from receiving new versions automatically when available.'=>'ಪ್ಲಗ್‌ಇನ್‌ಗಳಿಗಾಗಿ ಸ್ವಯಂ-ಅಪ್‌ಡೇಟ್‌ಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ. ಲಭ್ಯವಿರುವಾಗ ನಿಮ್ಮ ಸೈಟ್ ಹೊಸ ಆವೃತ್ತಿಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಸ್ವೀಕರಿಸುವುದನ್ನು ಇದು ತಡೆಯುತ್ತದೆ.','Auto-updates for plugins and themes appear to be disabled. This will prevent your site from receiving new versions automatically when available.'=>'ಪ್ಲಗಿನ್‌ಗಳು ಮತ್ತು ಥೀಮ್‌ಗಳಿಗಾಗಿ ಸ್ವಯಂ-ಅಪ್‌ಡೇಟ್‌ಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ. ಲಭ್ಯವಿರುವಾಗ ನಿಮ್ಮ ಸೈಟ್ ಹೊಸ ಆವೃತ್ತಿಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಸ್ವೀಕರಿಸುವುದನ್ನು ಇದು ತಡೆಯುತ್ತದೆ.','Auto-updates for plugins and/or themes appear to be disabled, but settings are still set to be displayed. This could cause auto-updates to not work as expected.'=>'ಪ್ಲಗ್‌ಇನ್‌ಗಳು ಮತ್ತು/ಅಥವಾ ಥೀಮ್‌ಗಳಿಗಾಗಿ ಸ್ವಯಂ-ಅಪ್‌ಡೇಟ್‌ಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ ಎಂದು ತೋರುತ್ತದೆ, ಆದರೆ ಸೆಟ್ಟಿಂಗ್‌ಗಳನ್ನು ಇನ್ನೂ ಪ್ರದರ್ಶಿಸಲು ಹೊಂದಿಸಲಾಗಿದೆ. ಇದು ಸ್ವಯಂಚಾಲಿತ ಅಪ್‌ಡೇಟ್‌ಗಳು ನಿರೀಕ್ಷೆಯಂತೆ ಕೆಲಸ ಮಾಡದಿರಲು ಕಾರಣವಾಗಬಹುದು.','Your site may have problems auto-updating plugins and themes'=>'ನಿಮ್ಮ ಸೈಟ್ ಪ್ಲಗಿನ್‌ಗಳು ಮತ್ತು ಥೀಮ್‌ಗಳನ್ನು ಸ್ವಯಂ-ಅಪ್‌ಡೇಟ್ ಮಾಡುವಲ್ಲಿ ಸಮಸ್ಯೆಗಳನ್ನು ಹೊಂದಿರಬಹುದು','Plugin and theme auto-updates ensure that the latest versions are always installed.'=>'ಪ್ಲಗಿನ್ ಮತ್ತು ಥೀಮ್ ಸ್ವಯಂ-ಅಪ್‌ಡೇಟ್‌ಗಳು ಇತ್ತೀಚಿನ ಆವೃತ್ತಿಗಳನ್ನು ಯಾವಾಗಲೂ ಇನ್‌ಸ್ಟಾಲ್ ಮಾಡಲಾಗಿದೆಯೇ ಎಂದು ಖಚಿತಪಡಿಸುತ್ತದೆ.','Plugin and theme auto-updates appear to be configured correctly'=>'ಪ್ಲಗಿನ್ ಮತ್ತು ಥೀಮ್ ಸ್ವಯಂ-ಅಪ್‌ಡೇಟ್‌ಗಳನ್ನು ಸರಿಯಾಗಿ ಕಾನ್ಫಿಗರ್ ಮಾಡಿದಂತೆ ಕಾಣುತ್ತದೆ','themeActivate &#8220;%s&#8221;'=>'ಸಕ್ರಿಯಗೊಳಿಸಿ &#8220;%s&#8221;','Sorry, you are not allowed to modify plugins.'=>'ಕ್ಷಮಿಸಿ, ಪ್ಲಗಿನ್ಗಳನ್ನು ಮಾರ್ಪಡಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','The %1$s directive in %2$s determines if uploading files is allowed on your site.'=>'%2$s ನಲ್ಲಿರುವ %1$s ನಿರ್ದೇಶವು ನಿಮ್ಮ ತಾಣದಲ್ಲಿ ಫೈಲ್ಗಳನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡುವುದನ್ನು ಅನುಮತಿಸಲಾಗಿದೆಯೇ ಎಂದು ನಿರ್ಧರಿಸುತ್ತದೆ.','The %s function has been disabled, some media settings are unavailable because of this.'=>'%s ಕಾರ್ಯವನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ, ಈ ಕಾರಣದಿಂದಾಗಿ ಕೆಲವು ಮಾಧ್ಯಮ ಸೆಟ್ಟಿಂಗ್‌ಗಳು ಅಲಭ್ಯವಾಗಿದೆ.','%1$s is set to %2$s. You won\'t be able to upload files on your site.'=>'%1$s ಅನ್ನು %2$s ಗೆ ಹೊಂದಿಸಲಾಗಿದೆ. ನಿಮ್ಮ ತಾಣದಲ್ಲಿ ಫೈಲ್ಗಳನ್ನು ಅಪ್ಲೋಡ್ ಮಾಡಲು ನಿಮಗೆ ಸಾಧ್ಯವಾಗುವುದಿಲ್ಲ.','The setting for %1$s is smaller than %2$s, this could cause some problems when trying to upload files.'=>'%1$s ಗಾಗಿ ಸೆಟ್ಟಿಂಗ್ %2$s ಗಿಂತ ಚಿಕ್ಕದಾಗಿದೆ, ಫೈಲ್ಗಳನ್ನು ಅಪ್ಲೋಡ್ ಮಾಡಲು ಪ್ರಯತ್ನಿಸುವಾಗ ಇದು ಕೆಲವು ಸಮಸ್ಯೆಗಳನ್ನು ಉಂಟುಮಾಡಬಹುದು.','Max effective file size'=>'ಗರಿಷ್ಠ ಪರಿಣಾಮಕಾರಿ ಫೈಲ್ ಗಾತ್ರ','Max size of an uploaded file'=>'ಅಪ್ಲೋಡ್ ಮಾಡಿದ ಫೈಲ್ ನ ಗರಿಷ್ಠ ಗಾತ್ರ','Max size of post data allowed'=>'ಪೋಸ್ಟ್ ಡೇಟಾಗೆ ಅನುಮತಿಸಲಾದ ಗರಿಷ್ಟ ಗಾತ್ರ ','File uploads'=>'ಫೈಲ್ ಅಪ್ಲೋಡ್ಗಳು','File upload settings'=>'ಫೈಲ್ ಅಪ್ಲೋಡ್ ಸೆಟ್ಟಿಂಗ್ಗಳು','Files can be uploaded'=>'ಫೈಲ್‌ಗಳನ್ನು ಅಪ್ಲೋಡ್ ಮಾಡಬಹುದು','pluginInstall %s'=>'%s ಸ್ಥಾಪಿಸು','themeInstall %s'=>'%s ಸ್ಥಾಪಿಸು','themeCannot Install %s'=>'%s ಅನ್ನು ಸ್ಥಾಪಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ','themeUpdate %s now'=>'ಈಗ %s ಅನ್ನು ನವೀಕರಿಸಿ','- %1$s version %2$s'=>'- %1$s ಆವೃತ್ತಿ %2$s','themeActivated'=>'ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ','This plugin is already installed.'=>'ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ಈಗಾಗಲೇ ಸ್ಥಾಪಿಸಲಾಗಿದೆ.','Sorry, you are not allowed to enable themes automatic updates.'=>'ಕ್ಷಮಿಸಿ, ಥೀಮ್‌ಗಳು ಸ್ವಯಂಚಾಲಿತ ಅಪ್‌ಡೇಟ್‌ಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','pluginUpdate %s now'=>'ಈಗ %s ಅನ್ನು ನವೀಕರಿಸಿ','pluginInstall %s now'=>'ಈಗ %s ಅನ್ನು ಸ್ಥಾಪಿಸಿ','Dismiss this notice.'=>'ಈ ಅಧಿಸೂಚನೆಯನ್ನು ವಜಾಗೊಳಿಸಿ.','themeCannot Activate %s'=>' %s ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ','Theme will be auto-updated.'=>'ಥೀಮ್ ಅನ್ನು ಸ್ವಯಂ ನವೀಕರಿಸಲಾಗುತ್ತದೆ.','Theme will no longer be auto-updated.'=>'ಥೀಮ್ ಇನ್ನು ಮುಂದೆ ಸ್ವಯಂ-ನವೀಕರಣಗೊಳ್ಳುವುದಿಲ್ಲ.','Auto-updates can be enabled or disabled for each individual theme. Themes with auto-updates enabled will display the estimated date of the next auto-update. Auto-updates depends on the WP-Cron task scheduling system.'=>'ಸ್ವಯಂ-ನವೀಕರಣಗಳನ್ನು ಪ್ರತಿಯೊಂದು ಪ್ರತ್ಯೇಕ ಥೀಮ್‌ಗೆ ಸಕ್ರಿಯಗೊಳಿಸಬಹುದು ಅಥವಾ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಬಹುದು. ಸ್ವಯಂ ನವೀಕರಣಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿದ ಥೀಮ್‌ಗಳು ಮುಂದಿನ ಸ್ವಯಂ-ಅಪ್‌ಡೇಟ್‌ನ ಅಂದಾಜು ದಿನಾಂಕವನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ. ಸ್ವಯಂ ನವೀಕರಣಗಳು WP-Cron ಕಾರ್ಯ ವೇಳಾಪಟ್ಟಿ ವ್ಯವಸ್ಥೆಯನ್ನು ಅವಲಂಬಿಸಿರುತ್ತದೆ.','Error in deleting the item.'=>'ಐಟಂ ಅಳಿಸುವಲ್ಲಿ ದೋಷ.','Sorry, you are not allowed to disable themes automatic updates.'=>'ಕ್ಷಮಿಸಿ, ಥೀಮ್‌ಗಳ ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to manage plugins automatic updates.'=>'ಕ್ಷಮಿಸಿ, ಪ್ಲಗಿನ್‌ಗಳ ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Plugin will be auto-updated.'=>'ಪ್ಲಗಿನ್ ಅನ್ನು ಸ್ವಯಂ-ನವೀಕರಿಸಲಾಗುತ್ತದೆ.','Error in restoring the item from Trash.'=>'ಕಸದಿಂದ ಐಟಂ ಅನ್ನು ಮರುಸ್ಥಾಪಿಸುವಲ್ಲಿ ದೋಷ.','Error in moving the item to Trash.'=>'ಐಟಂ ಅನ್ನು ಕಸಕ್ಕೆ ತಳ್ಳುವಲ್ಲಿ ದೋಷ.','Plugin will no longer be auto-updated.'=>'ಪ್ಲಗಿನ್ ಇನ್ನು ಮುಂದೆ ಸ್ವಯಂ-ನವೀಕರಿಸಲಾಗುವುದಿಲ್ಲ.','Selected plugins will no longer be auto-updated.'=>'ಆಯ್ದ ಪ್ಲಗ್‌ಇನ್‌ಗಳನ್ನು ಇನ್ನು ಮುಂದೆ ಸ್ವಯಂ-ನವೀಕರಿಸಲಾಗುವುದಿಲ್ಲ.','Selected plugins will be auto-updated.'=>'ಆಯ್ದ ಪ್ಲಗ್‌ಇನ್‌ಗಳನ್ನು ಸ್ವಯಂ-ನವೀಕರಣ ಮಾಡಲಾಗುತ್ತದೆ.','Auto-updates can be enabled or disabled for each individual plugin. Plugins with auto-updates enabled will display the estimated date of the next auto-update. Auto-updates depends on the WP-Cron task scheduling system.'=>'ಸ್ವಯಂ-ನವೀಕರಣಗಳನ್ನು ಪ್ರತಿ ಪ್ಲಗಿನ್‌ಗೆ ಸಕ್ರಿಯಗೊಳಿಸಬಹುದು ಅಥವಾ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಬಹುದು. ಸ್ವಯಂ ನವೀಕರಣಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿದ ಪ್ಲಗಿನ್‌ಗಳು ಮುಂದಿನ ಸ್ವಯಂ ನವೀಕರಣದ ಅಂದಾಜು ದಿನಾಂಕವನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ. ಸ್ವಯಂ ನವೀಕರಣಗಳು WP-Cron ಕಾರ್ಯ ವೇಳಾಪಟ್ಟಿ ವ್ಯವಸ್ಥೆಯನ್ನು ಅವಲಂಬಿಸಿರುತ್ತದೆ.','Please connect to your network admin to manage plugins automatic updates.'=>'ಪ್ಲಗಿನ್‌ಗಳ ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣಗಳನ್ನು ನಿರ್ವಹಿಸಲು ದಯವಿಟ್ಟು ನಿಮ್ಮ ನೆಟ್‌ವರ್ಕ್ ನಿರ್ವಾಹಕರನ್ನು  ಸಂಪರ್ಕಿಸಿ.','Auto-updates'=>'ಸ್ವಯಂ ನವೀಕರಣಗಳು','Please note: Third-party themes and plugins, or custom code, may override WordPress scheduling.'=>'ದಯವಿಟ್ಟು ಗಮನಿಸಿ: ಥರ್ಡ್-ಪಾರ್ಟಿ ಥೀಮ್‌ಗಳು ಮತ್ತು ಪ್ಲಗಿನ್‌ಗಳು, ಅಥವಾ ಕಸ್ಟಮ್ ಕೋಡ್, ವರ್ಡ್ಪ್ರೆಸ್ ವೇಳಾಪಟ್ಟಿಯನ್ನು ಅತಿಕ್ರಮಿಸಬಹುದು.','The admin email verification page will reappear after %s.'=>'ನಿರ್ವಾಹಕ ಇಮೇಲ್ ಪರಿಶೀಲನೆ ಪುಟವು %s ನಂತರ ಮತ್ತೆ ಕಾಣಿಸಿಕೊಳ್ಳುತ್ತದೆ.','Auto-updates can be enabled or disabled for WordPress major versions and for each individual theme or plugin. Themes or plugins with auto-updates enabled will display the estimated date of the next auto-update. Auto-updates depends on the WP-Cron task scheduling system.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಪ್ರಮುಖ ಆವೃತ್ತಿಗಳಿಗೆ ಮತ್ತು ಪ್ರತಿಯೊಂದು ಥೀಮ್ ಅಥವಾ ಪ್ಲಗಿನ್ ಗಾಗಿ ಸ್ವಯಂ ನವೀಕರಣಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಬಹುದು ಅಥವಾ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಬಹುದು. ಸ್ವಯಂ ನವೀಕರಣಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿದ ಥೀಮ್‌ಗಳು ಅಥವಾ ಪ್ಲಗ್‌ಇನ್‌ಗಳು ಮುಂದಿನ ಸ್ವಯಂ-ಅಪ್‌ಡೇಟ್‌ನ ಅಂದಾಜು ದಿನಾಂಕವನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ. ಸ್ವಯಂ ನವೀಕರಣಗಳು WP-Cron ಕಾರ್ಯ ವೇಳಾಪಟ್ಟಿ ವ್ಯವಸ್ಥೆಯನ್ನು ಅವಲಂಬಿಸಿರುತ್ತದೆ.','<strong>Important:</strong> Before updating, please <a href="%1$s">back up your database and files</a>. For help with updates, visit the <a href="%2$s">Updating WordPress</a> documentation page.'=>'<strong> ಪ್ರಮುಖ: </strong> ನವೀಕರಿಸುವ ಮೊದಲು, ದಯವಿಟ್ಟು <a href="%1$s"> ನಿಮ್ಮ ಡೇಟಾಬೇಸ್ ಮತ್ತು ಫೈಲ್‌ಗಳನ್ನು ಬ್ಯಾಕಪ್ ಮಾಡಿ </a>. ನವೀಕರಣಗಳ ಸಹಾಯಕ್ಕಾಗಿ, <a href="%2$s"> ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ನವೀಕರಿಸುವುದು </a> ದಸ್ತಾವೇಜನ್ನು ಪುಟಕ್ಕೆ ಭೇಟಿ ನೀಡಿ.','themeCannot Activate'=>'ಸಕ್ರಿಯಗೊಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ','media itemSuccess'=>'ಯಶಸ್ಸು','plugin<strong>Error:</strong> Current WordPress version (%1$s) does not meet minimum requirements for %2$s. The plugin requires WordPress %3$s.'=>'<strong> ದೋಷ: </strong> ಪ್ರಸ್ತುತ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿ ( %1$s) %2$s ಗೆ ಕನಿಷ್ಠ ಅವಶ್ಯಕತೆಗಳನ್ನು ಪೂರೈಸುವುದಿಲ್ಲ. ಪ್ಲಗಿನ್ ಗೆ ವರ್ಡ್ಪ್ರೆಸ್ %3$s ಅಗತ್ಯವಿದೆ.','plugin<strong>Error:</strong> Current PHP version (%1$s) does not meet minimum requirements for %2$s. The plugin requires PHP %3$s.'=>'<strong> ದೋಷ: </strong> ಪ್ರಸ್ತುತ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿ ( %1$s) %2$s ಗೆ ಕನಿಷ್ಠ ಅವಶ್ಯಕತೆಗಳನ್ನು ಪೂರೈಸುವುದಿಲ್ಲ. ಪ್ಲಗಿನ್ ಗೆ ವರ್ಡ್ಪ್ರೆಸ್ %3$s ಅಗತ್ಯವಿದೆ.','plugin<strong>Error:</strong> Current versions of WordPress (%1$s) and PHP (%2$s) do not meet minimum requirements for %3$s. The plugin requires WordPress %4$s and PHP %5$s.'=>'<strong> ದೋಷ: </strong> ವರ್ಡ್ಪ್ರೆಸ್ (%1$s) ಮತ್ತು PHP (%2$s) ನ ಪ್ರಸ್ತುತ ಆವೃತ್ತಿಗಳು%3$s ಗೆ ಕನಿಷ್ಠ ಅವಶ್ಯಕತೆಗಳನ್ನು ಪೂರೈಸುವುದಿಲ್ಲ. ಪ್ಲಗಿನ್‌ಗೆ ವರ್ಡ್‌ಪ್ರೆಸ್ %4$s ಮತ್ತು PHP %5$s ಅಗತ್ಯವಿದೆ.','These themes are now up to date:'=>'ಈ ಥೀಮ್‌ಗಳು ಈಗ ನವೀಕೃತವಾಗಿವೆ:','These plugins are now up to date:'=>'ಈ ಪ್ಲಗಿನ್‌ಗಳು ಈಗ ನವೀಕೃತವಾಗಿವೆ:','Invalid data. The item does not exist.'=>'ಅಮಾನ್ಯವಾದ ಡೇಟಾ. ಐಟಂ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','Please check your site now. It’s possible that everything is working. If there are updates available, you should update.'=>'ದಯವಿಟ್ಟು ಈಗ ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಪರಿಶೀಲಿಸಿ. ಎಲ್ಲವೂ ಕೆಲಸ ಮಾಡುವ ಸಾಧ್ಯತೆಯಿದೆ. ನವೀಕರಣಗಳು ಲಭ್ಯವಿದ್ದರೆ, ನೀವು ನವೀಕರಿಸಬೇಕು. ','Invalid data. Unknown type.'=>'ಅಮಾನ್ಯವಾದ ಡೇಟಾ. ಅಜ್ಞಾತ ಪ್ರಕಾರ.','Invalid data. Unknown state.'=>'ಅಮಾನ್ಯವಾದ ಡೇಟಾ. ಅಜ್ಞಾತ ಸ್ಥಿತಿ.','Invalid data. No selected item.'=>'ಅಮಾನ್ಯವಾದ ಡೇಟಾ. ಯಾವುದೇ ಆಯ್ದ ಐಟಂ ಇಲ್ಲ.','These themes failed to update:'=>'ಈ ಥೀಮ್‌ಗಳನ್ನು ನವೀಕರಿಸಲು ವಿಫಲವಾಗಿದೆ:','To manage themes on your site, visit the Themes page: %s'=>'ನಿಮ್ಮ ಸೈಟ್‌ನಲ್ಲಿ ಥೀಮ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಲು, ಥೀಮ್‌ಗಳ ಪುಟಕ್ಕೆ ಭೇಟಿ ನೀಡಿ: %s','To manage plugins on your site, visit the Plugins page: %s'=>'ನಿಮ್ಮ ಸೈಟ್‌ನಲ್ಲಿ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಲು, ಪ್ಲಗಿನ್‌ಗಳ ಪುಟಕ್ಕೆ ಭೇಟಿ ನೀಡಿ: %s','You cannot reply to a comment on a draft post.'=>'ಡ್ರಾಫ್ಟ್ ಪೋಸ್ಟ್‌ನಲ್ಲಿನ ಕಾಮೆಂಟ್‌ಗೆ ನೀವು ಪ್ರತ್ಯುತ್ತರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','[%s] Some themes have failed to update'=>'[%s] ಕೆಲವು ಥೀಮ್‌ಗಳನ್ನು ನವೀಕರಿಸಲು ವಿಫಲವಾಗಿದೆ','Howdy! Plugins failed to update on your site at %s.'=>'ಹೌಡಿ! %s ನಲ್ಲಿ ನಿಮ್ಮ ಸೈಟ್‌ನಲ್ಲಿ ಅಪ್‌ಡೇಟ್ ಮಾಡಲು ಪ್ಲಗಿನ್‌ಗಳು ವಿಫಲವಾಗಿವೆ.','Howdy! Plugins and themes failed to update on your site at %s.'=>'ಹೌಡಿ! ಪ್ಲಗಿನ್‌ಗಳು ಮತ್ತು ಥೀಮ್‌ಗಳು %s ನಲ್ಲಿ ನಿಮ್ಮ ಸೈಟ್‌ನಲ್ಲಿ ಅಪ್‌ಡೇಟ್ ಮಾಡಲು ವಿಫಲವಾಗಿದೆ.','Howdy! Themes failed to update on your site at %s.'=>'ಹೌಡಿ! %s ನಲ್ಲಿ ನಿಮ್ಮ ಸೈಟ್‌ನಲ್ಲಿ ಅಪ್‌ಡೇಟ್ ಮಾಡಲು ಥೀಮ್‌ಗಳು ವಿಫಲವಾಗಿವೆ.','[%s] Some plugins have failed to update'=>'[%s] ಕೆಲವು ಪ್ಲಗಿನ್‌ಗಳು ನವೀಕರಿಸಲು ವಿಫಲವಾಗಿದೆ','[%s] Some plugins and themes have failed to update'=>'[%s] ಕೆಲವು ಪ್ಲಗಿನ್ಸ್ ಮತ್ತು ಥೀಮ್‌ಗಳನ್ನು ನವೀಕರಿಸಲು ವಿಫಲವಾಗಿದೆ','Howdy! Some themes have automatically updated to their latest versions on your site at %s. No further action is needed on your part.'=>'ಹೌಡಿ! ಕೆಲವು ವಿಷಯಗಳು ನಿಮ್ಮ ಸೈಟ್‌ನಲ್ಲಿ %s ನಲ್ಲಿ ಅವುಗಳ ಇತ್ತೀಚಿನ ಆವೃತ್ತಿಗಳಿಗೆ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಅಪ್‌ಡೇಟ್ ಆಗಿವೆ. ನಿಮ್ಮ ಕಡೆಯಿಂದ ಯಾವುದೇ ಮುಂದಿನ ಕ್ರಮದ ಅಗತ್ಯವಿಲ್ಲ.','[%s] Some themes were automatically updated'=>'[%s] ಕೆಲವು ಥೀಮ್‌ಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ನವೀಕರಿಸಲಾಗಿದೆ','Howdy! Some plugins have automatically updated to their latest versions on your site at %s. No further action is needed on your part.'=>'ಹೌಡಿ! ಕೆಲವು ಪ್ಲಗ್‌ಇನ್‌ಗಳು ನಿಮ್ಮ ಸೈಟ್‌ನಲ್ಲಿ %s ನಲ್ಲಿ ತಮ್ಮ ಇತ್ತೀಚಿನ ಆವೃತ್ತಿಗಳಿಗೆ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಅಪ್‌ಡೇಟ್ ಆಗಿವೆ. ನಿಮ್ಮ ಕಡೆಯಿಂದ ಯಾವುದೇ ಮುಂದಿನ ಕ್ರಮದ ಅಗತ್ಯವಿಲ್ಲ.','[%s] Some plugins were automatically updated'=>'[%s] ಕೆಲವು ಪ್ಲಗ್‌ಇನ್‌ಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ನವೀಕರಿಸಲಾಗಿದೆ','Howdy! Some plugins and themes have automatically updated to their latest versions on your site at %s. No further action is needed on your part.'=>'ಹೌಡಿ! ಕೆಲವು ಪ್ಲಗ್‌ಇನ್‌ಗಳು ಮತ್ತು ಥೀಮ್‌ಗಳು ನಿಮ್ಮ ಸೈಟ್‌ನಲ್ಲಿ %s ನಲ್ಲಿ ಅವುಗಳ ಇತ್ತೀಚಿನ ಆವೃತ್ತಿಗಳಿಗೆ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಅಪ್‌ಡೇಟ್ ಆಗುತ್ತವೆ. ನಿಮ್ಮ ಕಡೆಯಿಂದ ಯಾವುದೇ ಮುಂದಿನ ಕ್ರಮದ ಅಗತ್ಯವಿಲ್ಲ.','Move %s box up'=>'%s ಬಾಕ್ಸ್ ಅನ್ನು ಮೇಲಕ್ಕೆ ಸರಿಸಿ','Move %s box down'=>'%s ಬಾಕ್ಸ್ ಅನು ಕಳೆಗೆ ಸರಿಸಿ ','[%s] Some plugins and themes have automatically updated'=>'[%s] ಕೆಲವು ಪ್ಲಗ್‌ಇನ್‌ಗಳು ಮತ್ತು ಥೀಮ್‌ಗಳು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ನವೀಕರಿಸಲ್ಪಟ್ಟಿವೆ.','commentNot spam'=>'ಸ್ಪ್ಯಾಮ್ ಅಲ್ಲ','PHP Sessions'=>'PHP ಸೆಷನ್‌ಗಳು','A PHP session was created by a %1$s function call. This interferes with REST API and loopback requests. The session should be closed by %2$s before making any HTTP requests.'=>'ಒಂದು PHP ಸೆಶನ್ ಅನ್ನು %1$s ಫಂಕ್ಷನ್ ಕರೆಯಿಂದ ರಚಿಸಲಾಗಿದೆ. ಇದು REST API ಮತ್ತು ಲೂಪ್‌ಬ್ಯಾಕ್ ವಿನಂತಿಗಳಿಗೆ ಅಡ್ಡಿಪಡಿಸುತ್ತದೆ. ಯಾವುದೇ HTTP ವಿನಂತಿಗಳನ್ನು ಮಾಡುವ ಮೊದಲು ಅಧಿವೇಶನವನ್ನು %2$s ಮುಚ್ಚಬೇಕು.','An active PHP session was detected'=>'ಸಕ್ರಿಯ PHP ಸೆಶನ್ ಪತ್ತೆಯಾಗಿದೆ','PHP sessions created by a %1$s function call may interfere with REST API and loopback requests. An active session should be closed by %2$s before making any HTTP requests.'=>'%1$s ಫಂಕ್ಷನ್ ಕರೆಯಿಂದ ರಚಿಸಲಾದ PHP ಸೆಶನ್‌ಗಳು REST API ಮತ್ತು ಲೂಪ್‌ಬ್ಯಾಕ್ ವಿನಂತಿಗಳೊಂದಿಗೆ ಹಸ್ತಕ್ಷೇಪ ಮಾಡಬಹುದು. ಯಾವುದೇ HTTP ವಿನಂತಿಗಳನ್ನು ಮಾಡುವ ಮೊದಲು ಸಕ್ರಿಯ ಅಧಿವೇಶನವನ್ನು %2$s ಮುಚ್ಚಬೇಕು.','No PHP sessions detected'=>'PHP ಸೆಷನಗಳು ಪತ್ತೆ ಅಗಿಲ್ಲ ','Extended view'=>'ವಿಸ್ತೃತ ನೋಟ','Compact view'=>'ಕಾಂಪ್ಯಾಕ್ಟ್ ನೋಟ','post action/button labelSchedule'=>'ವೇಳಾಪಟ್ಟಿ','No plugins found. Try a different search.'=>'ಯಾವುದೇ ಪ್ಲಗ್‌ಇನ್‌ಗಳು ಕಂಡುಬಂದಿಲ್ಲ. ಬೇರೆ ಹುಡುಕಾಟವನ್ನು ಪ್ರಯತ್ನಿಸಿ.','You are updating a plugin. Be sure to <a href="%s">back up your database and files</a> first.'=>'ನೀವು ಪ್ಲಗಿನ್ ಅನ್ನು ನವೀಕರಿಸುತ್ತಿದ್ದೀರಿ. ಮೊದಲು <a href="%s">ನಿಮ್ಮ ಡೇಟಾಬೇಸ್ ಮತ್ತು ಫೈಲ್‌ಗಳನ್ನು ಬ್ಯಾಕಪ್</a> ಮಾಡಲು ಮರೆಯದಿರಿ.','Automatic update scheduled in %s.'=>'ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣವನ್ನು %s ನಲ್ಲಿ ನಿಗದಿಪಡಿಸಲಾಗಿದೆ.','Automatic update not scheduled. There may be a problem with WP-Cron.'=>'ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣವನ್ನು ನಿಗದಿಪಡಿಸಲಾಗಿಲ್ಲ. WP-Cron ನಲ್ಲಿ ಸಮಸ್ಯೆ ಇರಬಹುದು.','Automatic update overdue by %s. There may be a problem with WP-Cron.'=>'ಸ್ವಯಂಚಾಲಿತ ಅಪ್‌ಡೇಟ್ ಮಿತಿಮೀರಿದ %s. WP-Cron ನಲ್ಲಿ ಸಮಸ್ಯೆ ಇರಬಹುದು.','You are uploading an older version of a current plugin. You can continue to install the older version, but be sure to <a href="%s">back up your database and files</a> first.'=>'ನೀವು ಪ್ರಸ್ತುತ ಪ್ಲಗಿನ್‌ನ ಹಳೆಯ ಆವೃತ್ತಿಯನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡುತ್ತಿರುವಿರಿ. ನೀವು ಹಳೆಯ ಆವೃತ್ತಿಯನ್ನು ಸ್ಥಾಪಿಸುವುದನ್ನು ಮುಂದುವರಿಸಬಹುದು, ಆದರೆ ಮೊದಲು <a href="%s">ನಿಮ್ಮ ಡೇಟಾಬೇಸ್ ಮತ್ತು ಫೈಲ್‌ಗಳನ್ನು ಬ್ಯಾಕಪ್ ಮಾಡಲು</a> ಮರೆಯದಿರಿ.','Plugin name'=>'ಪ್ಲಗಿನ್ ಹೆಸರು','Theme downgraded successfully.'=>'ಥೀಮ್ ಅನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಡೌನ್‌ಗ್ರೇಡ್ ಮಾಡಲಾಗಿದೆ.','Theme downgrade failed.'=>'ಥೀಮ್ ಡೌನ್‌ಗ್ರೇಡ್ ವಿಫಲವಾಗಿದೆ.','Downgrading the theme&#8230;'=>'ಥೀಮ್ ಅನ್ನು ಡೌನ್ಗ್ರೇಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ&#8230;','Your WordPress version is %1$s, however the uploaded plugin requires %2$s.'=>'ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿ %1$s, ಆದರೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಿದ ಪ್ಲಗಿನ್‌ಗೆ %2$s ಅಗತ್ಯವಿದೆ.','The plugin cannot be updated due to the following:'=>'ಕೆಳಗಿನವುಗಳಿಂದಾಗಿ ಪ್ಲಗಿನ್ ಅನ್ನು ನವೀಕರಿಸಲಾಗುವುದಿಲ್ಲ:','The PHP version on your server is %1$s, however the uploaded plugin requires %2$s.'=>'ನಿಮ್ಮ ಸರ್ವರ್‌ನಲ್ಲಿನ PHP ಆವೃತ್ತಿಯು %1$s ಆಗಿದೆ, ಆದರೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಿದ ಪ್ಲಗಿನ್‌ಗೆ %2$s ಅಗತ್ಯವಿದೆ.','No plugins are currently available.'=>'ಪ್ರಸ್ತುತ ಯಾವುದೇ ಪ್ಲಗ್‌ಇನ್‌ಗಳು ಲಭ್ಯವಿಲ್ಲ.','Restore original image'=>'ಮೂಲ ಚಿತ್ರವನ್ನು ಮರುಸ್ಥಾಪಿಸಿ','Cancel and go back'=>'ರದ್ದುಗೊಳಿಸಿ ಮತ್ತು ಹಿಂತಿರುಗಿ','Automatic Updates'=>'ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣಗಳು','Enable auto-updates'=>'ಸ್ವಯಂ ನವೀಕರಣಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿ','Disable auto-updates'=>'ಸ್ವಯಂ ನವೀಕರಣಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಿ','Updating the theme&#8230;'=>'ಥೀಮ್ ಅನ್ನು ನವೀಕರಿಸಲಾಗುತ್ತಿದೆ&#8230;','Enable Auto-updates'=>'ಸ್ವಯಂ ನವೀಕರಣವನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿ','Disable Auto-updates'=>'ಸ್ವಯಂ ನವೀಕರಣಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಿ','The uploaded file has expired. Please go back and upload it again.'=>'ಅಪ್‌ಲೋಡ್ ಮಾಡಿದ ಫೈಲ್ ಅವಧಿ ಮುಗಿದಿದೆ. ದಯವಿಟ್ಟು ಹಿಂತಿರುಗಿ ಮತ್ತು ಅದನ್ನು ಮತ್ತೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಿ.','You are updating a theme. Be sure to <a href="%s">back up your database and files</a> first.'=>'ನೀವು ಥೀಮ್ ಅನ್ನು ಅಪ್‌ಡೇಟ್ ಮಾಡುತ್ತಿದ್ದೀರಿ. ಮೊದಲು <a href="%s"> ನಿಮ್ಮ ಡೇಟಾಬೇಸ್ ಮತ್ತು ಫೈಲ್‌ಗಳನ್ನು ಬ್ಯಾಕಪ್ ಮಾಡಲು </a> ಖಚಿತವಾಗಿರಿ.','Auto-updates Disabled <span class="count">(%s)</span>'=>' ಸ್ವಯಂ-ನವೀಕರಣಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ <span class="count">(%s)</span>' . "\0" . 'ಆಟೋ-ಉಪ್ಡೇಟ್ಸ್ ಡಿಸೇಬಲ್ಡ <span class="count">(%s)</span>','Auto-updates Enabled <span class="count">(%s)</span>'=>'ಸ್ವಯಂ ನವೀಕರಣಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ <span class="count">(%s)</span>' . "\0" . 'ಸ್ವಯಂ ನವೀಕರಣಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ <span class="count"> (%s)</span>','themeReplace active with uploaded'=>'ಅಪ್‌ಲೋಡ್ ಮಾಡುವುದರೊಂದಿಗೆ ಸಕ್ರಿಯವನ್ನು ಬದಲಾಯಿಸಿ','Theme name'=>'ಥೀಮ್ ಹೆಸರು','Required WordPress version'=>'ಅಗತ್ಯವಿರುವ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿ','Required PHP version'=>'ಅಗತ್ಯವಿರುವ PHP ಆವೃತ್ತಿ','(not found)'=>'(ಸಿಕ್ಕಿಲ್ಲ)','The theme cannot be updated due to the following:'=>'ಕೆಳಗಿನವುಗಳಿಂದಾಗಿ ಥೀಮ್ ಅನ್ನು ನವೀಕರಿಸಲಾಗುವುದಿಲ್ಲ:','Your WordPress version is %1$s, however the uploaded theme requires %2$s.'=>'ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿ %1$s, ಆದರೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಿದ ಥೀಮ್‌ಗೆ %2$s ಅಗತ್ಯವಿದೆ.','The PHP version on your server is %1$s, however the uploaded theme requires %2$s.'=>'ನಿಮ್ಮ ಸರ್ವರ್‌ನಲ್ಲಿನ PHP ಆವೃತ್ತಿಯು %1$s ಆಗಿದೆ, ಆದರೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಿದ ಥೀಮ್‌ಗೆ %2$s ಅಗತ್ಯವಿದೆ.','themeCannot Install'=>'ಸ್ಥಾಪಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ','Block Editor Patterns'=>'ಬ್ಲಾಕ್ ಸಂಪಾದಕದ ಮಾದರಿಗಳು','Plugin downgraded successfully.'=>'ಪ್ಲಗಿನ್ ಯಶಸ್ವಿಯಾಗಿ ಡೌನ್‌ಗ್ರೇಡ್ ಮಾಡಲಾಗಿದೆ.','Plugin downgrade failed.'=>'ಪ್ಲಗಿನ್ ಡೌನ್‌ಗ್ರೇಡ್ ವಿಫಲವಾಗಿದೆ.','Auto-update'=>'ಸ್ವಯಂ-ನವೀಕರಣ','Auto-updates disabled'=>'ಸ್ವಯಂ-ನವೀಕರಣಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ','Auto-updates enabled'=>'ಸ್ವಯಂ-ನವೀಕರಣಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ','PHP memory limit (only for admin screens)'=>'PHP ಮೆಮೊರಿ ಮಿತಿ (ನಿರ್ವಾಹಕ ಪರದೆಗಳಿಗೆ ಮಾತ್ರ)','Is this site discouraging search engines?'=>'ಈ ಸೈಟ್ ಸರ್ಚ್ ಇಂಜಿನ್ಗಳನ್ನು ನಿರುತ್ಸಾಹಗೊಳಿಸುತ್ತಿದೆಯೇ?','Removing the current plugin&#8230;'=>'ಪ್ರಸ್ತುತ ಪ್ಲಗಿನ್ ತೆಗೆಯಲಾಗುತ್ತಿದೆ&#8230;','Are pretty permalinks supported?'=>'ಪ್ರೆಟಿ ಪರ್ಮಾಲಿಂಕ್‌ಗಳನ್ನು ಬೆಂಬಲಿಸಲಾಗಿದೆಯೇ?','Downgrading the plugin&#8230;'=>'ಪ್ಲಗಿನ್ ಅನ್ನು ಡೌನ್ಗ್ರೇಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ &#8230;','Updating the plugin&#8230;'=>'ಪ್ಲಗಿನ್ ಅನ್ನು ನವೀಕರಿಸಲಾಗುತ್ತಿದೆ &#8230;','Could not remove the current plugin.'=>'ಪ್ರಸ್ತುತ ಪ್ಲಗಿನ್ ಅನ್ನು ತೆಗೆದುಹಾಕಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Wide Blocks'=>'ವಿಶಾಲ ಬ್ಲಾಕ್ಗಳು','Block Editor Styles'=>'ಬ್ಲಾಕ್ ಎಡಿಟರ್ ಶೈಲಿಗಳು','Spam'=>'ಸ್ಪ್ಯಾಮ್','Unable to write to %s file.'=>'%s ಫೈಲ್‌ಗೆ ಬರೆಯಲು ಸಾಧ್ಯವಿಲ್ಲ.','Error:'=>'ದೋಷ:','This localized version contains both the translation and various other localization fixes.'=>'ಈ ಸ್ಥಳೀಕರಿಸಿದ ಆವೃತ್ತಿಯು ಅನುವಾದ ಮತ್ತು ವಿವಿಧ ಸ್ಥಳೀಕರಣ ಪರಿಹಾರಗಳನ್ನು ಒಳಗೊಂಡಿದೆ.','You should update your %s file now.'=>'ನೀವು ಈಗ ನಿಮ್ಮ %s ಫೈಲ್ ಅನ್ನು ಅಪ್‌ಡೇಟ್ ಮಾಡಬೇಕು. ','Take a look at the <strong>%1$d item</strong> on the <a href="%2$s">Site Health screen</a>.'=>'<a href="%2$s">ಸೈಟ್ ಆರೋಗ್ಯ ಪರದೆಯ</a> ಮೇಲೆ <strong>%1$d ಐಟಂ</strong> ಅನ್ನು ನೋಡಿ.' . "\0" . '<a href="%2$s">ಸೈಟ್ ಆರೋಗ್ಯ ಪರದೆಯ</a> ಮೇಲೆ <strong>%1$d ಐಟಂಗಳನ್ನು</strong> ನೋಡಿ.','Great job! Your site currently passes all site health checks.'=>'ಒಳ್ಳೆಯ ಕೆಲಸ! ನಿಮ್ಮ ಸೈಟ್ ಪ್ರಸ್ತುತ ಎಲ್ಲಾ ಸೈಟ್ ಆರೋಗ್ಯ ತಪಾಸಣೆಗಳನ್ನು ರವಾನಿಸುತ್ತದೆ.','Your site has critical issues that should be addressed as soon as possible to improve its performance and security.'=>'ನಿಮ್ಮ ಸೈಟ್ ತನ್ನ ಕಾರ್ಯಕ್ಷಮತೆ ಮತ್ತು ಭದ್ರತೆಯನ್ನು ಸುಧಾರಿಸಲು ಸಾಧ್ಯವಾದಷ್ಟು ಬೇಗ ಪರಿಹರಿಸಬೇಕಾದ ನಿರ್ಣಾಯಕ ಸಮಸ್ಯೆಗಳನ್ನು ಹೊಂದಿದೆ. ','Your site&#8217;s health is looking good, but there are still some things you can do to improve its performance and security.'=>'ನಿಮ್ಮ ಸೈಟ್‌ನ ಆರೋಗ್ಯವು ಉತ್ತಮವಾಗಿ ಕಾಣುತ್ತದೆ, ಆದರೆ ಅದರ ಕಾರ್ಯಕ್ಷಮತೆ ಮತ್ತು ಭದ್ರತೆಯನ್ನು ಸುಧಾರಿಸಲು ನೀವು ಇನ್ನೂ ಕೆಲವು ಕೆಲಸಗಳನ್ನು ಮಾಡಬಹುದು.','Site health checks will automatically run periodically to gather information about your site. You can also <a href="%s">visit the Site Health screen</a> to gather information about your site now.'=>'ನಿಮ್ಮ ಸೈಟ್ ಬಗ್ಗೆ ಮಾಹಿತಿಯನ್ನು ಸಂಗ್ರಹಿಸಲು ಸೈಟ್ ಆರೋಗ್ಯ ತಪಾಸಣೆ ನಿಯತಕಾಲಿಕವಾಗಿ ರನ್ ಆಗುತ್ತದೆ. ನಿಮ್ಮ ಸೈಟ್‌ನ ಮಾಹಿತಿಯನ್ನು ಈಗ ಸಂಗ್ರಹಿಸಲು ನೀವು <a href="%s">ಸೈಟ್ ಆರೋಗ್ಯ ಪರದೆಯನ್ನು</a> ಭೇಟಿ ಮಾಡಬಹುದು.','No information yet&hellip;'=>'ಇನ್ನೂ ಯಾವುದೇ ಮಾಹಿತಿ ಇಲ್ಲ&hellip;','The uploaded file exceeds the %1$s directive in %2$s.'=>'ಅಪ್‌ಲೋಡ್ ಮಾಡಿದ ಫೈಲ್ %2$s ನಲ್ಲಿ %1$s ನಿರ್ದೇಶನವನ್ನು ಮೀರಿದೆ.','No comments found in Trash.'=>'ಕಸದಲ್ಲಿ ಯಾವುದೇ ಕಾಮೆಂಟ್‌ಗಳು ಕಂಡುಬಂದಿಲ್ಲ.','File is empty. Please upload something more substantial. This error could also be caused by uploads being disabled in your %1$s file or by %2$s being defined as smaller than %3$s in %1$s.'=>'ಫೈಲ್ ಖಾಲಿಯಾಗಿದೆ. ದಯವಿಟ್ಟು ಹೆಚ್ಚು ಗಣನೀಯವಾದ ಯಾವುದನ್ನಾದರೂ ಅಪ್‌ಲೋಡ್ ಮಾಡಿ. ನಿಮ್ಮ %1$s ಫೈಲ್‌ನಲ್ಲಿ ಅಪ್‌ಲೋಡ್‌ಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸುವುದರಿಂದ ಅಥವಾ %1$s ನಲ್ಲಿ %3$s ಗಿಂತ %2$s ಚಿಕ್ಕದಾಗಿ ವ್ಯಾಖ್ಯಾನಿಸುವುದರಿಂದಲೂ ಈ ದೋಷ ಉಂಟಾಗಬಹುದು.','Error: %1$s (%2$s)'=>'ದೋಷ: %1$s (%2$s)','A test is unavailable'=>'ಪರೀಕ್ಷೆಯು ಲಭ್ಯವಿಲ್ಲ','Your site is running on an older version of PHP (%s), which should be updated'=>'ನಿಮ್ಮ ಸೈಟ್ PHP (%s) ನ ಹಳೆಯ ಆವೃತ್ತಿಯಲ್ಲಿ ಚಾಲನೆಯಲ್ಲಿದೆ, ಅದನ್ನು ನವೀಕರಿಸಬೇಕು','Your site is running on an older version of PHP (%s)'=>'ನಿಮ್ಮ ಸೈಟ್ PHP ನ ಹಳೆಯ ಆವೃತ್ತಿಯಲ್ಲಿ ಚಾಲನೆಯಲ್ಲಿದೆ (%s)','No media files found in Trash.'=>'ಅನುಪಯುಕ್ತದಲ್ಲಿ ಯಾವುದೇ ಮಾಧ್ಯಮ ಫೈಲ್‌ಗಳು ಕಂಡುಬಂದಿಲ್ಲ.','Your site is running a recommended version of PHP (%s)'=>'ನಿಮ್ಮ ಸೈಟ್ PHP (%s) ನ ಶಿಫಾರಸು ಮಾಡಲಾದ ಆವೃತ್ತಿಯನ್ನು ಚಾಲನೆ ಮಾಡುತ್ತಿದೆ','%1$s %2$d – %3$s %4$d, %5$d'=>'%1$s %2$d – %3$s %4$d, %5$d','upcoming events year formatY'=>'Y','upcoming events day formatj'=>'j','%1$s %2$d–%3$d, %4$d'=>'%1$s %2$d–%3$d, %4$d','upcoming events month formatF'=>'F','Delete requests'=>'ವಿನಂತಿಗಳನ್ನು ಅಳಿಸಿ','Table prefix'=>'ಟೇಬಲ್ ಪೂರ್ವಪ್ರತ್ಯಯ','Resend confirmation requests'=>'ದೃಡೀಕರಣ ವಿನಂತಿಗಳನ್ನು ಮತ್ತೆ ಕಳುಹಿಸಿ','PHP Default Timezone'=>'PHP ಡೀಫಾಲ್ಟ್ ಸಮಯ ವಲಯ','PHP default timezone is invalid'=>'PHP ಡೀಫಾಲ್ಟ್ ಸಮಯ ವಲಯವು ಅಮಾನ್ಯವಾಗಿದೆ','PHP default timezone is valid'=>'PHP ಡೀಫಾಲ್ಟ್ ಸಮಯ ವಲಯವು ಮಾನ್ಯವಾಗಿದೆ','PHP default timezone was changed after WordPress loading by a %s function call. This interferes with correct calculations of dates and times.'=>'%s ಫಂಕ್ಷನ್ ಕರೆಯಿಂದ ವರ್ಡ್ಪ್ರೆಸ್ ಲೋಡ್ ಮಾಡಿದ ನಂತರ PHP ಡೀಫಾಲ್ಟ್ ಸಮಯವಲಯವನ್ನು ಬದಲಾಯಿಸಲಾಗಿದೆ. ಇದು ದಿನಾಂಕಗಳು ಮತ್ತು ಸಮಯಗಳ ಸರಿಯಾದ ಲೆಕ್ಕಾಚಾರದಲ್ಲಿ ಹಸ್ತಕ್ಷೇಪ ಮಾಡುತ್ತದೆ.','PHP default timezone was configured by WordPress on loading. This is necessary for correct calculations of dates and times.'=>'PHP ಡೀಫಾಲ್ಟ್ ಸಮಯವಲಯವನ್ನು ಲೋಡ್ ಮಾಡುವಾಗ ವರ್ಡ್ಪ್ರೆಸ್ ಕಾನ್ಫಿಗರ್ ಮಾಡಿದೆ. ದಿನಾಂಕಗಳು ಮತ್ತು ಸಮಯಗಳ ಸರಿಯಾದ ಲೆಕ್ಕಾಚಾರಗಳಿಗೆ ಇದು ಅಗತ್ಯವಾಗಿರುತ್ತದೆ.','The seventh parameter passed to %s should be numeric representing menu position.'=>'%s ಗೆ ರವಾನಿಸಲಾದ ಏಳನೇ ಪ್ಯಾರಾಮೀಟರ್ ಮೆನು ಸ್ಥಾನವನ್ನು ಪ್ರತಿನಿಧಿಸುವ ಸಂಖ್ಯಾತ್ಮಕವಾಗಿರಬೇಕು.','The update cannot be installed because WordPress %1$s requires the %2$s PHP extension.'=>'ವರ್ಡ್ಪ್ರೆಸ್ %1$s ಗೆ %2$s PHP ವಿಸ್ತರಣೆಯ ಅಗತ್ಯವಿರುವುದರಿಂದ ಅಪ್‌ಡೇಟ್ ಅನ್ನು ಸ್ಥಾಪಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','https://wordpress.org/about/stats/'=>'https://wordpress.org/about/stats/','<a href="https://wordpress.org/documentation/article/tools-export-screen/">Documentation on Export</a>'=>'<a href="https://wordpress.org/documentation/article/tools-export-screen/">ರಫ್ತು ಕುರಿತು ದಾಖಲೆ</a>','<a href="https://wordpress.org/documentation/article/plugins-add-new-screen/">Documentation on Installing Plugins</a>'=>'<a href="https://wordpress.org/documentation/article/plugins-add-new-screen/">ಪ್ಲಗ್‌ಇನ್‌ಗಳನ್ನು ಸ್ಥಾಪಿಸುವ ಕುರಿತು ದಾಖಲೆ</a>','<a href="https://wordpress.org/documentation/article/pages-screen/">Documentation on Managing Pages</a>'=>'<a href="https://wordpress.org/documentation/article/pages-screen/">ಪುಟಗಳನ್ನು ನಿರ್ವಹಿಸುವಲ್ಲಿ ಡಾಕ್ಯುಮೆಂಟೇಶನ್</a>','<a href="https://wordpress.org/documentation/article/appearance-themes-screen/#install-themes">Documentation on Adding New Themes</a>'=>'<a href="https://wordpress.org/documentation/article/appearance-themes-screen/#install-themes">ಹೊಸ ಥೀಮ್‌ಗಳನ್ನು ಸೇರಿಸುವ ಕುರಿತು ದಾಖಲೆ</a>','<a href="https://wordpress.org/documentation/article/settings-discussion-screen/">Documentation on Discussion Settings</a>'=>'<a href="https://wordpress.org/documentation/article/settings-discussion-screen/">ಚರ್ಚೆಯ ಸೆಟ್ಟಿಂಗ್‌ಗಳಲ್ಲಿ ಡಾಕ್ಯುಮೆಂಟೇಶನ್</a>','<a href="https://wordpress.org/documentation/article/posts-screen/">Documentation on Managing Posts</a>'=>'<a href="https://wordpress.org/documentation/article/posts-screen/">ಪೋಸ್ಟ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸುವಲ್ಲಿ ಡಾಕ್ಯುಮೆಂಟೇಶನ್</a>','<a href="https://wordpress.org/documentation/article/media-add-new-screen/">Documentation on Uploading Media Files</a>'=>'<a href="https://wordpress.org/documentation/article/media-add-new-screen/">ಮಾಧ್ಯಮ ಫೈಲ್‌ಗಳನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡುವ ಕುರಿತು ಡಾಕ್ಯುಮೆಂಟೇಶನ್</a>','<a href="https://wordpress.org/documentation/article/roles-and-capabilities/">Descriptions of Roles and Capabilities</a>'=>'<a href="https://wordpress.org/documentation/article/roles-and-capabilities/">ಪಾತ್ರಗಳು ಮತ್ತು ಸಾಮರ್ಥ್ಯಗಳ ವಿವರಣೆಗಳು</a>','<a href="https://wordpress.org/documentation/article/users-screen/">Documentation on Managing Users</a>'=>'<a href="https://wordpress.org/documentation/article/users-screen/">ಬಳಕೆದಾರರನ್ನು ನಿರ್ವಹಿಸುವ ಕುರಿತು ದಾಖಲೆ</a>','This page allows direct access to your site settings. You can break things here. Please be cautious!'=>'ಈ ಪುಟವು ನಿಮ್ಮ ಸೈಟ್ ಸೆಟ್ಟಿಂಗ್‌ಗಳಿಗೆ ನೇರ ಪ್ರವೇಶವನ್ನು ನೀಡುತ್ತದೆ. ನೀವು ಇಲ್ಲಿ ವಸ್ತುಗಳನ್ನು ಮುರಿಯಬಹುದು. ದಯವಿಟ್ಟು ಜಾಗರೂಕರಾಗಿರಿ!','<a href="https://wordpress.org/documentation/article/pages-screen/">Documentation on Editing Pages</a>'=>'<a href="https://wordpress.org/documentation/article/pages-screen/">ಪುಟಗಳನ್ನು ಸಂಪಾದಿಸುವ ಕುರಿತು ದಾಖಲೀಕರಣ</a>','<a href="https://wordpress.org/documentation/article/pages-add-new-screen/">Documentation on Adding New Pages</a>'=>'<a href="https://wordpress.org/documentation/article/pages-add-new-screen/">ಹೊಸ ಪುಟಗಳನ್ನು ಸೇರಿಸುವ ಕುರಿತು ದಾಖಲೀಕರಣ</a>','<a href="https://wordpress.org/documentation/article/media-library-screen/">Documentation on Media Library</a>'=>'<a href="https://wordpress.org/documentation/article/media-library-screen/">ಮೀಡಿಯಾ ಲೈಬ್ರರಿಯ ಕುರಿತು ದಾಖಲೀಕರಣ</a>','<a href="https://wordpress.org/documentation/article/revisions/">Revisions Management</a>'=>'<a href="https://wordpress.org/documentation/article/revisions">ಪರಿಷ್ಕರಣೆ ನಿರ್ವಹಣೆ</a>','This page can show you every detail about the configuration of your WordPress website. For any improvements that could be made, see the <a href="%s">Site Health Status</a> page.'=>'ಈ ಪುಟವು ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ವೆಬ್‌ಸೈಟ್‌ನ ಸಂರಚನೆಯ ಬಗ್ಗೆ ಪ್ರತಿಯೊಂದು ವಿವರವನ್ನು ನಿಮಗೆ ತೋರಿಸುತ್ತದೆ. ಮಾಡಬಹುದಾದ ಯಾವುದೇ ಸುಧಾರಣೆಗಳಿಗಾಗಿ, <a href="%s"> ಸೈಟ್ ಆರೋಗ್ಯ ಸ್ಥಿತಿ </a> ಪುಟವನ್ನು ನೋಡಿ.','Results are still loading&hellip;'=>'ಫಲಿತಾಂಶಗಳು ಇನ್ನೂ ಲೋಡ್ ಆಗುತ್ತಿವೆ&hellip;','<a href="https://developer.wordpress.org/themes/basics/template-tags/">Documentation on Template Tags</a>'=>'<a href="https://developer.wordpress.org/themes/basics/template-tags/">ಟೆಂಪ್ಲೇಟ್ ಟ್ಯಾಗ್‌ಗಳ ಕುರಿತು ದಾಖಲೀಕರಣ</a>','<a href="https://developer.wordpress.org/plugins/">Documentation on Writing Plugins</a>'=>'<a href="https://developer.wordpress.org/plugins/">ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಬರೆಯುವ ಕುರಿತು ದಾಖಲೀಕರಣ</a>','<a href="https://developer.wordpress.org/themes/">Documentation on Theme Development</a>'=>'<a href="https://developer.wordpress.org/themes/">ಥೀಮ್ ಅಭಿವೃದ್ಧಿ ಕುರಿತು ದಾಖಲೀಕರಣ</a>','Universal time is %s.'=>'ಸಾರ್ವತ್ರಿಕ ಸಮಯವು %s.','Choose either a city in the same timezone as you or a %s (Coordinated Universal Time) time offset.'=>'ನೀವು ಅದೇ ಸಮಯ ವಲಯದಲ್ಲಿರುವ ನಗರವನ್ನು ಅಥವಾ %s (ಸಮನ್ವಯ ಯುನಿವರ್ಸಲ್ ಟೈಮ್) ಸಮಯ ಆಫ್‌ಸೆಟ್ ಅನ್ನು ಆಯ್ಕೆ ಮಾಡಿ.','Administration Email Address'=>'ಆಡಳಿತ ಇಮೇಲ್ ವಿಳಾಸ','You need to make this file writable before you can save your changes. See <a href="%s">Changing File Permissions</a> for more information.'=>'ನಿಮ್ಮ ಬದಲಾವಣೆಗಳನ್ನು ಉಳಿಸುವ ಮೊದಲು ನೀವು ಈ ಫೈಲ್ ಅನ್ನು ಬರೆಯುವಂತೆ ಮಾಡಬೇಕಾಗಿದೆ. ಹೆಚ್ಚಿನ ಮಾಹಿತಿಗಾಗಿ <a href="%s">ಫೈಲ್ ಅನುಮತಿಗಳನ್ನು ಬದಲಾಯಿಸುವುದು</a> ನೋಡಿ.','Upload failed. Please reload and try again.'=>'ಅಪ್‌ಲೋಡ್ ವಿಫಲವಾಗಿದೆ. ದಯವಿಟ್ಟು ಮರುಲೋಡ್ ಮಾಡಿ ಮತ್ತು ಇನ್ನೊಮ್ಮೆ ಪ್ರಯತ್ನಿಸಿ.','Data erasure has failed.'=>'ಡೇಟಾ ಅಳಿಸುವಿಕೆ ವಿಫಲವಾಗಿದೆ.','Erasure completed.'=>'ಅಳಿಸುವಿಕೆ ಪೂರ್ಣಗೊಂಡಿದೆ.','page labelPrivacy Policy Page'=>'ಗೌಪ್ಯತೆ ನೀತಿ ಪುಟ','page labelPosts Page'=>'ಲೇಖನಗಳ ಪುಟ','page labelFront Page'=>'ಮುಖ ಪುಟ','post statusSticky'=>'ಸ್ಟಿಕಿ','post statusPassword protected'=>'ಪ್ರವೇಶಪದದಿಂದ ರಕ್ಷಿತವಾಗಿದೆ.','post statusCustomization Draft'=>'ಗ್ರಾಹಕೀಕರಣ ಕರಡು','The attached file cannot be found.'=>'ಲಗತ್ತಿಸಲಾದ ಫೈಲ್ ಕಂಡುಬಂದಿಲ್ಲ.','The scheduled event, %s, is late to run. Your site still works, but this may indicate that scheduling posts or automated updates may not work as intended.'=>'ನಿಗದಿತ ಈವೆಂಟ್, %s, ರನ್ ಮಾಡಲು ತಡವಾಗಿದೆ. ನಿಮ್ಮ ಸೈಟ್ ಇನ್ನೂ ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತಿದೆ, ಆದರೆ ಇದು ಪೋಸ್ಟ್‌ಗಳ ವೇಳಾಪಟ್ಟಿ ಅಥವಾ ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣಗಳು ಉದ್ದೇಶಿಸಿದಂತೆ ಕೆಲಸ ಮಾಡದಿರಬಹುದು ಎಂದು ಸೂಚಿಸಬಹುದು.','A scheduled event is late'=>'ನಿಗದಿತ ಈವೆಂಟ್ ತಡವಾಗಿದೆ','An HTTPS connection is a more secure way of browsing the web. Many services now have HTTPS as a requirement. HTTPS allows you to take advantage of new features that can increase site speed, improve search rankings, and gain the trust of your visitors by helping to protect their online privacy.'=>'HTTPS ಸಂಪರ್ಕವು ವೆಬ್ ಬ್ರೌಸಿಂಗ್‌ನ ಹೆಚ್ಚು ಸುರಕ್ಷಿತ ಮಾರ್ಗವಾಗಿದೆ. ಅನೇಕ ಸೇವೆಗಳು ಈಗ HTTPS ಅನ್ನು ಅಗತ್ಯವಾಗಿ ಹೊಂದಿವೆ. ಸೈಟ್ ವೇಗವನ್ನು ಹೆಚ್ಚಿಸುವ, ಹುಡುಕಾಟ ಶ್ರೇಯಾಂಕಗಳನ್ನು ಸುಧಾರಿಸುವ ಮತ್ತು ನಿಮ್ಮ ಸಂದರ್ಶಕರ ಆನ್‌ಲೈನ್ ಗೌಪ್ಯತೆಯನ್ನು ರಕ್ಷಿಸಲು ಸಹಾಯ ಮಾಡುವ ಹೊಸ ವೈಶಿಷ್ಟ್ಯಗಳ ಲಾಭವನ್ನು ಪಡೆಯಲು HTTPS ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ.','Your version of WordPress (%s) is up to date'=>'ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿ (%s) ಅಪ್ ಟು ಡೇಟ್ ಆಗಿದೆ','publish box date formatM j, Y'=>'M j, Y','publish box time formatH:i'=>'H:i','Scheduled for: %s'=>'%s ನಿಗದಿತವಾಗಿರುವುದು:','Published on: %s'=>'ಪ್ರಕಟಿಸಿದ ದಿನಾಂಕ: %s','Schedule for: %s'=>'ಇದಕ್ಕಾಗಿ ವೇಳಾಪಟ್ಟಿ: %s','Publish on: %s'=>'%s ರಂದು ಪ್ರಕಟಿಸಿ','The directives (lines) between "BEGIN %1$s" and "END %1$s" are
