ಕ್ರಿಯಾತ್ಮಕವಾಗಿ ರಚಿಸಲಾಗಿದೆ, ಮತ್ತು ವರ್ಡ್ಪ್ರೆಸ್ ಫಿಲ್ಟರ್‌ಗಳ ಮೂಲಕ ಮಾತ್ರ ಮಾರ್ಪಡಿಸಬೇಕು.
ಈ ಗುರುತುಗಳ ನಡುವಿನ ನಿರ್ದೇಶನಗಳಲ್ಲಿನ ಯಾವುದೇ ಬದಲಾವಣೆಗಳನ್ನು ತಿದ್ದಿ ಬರೆಯಲಾಗುತ್ತದೆ.','https://wordpress.org/documentation/article/introduction-to-blogging/#comments'=>'https://wordpress.org/documentation/article/introduction-to-blogging/#comments','https://wordpress.org/documentation/article/introduction-to-blogging/#managing-comments'=>'https://wordpress.org/documentation/article/introduction-to-blogging/#managing-comments','All automatic updates are disabled.'=>'ಎಲ್ಲಾ ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','Parent Theme'=>'ಪೋಷಕ ಥೀಮ್','Database collation'=>'ಡೇಟಾಬೇಸ್ ಸಂಗ್ರಹ','Database charset'=>'ಡೇಟಾಬೇಸ್ ಚಾರ್ಸೆಟ್','Inactive Themes'=>'ನಿಷ್ಕ್ರಿಯ ಥೀಮ್‌ಗಳು','Drop-ins are single files, found in the %s directory, that replace or enhance WordPress features in ways that are not possible for traditional plugins.'=>'ಡ್ರಾಪ್-ಇನ್‌ಸ  ಏಕೈಕ ಫೈಲ್‌ಗಳು, %s ಡೈರೆಕ್ಟರಿಯಲ್ಲಿ ಕಂಡುಬರುತ್ತವೆ, ಸಾಂಪ್ರದಾಯಿಕ ಪ್ಲಗಿನ್‌ಗಳಿಗೆ ಸಾಧ್ಯವಾಗದ ರೀತಿಯಲ್ಲಿ ವರ್ಡ್‌ಪ್ರೆಸ್ ವೈಶಿಷ್ಟ್ಯಗಳನ್ನು ಬದಲಾಯಿಸುವ ಅಥವಾ ವರ್ಧಿಸುವ.','personal data group descriptionOverview of export report.'=>'ರಫ್ತು ವರದಿಯ ಅವಲೋಕನ.','For each post in a feed, include'=>'ಫೀಡ್‌ನಲ್ಲಿ ಪ್ರತಿ ಪೋಸ್ಟ್‌ಗೆ, ಸೇರಿಸಿ','Your theme determines how content is displayed in browsers. <a href="%s">Learn more about feeds</a>.'=>'ಬ್ರೌಸರ್‌ಗಳಲ್ಲಿ ವಿಷಯವನ್ನು ಹೇಗೆ ಪ್ರದರ್ಶಿಸಲಾಗುತ್ತದೆ ಎಂಬುದನ್ನು ನಿಮ್ಮ ಥೀಮ್ ನಿರ್ಧರಿಸುತ್ತದೆ. <a href="%s"> ಫೀಡ್‌ಗಳ ಬಗ್ಗೆ ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ </a>.','<strong>Warning:</strong> these pages should not be the same as your Privacy Policy page!'=>'<strong> ಎಚ್ಚರಿಕೆ: </strong> ಈ ಪುಟಗಳು ನಿಮ್ಮ ಗೌಪ್ಯತೆ ನೀತಿ ಪುಟದಂತೆಯೇ ಇರಬಾರದು!','[%s] Delete My Site'=>'[%s] ನನ್ನ ಸೈಟ್ ಅನ್ನು ಅಳಿಸಿ','Allow people to submit comments on new posts'=>'ಹೊಸ ಪೋಸ್ಟ್‌ಗಳಲ್ಲಿ ಕಾಮೆಂಟ್‌ಗಳನ್ನು ಸಲ್ಲಿಸಲು ಜನರಿಗೆ ಅನುಮತಿಸಿ','Default post settings'=>'ಡೀಫಾಲ್ಟ್ ಪೋಸ್ಟ್ ಸೆಟ್ಟಿಂಗ್‌ಗಳು','<a href="%s">You can change your profile picture on Gravatar</a>.'=>'<a href="%s"> Gravatar ನಲ್ಲಿ ನಿಮ್ಮ ಪ್ರೊಫೈಲ್ ಚಿತ್ರವನ್ನು ನೀವು ಬದಲಾಯಿಸಬಹುದು</a>.','Plugin deactivated.'=>'ಪ್ಲಗಿನ್ ಅನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','Selected plugins activated.'=>'ಆಯ್ದ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','Plugin activated.'=>'ಪ್ಲಗಿನ್ ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','The selected plugins have been deleted.'=>'ಆಯ್ದ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಅಳಿಸಲಾಗಿದೆ.','The selected plugin has been deleted.'=>'ಆಯ್ದ ಪ್ಲಗಿನ್ ಅನ್ನು ಅಳಿಸಲಾಗಿದೆ.','Plugin resumed.'=>'ಪ್ಲಗಿನ್ ಪುನರಾರಂಭವಾಯಿತು.','Selected plugins deactivated.'=>'ಆಯ್ದ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','The plugin %1$s has been deactivated due to an error: %2$s'=>'ದೋಷದಿಂದಾಗಿ %1$s ಪ್ಲಗಿನ್ ಅನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ: %2$s ','If you need to tweak more than your theme&#8217;s CSS, you might want to try <a href="%s">making a child theme</a>.'=>' ನಿಮ್ಮ ಥೀಮ್‌ನ CSSಗಿಂತ ಹೆಚ್ಚಿನದನ್ನು ನೀವು ಸರಿಹೊಂದಿಸಬೇಕಾದರೆ, ನೀವು <a href="%s"> ಚೈಲ್ಡ್ ಥೀಮ್ ಮಾಡಲು </a> ಪ್ರಯತ್ನಿಸಲು ಬಯಸಬಹುದು.','You appear to be making direct edits to your theme in the WordPress dashboard. It is not recommended! Editing your theme directly could break your site and your changes may be lost in future updates.'=>'ನೀವು ವರ್ಡ್ಪ್ರೆಸ್ ಡ್ಯಾಶ್‌ಬೋರ್ಡ್‌ನಲ್ಲಿ ನಿಮ್ಮ ಥೀಮ್‌ಗೆ ನೇರ ಸಂಪಾದನೆಗಳನ್ನು ಮಾಡುತ್ತಿರುವಂತೆ ತೋರುತ್ತಿದೆ. ಇದನ್ನು ಶಿಫಾರಸು ಮಾಡಲಾಗಿಲ್ಲ! ನಿಮ್ಮ ಥೀಮ್ ಅನ್ನು ನೇರವಾಗಿ ಸಂಪಾದಿಸುವುದರಿಂದ ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಮುರಿಯಬಹುದು ಮತ್ತು ಭವಿಷ್ಯದ ನವೀಕರಣಗಳಲ್ಲಿ ನಿಮ್ಮ ಬದಲಾವಣೆಗಳು ಕಳೆದುಹೋಗಬಹುದು.','draft_length10'=>'೧೦','File does not exist! Please double check the name and try again.'=>'ಕಡತ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ! ದಯವಿಟ್ಟು ಹೆಸರನ್ನು ಎರಡು ಬಾರಿ ಪರಿಶೀಲಿಸಿ ಮತ್ತು ಇನ್ನೊಮ್ಮೆ ಪ್ರಯತ್ನಿಸಿ.','%1$s needs to be a %2$s object.'=>'%1$s ಒಂದು %2$s ವಸ್ತುವಾಗಿರಬೇಕು.','You are in recovery mode. This means there may be an error with a theme or plugin. To exit recovery mode, log out or use the Exit button. <a href="%s">Exit Recovery Mode</a>'=>'ನೀವು ರಿಕವರಿ ಮೋಡ್‌ನಲ್ಲಿದ್ದೀರಿ. ಇದರರ್ಥ ಥೀಮ್ ಅಥವಾ ಪ್ಲಗಿನ್‌ನಲ್ಲಿ ದೋಷವಿರಬಹುದು. ಮರುಪಡೆಯುವಿಕೆ ಮೋಡ್‌ನಿಂದ ನಿರ್ಗಮಿಸಲು, ಲಾಗ್ ಔಟ್ ಅಥವಾ ಎಕ್ಸಿಟ್ ಬಟನ್ ಬಳಸಿ. <a href="%s"> ರಿಕವರಿ ಮೋಡ್‌ನಿಂದ ನಿರ್ಗಮಿಸಿ </a>','Site HealthInfo'=>'ಮಾಹಿತಿ','Site HealthStatus'=>'ಸ್ಥಿತಿ','Themes directory location'=>'ಥೀಮ್ ಡೈರೆಕ್ಟರಿಯ ಸ್ಥಳ','comment statusClosed'=>'ಮುಚ್ಚಲಾಗಿದೆ','%s critical issue'=>'%s ನಿರ್ಣಾಯಕ ಸಮಸ್ಯೆ' . "\0" . '%s ನಿರ್ಣಾಯಕ ಸಮಸ್ಯೆಗಳು','https://wordpress.org/about/requirements/'=>'https://wordpress.org/about/requirements/','Learn more about what WordPress requires to run.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ರನ್ ಮಾಡಲು ಏನು ಅಗತ್ಯವಿದೆ ಎಂಬುದರ ಕುರಿತು ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ.','Get help resolving this issue.'=>'ಈ ಸಮಸ್ಯೆಯನ್ನು ಪರಿಹರಿಸಲು ಸಹಾಯ ಪಡೆಯಿರಿ.','PHP modules perform most of the tasks on the server that make your site run. Any changes to these must be made by your server administrator.'=>'PHP ಮಾಡ್ಯೂಲ್‌ಗಳು ಸರ್ವರ್‌ನಲ್ಲಿ ಹೆಚ್ಚಿನ ಕಾರ್ಯಗಳನ್ನು ನಿರ್ವಹಿಸುತ್ತವೆ. ಇವುಗಳಲ್ಲಿ ಯಾವುದೇ ಬದಲಾವಣೆಗಳನ್ನು ನಿಮ್ಮ ಸರ್ವರ್ ನಿರ್ವಾಹಕರು ಮಾಡಬೇಕು.','The SQL server is a required piece of software for the database WordPress uses to store all your site&#8217;s content and settings.'=>'SQL ಸರ್ವರ್ ಎನ್ನುವುದು ನಿಮ್ಮ ಎಲ್ಲಾ ಸೈಟ್‌ನ ವಿಷಯ ಮತ್ತು ಸೆಟ್ಟಿಂಗ್‌ಗಳನ್ನು ಸಂಗ್ರಹಿಸಲು ವರ್ಡ್ಪ್ರೆಸ್ ಬಳಸುವ ಡೇಟಾಬೇಸ್‌ಗೆ ಅಗತ್ಯವಾದ ಸಾಫ್ಟ್‌ವೇರ್ ಆಗಿದೆ.','https://wordpress.org/documentation/article/updating-wordpress/'=>'https://wordpress.org/documentation/article/updating-wordpress/','Manage inactive plugins'=>'ನಿಷ್ಕ್ರಿಯ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಿ','Update your plugins'=>'ನಿಮ್ಮ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನವೀಕರಿಸಿ','Manage your plugins'=>'ನಿಮ್ಮ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಿ','View Privacy Policy Guide.'=>'ಗೌಪ್ಯತೆ ನೀತಿ ಮಾರ್ಗದರ್ಶಿಯನ್ನು ವೀಕ್ಷಿಸಿ.','Manage your themes'=>'ನಿಮ್ಮ ವಿಷಯಗಳನ್ನು ನಿರ್ವಹಿಸಿ','User Language'=>'ಬಳಕೆದಾರ ಭಾಷೆ','The value, %1$s, has either been enabled by %2$s or added to your configuration file. This will make errors display on the front end of your site.'=>'%1$s ಮೌಲ್ಯವನ್ನು %2$s ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ ಅಥವಾ ನಿಮ್ಮ ಸಂರಚನಾ ಕಡತಕ್ಕೆ ಸೇರಿಸಲಾಗಿದೆ. ಇದು ನಿಮ್ಮ ಸೈಟ್‌ನ ಮುಂಭಾಗದ ಭಾಗದಲ್ಲಿ ದೋಷಗಳನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','[%s] Background Update Finished'=>'[%s] ಹಿನ್ನೆಲೆ ನವೀಕರಣ ಮುಕ್ತಯವಾಗಿದೆ ','[%s] Background Update Failed'=>'[%s] ಹಿನ್ನೆಲೆ ನವೀಕರಣ ವಿಫಲವಾಗಿದೆ ','You should remove inactive themes'=>'ನೀವು ನಿಷ್ಕ್ರಿಯ ಥೀಮ್‌ಗಳನ್ನು ತೆಗೆದುಹಾಕಬೇಕು','Your site has 1 active plugin, and it is up to date.'=>'ನಿಮ್ಮ ಸೈಟ್ 1 ಸಕ್ರಿಯ ಪ್ಲಗಿನ್ ಹೊಂದಿದೆ, ಮತ್ತು ಇದು ಅಪ್ ಟು ಡೇಟ್ ಆಗಿದೆ.','Plugin could not be resumed because it triggered a <strong>fatal error</strong>.'=>'<strong>ಮಾರಣಾಂತಿಕ ದೋಷ</strong>ವನ್ನು ಪ್ರಚೋದಿಸಿದ ಕಾರಣ ಪ್ಲಗಿನ್ ಅನ್ನು ಪುನರಾರಂಭಿಸಲಾಗಲಿಲ್ಲ.','Your site has 1 installed theme, and it is up to date.'=>'ನಿಮ್ಮ ಸೈಟ್ 1 ಸ್ಥಾಪಿಸಲಾದ ಥೀಮ್ ಅನ್ನು ಹೊಂದಿದೆ, ಮತ್ತು ಇದು ಅಪ್ ಟು ಡೇಟ್ ಆಗಿದೆ.','Copy site info to clipboard'=>'ಸೈಟ್ ಮಾಹಿತಿಯನ್ನು ಕ್ಲಿಪ್‌ಬೋರ್ಡ್‌ಗೆ ನಕಲಿಸಿ','Sorry, you are not allowed to access site health information.'=>'ಕ್ಷಮಿಸಿ, ಸೈಟ್ ಆರೋಗ್ಯ ಮಾಹಿತಿಯನ್ನು ಪ್ರವೇಶಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Passed tests'=>'ಉತ್ತೀರ್ಣಗೊಂಡ ಪರೀಕ್ಷೆಗಳು','If you want to export a handy list of all the information on this page, you can use the button below to copy it to the clipboard. You can then paste it in a text file and save it to your device, or paste it in an email exchange with a support engineer or theme/plugin developer for example.'=>'ಈ ಪುಟದಲ್ಲಿರುವ ಎಲ್ಲಾ ಮಾಹಿತಿಯ ಸೂಕ್ತ ಪಟ್ಟಿಯನ್ನು ನೀವು ರಫ್ತು ಮಾಡಲು ಬಯಸಿದರೆ, ಕ್ಲಿಪ್‌ಬೋರ್ಡ್‌ಗೆ ನಕಲಿಸಲು ನೀವು ಕೆಳಗಿನ ಬಟನ್ ಅನ್ನು ಬಳಸಬಹುದು. ನಂತರ ನೀವು ಅದನ್ನು ಪಠ್ಯ ಕಡತದಲ್ಲಿ ಅಂಟಿಸಬಹುದು ಮತ್ತು ಅದನ್ನು ನಿಮ್ಮ ಸಾಧನಕ್ಕೆ ಉಳಿಸಬಹುದು, ಅಥವಾ ಅದನ್ನು ಬೆಂಬಲ ಎಂಜಿನಿಯರ್ ಅಥವಾ ಥೀಮ್/ಪ್ಲಗಿನ್ ಡೆವಲಪರ್‌ನೊಂದಿಗೆ ಇಮೇಲ್ ವಿನಿಮಯದಲ್ಲಿ ಅಂಟಿಸಬಹುದು.','All formats'=>'ಎಲ್ಲಾ ಸ್ವರೂಪಗಳು','Filter by post format'=>'ಪೋಸ್ಟ್ ಫಾರ್ಮ್ಯಾಟ್ ಮೂಲಕ ಫಿಲ್ಟರ್ ಮಾಡಿ','Go to the Plugins screen'=>'ಪ್ಲಗಿನ್‌ಗಳ ಪರದೆಗೆ ಹೋಗಿ','The authenticity of %s could not be verified.'=>'%s ನ ಸತ್ಯಾಸತ್ಯತೆಯನ್ನು ಪರಿಶೀಲಿಸಲಾಗಲಿಲ್ಲ.','The authenticity of %s could not be verified as no signature was found.'=>'ಸಹಿ ಕಂಡುಬಂದಿಲ್ಲವಾದ್ದರಿಂದ %s ನ ಸತ್ಯಾಸತ್ಯತೆಯನ್ನು ಪರಿಶೀಲಿಸಲಾಗಲಿಲ್ಲ.','Site Health Info'=>'ಸೈಟ್ ಆರೋಗ್ಯ ಮಾಹಿತಿ','The Site Health check requires JavaScript.'=>'ಸೈಟ್ ಆರೋಗ್ಯ ತಪಾಸಣೆಗೆ JavaScript ಅಗತ್ಯವಿದೆ.','The authenticity of %s could not be verified as signature verification is unavailable on this system.'=>'ಈ ವ್ಯವಸ್ಥೆಯಲ್ಲಿ ಸಹಿ ಪರಿಶೀಲನೆ ಲಭ್ಯವಿಲ್ಲದ ಕಾರಣ %s ನ ಸತ್ಯಾಸತ್ಯತೆಯನ್ನು ಪರಿಶೀಲಿಸಲಾಗಲಿಲ್ಲ.','Eraser callback is not valid: %s.'=>'ಎರೇಸರ್ ಕಾಲ್‌ಬ್ಯಾಕ್ ಮಾನ್ಯವಾಗಿಲ್ಲ: %s.','Eraser does not include a callback: %s.'=>'ಎರೇಸರ್ ಕಾಲ್‌ಬ್ಯಾಕ್ ಅನ್ನು ಒಳಗೊಂಡಿಲ್ಲ: %s.','Sorry, you are not allowed to perform this action.'=>'ಕ್ಷಮಿಸಿ, ಈ ಕ್ರಿಯೆಯನ್ನು ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','HTTP requests have been blocked by the %1$s constant, with some allowed hosts: %2$s.'=>'HTTP ವಿನಂತಿಗಳನ್ನು %1$s ಸ್ಥಿರದಿಂದ ನಿರ್ಬಂಧಿಸಲಾಗಿದೆ, ಕೆಲವು ಅನುಮತಿಸಲಾದ ಹೋಸ್ಟ್‌ಗಳೊಂದಿಗೆ: %2$s.','HTTP requests have been blocked by the %s constant, with no allowed hosts.'=>'HTTP ವಿನಂತಿಗಳನ್ನು %s ಸ್ಥಿರದಿಂದ ನಿರ್ಬಂಧಿಸಲಾಗಿದೆ, ಯಾವುದೇ ಅನುಮತಿಸುವ ಹೋಸ್ಟ್‌ಗಳಿಲ್ಲ.','https://make.wordpress.org/hosting/handbook/handbook/server-environment/#php-extensions'=>'https://make.wordpress.org/hosting/handbook/handbook/server-environment/#php-extensions','Performance'=>'ಕಾರ್ಯಕ್ಷಮತೆ','You are using a %1$s drop-in which might mean that a %2$s database is not being used.'=>'ನೀವು %1$s ಡ್ರಾಪ್-ಇನ್ ಅನ್ನು ಬಳಸುತ್ತಿರುವಿರಿ ಅಂದರೆ %2$s ಡೇಟಾಬೇಸ್ ಅನ್ನು ಬಳಸುತ್ತಿಲ್ಲ ಎಂದರ್ಥ.','Your site has %1$d inactive theme, other than %2$s, the default WordPress theme, and %3$s, your active theme.'=>'ನಿಮ್ಮ ಸೈಟ್ %1$d ನಿಷ್ಕ್ರಿಯ ಥೀಮ್ ಅನ್ನು ಹೊಂದಿದೆ, %2$s ಹೊರತುಪಡಿಸಿ, ಡೀಫಾಲ್ಟ್ ವರ್ಡ್ಪ್ರೆಸ್ ಥೀಮ್, ಮತ್ತು %3$s, ನಿಮ್ಮ ಸಕ್ರಿಯ ಥೀಮ್.' . "\0" . 'ನಿಮ್ಮ ಸೈಟ್ %1$d ನಿಷ್ಕ್ರಿಯ ಥೀಮ್‌ಗಳನ್ನು ಹೊಂದಿದೆ, %2$s ಹೊರತುಪಡಿಸಿ, ಡೀಫಾಲ್ಟ್ ವರ್ಡ್ಪ್ರೆಸ್ ಥೀಮ್ ಮತ್ತು %3$s, ನಿಮ್ಮ ಸಕ್ರಿಯ ಥೀಮ್.','Your site has %1$d inactive theme, other than %2$s, your active theme.'=>'ನಿಮ್ಮ ಸೈಟ್ %1$d ನಿಷ್ಕ್ರಿಯ ಥೀಮ್ ಅನ್ನು ಹೊಂದಿದೆ, %2$s ಹೊರತುಪಡಿಸಿ, ನಿಮ್ಮ ಸಕ್ರಿಯ ಥೀಮ್.' . "\0" . 'ನಿಮ್ಮ ಸೈಟ್ %1$d ನಿಷ್ಕ್ರಿಯ ಥೀಮ್‌ಗಳನ್ನು ಹೊಂದಿದೆ, %2$s ಹೊರತುಪಡಿಸಿ, ನಿಮ್ಮ ಸಕ್ರಿಯ ಥೀಮ್.','The WordPress Hosting Team maintains a list of those modules, both recommended and required, in <a href="%1$s" %2$s>the team handbook%3$s</a>.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಹೋಸ್ಟಿಂಗ್ ತಂಡವು, ಶಿಫಾರಸು ಮಾಡಲಾಗಿದ ಮತ್ತು ಅಗತ್ಯ ಮಾಡ್ಯೂಲ್‍ಗಳ ಪಟ್ಟಿಯನ್ನು ನಿರ್ವಹಿಸುತ್ತದೆ, <a href="%1$s" %2$s >ತಂಡದ ಹ್ಯಾಂಡ್ ಬುಕ್ %3$s</a>.','You should consider removing any unused themes to enhance your site&#8217;s security.'=>'ನಿಮ್ಮ ಸೈಟ್‌ನ ಸುರಕ್ಷತೆಯನ್ನು ಹೆಚ್ಚಿಸಲು ಬಳಕೆಯಾಗದ ಥೀಮ್‌ಗಳನ್ನು ತೆಗೆದುಹಾಕಲು ನಾವು ಶಿಫಾರಸು ಮಾಡುತ್ತೇವೆ.','Security'=>'ಭದ್ರತೆ','Erase personal data list'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ಪಟ್ಟಿಯನ್ನು ಅಳಿಸಿ','Erase personal data list navigation'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ಪಟ್ಟಿ ನ್ಯಾವಿಗೇಷನ್ ಅನ್ನು ಅಳಿಸಿ','Export personal data list'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ಪಟ್ಟಿಯನ್ನು ರಫ್ತು ಮಾಡಿ','Export personal data list navigation'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ಪಟ್ಟಿ ನ್ಯಾವಿಗೇಷನ್ ಅನ್ನು ರಫ್ತು ಮಾಡಿ','Filter export personal data list'=>'ಫಿಲ್ಟರ್ ರಫ್ತು ವೈಯಕ್ತಿಕ ಡೇಟಾ ಪಟ್ಟಿ','Your site has %d inactive plugin.'=>'ನಿಮ್ಮ ಸೈಟ್ %d ನಿಷ್ಕ್ರಿಯ ಪ್ಲಗಿನ್ ಹೊಂದಿದೆ.' . "\0" . 'ನಿಮ್ಮ ಸೈಟ್ %d ನಿಷ್ಕ್ರಿಯ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಹೊಂದಿದೆ.','Filter erase personal data list'=>'ಫಿಲ್ಟರ್ ವೈಯಕ್ತಿಕ ಡೇಟಾ ಪಟ್ಟಿಯನ್ನು ಅಳಿಸಿ','Your site has %d inactive theme.'=>'ನಿಮ್ಮ ಸೈಟ್ %d ನಿಷ್ಕ್ರಿಯ ಥೀಮ್ ಹೊಂದಿದೆ.' . "\0" . 'ನಿಮ್ಮ ಸೈಟ್ %d ನಿಷ್ಕ್ರಿಯ ಥೀಮ್‌ಗಳನ್ನು ಹೊಂದಿದೆ.','Go to the Themes screen'=>'ಥೀಮ್‌ಗಳ ಪರದೆಗೆ ಹೋಗಿ','These settings alter where and how parts of WordPress are loaded.'=>'ಈ ಸೆಟ್ಟಿಂಗ್‌ಗಳು ವರ್ಡ್‌ಪ್ರೆಸ್‌ನ ಭಾಗಗಳನ್ನು ಎಲ್ಲಿ ಮತ್ತು ಹೇಗೆ ಲೋಡ್ ಮಾಡಲಾಗುತ್ತದೆ ಎಂಬುದನ್ನು ಬದಲಾಯಿಸುತ್ತದೆ.','Total size is not available. Some errors were encountered when determining the size of your installation.'=>'ಒಟ್ಟು ಗಾತ್ರ ಲಭ್ಯವಿಲ್ಲ. ನಿಮ್ಮ ಅನುಸ್ಥಾಪನೆಯ ಗಾತ್ರವನ್ನು ನಿರ್ಧರಿಸುವಾಗ ಕೆಲವು ದೋಷಗಳು ಎದುರಾದವು.','The size cannot be calculated. The directory is not accessible. Usually caused by invalid permissions.'=>'ಗಾತ್ರವನ್ನು ಲೆಕ್ಕಹಾಕಲಾಗುವುದಿಲ್ಲ. ಡೈರೆಕ್ಟರಿಯನ್ನು ಪ್ರವೇಶಿಸಲಾಗುವುದಿಲ್ಲ. ಸಾಮಾನ್ಯವಾಗಿ ಅಮಾನ್ಯ ಅನುಮತಿಗಳಿಂದ ಉಂಟಾಗುತ್ತದೆ.','The directory size calculation has timed out. Usually caused by a very large number of sub-directories and files.'=>'ಡೈರೆಕ್ಟರಿ ಗಾತ್ರದ ಲೆಕ್ಕಾಚಾರವು ಸಮಯ ಮೀರಿದೆ. ಸಾಮಾನ್ಯವಾಗಿ ಅತಿ ಹೆಚ್ಚಿನ ಸಂಖ್ಯೆಯ ಉಪ-ಡೈರೆಕ್ಟರಿಗಳು ಮತ್ತು ಫೈಲ್‌ಗಳಿಂದ ಉಂಟಾಗುತ್ತದೆ.','This plugin failed to load properly and is paused during recovery mode.'=>'ಈ ಪ್ಲಗಿನ್ ಸರಿಯಾಗಿ ಲೋಡ್ ಆಗಲು ವಿಫಲವಾಗಿದೆ ಮತ್ತು ರಿಕವರಿ ಮೋಡ್‌ನಲ್ಲಿ ವಿರಾಮಗೊಳಿಸಲಾಗಿದೆ.','Great job!'=>'ಒಳ್ಳೆಯ ಕೆಲಸ!','Site Health Status'=>'ಸೈಟ್ ಆರೋಗ್ಯ ಸ್ಥಿತಿ','Everything is running smoothly here.'=>'ಇಲ್ಲಿ ಎಲ್ಲವೂ ಸುಗಮವಾಗಿ ನಡೆಯುತ್ತಿದೆ.','%s recommended improvement'=>'%s ಶಿಫಾರಸು ಮಾಡಿದ ಸುಧಾರಣೆ' . "\0" . '%s ಶಿಫಾರಸು ಮಾಡಿದ ಸುಧಾರಣೆಗಳು','%s item with no issues detected'=>'ಯಾವುದೇ ಸಮಸ್ಯೆಗಳಿಲ್ಲದ %s ಐಟಂ ಪತ್ತೆಯಾಗಿದೆ' . "\0" . 'ಯಾವುದೇ ಸಮಸ್ಯೆಗಳಿಲ್ಲದ %s ಐಟಂಗಳು ಪತ್ತೆಯಾಗಿವೆ','Secondary menu'=>'ದ್ವಿತೀಯ ಮೆನು','HTTP Requests'=>'HTTP ವಿನಂತಿಗಳು','Scheduled events'=>'ನಿಗದಿತ ಘಟನೆಗಳು','REST API availability'=>'REST API ಲಭ್ಯತೆ','Loopback request'=>'ಲೂಪ್‌ಬ್ಯಾಕ್ ವಿನಂತಿ','Debugging enabled'=>'ಡೀಬಗ್ ಮಾಡುವಿಕೆಯನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ','The REST API encountered an error'=>'REST API ನಲ್ಲಿ ದೋಷ ಎದುರಾಗಿದೆ','No scheduled events exist on this site.'=>'ಈ ಸೈಟ್‌ನಲ್ಲಿ ಯಾವುದೇ ನಿಗದಿತ ಈವೆಂಟ್‌ಗಳಿಲ್ಲ.','Secure communication'=>'ಸುರಕ್ಷಿತ ಸಂವಹನ','HTTPS status'=>'HTTPS ಸ್ಥಿತಿ','PHP Extensions'=>'PHP ವಿಸ್ತರಣೆಗಳು','Database Server version'=>'ಡೇಟಾಬೇಸ್ ಸರ್ವರ್ ಆವೃತ್ತಿ','PHP Version'=>'ಪಿಎಚ್ಪಿ ಆವೃತ್ತಿ','Theme Versions'=>'ಥೀಮ್ ಆವೃತ್ತಿಗಳು','Plugin Versions'=>'ಪ್ಲಗಿನ್ ಆವೃತ್ತಿಗಳು','WordPress Version'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿ','The REST API did not behave correctly'=>'REST API ಸರಿಯಾಗಿ ವರ್ತಿಸಲಿಲ್ಲ','The loopback request to your site completed successfully.'=>'ನಿಮ್ಮ ಸೈಟ್‌ಗೆ ಲೂಪ್‌ಬ್ಯಾಕ್ ವಿನಂತಿಯು ಯಶಸ್ವಿಯಾಗಿ ಪೂರ್ಣಗೊಂಡಿದೆ.','The REST API encountered an unexpected result'=>'REST API ಅನಿರೀಕ್ಷಿತ ಫಲಿತಾಂಶವನ್ನು ಎದುರಿಸಿತು','The loopback request returned an unexpected http status code, %d, it was not possible to determine if this will prevent features from working as expected.'=>'ಲೂಪ್‌ಬ್ಯಾಕ್ ವಿನಂತಿಯು ಅನಿರೀಕ್ಷಿತ http ಸ್ಟೇಟಸ್ ಕೋಡ್, %d ಅನ್ನು ಹಿಂತಿರುಗಿಸಿತು, ಇದು ನಿರೀಕ್ಷೆಯಂತೆ ಕಾರ್ಯನಿರ್ವಹಿಸುವುದನ್ನು ತಡೆಯುತ್ತದೆ ಎಂಬುದನ್ನು ನಿರ್ಧರಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','The loopback request to your site failed, this means features relying on them are not currently working as expected.'=>'ನಿಮ್ಮ ಸೈಟ್‌ಗೆ ಲೂಪ್‌ಬ್ಯಾಕ್ ವಿನಂತಿಯು ವಿಫಲವಾಗಿದೆ, ಇದರರ್ಥ ಅವುಗಳನ್ನು ಅವಲಂಬಿಸಿರುವ ವೈಶಿಷ್ಟ್ಯಗಳು ಪ್ರಸ್ತುತ ನಿರೀಕ್ಷೆಯಂತೆ ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತಿಲ್ಲ.','The REST API did not process the %s query parameter correctly.'=>'REST API %s ಪ್ರಶ್ನೆ ಪ್ಯಾರಾಮೀಟರ್ ಅನ್ನು ಸರಿಯಾಗಿ ಪ್ರಕ್ರಿಯೆಗೊಳಿಸಲಿಲ್ಲ.','HTTP requests are blocked'=>'HTTP ವಿನಂತಿಗಳನ್ನು ನಿರ್ಬಂಧಿಸಲಾಗಿದೆ','HTTP requests are partially blocked'=>'HTTP ವಿನಂತಿಗಳನ್ನು ಭಾಗಶಃ ನಿರ್ಬಂಧಿಸಲಾಗಿದೆ','The REST API is available'=>'REST API ಲಭ್ಯವಿದೆ','It is possible for site maintainers to block all, or some, communication to other sites and services. If set up incorrectly, this may prevent plugins and themes from working as intended.'=>'ಸೈಟ್ ನಿರ್ವಾಹಕರು ಎಲ್ಲವನ್ನೂ ನಿರ್ಬಂಧಿಸಲು ಸಾಧ್ಯವಿದೆ, ಅಥವಾ ಕೆಲವು, ಇತರ ಸೈಟ್ಗಳು ಮತ್ತು ಸೇವೆಗಳಿಗೆ ಸಂವಹನವನ್ನು. ತಪ್ಪಾಗಿ ಹೊಂದಿಸಿದರೆ, ಇದು ಪ್ಲಗಿನ್‌ಗಳು ಮತ್ತು ಥೀಮ್‌ಗಳು ಉದ್ದೇಶಿಸಿದಂತೆ ಕೆಲಸ ಮಾಡುವುದನ್ನು ತಡೆಯಬಹುದು.','Background updates are working'=>'ಹಿನ್ನೆಲೆ ನವೀಕರಣಗಳು ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತಿವೆ','A scheduled event has failed'=>'ನಿಗದಿತ ಈವೆಂಟ್ ವಿಫಲವಾಗಿದೆ','HTTP requests seem to be working as expected'=>'HTTP ವಿನಂತಿಗಳು ನಿರೀಕ್ಷೆಯಂತೆ ಕೆಲಸ ಮಾಡುತ್ತಿವೆ','Your site could not complete a loopback request'=>'ನಿಮ್ಮ ಸೈಟ್‌ಗೆ ಲೂಪ್‌ಬ್ಯಾಕ್ ವಿನಂತಿಯನ್ನು ಪೂರ್ಣಗೊಳಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ','Loopback requests are used to run scheduled events, and are also used by the built-in editors for themes and plugins to verify code stability.'=>'ನಿಗದಿತ ಈವೆಂಟ್‌ಗಳನ್ನು ಚಲಾಯಿಸಲು ಲೂಪ್‌ಬ್ಯಾಕ್ ವಿನಂತಿಗಳನ್ನು ಬಳಸಲಾಗುತ್ತದೆ, ಮತ್ತು ಕೋಡ್ ಸ್ಥಿರತೆಯನ್ನು ಪರಿಶೀಲಿಸಲು ಥೀಮ್‌ಗಳು ಮತ್ತು ಪ್ಲಗಿನ್‌ಗಳಿಗಾಗಿ ಅಂತರ್ನಿರ್ಮಿತ ಸಂಪಾದಕರು ಬಳಸುತ್ತಾರೆ.','Your site can perform loopback requests'=>'ನಿಮ್ಮ ಸೈಟ್ ಲೂಪ್‌ಬ್ಯಾಕ್ ವಿನಂತಿಗಳನ್ನು ನಿರ್ವಹಿಸಬಹುದು','Scheduled events are what periodically looks for updates to plugins, themes and WordPress itself. It is also what makes sure scheduled posts are published on time. It may also be used by various plugins to make sure that planned actions are executed.'=>'ನಿಗದಿತ ಈವೆಂಟ್‌ಗಳು ನಿಯತಕಾಲಿಕವಾಗಿ ಪ್ಲಗಿನ್‌ಗಳು, ಥೀಮ್‌ಗಳು ಮತ್ತು ವರ್ಡ್‌ಪ್ರೆಸ್‌ಗೆ ನವೀಕರಣಗಳನ್ನು ಹುಡುಕುತ್ತದೆ. ನಿಗದಿತ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಸಮಯಕ್ಕೆ ಸರಿಯಾಗಿ ಪ್ರಕಟಿಸಲಾಗಿದೆಯೆ ಎಂದು ಖಚಿತಪಡಿಸುತ್ತದೆ. ಯೋಜಿತ ಕ್ರಿಯೆಗಳನ್ನು ಕಾರ್ಯಗತಗೊಳಿಸಲಾಗಿದೆಯೆ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಲು ಇದನ್ನು ವಿವಿಧ ಪ್ಲಗ್‌ಇನ್‌ಗಳಿಂದಲೂ ಬಳಸಬಹುದು.','It was not possible to check your scheduled events'=>'ನಿಮ್ಮ ನಿಗದಿತ ಈವೆಂಟ್‌ಗಳನ್ನು ಪರಿಶೀಲಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ','Background updates ensure that WordPress can auto-update if a security update is released for the version you are currently using.'=>'ನೀವು ಪ್ರಸ್ತುತ ಬಳಸುತ್ತಿರುವ ಆವೃತ್ತಿಗೆ ಭದ್ರತಾ ಅಪ್‌ಡೇಟ್ ಬಿಡುಗಡೆಯಾದರೆ ವರ್ಡ್‌ಪ್ರೆಸ್ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ನವೀಕರಿಸಬಹುದೆಂದು ಹಿನ್ನೆಲೆ ನವೀಕರಣಗಳು ಖಚಿತಪಡಿಸುತ್ತವೆ.','Passed'=>'ಉತ್ತೀರ್ಣರಾದರು','The scheduled event, %s, failed to run. Your site still works, but this may indicate that scheduling posts or automated updates may not work as intended.'=>'ನಿಗದಿತ ಈವೆಂಟ್, %s, ರನ್ ಆಗಲು ವಿಫಲವಾಗಿದೆ. ನಿಮ್ಮ ಸೈಟ್ ಇನ್ನೂ ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತಿದೆ, ಆದರೆ ಇದು ಪೋಸ್ಟ್‌ಗಳ ವೇಳಾಪಟ್ಟಿ ಅಥವಾ ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣಗಳು ಉದ್ದೇಶಿಸಿದಂತೆ ಕೆಲಸ ಮಾಡದಿರಬಹುದು ಎಂದು ಸೂಚಿಸಬಹುದು.','Background updates may not be working properly'=>'ಹಿನ್ನೆಲೆ ನವೀಕರಣಗಳು ಸರಿಯಾಗಿ ಕೆಲಸ ಮಾಡುತ್ತಿಲ್ಲ','Background updates are not working as expected'=>'ಹಿನ್ನೆಲೆ ನವೀಕರಣಗಳು ನಿರೀಕ್ಷಿಸಿದಂತೆ ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತಿಲ್ಲ','While trying to test your site&#8217;s scheduled events, the following error was returned: %s'=>'ನಿಮ್ಮ ಸೈಟ್‌ನ ನಿಗದಿತ ಈವೆಂಟ್‌ಗಳನ್ನು ಪರೀಕ್ಷಿಸಲು ಪ್ರಯತ್ನಿಸುತ್ತಿರುವಾಗ, ಈ ಕೆಳಗಿನ ದೋಷವನ್ನು ಹಿಂತಿರುಗಿಸಲಾಗಿದೆ: %s','Scheduled events are running'=>'ನಿಗದಿತ ಕಾರ್ಯಕ್ರಮಗಳು ನಡೆಯುತ್ತಿವೆ','Your site can communicate securely with other services'=>'ನಿಮ್ಮ ಸೈಟ್ ಇತರ ಸೇವೆಗಳೊಂದಿಗೆ ಸುರಕ್ಷಿತವಾಗಿ ಸಂವಹನ ಮಾಡಬಹುದು','Talk to your web host about OpenSSL support for PHP.'=>'PHP ಗಾಗಿ OpenSSL ಬೆಂಬಲದ ಬಗ್ಗೆ ನಿಮ್ಮ ವೆಬ್ ಹೋಸ್ಟ್‌ಗೆ ಮಾತನಾಡಿ.','Your site is unable to communicate securely with other services'=>'ನಿಮ್ಮ ಸೈಟ್ ಇತರ ಸೇವೆಗಳೊಂದಿಗೆ ಸುರಕ್ಷಿತವಾಗಿ ಸಂವಹನ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲ','Your website is using an active HTTPS connection'=>'ನಿಮ್ಮ ವೆಬ್‌ಸೈಟ್ ಸಕ್ರಿಯ HTTPS ಸಂಪರ್ಕವನ್ನು ಬಳಸುತ್ತಿದೆ','Learn more about why you should use HTTPS'=>'ನೀವು HTTPS ಅನ್ನು ಏಕೆ ಬಳಸಬೇಕು ಎಂಬುದರ ಕುರಿತು ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ','Securely communicating between servers are needed for transactions such as fetching files, conducting sales on store sites, and much more.'=>'ಫೈಲ್‌ಗಳನ್ನು ತರುವುದು, ಅಂಗಡಿ ಸೈಟ್‌ಗಳಲ್ಲಿ ಮಾರಾಟ ನಡೆಸುವುದು ಮತ್ತು ಇನ್ನೂ ಹೆಚ್ಚಿನವುಗಳಂತಹ ವಹಿವಾಟುಗಳಿಗೆ ಸರ್ವರ್‌ಗಳ ನಡುವೆ ಸುರಕ್ಷಿತವಾಗಿ ಸಂವಹನ ನಡೆಸುವುದು ಅಗತ್ಯವಾಗಿರುತ್ತದೆ.','You are accessing this website using HTTPS, but your <a href="%s">Site Address</a> is not set up to use HTTPS by default.'=>'ನೀವು HTTPS ಬಳಸಿ ಈ ವೆಬ್‌ಸೈಟ್‌ಗೆ ಪ್ರವೇಶಿಸುತ್ತಿದ್ದೀರಿ, ಆದರೆ ನಿಮ್ಮ <a href="%s"> ಸೈಟ್ ವಿಳಾಸ </a> ಪೂರ್ವನಿಯೋಜಿತವಾಗಿ HTTPS ಬಳಸಲು ಹೊಂದಿಸಲಾಗಿಲ್ಲ.','Your website does not use HTTPS'=>'ನಿಮ್ಮ ವೆಬ್‌ಸೈಟ್ HTTPS ಬಳಸುವುದಿಲ್ಲ','Your site is set to display errors to site visitors'=>'ಸೈಟ್ ಸಂದರ್ಶಕರಿಗೆ ದೋಷಗಳನ್ನು ಪ್ರದರ್ಶಿಸಲು ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಹೊಂದಿಸಲಾಗಿದೆ','The value, %s, has been added to this website&#8217;s configuration file. This means any errors on the site will be written to a file which is potentially available to all users.'=>'ಈ ವೆಬ್‌ಸೈಟ್‌ನ ಸಂರಚನಾ ಕಡತಕ್ಕೆ %s ಮೌಲ್ಯವನ್ನು ಸೇರಿಸಲಾಗಿದೆ. ಇದರರ್ಥ ಸೈಟ್‌ನಲ್ಲಿನ ಯಾವುದೇ ದೋಷಗಳನ್ನು ಎಲ್ಲಾ ಬಳಕೆದಾರರಿಗೆ ಲಭ್ಯವಿರುವ ಫೈಲ್‌ಗೆ ಬರೆಯಲಾಗುತ್ತದೆ.','Debug mode is often enabled to gather more details about an error or site failure, but may contain sensitive information which should not be available on a publicly available website.'=>'ದೋಷ ಅಥವಾ ಸೈಟ್ ವೈಫಲ್ಯದ ಬಗ್ಗೆ ಹೆಚ್ಚಿನ ವಿವರಗಳನ್ನು ಸಂಗ್ರಹಿಸಲು ಡೀಬಗ್ ಮೋಡ್ ಅನ್ನು ಹೆಚ್ಚಾಗಿ ಸಕ್ರಿಯಗೊಳಿಸಲಾಗುತ್ತದೆ, ಆದರೆ ಸಾರ್ವಜನಿಕವಾಗಿ ಲಭ್ಯವಿರುವ ವೆಬ್‌ಸೈಟ್‌ನಲ್ಲಿ ಲಭ್ಯವಿರದ ಸೂಕ್ಷ್ಮ ಮಾಹಿತಿಯನ್ನು ಒಳಗೊಂಡಿರಬಹುದು.','Your site is set to log errors to a potentially public file'=>'ಸಂಭಾವ್ಯ ಸಾರ್ವಜನಿಕ ಫೈಲ್‌ಗೆ ದೋಷಗಳನ್ನು ಲಾಗ್ ಮಾಡಲು ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಹೊಂದಿಸಲಾಗಿದೆ','Can communicate with WordPress.org'=>'WordPress.org ನೊಂದಿಗೆ ಸಂವಹನ ಮಾಡಬಹುದು','Could not reach WordPress.org'=>'WordPress.org ಅನ್ನು ತಲುಪಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ','Your site is unable to reach WordPress.org at %1$s, and returned the error: %2$s'=>'ನಿಮ್ಮ ಸೈಟ್ %1$s ನಲ್ಲಿ WordPress.org ಅನ್ನು ತಲುಪಲು ಸಾಧ್ಯವಾಗುತ್ತಿಲ್ಲ, ಮತ್ತು ದೋಷವನ್ನು ಹಿಂತಿರುಗಿಸಿದೆ: %2$s','WordPress requires %1$s version %2$s or higher. Contact your web hosting company to correct this.'=>'ವರ್ಡ್‌ಪ್ರೆಸ್‌ಗೆ %1$s ಆವೃತ್ತಿ %2$s ಅಥವಾ ಹೆಚ್ಚಿನದು ಅಗತ್ಯವಿದೆ. ಇದನ್ನು ಸರಿಪಡಿಸಲು ನಿಮ್ಮ ವೆಬ್ ಹೋಸ್ಟಿಂಗ್ ಕಂಪನಿಯನ್ನು ಸಂಪರ್ಕಿಸಿ.','Severely outdated SQL server'=>'ತೀವ್ರವಾಗಿ ಹಳತಾದ SQL ಸರ್ವರ್','For optimal performance and security reasons, you should consider running %1$s version %2$s or higher. Contact your web hosting company to correct this.'=>'ಸೂಕ್ತ ಕಾರ್ಯಕ್ಷಮತೆ ಮತ್ತು ಭದ್ರತಾ ಕಾರಣಗಳಿಗಾಗಿ, %1$s ಆವೃತ್ತಿ %2$s ಅಥವಾ ಹೆಚ್ಚಿನದನ್ನು ಚಲಾಯಿಸಲು ನಾವು ಶಿಫಾರಸು ಮಾಡುತ್ತೇವೆ. ಇದನ್ನು ಸರಿಪಡಿಸಲು ನಿಮ್ಮ ವೆಬ್ ಹೋಸ್ಟಿಂಗ್ ಕಂಪನಿಯನ್ನು ಸಂಪರ್ಕಿಸಿ.','Your site is not set to output debug information'=>'ಡೀಬಗ್ ಮಾಹಿತಿಯನ್ನು ಔಟ್ಪುಟ್ ಮಾಡಲು ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಹೊಂದಿಸಲಾಗಿಲ್ಲ','Communicating with the WordPress servers is used to check for new versions, and to both install and update WordPress core, themes or plugins.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಸರ್ವರ್‌ಗಳೊಂದಿಗೆ ಸಂವಹನ ಮಾಡುವುದನ್ನು ಹೊಸ ಆವೃತ್ತಿಗಳನ್ನು ಪರಿಶೀಲಿಸಲು ಮತ್ತು ವರ್ಡ್ಪ್ರೆಸ್ ಕೋರ್, ಥೀಮ್‌ಗಳು ಅಥವಾ ಪ್ಲಗ್‌ಇನ್‌ಗಳನ್ನು ಸ್ಥಾಪಿಸಲು ಮತ್ತು ನವೀಕರಿಸಲು ಬಳಸಲಾಗುತ್ತದೆ.','Outdated SQL server'=>'ಹಳೆಯ SQL ಸರ್ವರ್','Error'=>'ದೋಷ','SQL server is up to date'=>'SQL ಸರ್ವರ್ ನವೀಕೃತವಾಗಿದೆ','One or more recommended modules are missing'=>'ಒಂದು ಅಥವಾ ಹೆಚ್ಚು ಶಿಫಾರಸು ಮಾಡ್ಯೂಲ್‌ಗಳು ಕಾಣೆಯಾಗಿವೆ','The optional module, %s, is not installed, or has been disabled.'=>'ಐಚ್ಛಿಕ ಮಾಡ್ಯೂಲ್, %s ಅನ್ನು ಸ್ಥಾಪಿಸಲಾಗಿಲ್ಲ, ಅಥವಾ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','The required module, %s, is not installed, or has been disabled.'=>'ಅಗತ್ಯವಿರುವ ಮಾಡ್ಯೂಲ್, %s ಅನ್ನು ಸ್ಥಾಪಿಸಲಾಗಿಲ್ಲ, ಅಥವಾ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','One or more required modules are missing'=>'ಒಂದು ಅಥವಾ ಹೆಚ್ಚಿನ ಅಗತ್ಯ ಮಾಡ್ಯೂಲ್‌ಗಳು ಕಾಣೆಯಾಗಿವೆ','Have a default theme available'=>'ಡೀಫಾಲ್ಟ್ ಥೀಮ್ ಲಭ್ಯವಿರಲಿ','Required and recommended modules are installed'=>'ಅಗತ್ಯವಿರುವ ಮತ್ತು ಶಿಫಾರಸು ಮಾಡ್ಯೂಲ್‌ಗಳನ್ನು ಸ್ಥಾಪಿಸಲಾಗಿದೆ','Your site does not have any default theme. Default themes are used by WordPress automatically if anything is wrong with your chosen theme.'=>'ನಿಮ್ಮ ಸೈಟ್ ಯಾವುದೇ ಡೀಫಾಲ್ಟ್ ಥೀಮ್ ಹೊಂದಿಲ್ಲ. ನೀವು ಆಯ್ಕೆ ಮಾಡಿದ ಥೀಮ್‌ನಲ್ಲಿ ಏನಾದರೂ ತಪ್ಪಾಗಿದ್ದರೆ ಡೀಫಾಲ್ಟ್ ಥೀಮ್‌ಗಳನ್ನು ವರ್ಡ್‌ಪ್ರೆಸ್ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಬಳಸುತ್ತದೆ.','You have themes waiting to be updated'=>'ನವೀಕರಿಸಲು ನೀವು ಥೀಮ್‌ಗಳನ್ನು ಕಾಯುತ್ತಿದ್ದೀರಿ','You should remove inactive plugins'=>'ನೀವು ನಿಷ್ಕ್ರಿಯ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ತೆಗೆದುಹಾಕಬೇಕು','Your site has %d installed theme, and it is up to date.'=>'ನಿಮ್ಮ ಸೈಟ್ %d ಇನ್‌ಸ್ಟಾಲ್ ಮಾಡಿದ ಥೀಮ್ ಹೊಂದಿದೆ, ಮತ್ತು ಇದು ಅಪ್ ಟು ಡೇಟ್ ಆಗಿದೆ.' . "\0" . 'ನಿಮ್ಮ ಸೈಟ್ %d ಇನ್‌ಸ್ಟಾಲ್ ಮಾಡಿದ ಥೀಮ್‌ಗಳನ್ನು ಹೊಂದಿದೆ, ಮತ್ತು ಅವೆಲ್ಲವೂ ಅಪ್ ಟು ಡೇಟ್ ಆಗಿವೆ.','Your site has %d theme waiting to be updated.'=>'ನಿಮ್ಮ ಸೈಟ್ ನವೀಕರಿಸಲು %d ಥೀಮ್ ಕಾಯುತ್ತಿದೆ.' . "\0" . 'ನಿಮ್ಮ ಸೈಟ್ ನವೀಕರಿಸಲು %d ಥೀಮ್‌ಗಳನ್ನು ಕಾಯುತ್ತಿದೆ.','Themes add your site&#8217;s look and feel. It&#8217;s important to keep them up to date, to stay consistent with your brand and keep your site secure.'=>'ಥೀಮ್‌ಗಳು ನಿಮ್ಮ ಸೈಟ್‌ನ ನೋಟ ಮತ್ತು ಭಾವನೆಯನ್ನು ಸೇರಿಸುತ್ತವೆ. ನಿಮ್ಮ ಬ್ರ್ಯಾಂಡ್‌ನೊಂದಿಗೆ ಸ್ಥಿರವಾಗಿರಲು ಮತ್ತು ನಿಮ್ಮ ಸೈಟ್‌ ಅನ್ನು ಸುರಕ್ಷಿತವಾಗಿರಿಸಲು ಅವುಗಳನ್ನು ನವೀಕೃತವಾಗಿರಿಸುವುದು ಮುಖ್ಯವಾಗಿದೆ.','Your themes are all up to date'=>'ನಿಮ್ಮ ಥೀಮ್‌ಗಳು ಎಲ್ಲಾ ಅಪ್‌ಡೇಟ್‌ ಆಗಿವೆ','Your site has %d active plugin, and it is up to date.'=>'ನಿಮ್ಮ ಸೈಟ್ %d ಸಕ್ರಿಯ ಪ್ಲಗಿನ್ ಅನ್ನು ಹೊಂದಿದೆ ಮತ್ತು ಇದು ಅಪ್ ಟು ಡೇಟ್ ಆಗಿದೆ.' . "\0" . 'ನಿಮ್ಮ ಸೈಟ್ %d ಸಕ್ರಿಯ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಹೊಂದಿದೆ, ಮತ್ತು ಅವೆಲ್ಲವೂ ನವೀಕೃತವಾಗಿವೆ.','Your site has %d plugin waiting to be updated.'=>'ನಿಮ್ಮ ಸೈಟ್ ನವೀಕರಿಸಲು %d ಪ್ಲಗಿನ್ ಕಾಯುತ್ತಿದೆ.' . "\0" . 'ನಿಮ್ಮ ಸೈಟ್ ನವೀಕರಿಸಲು ಕಾಯುತ್ತಿರುವ %d ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಹೊಂದಿದೆ.','Plugins extend your site&#8217;s functionality with things like contact forms, ecommerce and much more. That means they have deep access to your site, so it&#8217;s vital to keep them up to date.'=>'ಪ್ಲಗಿನ್‌ಗಳು ನಿಮ್ಮ ಸೈಟ್‌ನ ಕಾರ್ಯವನ್ನು ಸಂಪರ್ಕ ರೂಪಗಳು, ಇಕಾಮರ್ಸ್ ಮತ್ತು ಹೆಚ್ಚಿನವುಗಳೊಂದಿಗೆ ವಿಸ್ತರಿಸುತ್ತದೆ. ಅಂದರೆ ಅವರು ನಿಮ್ಮ ಸೈಟ್‌ಗೆ ಆಳವಾದ ಪ್ರವೇಶವನ್ನು ಹೊಂದಿದ್ದಾರೆ, ಆದ್ದರಿಂದ ಅವುಗಳನ್ನು ನವೀಕೃತವಾಗಿರಿಸುವುದು ಅತ್ಯಗತ್ಯ.','You have plugins waiting to be updated'=>'ನೀವು ನವೀಕರಣ ಮಾಡಲು ಕಾಯುತ್ತಿರುವ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಹೊಂದಿದ್ದೀರಿ','Your plugins are all up to date'=>'ನಿಮ್ಮ ಪ್ಲಗ್‌ಇನ್‌ಗಳೆಲ್ಲವೂ ನವೀಕೃತವಾಗಿವೆ','You are currently running the latest version of WordPress available, keep it up!'=>'ನೀವು ಪ್ರಸ್ತುತ ಲಭ್ಯವಿರುವ ವರ್ಡ್‌ಪ್ರೆಸ್‌ನ ಇತ್ತೀಚಿನ ಆವೃತ್ತಿಯನ್ನು ಚಾಲನೆ ಮಾಡುತ್ತಿದ್ದೀರಿ, ಅದನ್ನು ಮುಂದುವರಿಸಿ!','A new minor update is available for your site. Because minor updates often address security, it&#8217;s important to install them.'=>'ನಿಮ್ಮ ಸೈಟ್‌ಗೆ ಹೊಸ ಮೈನರ್ ಅಪ್‌ಡೇಟ್ ಲಭ್ಯವಿದೆ. ಸಣ್ಣ ಅಪ್‌ಡೇಟ್‌ಗಳು ಆಗಾಗ್ಗೆ ಭದ್ರತೆಯನ್ನು ಉದ್ದೇಶಿಸಿರುವುದರಿಂದ, ಅವುಗಳನ್ನು ಸ್ಥಾಪಿಸುವುದು ಮುಖ್ಯವಾಗಿದೆ.','This could mean that connections are failing to WordPress.org.'=>'ಇದರರ್ಥ WordPress.org ಗೆ ಸಂಪರ್ಕಗಳು ವಿಫಲವಾಗುತ್ತಿವೆ.','Check for updates manually'=>'ಹಸ್ತಚಾಲಿತವಾಗಿ ನವೀಕರಣಗಳಿಗಾಗಿ ಪರಿಶೀಲಿಸಿ','A new version of WordPress is available.'=>'ವರ್ಡ್‌ಪ್ರೆಸ್‌ನ ಹೊಸ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ.','Install the latest version of WordPress'=>'ವರ್ಡ್ಪ್ರೆಸ್ನ ಇತ್ತೀಚಿನ ಆವೃತ್ತಿಯನ್ನು ಸ್ಥಾಪಿಸಿ','The error code was %s.'=>'ದೋಷ ಕೋಡ್ %s ಆಗಿತ್ತು.','The %s filter is enabled.'=>'%s ಫಿಲ್ಟರ್ ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','Author website'=>'ಲೇಖಕರ ವೆಬ್‌ಸೈಟ್','(Latest version: %s)'=>'(ಇತ್ತೀಚಿನ ಆವೃತ್ತಿ: %s)','No version or author information is available.'=>'ಯಾವುದೇ ಆವೃತ್ತಿ ಅಥವಾ ಲೇಖಕರ ಮಾಹಿತಿ ಲಭ್ಯವಿಲ್ಲ.','Server version'=>'ಸರ್ವರ್ ಆವೃತ್ತಿ','cURL version'=>'cURL ಆವೃತ್ತಿ','WordPress update available (%s)'=>'ವರ್ಡ್ಪ್ರೆಸ್ ನವೀಕರಣ ಲಭ್ಯವಿದೆ (%s)','Some files are not writable by WordPress:'=>'ಕೆಲವು ಫೈಲ್‌ಗಳನ್ನು ವರ್ಡ್‌ಪ್ರೆಸ್‌ನಿಂದ ಬರೆಯಲಾಗುವುದಿಲ್ಲ:','Couldn\'t retrieve a list of the checksums for WordPress %s.'=>'ವರ್ಡ್‌ಪ್ರೆಸ್ %s ಗಾಗಿ ಚೆಕ್‌ಸಮ್‌ಗಳ ಪಟ್ಟಿಯನ್ನು ಹಿಂಪಡೆಯಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','(Your site is performing updates over FTP due to file ownership. Talk to your hosting company.)'=>'(ಫೈಲ್ ಮಾಲೀಕತ್ವದಿಂದಾಗಿ ನಿಮ್ಮ ಸೈಟ್ FTP ಮೂಲಕ ನವೀಕರಣಗಳನ್ನು ನಿರ್ವಹಿಸುತ್ತಿದೆ. ನಿಮ್ಮ ಹೋಸ್ಟಿಂಗ್ ಕಂಪನಿಯೊಂದಿಗೆ ಮಾತನಾಡಿ.)','Your installation of WordPress prompts for FTP credentials to perform updates.'=>'ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಸ್ಥಾಪನೆಯು ನವೀಕರಣಗಳನ್ನು ನಿರ್ವಹಿಸಲು FTP ರುಜುವಾತುಗಳನ್ನು ಕೇಳುತ್ತದೆ.','No version control systems were detected.'=>'ಯಾವುದೇ ಆವೃತ್ತಿ ನಿಯಂತ್ರಣ ವ್ಯವಸ್ಥೆಗಳು ಪತ್ತೆಯಾಗಿಲ್ಲ.','The folder %1$s was detected as being under version control (%2$s).'=>'ಫೋಲ್ಡರ್ %1$s ಆವೃತ್ತಿ ನಿಯಂತ್ರಣದಲ್ಲಿದೆ ( %2$s) ಎಂದು ಪತ್ತೆಯಾಗಿದೆ.','The folder %1$s was detected as being under version control (%2$s), but the %3$s filter is allowing updates.'=>'%1$s ಫೋಲ್ಡರ್ ಆವೃತ್ತಿ ನಿಯಂತ್ರಣದಲ್ಲಿದೆ ( %2$s) ಎಂದು ಪತ್ತೆಯಾಗಿದೆ, ಆದರೆ %3$s ಫಿಲ್ಟರ್ ನವೀಕರಣಗಳನ್ನು ಅನುಮತಿಸುತ್ತಿದೆ.','A previous automatic background update could not occur.'=>'ಹಿಂದಿನ ಸ್ವಯಂಚಾಲಿತ ಹಿನ್ನೆಲೆ ನವೀಕರಣವು ಸಂಭವಿಸಲಿಲ್ಲ.','A previous automatic background update ended with a critical failure, so updates are now disabled.'=>'ಹಿಂದಿನ ಸ್ವಯಂಚಾಲಿತ ಹಿನ್ನೆಲೆ ನವೀಕರಣವು ನಿರ್ಣಾಯಕ ವೈಫಲ್ಯದೊಂದಿಗೆ ಕೊನೆಗೊಂಡಿತು, ಆದ್ದರಿಂದ ನವೀಕರಣಗಳನ್ನು ಈಗ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','A plugin has prevented updates by disabling %s.'=>'ಪ್ಲಗಿನ್ %s ಅನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸುವ ಮೂಲಕ ನವೀಕರಣಗಳನ್ನು ತಡೆಯುತ್ತದೆ.','(Does not support 64bit values)'=>'(64 ಬಿಟ್ ಮೌಲ್ಯಗಳನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ)','(Supports 64bit values)'=>'(64 ಬಿಟ್ ಮೌಲ್ಯಗಳನ್ನು ಬೆಂಬಲಿಸುತ್ತದೆ)','PHP version'=>'PHP ಆವೃತ್ತಿ','Unable to determine what web server software is used'=>'ಯಾವ ವೆಬ್ ಸರ್ವರ್ ಸಾಫ್ಟ್‌ವೇರ್ ಅನ್ನು ಬಳಸಲಾಗಿದೆ ಎಂಬುದನ್ನು ನಿರ್ಧರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ','Web server'=>'ವೆಬ್ ಸರ್ವರ್ ','Unable to determine server architecture'=>'ಸರ್ವರ್ ಆರ್ಕಿಟೆಕ್ಚರ್ ಅನ್ನು ನಿರ್ಧರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ','Server architecture'=>'ಸರ್ವರ್ ಆರ್ಕಿಟೆಕ್ಚರ್','Ghostscript version'=>'ಘೋಸ್ಟ್‌ಸ್ಕ್ರಿಪ್ಟ್ ಆವೃತ್ತಿ','Unable to determine if Ghostscript is installed'=>'ಘೋಸ್ಟ್‌ಸ್ಕ್ರಿಪ್ಟ್ ಅನ್ನು ಸ್ಥಾಪಿಸಲಾಗಿದೆಯೇ ಎಂದು ನಿರ್ಧರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ','Imagick Resource Limits'=>'ಇಮೇಜಿಕ್ ಸಂಪನ್ಮೂಲ ಮಿತಿಗಳು','WordPress security and maintenance releases are blocked by the %s filter.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಭದ್ರತೆ ಮತ್ತು ನಿರ್ವಹಣೆ ಬಿಡುಗಡೆಗಳನ್ನು %s ಫಿಲ್ಟರ್ ನಿಂದ ನಿರ್ಬಂಧಿಸಲಾಗಿದೆ.','WordPress development updates are blocked by the %s constant.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಅಭಿವೃದ್ಧಿ ನವೀಕರಣಗಳನ್ನು %s ಸ್ಥಿರದಿಂದ ನಿರ್ಬಂಧಿಸಲಾಗಿದೆ.','All of your WordPress files are writable.'=>'ನಿಮ್ಮ ಎಲ್ಲಾ ವರ್ಡ್ಪ್ರೆಸ್ ಫೈಲ್‌ಗಳನ್ನು ಬರೆಯಬಹುದಾಗಿದೆ.','Unable to determine some settings, as the %s function has been disabled.'=>'%s ಕಾರ್ಯವನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿರುವುದರಿಂದ ಕೆಲವು ಸೆಟ್ಟಿಂಗ್‌ಗಳನ್ನು ನಿರ್ಧರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Server settings'=>'ಸರ್ವರ್ ಸೆಟ್ಟಿಂಗ್‌ಗಳು','Not available'=>'ಲಭ್ಯವಿಲ್ಲ','Active editor'=>'ಸಕ್ರಿಯ ಸಂಪಾದಕ','The must use plugins directory'=>'ಪ್ಲಗಿನ್‌ಗಳ ಡೈರೆಕ್ಟರಿಯನ್ನು ಬಳಸಬೇಕು ','Theme features'=>'ಥೀಮ್ ವೈಶಿಷ್ಟ್ಯಗಳು','PHP memory limit'=>'PHP ಮೆಮೊರಿ ಮಿತಿ','PHP time limit'=>'PHP ಸಮಯದ ಮಿತಿ','Is SUHOSIN installed?'=>'SUHOSIN ಅನ್ನು ಸ್ಥಾಪಿಸಲಾಗಿದೆಯೇ?','Your %s file contains only core WordPress features.'=>'ನಿಮ್ಮ %s ಕಡತವು ಕೋರ್ ವರ್ಡ್ಪ್ರೆಸ್ ವೈಶಿಷ್ಟ್ಯಗಳನ್ನು ಮಾತ್ರ ಒಳಗೊಂಡಿದೆ.','Custom rules have been added to your %s file.'=>'ನಿಮ್ಮ %s ಫ