med because it triggered a <strong>fatal error</strong>.'=>'ಥೀಮ್ ಅನ್ನು ಪುನರಾರಂಭಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ ಏಕೆಂದರೆ ಅದು <strong> ಮಾರಣಾಂತಿಕ ದೋಷ </strong> ವನ್ನು ಪ್ರಚೋದಿಸಿತು.','Sorry, you are not allowed to resume this plugin.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ಪುನರಾರಂಭಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ. ','If you notice &#8220;headers already sent&#8221; messages, problems with syndication feeds or other issues, try deactivating or removing this plugin.'=>'ನೀವು ಗಮನಿಸಿದರೆ &#8220; ಶಿರೋನಾಮೆಗಳನ್ನು ಈಗಾಗಲೇ ಕಳುಹಿಸಲಾಗಿದೆ &#8221; ಸಂದೇಶಗಳು, ಸಿಂಡಿಕೇಶನ್ ಫೀಡ್‌ಗಳ ತೊಂದರೆಗಳು ಅಥವಾ ಇತರ ಸಮಸ್ಯೆಗಳು, ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲು ಅಥವಾ ತೆಗೆದುಹಾಕಲು ಪ್ರಯತ್ನಿಸಿ.','The plugin generated %d character of <strong>unexpected output</strong> during activation.'=>'ಪ್ಲಗಿನ್ ಸಕ್ರಿಯಗೊಳಿಸುವ ಸಮಯದಲ್ಲಿ <strong> ಅನಿರೀಕ್ಷಿತ ಔಟ್ಪುಟ್ </strong> ನ %d ಅಕ್ಷರವನ್ನು ಸೃಷ್ಟಿಸಿದೆ.' . "\0" . 'ಪ್ಲಗಿನ್ ಸಕ್ರಿಯಗೊಳಿಸುವ ಸಮಯದಲ್ಲಿ <strong> ಅನಿರೀಕ್ಷಿತ ಔಟ್ಪುಟ್ </strong> ನ %d ಅಕ್ಷರಗಳನ್ನು ಸೃಷ್ಟಿಸಿದೆ.','<strong>WordPress Events and News</strong> &mdash; Upcoming events near you as well as the latest news from the official WordPress project and the <a href="%s">WordPress Planet</a>.'=>'<strong> ವರ್ಡ್ಪ್ರೆಸ್ ಈವೆಂಟ್‌ಗಳು ಮತ್ತು ಸುದ್ದಿ </strong> & mdash; ನಿಮ್ಮ ಬಳಿ ಮುಂಬರುವ ಈವೆಂಟ್‌ಗಳು ಹಾಗೂ ಅಧಿಕೃತ ವರ್ಡ್‌ಪ್ರೆಸ್ ಪ್ರಾಜೆಕ್ಟ್ ಮತ್ತು <a href="%s"> ವರ್ಡ್‌ಪ್ರೆಸ್ ಪ್ಲಾನೆಟ್ </a> ನಿಂದ ಇತ್ತೀಚಿನ ಸುದ್ದಿಗಳು.','You cannot update because <a href="%1$s">WordPress %2$s</a> requires MySQL version %3$s or higher. You are running version %4$s.'=>'ನೀವು ನವೀಕರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ ಏಕೆಂದರೆ <a href="%1$s"> ವರ್ಡ್ಪ್ರೆಸ್ %2$s </a> ಗೆ MySQL ಆವೃತ್ತಿ %3$s ಅಥವಾ ಹೆಚ್ಚಿನದು ಅಗತ್ಯವಿದೆ. ನೀವು %4$s ಆವೃತ್ತಿಯನ್ನು ಚಲಾಯಿಸುತ್ತಿದ್ದೀರಿ.','You cannot update because <a href="%1$s">WordPress %2$s</a> requires PHP version %3$s or higher. You are running version %4$s.'=>'ನೀವು ನವೀಕರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ ಏಕೆಂದರೆ <a href="%1$s"> ವರ್ಡ್ಪ್ರೆಸ್ %2$s </a> ಗೆ PHP ಆವೃತ್ತಿ %3$s ಅಥವಾ ಹೆಚ್ಚಿನದು ಅಗತ್ಯವಿದೆ. ನೀವು %4$s ಆವೃತ್ತಿಯನ್ನು ಚಲಾಯಿಸುತ್ತಿದ್ದೀರಿ.','Add menu items'=>'ಮೆನು ಐಟಂಗಳನ್ನು ಸೇರಿಸಿ','Fill in the Menu Name and click the Create Menu button to create