pdating PHP</a>.'=>'<a href="%s" target="_blank">PHP ಅನ್ನು ನವೀಕರಿಸುವ ಬಗ್ಗೆ ಇನ್ನಷ್ಟು ತಿಳಿದುಕೊಳ್ಳಲು ಇಲ್ಲಿ ಕ್ಲಿಕ್ ಮಾಡಿ</a>.','<strong>Error:</strong> This plugin <strong>requires a newer version of PHP</strong>.'=>'<strong>ದೋಷ:</strong> ಈ ಪ್ಲಗಿನ್‌ಗೆ <strong>PHP ಯ ಹೊಸ ಆವೃತ್ತಿ ಅಗತ್ಯವಿದೆ</strong>.','Add widget: %s'=>'ವಿಜೆಟ್ ಸೇರಿಸಿ: %s','Add to: %s'=>'ಇದಕ್ಕೆ ಸೇರಿಸಿ: %s','Track %s.'=>'ಟ್ರ್ಯಾಕ್ %s.','Custom PHP fatal error handler.'=>'ಕಸ್ಟಮ್ PHP ಮಾರಕ ದೋಷ ನಿರ್ವಹಣೆ.','Custom PHP error message.'=>'ಕಸ್ಟಮ್ PHP ದೋಷ ಸಂದೇಶ. ','PHP Update Required'=>'PHP ಅಪ್ಡೇಟ್ ಅಗತ್ಯವಿದೆ','My Network'=>'ನನ್ನ ನೆಟ್ವರ್ಕ್','This plugin does not work with your version of PHP.'=>'ಈ ಪ್ಲಗಿನ್ ನಿಮ್ಮ PHP ಆವೃತ್ತಿಯೊಂದಿಗೆ ಕಾರ್ಯನಿರ್ವಹಿಸುವುದಿಲ್ಲ.','This plugin does not work with your version of WordPress.'=>'ಈ ಪ್ಲಗಿನ್ ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿಯೊಂದಿಗೆ ಕಾರ್ಯನಿರ್ವಹಿಸುವುದಿಲ್ಲ.','This plugin does not work with your versions of WordPress and PHP.'=>'ಈ ಪ್ಲಗಿನ್ ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಮತ್ತು PHP ಆವೃತ್ತಿಗಳೊಂದಿಗೆ ಕಾರ್ಯನಿರ್ವಹಿಸುವುದಿಲ್ಲ.','https://wordpress.org/documentation/wordpress-version/version-%s/'=>'https://wordpress.org/documentation/wordpress-version/version-%s/','Resume'=>'ಪುನರಾರಂಭಿಸು','pluginResume %s'=>'%s ಪುನರಾರಂಭಿಸಿ','You can find more details and make changes on the Themes screen.'=>'ನೀವು ಹೆಚ್ಚಿನ ವಿವರಗಳನ್ನು ಹುಡುಕಬಹುದು ಮತ್ತು ಥೀಮ್‌ಗಳ ಪರದೆಯಲ್ಲಿ ಬದಲಾವಣೆಗಳನ್ನು ಮಾಡಬಹುದು.','One or more themes failed to load properly.'=>'ಒಂದು ಅಥವಾ ಹೆಚ್ಚಿನ ಥೀಮ್‌ಗಳು ಸರಿಯಾಗಿ ಲೋಡ್ ಆಗಲು ವಿಫಲವಾಗಿದೆ.','Could not resume the theme.'=>'ಥೀಮ್ ಅನ್ನು ಪುನರಾರಂಭಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Deleting a category does not delete the posts in that category. Instead, posts that were only assigned to the deleted category are set to the default category %s. The default category cannot be deleted.'=>'ಒಂದು ವರ್ಗವನ್ನು ಅಳಿಸುವುದರಿಂದ ಆ ವರ್ಗದಲ್ಲಿರುವ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಅಳಿಸುವುದಿಲ್ಲ. ಬದಲಾಗಿ, ಅಳಿಸಿದ ವರ್ಗಕ್ಕೆ ಮಾತ್ರ ನಿಯೋಜಿಸಲಾದ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಡೀಫಾಲ್ಟ್ ವರ್ಗ %s ಗೆ ಹೊಂದಿಸಲಾಗಿದೆ. ಡೀಫಾಲ್ಟ್ ವರ್ಗವನ್ನು ಅಳಿಸಲಾಗುವುದಿಲ್ಲ.','A post ID mismatch has been detected.'=>'ಪೋಸ್ಟ್ ID ಹೊಂದಿಕೆ ಪತ್ತೆಯಾಗಿದೆ.','A post type mismatch has been detected.'=>'ಹೊಂದಿಕೆಯಾಗದ ಪೋಸ್ಟ್ ರೀತಿ ಪತ್ತೆಯಾಗಿದೆ.','Please activate the <a href="%s">Classic Editor plugin</a> to use this meta box.'=>'ಈ ಮೆಟಾಬಾಕ್ಸ್ ಅನ್ನು ಬಳಸಲು ದಯವಿಟ್ಟು <a href="%s">ಕ್ಲಾಸಿಕ್ ಎಡಿಟರ್ ಪ್ಲಗ್ಇನ್</a> ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿ.','Please install the <a href="%s">Classic Editor plugin</a> to use this meta box.'=>'ಈ ಮೆಟಾ ಬಾಕ್ಸ್ ಅನ್ನು ಬಳಸಲು ದಯವಿಟ್ಟು <a href="%s">ಕ್ಲಾಸಿಕ್ ಎಡಿಟರ್ ಪ್ಲಗ್ಇನ್</a> ಅನ್ನು ಸ್ಥಾಪಿಸಿ.','Please open the <a href="%s">classic editor</a> to use this meta box.'=>'ಈ ಮೆಟಾ ಬಾಕ್ಸ್ ಅನ್ನು ಬಳಸಲು ದಯವಿಟ್ಟು <a href="%s">ಕ್ಲಾಸಿಕ್ ಎಡಿಟರ್</a> ಅನ್ನು ತೆರೆಯಿರಿ.','The 4th Freedom'=>'4 ನೇ ಸ್ವಾತಂತ್ರ್ಯ','To redistribute.'=>'ಪುನರ್ವಿತರಣೆ ಮಾಡಲು.','The 3rd Freedom'=>'3 ನೇ ಸ್ವಾತಂತ್ರ್ಯ','The 2nd Freedom'=>'2 ನೇ ಸ್ವಾತಂತ್ರ್ಯ','The 1st Freedom'=>'1 ನೇ ಸ್ವಾತಂತ್ರ್ಯ','To distribute copies of your modified versions to others.'=>'ನೀವು ಮಾರ್ಪಡಿಸಿದ ಆವೃತ್ತಿಯ ನಕಲುಗಳನ್ನು ಇತರರಿಗೆ ವಿತರಿಸಲು.','To study how the program works and change it to make it do what you wish.'=>'ಪ್ರೋಗ್ರಾಂ ಹೇಗೆ ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತದೆ ಎಂಬುದನ್ನು ಅಧ್ಯಯನ ಮಾಡಲು ಮತ್ತು ಅದನ್ನು ನಿಮಗೆ ಬೇಕಾದಂತೆ ಮಾಡಲು ಅದನ್ನು ಬದಲಾಯಿಸಲು.','To run the program for any purpose.'=>'ಪ್ರೋಗ್ರಾಮ್ ಅನ್ನು ಯಾವ ಉದ್ದೇಶಕ್ಕಾದರೂ ನಡೆಸಲು.','Created'=>'ರಚಿಸಲಾಗಿದೆ','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!'=>'ವರ್ಡ್‌ಪ್ರೆಸ್‌ಗೆ ಸುಸ್ವಾಗತ. ಇದು ನಿಮ್ಮ ಮೊದಲ ಲೇಖನ. ಸಂಪಾದಿಸಿ ಅಥವಾ ಅಳಿಸಿ, ನಂತರ ಬರೆಯಲು ಪ್ರಾರಂಭಿಸಿ!','As a new WordPress user, you should go to <a href="%s">your dashboard</a> to delete this page and create new pages for your content. Have fun!'=>'ಹೊಸ ವರ್ಡ್ಪ್ರೆಸ್ ಬಳಕೆದಾರರಾಗಿ, ಈ ಪುಟವನ್ನು ಅಳಿಸಲು ಮತ್ತು ನಿಮ್ಮ ವಿಷಯಕ್ಕಾಗಿ ಹೊಸ ಪುಟಗಳನ್ನು ರಚಿಸಲು ನೀವು <a href="%s">ನಿಮ್ಮ ಡ್ಯಾಶ್‌ಬೋರ್ಡ್‌</a>ಗೆ ಹೋಗಬೇಕು. ಆನಂದಿಸಿ!','The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.'=>'XYZ ಡೂಹಿಕಿ ಕಂಪನಿಯನ್ನು 1971 ರಲ್ಲಿ ಸ್ಥಾಪಿಸಲಾಯಿತು, ಮತ್ತು ಅಂದಿನಿಂದ ಸಾರ್ವಜನಿಕರಿಗೆ ಗುಣಮಟ್ಟದ ಡೂಹಿಕೆಗಳನ್ನು ಒದಗಿಸುತ್ತಿದೆ.  ಗೊಥಮ್ ಸಿಟಿಯಲ್ಲಿದೆ, XYZ 2,000 ಕ್ಕಿಂತ ಹೆಚ್ಚು ಜನರಿಗೆ ಉದ್ಯೋಗ ನೀಡುತ್ತದೆ ಮತ್ತು ಗೊಥಮ್ ಸಮುದಾಯಕ್ಕಾಗಿ ಎಲ್ಲಾ ರೀತಿಯ ಅದ್ಭುತವಾದ ಕೆಲಸಗಳನ್ನು ಮಾಡುತ್ತದೆ.','...or something like this:'=>'... ಅಥವಾ ಈ ರೀತಿಯಾಗಿ:','Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)'=>'ಹಾಯ್! ನಾನು ದಿನದಿಂದ ಬೈಕು ಮೆಸೆಂಜರ್ ಆಗಿದ್ದೇನೆ, ರಾತ್ರಿಯಲ್ಲಿ ಮಹತ್ವಾಕಾಂಕ್ಷಿ ನಟ, ಮತ್ತು ಇದು ನನ್ನ ವೆಬ್ಸೈಟ್. ನಾನು ಲಾಸ್ ಏಂಜಲೀಸ್ನಲ್ಲಿ ವಾಸಿಸುತ್ತಿದ್ದೇನೆ, ಜ್ಯಾಕ್ ಎಂಬ ದೊಡ್ಡ ನಾಯಿಯನ್ನು ಹೊಂದಿದ್ದೇನೆ ಮತ್ತು ನಾನು ಪೈ & # 241; (ಮತ್ತು ಗೆಟ್ಟಿನ್ \'ಮಳೆಯಲ್ಲಿ ಸೆಳೆಯಿತು.)','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:'=>'ಇದು ಒಂದು ಉದಾಹರಣೆ ಪುಟ. ಇದು ಬ್ಲಾಗ್ ಪೋಸ್ಟ್ನಿಂದ ವಿಭಿನ್ನವಾಗಿದೆ ಏಕೆಂದರೆ ಅದು ಒಂದೇ ಸ್ಥಳದಲ್ಲಿ ಉಳಿಯುತ್ತದೆ ಮತ್ತು ನಿಮ್ಮ ಸೈಟ್ ನ್ಯಾವಿಗೇಷನ್ (ಹೆಚ್ಚಿನ ವಿಷಯಗಳಲ್ಲಿ) ನಲ್ಲಿ ತೋರಿಸುತ್ತದೆ. ಬಹುಪಾಲು ಜನರು ಸಂಭಾವ್ಯ ಸೈಟ್ ಸಂದರ್ಶಕರಿಗೆ ಪರಿಚಯಿಸುವ ಬಗ್ಗೆ ಪುಟದೊಂದಿಗೆ ಪ್ರಾರಂಭಿಸುತ್ತಾರೆ. ಇದು ಹೀಗೆ ಹೇಳಬಹುದು:','Export &#8220;%s&#8221; as JSON'=>'&#8220;%s&#8221; ಅನ್ನು JSON ನಂತೆ ರಫ್ತು ಮಾಡಿ','personal data group labelAbout'=>'ಬಗ್ಗೆ','page titleAbout'=>'ಬಗ್ಗೆ','Privacy Policy Page'=>'ಗೌಪ್ಯತೆ ನೀತಿ ಪುಟ','%s (Draft)'=>'%s (ಡ್ರಾಫ್ಟ್)','<a href="%1$s">Edit</a> or <a href="%2$s">preview</a> your Privacy Policy page content.'=>'ನಿಮ್ಮ ಗೌಪ್ಯತೆ ನೀತಿ ಪುಟದ ವಿಷಯವನ್ನು <a href="%1$s">ಸಂಪಾದಿಸಿ</a> ಅಥವಾ <a href="%2$s">ಪೂರ್ವವೀಕ್ಷಣೆ</a> ಮಾಡಿ.','Privacy Policy page updated successfully.'=>'ಗೌಪ್ಯತಾ ನೀತಿ ಪುಟವನ್ನು ಯಶಸ್ವಿಯಾಗಿ ನವೀಕರಿಸಲಾಗಿದೆ.','The suggested privacy policy content should be added only in wp-admin by using the %s (or later) action.'=>'ಸೂಚಿಸಿದ ಗೌಪ್ಯತೆ ನೀತಿ ವಿಷಯವನ್ನು %s (ಅಥವಾ ನಂತರದ) ಕ್ರಿಯೆಯನ್ನು ಬಳಸಿಕೊಂಡು wp-admin ನಲ್ಲಿ ಮಾತ್ರ ಸೇರಿಸಬೇಕು.','The suggested privacy policy content should be added by using the %s (or later) action. Please see the inline documentation.'=>'ಸೂಚಿಸಿದ ಗೌಪ್ಯತೆ ನೀತಿ ವಿಷಯವನ್ನು %s (ಅಥವಾ ನಂತರದ) ಕ್ರಿಯೆಯನ್ನು ಬಳಸಿಕೊಂಡು ಸೇರಿಸಬೇಕು. ದಯವಿಟ್ಟು ಇನ್ಲೈನ್ ​​ದಸ್ತಾವೇಜನ್ನು ನೋಡಿ.','The suggested privacy policy text has changed. Please <a href="%s">review the guide</a> and update your privacy policy.'=>'ಸೂಚಿಸಿದ ಗೌಪ್ಯತೆ ನೀತಿ ಪಠ್ಯ ಬದಲಾಗಿದೆ. ದಯವಿಟ್ಟು <a href="%s">ಮಾರ್ಗದರ್ಶಿಯನ್ನು ವಿಮರ್ಶಿಸಿ</a> ಮತ್ತು ನಿಮ್ಮ ಗೌಪ್ಯತೆ ನೀತಿಯನ್ನು ನವೀಕರಿಸಿ.','There are no pages.'=>'ಯಾವುದೇ ಪುಟಗಳಿಲ್ಲ.','Privacy Policy Guide'=>'ಗೌಪ್ಯತೆಯ ನೀತಿ ಮಾರ್ಗದರ್ಶಿ','Visitor comments may be checked through an automated spam detection service.'=>'ಸ್ವಯಂಚಾಲಿತ ಸ್ಪ್ಯಾಮ್ ಪತ್ತೆ ಸೇವೆಯ ಮೂಲಕ ಸಂದರ್ಶಕರ ಕಾಮೆಂಟ್‌ಗಳನ್ನು ಪರಿಶೀಲಿಸಬಹುದು.','In this subsection you should note what analytics package you use, how users can opt out of analytics tracking, and a link to your analytics provider&#8217;s privacy policy, if any.'=>'ಈ ಉಪವಿಭಾಗದಲ್ಲಿ ನೀವು ಯಾವ ಅನಾಲಿಟಿಕ್ಸ್ ಪ್ಯಾಕೇಜ್ ಅನ್ನು ಬಳಸುತ್ತೀರಿ, ಬಳಕೆದಾರರು ಹೇಗೆ ಅನಾಲಿಟಿಕ್ಸ್ ಟ್ರ್ಯಾಕಿಂಗ್‌ನಿಂದ ಹೊರಗುಳಿಯಬಹುದು ಮತ್ತು ನಿಮ್ಮ ಅನಾಲಿಟಿಕ್ಸ್ ಪ್ರೊವೈಡರ್‌ನ ಗೌಪ್ಯತೆ ನೀತಿಯ ಲಿಂಕ್, ಏನಾದರು ಇದ್ದಲ್ಲಿ ಅದನ್ನು ನೀವು ಗಮನಿಸಬೇಕು.','In this subsection you should note what information may be disclosed by users who can upload media files. All uploaded files are usually publicly accessible.'=>'ಈ ಉಪವಿಭಾಗದಲ್ಲಿ ನೀವು ಮಾಧ್ಯಮ ಫೈಲ್ಗಳನ್ನು ಅಪ್ಲೋಡ್ ಮಾಡುವ ಬಳಕೆದಾರರಿಂದ ಯಾವ ಮಾಹಿತಿಯನ್ನು ಬಹಿರಂಗಗೊಳಿಸಬೇಕೆಂದು ಗಮನಿಸಿ. ಅಪ್ಲೋಡ್ ಮಾಡಿದ ಎಲ್ಲಾ ಫೈಲ್ಗಳನ್ನು ಸಾಮಾನ್ಯವಾಗಿ ಸಾರ್ವಜನಿಕವಾಗಿ ಪ್ರವೇಶಿಸಬಹುದು.','In this subsection you should note what information is captured through comments. We have noted the data which WordPress collects by default.'=>'ಈ ಉಪವಿಭಾಗದಲ್ಲಿ ಯಾವ ಮಾಹಿತಿಯನ್ನು ಕಾಮೆಂಟ್‌ಗಳ ಮೂಲಕ ಸೆರೆಹಿಡಿಯಲಾಗಿದೆ ಎಂಬುದನ್ನು ನೀವು ಗಮನಿಸಬೇಕು. ಪೂರ್ವನಿಯೋಜಿತವಾಗಿ ವರ್ಡ್ಪ್ರೆಸ್ ಸಂಗ್ರಹಿಸುವ ಡೇಟಾವನ್ನು ನಾವು ಗಮನಿಸಿದ್ದೇವೆ.','In this section you should note what personal data you collect from users and site visitors. This may include personal data, such as name, email address, personal account preferences; transactional data, such as purchase information; and technical data, such as information about cookies.'=>'ಈ ವಿಭಾಗದಲ್ಲಿ ನೀವು ಬಳಕೆದಾರರಿಂದ ಮತ್ತು ಸೈಟ್ ಸಂದರ್ಶಕರಲ್ಲಿ ನೀವು ಸಂಗ್ರಹಿಸುವ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಗಮನಿಸಿ. ಇದು ಹೆಸರು, ಇಮೇಲ್ ವಿಳಾಸ, ವೈಯಕ್ತಿಕ ಖಾತೆ ಆದ್ಯತೆಗಳು ಮುಂತಾದ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಒಳಗೊಂಡಿರಬಹುದು; ಖರೀದಿ ಮಾಹಿತಿಯಂತಹ ವಹಿವಾಟು ಡೇಟಾ; ಮತ್ತು ಕುಕೀಗಳ ಕುರಿತ ಮಾಹಿತಿಯಂತಹ ತಾಂತ್ರಿಕ ಡೇಟಾ.','Suggested text:'=>'ಸೂಚಿಸಿದ ಪಠ್ಯ:','Introduction'=>'‍ಪರಿಚಯ‍','Updated %s.'=>'%s ನವೀಕರಿಸಲಾಗಿದೆ.','Removed %s.'=>'%s ತೆಗೆದುಹಾಕಲಾಗಿದೆ.','You deactivated this plugin on %s and may no longer need this policy.'=>'ನೀವು %s ರಂದು ಈ ಪ್ಲಗಿನ್ ಅನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಿದ್ದೀರಿ ಮತ್ತು ಇನ್ನು ಮುಂದೆ ಈ ನೀತಿಯ ಅಗತ್ಯವಿಲ್ಲದಿರಬಹುದು.','Need help putting together your new Privacy Policy page? Check out our guide for recommendations on what content to include, along with policies suggested by your plugins and theme.'=>'ನಿಮ್ಮ ಹೊಸ ಗೌಪ್ಯತೆ ನೀತಿ ಪುಟವನ್ನು ಒಟ್ಟುಗೂಡಿಸಲು ಸಹಾಯ ಬೇಕೇ? ನಿಮ್ಮ ಪ್ಲಗ್‌ಇನ್‌ಗಳು ಮತ್ತು ಥೀಮ್‌ನಿಂದ ಸೂಚಿಸಲಾದ ನೀತಿಗಳ ಜೊತೆಗೆ ಯಾವ ವಿಷಯವನ್ನು ಸೇರಿಸಬೇಕೆಂಬ ಶಿಫಾರಸುಗಳಿಗಾಗಿ ನಮ್ಮ ಮಾರ್ಗದರ್ಶಿಯನ್ನು ಪರಿಶೀಲಿಸಿ.','Erasing data...'=>'ಡೇಟಾವನ್ನು ಅಳಿಸಲಾಗುತ್ತಿದೆ ...','Add Data Erasure Request'=>'ಡೇಟಾ ಅಳಿಸುವಿಕೆ ವಿನಂತಿಯನ್ನು ಸೇರಿಸಿ','Send export link'=>'ರಫ್ತು ಲಿಂಕ್ ಕಳುಹಿಸಿ','If you are a member of a regulated industry, or if you are subject to additional privacy laws, you may be required to disclose that information here.'=>'ನೀವು ನಿಯಂತ್ರಿತ ಉದ್ಯಮದ ಸದಸ್ಯರಾಗಿದ್ದರೆ ಅಥವಾ ನೀವು ಹೆಚ್ಚುವರಿ ಗೌಪ್ಯತೆ ಕಾನೂನುಗಳಿಗೆ ಒಳಪಟ್ಟಿದ್ದರೆ, ಆ ಮಾಹಿತಿಯನ್ನು ಇಲ್ಲಿ ಬಹಿರಂಗಪಡಿಸಬೇಕಾಗಬಹುದು.','Industry regulatory disclosure requirements'=>'ಇಂಡಸ್ಟ್ರಿ ರೆಗ್ಯುಲೇಟರಿ ಡಿಸ್ಕ್ಲೋಸರ್ ಅಗತ್ಯತೆಗಳು','What automated decision making and/or profiling we do with user data'=>'ಬಳಕೆದಾರರ ಡೇಟಾದೊಂದಿಗೆ ನಾವು ಯಾವ ಸ್ವಯಂಚಾಲಿತ ನಿರ್ಧಾರ ತೆಗೆದುಕೊಳ್ಳುವುದು ಮತ್ತು/ಅಥವಾ ಪ್ರೊಫೈಲಿಂಗ್ ಮಾಡುತ್ತೇವೆ','In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.'=>'ಆಂತರಿಕ ವರದಿ ವ್ಯವಸ್ಥೆಗಳು, ಸಂಪರ್ಕ ಕಾರ್ಯವಿಧಾನಗಳು, ಅಥವಾ ಬಗ್ ಬಂಟೀಸ್ಗಳಂತಹ ಡೇಟಾ ಉಲ್ಲಂಘನೆ, ಸಂಭವನೀಯ ಅಥವಾ ನೈಜತೆಯೊಂದಿಗೆ ವ್ಯವಹರಿಸಲು ನೀವು ಯಾವ ವಿಧಾನಗಳನ್ನು ವಿವರಿಸಬೇಕು ಎಂಬುದನ್ನು ಈ ವಿಭಾಗದಲ್ಲಿ ನೀವು ವಿವರಿಸಬೇಕು.','What third parties we receive data from'=>'ಯಾವ ಮೂರನೇ ವ್ಯಕ್ತಿಗಳಿಂದ ನಾವು ಡೇಟಾವನ್ನು ಸ್ವೀಕರಿಸುತ್ತೇವೆ','In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.'=>'ಈ ವಿಭಾಗದಲ್ಲಿ ನಿಮ್ಮ ಬಳಕೆದಾರರನ್ನು ರಕ್ಷಿಸಲು ನೀವು ತೆಗೆದುಕೊಂಡ ಕ್ರಮಗಳನ್ನು ವಿವರಿಸಬೇಕು & # 8217; ಡೇಟಾ. ಇದು ಗೂಢಲಿಪೀಕರಣದಂತಹ ತಾಂತ್ರಿಕ ಕ್ರಮಗಳನ್ನು ಒಳಗೊಂಡಿರಬಹುದು; ಎರಡು ಅಂಶ ದೃಢೀಕರಣದಂತಹ ಸುರಕ್ಷತಾ ಕ್ರಮಗಳು; ಮತ್ತು ಡೇಟಾ ರಕ್ಷಣೆಗಾಗಿ ಸಿಬ್ಬಂದಿ ತರಬೇತಿಯಂತಹ ಕ್ರಮಗಳನ್ನು ತೆಗೆದುಕೊಳ್ಳುತ್ತದೆ. ನೀವು ಗೌಪ್ಯತೆ ಇಂಪ್ಯಾಕ್ಟ್ ಅಸ್ಸೆಸ್ಮೆಂಟ್ ನಡೆಸಿದ್ದರೆ, ನೀವು ಅದನ್ನು ಇಲ್ಲಿಯೂ ಉಲ್ಲೇಖಿಸಬಹುದು.','What data breach procedures we have in place'=>'ನಾವು ಯಾವ ಡೇಟಾ ಉಲ್ಲಂಘನೆ ಪ್ರಕ್ರಿಯೆಗಳನ್ನು ಹೊಂದಿದ್ದೇವೆ','How we protect your data'=>'ನಿಮ್ಮ ಡೇಟಾವನ್ನು ನಾವು ಹೇಗೆ ರಕ್ಷಿಸುತ್ತೇವೆ','If you use your site for commercial purposes and you engage in more complex collection or processing of personal data, you should note the following information in your privacy policy in addition to the information we have already discussed.'=>'ನೀವು ವಾಣಿಜ್ಯ ಉದ್ದೇಶಗಳಿಗಾಗಿ ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಬಳಸಿದರೆ ಮತ್ತು ವೈಯಕ್ತಿಕ ಡೇಟಾದ ಸಂಕೀರ್ಣ ಸಂಗ್ರಹ ಅಥವಾ ಪ್ರಕ್ರಿಯೆಯಲ್ಲಿ ತೊಡಗಿದ್ದರೆ, ನಾವು ಈಗಾಗಲೇ ಚರ್ಚಿಸಿದ ಮಾಹಿತಿಯ ಜೊತೆಗೆ ನಿಮ್ಮ ಗೌಪ್ಯತೆ ನೀತಿಯಲ್ಲಿ ಕೆಳಗಿನ ಮಾಹಿತಿಯನ್ನು ನೀವು ಗಮನಿಸಬೇಕು.','Additional information'=>'ಹೆಚ್ಚುವರಿ ಮಾಹಿತಿ','In this section you should provide a contact method for privacy-specific concerns. If you are required to have a Data Protection Officer, list their name and full contact details here as well.'=>'ಈ ವಿಭಾಗದಲ್ಲಿ ನೀವು ಗೌಪ್ಯತೆ-ನಿರ್ದಿಷ್ಟ ಕಾಳಜಿಗಳಿಗಾಗಿ ಸಂಪರ್ಕ ವಿಧಾನವನ್ನು ಒದಗಿಸಬೇಕು. ನಿಮಗೆ ಡಾಟಾ ಪ್ರೊಟೆಕ್ಷನ್ ಆಫೀಸರ್ ಅಗತ್ಯವಿದ್ದರೆ, ಅವರ ಹೆಸರು ಮತ್ತು ಪೂರ್ಣ ಸಂಪರ್ಕ ವಿವರಗಳನ್ನು ಇಲ್ಲಿ ಪಟ್ಟಿ ಮಾಡಿ.','European data protection law requires data about European residents which is transferred outside the European Union to be safeguarded to the same standards as if the data was in Europe. So in addition to listing where data goes, you should describe how you ensure that these standards are met either by yourself or by your third party providers, whether that is through an agreement such as Privacy Shield, model clauses in your contracts, or binding corporate rules.'=>'ಐರೋಪ್ಯ ದತ್ತಾಂಶ ಸಂರಕ್ಷಣಾ ಕಾನೂನಿಗೆ ಯುರೋಪಿಯನ್ ನಿವಾಸಿಗಳ ಕುರಿತಾದ ದತ್ತಾಂಶದ ಅಗತ್ಯವಿದೆ, ಅದನ್ನು ಯುರೋಪಿಯನ್ ಒಕ್ಕೂಟದ ಹೊರಗೆ ವರ್ಗಾಯಿಸಲಾಗುತ್ತದೆ ಮತ್ತು ಅದೇ ಡೇಟಾವನ್ನು ಯುರೋಪಿನಲ್ಲಿದ್ದಂತೆ ಅದೇ ಮಾನದಂಡಗಳಿಗೆ ರಕ್ಷಿಸಬೇಕು. ಆದ್ದರಿಂದ ಡೇಟಾ ಎಲ್ಲಿಗೆ ಹೋಗುತ್ತದೆ ಎಂಬುದನ್ನು ಪಟ್ಟಿ ಮಾಡುವುದರ ಜೊತೆಗೆ, ಈ ಮಾನದಂಡಗಳನ್ನು ನೀವೇ ಅಥವಾ ನಿಮ್ಮ ಮೂರನೇ ಪಕ್ಷದ ಪೂರೈಕೆದಾರರು ಹೇಗೆ ಪೂರೈಸುತ್ತಾರೆ ಎಂಬುದನ್ನು ನೀವು ಹೇಗೆ ವಿವರಿಸುತ್ತೀರಿ ಎಂಬುದನ್ನು ವಿವರಿಸಬೇಕು, ಅದು ಗೌಪ್ಯತೆ ಶೀಲ್ಡ್, ನಿಮ್ಮ ಒಪ್ಪಂದಗಳಲ್ಲಿನ ಮಾದರಿ ಷರತ್ತುಗಳು, ಅಥವಾ ಬೈಂಡಿಂಗ್ ಕಾರ್ಪೊರೇಟ್ ನಿಯಮಗಳು.','In this section you should list all transfers of your site data outside the European Union and describe the means by which that data is safeguarded to European data protection standards. This could include your web hosting, cloud storage, or other third party services.'=>'ಈ ವಿಭಾಗದಲ್ಲಿ ನೀವು ಯೂರೋಪಿಯನ್ ಒಕ್ಕೂಟದ ಹೊರಗೆ ನಿಮ್ಮ ಸೈಟ್ ಡೇಟಾದ ಎಲ್ಲಾ ವರ್ಗಾವಣೆಗಳನ್ನು ಪಟ್ಟಿ ಮಾಡಬೇಕು ಮತ್ತು ಆ ಡೇಟಾವನ್ನು ಯುರೋಪಿಯನ್ ಡೇಟಾ ಸಂರಕ್ಷಣಾ ಮಾನದಂಡಗಳಿಗೆ ರಕ್ಷಿಸುವ ವಿಧಾನಗಳನ್ನು ವಿವರಿಸಬೇಕು. ಇದು ನಿಮ್ಮ ವೆಬ್ ಹೋಸ್ಟಿಂಗ್, ಕ್ಲೌಡ್ ಸ್ಟೋರೇಜ್ ಅಥವಾ ಇತರ ಥರ್ಡ್ ಪಾರ್ಟಿ ಸೇವೆಗಳನ್ನು ಒಳಗೊಂಡಿರಬಹುದು.','If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.'=>'ಈ ಸೈಟ್ನಲ್ಲಿ ನೀವು ಖಾತೆಯನ್ನು ಹೊಂದಿದ್ದರೆ, ಅಥವಾ ಕಾಮೆಂಟ್ಗಳನ್ನು ಬಿಟ್ಟು ಹೋದರೆ, ನೀವು ನಮ್ಮ ಬಗ್ಗೆ ಒದಗಿಸಿದ ಯಾವುದೇ ಡೇಟಾವನ್ನು ಒಳಗೊಂಡಂತೆ, ನಿಮ್ಮ ಬಗ್ಗೆ ನಾವು ಹೊಂದಿರುವ ವೈಯಕ್ತಿಕ ಡೇಟಾದ ರಫ್ತು ಮಾಡಿದ ಫೈಲ್ ಅನ್ನು ಸ್ವೀಕರಿಸಲು ವಿನಂತಿಸಬಹುದು. ನಾವು ನಿಮ್ಮ ಬಗ್ಗೆ ಯಾವುದೇ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಅಳಿಸುತ್ತೇವೆ ಎಂದು ನೀವು ವಿನಂತಿಸಬಹುದು. ಇದು ಆಡಳಿತಾತ್ಮಕ, ಕಾನೂನು ಅಥವಾ ಭದ್ರತೆ ಉದ್ದೇಶಗಳಿಗಾಗಿ ನಾವು ಇರಿಸಿಕೊಳ್ಳಲು ಯಾವುದೇ ಡೇಟಾವನ್ನು ಒಳಗೊಂಡಿಲ್ಲ.','For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.'=>'ನಮ್ಮ ವೆಬ್ಸೈಟ್ನಲ್ಲಿ (ಯಾವುದಾದರೂ ಇದ್ದರೆ) ನೋಂದಾಯಿಸುವ ಬಳಕೆದಾರರಿಗೆ, ನಾವು ಅವರ ಬಳಕೆದಾರರ ಪ್ರೊಫೈಲ್ನಲ್ಲಿ ಒದಗಿಸುವ ವೈಯಕ್ತಿಕ ಮಾಹಿತಿಯನ್ನು ನಾವು ಸಂಗ್ರಹಿಸುತ್ತೇವೆ. ಎಲ್ಲಾ ಬಳಕೆದಾರರಿಗೆ ಯಾವುದೇ ಸಮಯದಲ್ಲಾದರೂ ತಮ್ಮ ವೈಯಕ್ತಿಕ ಮಾಹಿತಿಯನ್ನು ನೋಡಬಹುದು, ಸಂಪಾದಿಸಬಹುದು, ಅಥವಾ ಅಳಿಸಬಹುದು (ತಮ್ಮ ಬಳಕೆದಾರ ಹೆಸರನ್ನು ಬದಲಾಯಿಸದೆ ಹೊರತುಪಡಿಸಿ). ವೆಬ್ಸೈಟ್ ನಿರ್ವಾಹಕರು ಆ ಮಾಹಿತಿಯನ್ನು ನೋಡಬಹುದು ಮತ್ತು ಸಂಪಾದಿಸಬಹುದು.','What rights you have over your data'=>'ನಿಮ್ಮ ಡೇಟಾದ ಮೇಲೆ ನಿಮಗೆ ಯಾವ ಹಕ್ಕುಗಳಿವೆ','In this section you should explain what rights your users have over their data and how they can invoke those rights.'=>'ಈ ವಿಭಾಗದಲ್ಲಿ ನಿಮ್ಮ ಬಳಕೆದಾರರು ತಮ್ಮ ಡೇಟಾದ ಮೇಲೆ ಯಾವ ಹಕ್ಕುಗಳನ್ನು ಹೊಂದಿದ್ದಾರೆ ಮತ್ತು ಅವರು ಆ ಹಕ್ಕುಗಳನ್ನು ಹೇಗೆ ಪಡೆದುಕೊಳ್ಳಬಹುದು ಎಂಬುದನ್ನು ವಿವರಿಸಬೇಕು.','If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.'=>'ನೀವು ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ತೊರೆದರೆ, ಕಾಮೆಂಟ್ ಮತ್ತು ಅದರ ಮೆಟಾಡೇಟಾವನ್ನು ಅನಿರ್ದಿಷ್ಟವಾಗಿ ಉಳಿಸಿಕೊಳ್ಳಲಾಗುತ್ತದೆ. ಹೀಗಾಗಿ ನಾವು ಯಾವುದೇ ಅನುಸರಣಾ ಕಾಮೆಂಟ್ಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಮಿತಿಗೊಳಿಸುವ ಸರದಿಯಲ್ಲಿ ಹಿಡಿದಿಟ್ಟುಕೊಳ್ಳುವ ಬದಲು ಗುರುತಿಸಬಹುದು ಮತ್ತು ಅಂಗೀಕರಿಸಬಹುದು.','How long we retain your data'=>'ನಿಮ್ಮ ಡೇಟಾವನ್ನು ನಾವು ಎಷ್ಟು ಕಾಲ ಉಳಿಸಿಕೊಳ್ಳುತ್ತೇವೆ','By default WordPress does not share any personal data with anyone.'=>'ಪೂರ್ವನಿಯೋಜಿತವಾಗಿ ವರ್ಡ್ಪ್ರೆಸ್ ಯಾವುದೇ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಯಾರೊಂದಿಗೂ ಹಂಚಿಕೊಳ್ಳುವುದಿಲ್ಲ.','In this section you should name and list all third party providers with whom you share site data, including partners, cloud-based services, payment processors, and third party service providers, and note what data you share with them and why. Link to their own privacy policies if possible.'=>'ಈ ವಿಭಾಗದಲ್ಲಿ ಪಾಲುದಾರರು, ಕ್ಲೌಡ್-ಆಧಾರಿತ ಸೇವೆಗಳು, ಪಾವತಿ ಪ್ರಕ್ರಿಯೆಗಳು ಮತ್ತು ಮೂರನೇ ವ್ಯಕ್ತಿಯ ಸೇವಾ ಪೂರೈಕೆದಾರರು ಸೇರಿದಂತೆ ನೀವು ಸೈಟ್ ಡೇಟಾವನ್ನು ಹಂಚಿಕೊಳ್ಳುವ ಎಲ್ಲ ಮೂರನೇ ಪಕ್ಷದ ಪೂರೈಕೆದಾರರನ್ನು ಹೆಸರಿಸಿ ಮತ್ತು ಪಟ್ಟಿ ಮಾಡಬೇಕು ಮತ್ತು ನೀವು ಅವರೊಂದಿಗೆ ಯಾವ ಡೇಟಾವನ್ನು ಹಂಚಿಕೊಳ್ಳುತ್ತೀರಿ ಮತ್ತು ಏಕೆ ಗಮನಿಸಿ. ಸಾಧ್ಯವಾದರೆ ಅವರ ಸ್ವಂತ ಗೌಪ್ಯತೆ ನೀತಿಗಳಿಗೆ ಲಿಂಕ್.','By default WordPress does not collect any analytics data. However, many web hosting accounts collect some anonymous analytics data. You may also have installed a WordPress plugin that provides analytics services. In that case, add information from that plugin here.'=>'ಪೂರ್ವನಿಯೋಜಿತವಾಗಿ ವರ್ಡ್ಪ್ರೆಸ್ ಯಾವುದೇ ಅನಾಲಿಟಿಕ್ಸ್ ಡೇಟಾವನ್ನು ಸಂಗ್ರಹಿಸುವುದಿಲ್ಲ. ಆದಾಗ್ಯೂ, ಹಲವು ವೆಬ್ ಹೋಸ್ಟಿಂಗ್ ಖಾತೆಗಳು ಕೆಲವು ಅನಾಮಧೇಯ ಅನಾಲಿಟಿಕ್ಸ್ ಡೇಟಾವನ್ನು ಸಂಗ್ರಹಿಸುತ್ತವೆ. ನೀವು ವಿಶ್ಲೇಷಣಾತ್ಮಕ ಸೇವೆಗಳನ್ನು ಒದಗಿಸುವ ವರ್ಡ್ಪ್ರೆಸ್ ಪ್ಲಗ್ಇನ್ ಅನ್ನು ಸಹ ಸ್ಥಾಪಿಸಬಹುದು. ಆ ಸಂದರ್ಭದಲ್ಲಿ, ಆ ಪ್ಲಗಿನ್ನಿಂದ ಮಾಹಿತಿಯನ್ನು ಇಲ್ಲಿ ಸೇರಿಸಿ.','Who we share your data with'=>'ನಾವು ನಿಮ್ಮ ಡೇಟಾವನ್ನು ಯಾರೊಂದಿಗೆ ಹಂಚಿಕೊಳ್ಳುತ್ತೇವೆ','Analytics'=>'ವಿಶ್ಲೇಷಕಗಳು','These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.'=>'ಈ ವೆಬ್ಸೈಟ್ಗಳು ನಿಮ್ಮ ಬಗ್ಗೆ ಮಾಹಿತಿ ಸಂಗ್ರಹಿಸಬಹುದು, ಕುಕೀಗಳನ್ನು ಬಳಸುತ್ತವೆ, ಹೆಚ್ಚುವರಿ ಮೂರನೇ ವ್ಯಕ್ತಿಯ ಟ್ರ್ಯಾಕಿಂಗ್ ಅನ್ನು ಎಂಬೆಡ್ ಮಾಡುತ್ತವೆ, ಮತ್ತು ನೀವು ಎಂಬೆಡ್ ಮಾಡಿದ ವಿಷಯದೊಂದಿಗೆ ನಿಮ್ಮ ಸಂವಾದವನ್ನು ಟ್ರ್ಯಾಕ್ ಮಾಡುವುದು ಮತ್ತು ಆ ವೆಬ್ಸೈಟ್ಗೆ ಲಾಗ್ ಇನ್ ಮಾಡಿದರೆ ಆ ಎಂಬೆಡ್ ಮಾಡಿದ ವಿಷಯದೊಂದಿಗೆ ನಿಮ್ಮ ಸಂವಾದವನ್ನು ಮೇಲ್ವಿಚಾರಣೆ ಮಾಡಬಹುದು.','Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.'=>'ಈ ಸೈಟ್ನಲ್ಲಿನ ಲೇಖನಗಳು ಎಂಬೆಡೆಡ್ ವಿಷಯವನ್ನು ಒಳಗೊಂಡಿರಬಹುದು (ಉದಾ. ವೀಡಿಯೊಗಳು, ಚಿತ್ರಗಳು, ಲೇಖನಗಳು, ಇತ್ಯಾದಿ). ಇತರ ವೆಬ್ಸೈಟ್ಗಳಿಂದ ಎಂಬೆಡ್ ಮಾಡಿದ ವಿಷಯವು ಭೇಟಿ ನೀಡುವವರು ಬೇರೆ ವೆಬ್ಸೈಟ್ಗೆ ಭೇಟಿ ನೀಡಿದಂತೆಯೇ ಅದೇ ರೀತಿಯಲ್ಲಿ ವರ್ತಿಸುತ್ತದೆ.','If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.'=>'ನೀವು ಲೇಖನವನ್ನು ಸಂಪಾದಿಸಿದರೆ ಅಥವಾ ಪ್ರಕಟಿಸಿದರೆ, ಹೆಚ್ಚುವರಿ ಕುಕೀಸ್ ಅನ್ನು ನಿಮ್ಮ ಬ್ರೌಸರ್ನಲ್ಲಿ ಉಳಿಸಲಾಗುತ್ತದೆ. ಈ ಕುಕೀ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಒಳಗೊಂಡಿಲ್ಲ ಮತ್ತು ನೀವು ಈಗ ಸಂಪಾದಿಸಿದ ಲೇಖನದ ಪೋಸ್ಟ್ ID ಅನ್ನು ಸೂಚಿಸುತ್ತದೆ. 1 ದಿನದ ನಂತರ ಇದು ಮುಕ್ತಾಯಗೊಳ್ಳುತ್ತದೆ.','Embedded content from other websites'=>'ಇತರ ವೆಬ್‌ಸೈಟ್‌ಗಳಿಂದ ಎಂಬೆಡ್ ಮಾಡಲಾದ ವಿಷಯ','When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.'=>'ನೀವು ಲಾಗಿನ್ ಮಾಡುವಾಗ, ನಿಮ್ಮ ಲಾಗಿನ್ ಮಾಹಿತಿ ಮತ್ತು ನಿಮ್ಮ ಪರದೆಯ ಪ್ರದರ್ಶನ ಆಯ್ಕೆಗಳನ್ನು ಉಳಿಸಲು ನಾವು ಹಲವಾರು ಕುಕೀಸ್ಗಳನ್ನು ಹೊಂದಿಸುತ್ತೇವೆ. ಎರಡು ದಿನಗಳವರೆಗೆ ಕುಕೀಸ್ ಅನ್ನು ಲಾಗಿನ್ ಮಾಡಿ, ಮತ್ತು ಒಂದು ವರ್ಷದವರೆಗೆ ತೆರೆ ಆಯ್ಕೆಗಳನ್ನು ಕುಕೀಸ್ ಮಾಡಲಾಗುತ್ತದೆ. ನೀವು & quot; ನನ್ನನ್ನು ನೆನಪಿನಲ್ಲಿರಿಸು & quot; ಅನ್ನು ಆಯ್ಕೆ ಮಾಡಿದರೆ, ನಿಮ್ಮ ಲಾಗಿನ್ ಎರಡು ವಾರಗಳವರೆಗೂ ಇರುತ್ತದೆ. ನಿಮ್ಮ ಖಾತೆಯಿಂದ ನೀವು ಲಾಗ್ ಔಟ್ ಮಾಡಿದರೆ, ಲಾಗಿನ್ ಕುಕೀಗಳನ್ನು ತೆಗೆದುಹಾಕಲಾಗುತ್ತದೆ.','If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.'=>'ನೀವು ಖಾತೆಯನ್ನು ಹೊಂದಿದ್ದರೆ ಮತ್ತು ನೀವು ಈ ಸೈಟ್ಗೆ ಪ್ರವೇಶಿಸಿದರೆ, ಕುಕೀಗಳನ್ನು ನಿಮ್ಮ ಬ್ರೌಸರ್ ಸ್ವೀಕರಿಸುತ್ತದೆಯೇ ಎಂದು ನಾವು ನಿರ್ಧರಿಸಲು ತಾತ್ಕಾಲಿಕ ಕುಕೀಯನ್ನು ಹೊಂದಿಸುತ್ತೇವೆ. ಈ ಕುಕೀ ಯಾವುದೇ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಹೊಂದಿಲ್ಲ ಮತ್ತು ನಿಮ್ಮ ಬ್ರೌಸರ್ ಅನ್ನು ನೀವು ಮುಚ್ಚಿದಾಗ ಅದನ್ನು ತಿರಸ್ಕರಿಸಲಾಗುತ್ತದೆ.','If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.'=>'ನಮ್ಮ ಸೈಟ್ನಲ್ಲಿ ನೀವು ಪ್ರತಿಕ್ರಿಯಿಸುವಾಗ ನಿಮ್ಮ ಹೆಸರು, ಇಮೇಲ್ ವಿಳಾಸ ಮತ್ತು ವೆಬ್ಸೈಟ್ಗಳನ್ನು ಕುಕೀಸ್ನಲ್ಲಿ ಉಳಿಸಲು ಆಯ್ಕೆ ಮಾಡಬಹುದು. ಇವುಗಳು ನಿಮ್ಮ ಅನುಕೂಲಕ್ಕಾಗಿ ಇವೆ, ಆದ್ದರಿಂದ ನೀವು ಇನ್ನೊಂದು ಕಾಮೆಂಟ್ ಅನ್ನು ಬಿಟ್ಟುಹೋಗುವಾಗ ನಿಮ್ಮ ವಿವರಗಳನ್ನು ಮತ್ತೊಮ್ಮೆ ತುಂಬಬೇಕಾಗಿಲ್ಲ. ಈ ಕುಕೀಸ್ ಒಂದು ವರ್ಷದವರೆಗೆ ಇರುತ್ತದೆ.','An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.'=>'ನಿಮ್ಮ ಇಮೇಲ್ ವಿಳಾಸದಿಂದ (ಹ್ಯಾಶ್ ಎಂದೂ ಕರೆಯಲಾಗುತ್ತದೆ) ರಚಿಸಲಾದ ಅನಾಮಧೇಯಗೊಳಿಸಿದ ಸ್ಟ್ರಿಂಗ್ ನೀವು ಅದನ್ನು ಬಳಸುತ್ತಿದ್ದರೆ ನೋಡಲು Gravatar ಸೇವೆಗೆ ಒದಗಿಸಬಹುದು. Gravatar ಸೇವಾ ಗೌಪ್ಯತಾ ನೀತಿ ಇಲ್ಲಿ ಲಭ್ಯವಿದೆ: https://automattic.com/privacy/. ನಿಮ್ಮ ಕಾಮೆಂಟ್ ಅನುಮೋದನೆಯ ನಂತರ, ನಿಮ್ಮ ಪ್ರೊಫೈಲ್ ಚಿತ್ರವು ನಿಮ್ಮ ಕಾಮೆಂಟ್ನ ಸಂದರ್ಭದಲ್ಲಿ ಸಾರ್ವಜನಿಕರಿಗೆ ಗೋಚರಿಸುತ್ತದೆ.','Cookies'=>'ಕುಕೀಗಳು','When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.'=>'ಸಂದರ್ಶಕರ ರೂಪದಲ್ಲಿ ತೋರಿಸಲಾದ ಡೇಟಾವನ್ನು ನಾವು ಸೈಟ್ನಲ್ಲಿ ಭೇಟಿ ನೀಡಿದಾಗ ಭೇಟಿ ನೀಡುವವರು & # 8217; ನ IP ವಿಳಾಸ ಮತ್ತು ಬ್ರೌಸರ್ ಬಳಕೆದಾರ ಏಜೆಂಟ್ ಸ್ಟ್ರಿಂಗ್ ಸಹ ಸ್ಪ್ಯಾಮ್ ಪತ್ತೆಹಚ್ಚಲು ಸಹಾಯ ಮಾಡುತ್ತದೆ.','By default, WordPress does not include a contact form. If you use a contact form plugin, use this subsection to note what personal data is captured when someone submits a contact form, and how long you keep it. For example, you may note that you keep contact form submissions for a certain period for customer service purposes, but you do not use the information submitted through them for marketing purposes.'=>'ಪೂರ್ವನಿಯೋಜಿತವಾಗಿ, ವರ್ಡ್ಪ್ರೆಸ್ ಸಂಪರ್ಕ ರೂಪವನ್ನು ಒಳಗೊಂಡಿಲ್ಲ. ನೀವು ಸಂಪರ್ಕ ಫಾರ್ಮ್ ಪ್ಲಗ್ಇನ್ ಅನ್ನು ಬಳಸಿದರೆ, ಯಾರಾದರೂ ಸಂಪರ್ಕ ಫಾರ್ಮ್ ಅನ್ನು ಸಲ್ಲಿಸುವಾಗ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಸೆರೆಹಿಡಿಯಲಾಗುತ್ತದೆ ಎಂಬುದನ್ನು ಗಮನಿಸಲು ಈ ಉಪವಿಭಾಗವನ್ನು ಬಳಸಿ, ಮತ್ತು ಎಷ್ಟು ಸಮಯದವರೆಗೆ ನೀವು ಅದನ್ನು ಇರಿಸಿಕೊಳ್ಳಿ. ಉದಾಹರಣೆಗೆ, ನೀವು ಗ್ರಾಹಕರ ಸೇವಾ ಉದ್ದೇಶಗಳಿಗಾಗಿ ಒಂದು ನಿರ್ದಿಷ್ಟ ಅವಧಿಗೆ ಸಂಪರ್ಕ ಫಾರ್ಮ್ ಸಲ್ಲಿಕೆಗಳನ್ನು ಇರಿಸಿಕೊಳ್ಳುತ್ತೀರಿ ಎಂದು ನೀವು ಗಮನಿಸಬಹುದು, ಆದರೆ ನೀವು ಮಾರ್ಕೆಟಿಂಗ್ ಉದ್ದೇಶಗಳಿಗಾಗಿ ಅವುಗಳ ಮೂಲಕ ಸಲ್ಲಿಸಿದ ಮಾಹಿತಿಯನ್ನು ಬಳಸಬೇಡಿ.','Contact forms'=>'ಸಂಪರ್ಕ ಫಾರ್ಮ್ಗಳು','If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.'=>'ನೀವು ಚಿತ್ರಗಳನ್ನು ವೆಬ್ ಸೈಟ್ ಗೆ ಅಪ್ ಲೋಡ್ ಮಾಡಿದರೆ, ಎಂಬೆಡೆಡ್ ಲೊಕೇಶನ್ ಡೇಟಾ (ಎಕ್ಸಿಎಫ್ ಜಿಪಿಎಸ್) ಒಳಗೊಂಡಿರುವ ಚಿತ್ರಗಳನ್ನು ಅಪ್ ಲೋಡ್ ಮಾಡುವುದನ್ನು ನೀವು ತಪ್ಪಿಸಬೇಕು. ವೆಬ್ ಸೈಟ್ ಗೆ ಭೇಟಿ ನೀಡುವವರು ವೆಬ್ ಸೈಟ್ ನಲ್ಲಿರುವ ಚಿತ್ರಗಳಿಂದ ಯಾವುದೇ ಸ್ಥಳ ಡೇಟಾವನ್ನು ಡೌನ್ ಲೋಡ್ ಮಾಡಬಹುದು ಮತ್ತು ಹೊರತೆಗೆಯಬಹುದು.','By default WordPress does not collect any personal data about visitors, and only collects the data shown on the User Profile screen from registered users. However some of your plugins may collect personal data. You should add the relevant information below.'=>'ಪೂರ್ವನಿಯೋಜಿತವಾಗಿ ವರ್ಡ್ಪ್ರೆಸ್ ಸಂದರ್ಶಕರ ಬಗ್ಗೆ ಯಾವುದೇ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಸಂಗ್ರಹಿಸುವುದಿಲ್ಲ, ಮತ್ತು ನೋಂದಾಯಿತ ಬಳಕೆದಾರರಿಂದ ಬಳಕೆದಾರ ಪ್ರೊಫೈಲ್ ಪರದೆಯಲ್ಲಿ ತೋರಿಸಿದ ಡೇಟಾವನ್ನು ಮಾತ್ರ ಸಂಗ್ರಹಿಸುತ್ತದೆ. ಆದಾಗ್ಯೂ ನಿಮ್ಮ ಕೆಲವು ಪ್ಲಗ್ಇನ್ಗಳು ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಸಂಗ್ರಹಿಸಬಹುದು. ನೀವು ಕೆಳಗಿನ ಸಂಬಂಧಿತ ಮಾಹಿತಿಯನ್ನು ಸೇರಿಸಬೇಕು.','Personal data is not just created by a user&#8217;s interactions with your site. Personal data is also generated from technical processes such as contact forms, comments, cookies, analytics, and third party embeds.'=>'ನಿಮ್ಮ ಸೈಟ್ನ ಬಳಕೆದಾರರ & # 8217; ನ ಸಂವಹನಗಳಿಂದ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ರಚಿಸಲಾಗಿಲ್ಲ. ಸಂಪರ್ಕ ರೂಪಗಳು, ಕಾಮೆಂಟ್ಗಳು, ಕುಕೀಗಳು, ವಿಶ್ಲೇಷಣೆಗಳು, ಮತ್ತು ಮೂರನೇ ವ್ಯಕ್ತಿ ಎಂಬೆಡ್ಗಳಂತಹ ತಾಂತ್ರಿಕ ಪ್ರಕ್ರಿಯೆಗಳಿಂದ ಕೂಡಾ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಉತ್ಪಾದಿಸಲಾಗುತ್ತದೆ.','In addition to listing what personal data you collect, you need to note why you collect it. These explanations must note either the legal basis for your data collection and retention or the active consent the user has given.'=>'ನೀವು ಸಂಗ್ರಹಿಸುವ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಪಟ್ಟಿ ಮಾಡುವುದರ ಜೊತೆಗೆ, ನೀವು ಅದನ್ನು ಏಕೆ ಸಂಗ್ರಹಿಸುತ್ತೀರಿ ಎಂಬುದನ್ನು ನೀವು ಗಮನಿಸಬೇಕು. ಈ ವಿವರಣೆಗಳು ನಿಮ್ಮ ಡೇಟಾ ಸಂಗ್ರಹಣೆ ಮತ್ತು ಧಾರಣ ಅಥವಾ ಬಳಕೆದಾರ ನೀಡಿದ ಸಕ್ರಿಯ ಸಮ್ಮತಿಯ ಕಾನೂನು ಆಧಾರವನ್ನು ಗಮನಿಸಿ ಮಾಡಬೇಕು.','You should also note any collection and retention of sensitive personal data, such as data concerning health.'=>'ಮಾಹಿತಿಯ ಆರೋಗ್ಯದಂತಹ ಸೂಕ್ಷ್ಮವಾದ ವೈಯಕ್ತಿಕ ಡೇಟಾದ ಯಾವುದೇ ಸಂಗ್ರಹಣೆ ಮತ್ತು ಧಾರಣವನ್ನೂ ನೀವು ಗಮನಿಸಬೇಕು.','Our website address is: %s.'=>'ನಮ್ಮ ವೆಬ್ಸೈಟ್ ವಿಳಾಸ: %s .','The amount of information you may be required to show will vary depending on your local or national business regulations. You may, for example, be required to display a physical address, a registered address, or your company registration number.'=>'ನಿಮ್ಮ ಸ್ಥಳೀಯ ಅಥವಾ ರಾಷ್ಟ್ರೀಯ ವ್ಯವಹಾರ ನಿಯಮಗಳ ಆಧಾರದ ಮೇಲೆ ನೀವು ತೋರಿಸಲು ಅಗತ್ಯವಿರುವ ಮಾಹಿತಿಯ ಪ್ರಮಾಣವು ಬದಲಾಗುತ್ತದೆ. ಉದಾಹರಣೆಗೆ, ನೀವು ಭೌತಿಕ ವಿಳಾಸ, ನೋಂದಾಯಿತ ವಿಳಾಸ, ಅಥವಾ ನಿಮ್ಮ ಕಂಪನಿ ನೋಂದಣಿ ಸಂಖ್ಯೆಯನ್ನು ಪ್ರದರ್ಶಿಸುವ ಅಗತ್ಯವಿದೆ.','What personal data we collect and why we collect it'=>'ನಾವು ಯಾವ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಸಂಗ್ರಹಿಸುತ್ತೇವೆ ಮತ್ತು ಏಕೆ ಸಂಗ್ರಹಿಸುತ್ತೇವೆ','In this section you should note your site URL, as well as the name of the company, organization, or individual behind it, and some accurate contact information.'=>'ಈ ವಿಭಾಗದಲ್ಲಿ ನೀವು ನಿಮ್ಮ ಸೈಟ್ URL ಅನ್ನು ಗಮನಿಸಬೇಕು, ಜೊತೆಗೆ ಕಂಪನಿಯ, ಸಂಸ್ಥೆಯ ಅಥವಾ ಅದರ ಹಿಂದಿನ ವ್ಯಕ್ತಿಯ ಹೆಸರು, ಮತ್ತು ಕೆಲವು ನಿಖರ ಸಂಪರ್ಕ ಮಾಹಿತಿ.','Who we are'=>'ನಾವು ಯಾರು','It is your responsibility to write a comprehensive privacy policy, to make sure it reflects all national and international legal requirements on privacy, and to keep your policy current and accurate.'=>'ಎಲ್ಲಾ ರಾಷ್ಟ್ರೀಯ ಮತ್ತು ಅಂತರರಾಷ್ಟ್ರೀಯ ಕಾನೂನು ಅಗತ್ಯತೆಗಳನ್ನು ಗೌಪ್ಯತೆಗೆ ಪ್ರತಿಬಿಂಬಿಸುತ್ತದೆ ಮತ್ತು ನಿಮ್ಮ ನೀತಿಯನ್ನು ಪ್ರಸ್ತುತ ಮತ್ತು ನಿಖರವಾಗಿ ಇಟ್ಟುಕೊಳ್ಳುವುದನ್ನು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಲು ಸಮಗ್ರ ಗೌಪ್ಯತೆ ನೀತಿಯನ್ನು ಬರೆಯುವುದು ನಿಮ್ಮ ಜವಾಬ್ದಾರಿಯಾಗಿದೆ.','Please edit your privacy policy content, making sure to delete the summaries, and adding any information from your theme and plugins. Once you publish your policy page, remember to add it to your navigation menu.'=>'ದಯವಿಟ್ಟು ನಿಮ್ಮ ಗೌಪ್ಯತೆ ನೀತಿ ವಿಷಯವನ್ನು ಸಂಪಾದಿಸಿ, ಸಾರಾಂಶಗಳನ್ನು ಅಳಿಸಲು, ಮತ್ತು ನಿಮ್ಮ ಥೀಮ್ ಮತ್ತು ಪ್ಲಗ್ಇನ್ಗಳಿಂದ ಯಾವುದೇ ಮಾಹಿತಿಯನ್ನು ಸೇರಿಸುವುದನ್ನು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ. ನಿಮ್ಮ ನೀತಿಯ ಪುಟವನ್ನು ನೀವು ಪ್ರಕಟಿಸಿದ ನಂತರ, ನಿಮ್ಮ ಸಂಚರಣೆ ಮೆನುವಿನಲ್ಲಿ ಅದನ್ನು ಸೇರಿಸಲು ಮರೆಯದಿರಿ.','Force erasure has failed.'=>'ಫೋರ್ಸ್ ಅಳಿಸುವಿಕೆ ವಿಫಲವಾಗಿದೆ.','website URLAt URL'=>'URL ನಲ್ಲಿ','website nameFor site'=>'ಸೈಟ್ಗಾಗಿ','date/timeOn'=>'ರಂದು','email addressReport generated for'=>'ವರದಿಯನ್ನು ರಚಿಸಲಾಗಿದೆ','Email could not be sent.'=>'ಇಮೇಲ್ ಕಳುಹಿಸಲಾಗಲಿಲ್ಲ.','Exporter array at index %s does not include a friendly name.'=>'ಸೂಚ್ಯಂಕ %s ನಲ್ಲಿ ರಫ್ತುದಾರರ ಶ್ರೇಣಿಯು ಸ್ನೇಹಪರ ಹೆಸರನ್ನು ಒಳಗೊಂಡಿಲ್ಲ.','Expected done (boolean) in response array from exporter: %s.'=>'ರಫ್ತುದಾರರಿಂದ ಪ್ರತಿಕ್ರಿಯೆ ಶ್ರೇಣಿಯಲ್ಲಿ ನಿರೀಕ್ಷಿತ ಮಾಡಲಾಗುತ್ತದೆ (ಬೂಲಿಯನ್): %s .','Expected data array in response array from exporter: %s.'=>'ರಫ್ತುದಾರರಿಂದ ಪ್ರತಿಕ್ರಿಯೆ ಶ್ರೇಣಿಯಲ್ಲಿ ನಿರೀಕ್ಷಿತ ಡೇಟಾ ಸರಣಿ: %s .','Expected data in response array from exporter: %s.'=>'ರಫ್ತುದಾರರಿಂದ ಪ್ರತಿಕ್ರಿಯೆ ಶ್ರೇಣಿಯಲ್ಲಿ ನಿರೀಕ್ಷಿತ ಡೇಟಾ: %s .','Exporter callback is not a valid callback: %s.'=>'ರಫ್ತುದಾರ ಕಾಲ್ಬ್ಯಾಕ್ ಮಾನ್ಯವಾದ ಕಾಲ್ಬ್ಯಾಕ್ ಅಲ್ಲ: %s .','Exporter does not include a callback: %s.'=>'ರಫ್ತುದಾರರು ಕಾಲ್ಬ್ಯಾಕ್ ಅನ್ನು ಒಳಗೊಂಡಿರುವುದಿಲ್ಲ: %s .','Expected an array describing the exporter at index %s.'=>'ಸೂಚ್ಯಂಕ %s ನಲ್ಲಿ ರಫ್ತುದಾರನನ್ನು ವಿವರಿಸುವ ಒಂದು ಶ್ರೇಣಿಯನ್ನು ನಿರೀಕ್ಷಿಸಲಾಗಿದೆ.','Exporter index cannot be negative.'=>'ರಫ್ತು ಸೂಚ್ಯಂಕ ಋಣಾತ್ಮಕವಾಗಿರಬಾರದು.','Missing page index.'=>'ಪುಟ ಸೂಚ್ಯಂಕ ಕಾಣೆಯಾಗಿದೆ.','Invalid request type.'=>'ಅಮಾನ್ಯವಾದ ವಿನಂತಿ ಪ್ರಕಾರ.','Eraser index is out of range.'=>'ಎರೇಸರ್ ಸೂಚ್ಯಂಕವು ವ್ಯಾಪ್ತಿಯಲ್ಲಿಲ್ಲ.','Missing eraser index.'=>'ಎರೇಸರ್ ಸೂಚ್ಯಂಕ ಕಾಣೆಯಾಗಿದೆ.','Exporter index is out of range.'=>'ರಫ್ತು ಸೂಚ್ಯಂಕವು ವ್ಯಾಪ್ತಿಯಿಂದ ಹೊರಗಿದೆ.','Sorry, you are not allowed to export personal data on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನಲ್ಲಿ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ರಫ್ತು ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to erase personal data on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನಲ್ಲಿ ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Missing exporter index.'=>'ರಫ್ತು ಸೂಚ್ಯಂಕ ಕಾಣೆಯಾಗಿದೆ.','An exporter has improperly used the registration filter.'=>'ರಫ್ತುದಾರವು ನೋಂದಣಿ ಫಿಲ್ಟರ್ ಅನ್ನು ಸರಿಯಾಗಿ ಬಳಸಿಲ್ಲ.','Expected response as an array from exporter: %s.'=>'ರಫ್ತುದಾರರಿಂದ ರಚನೆಯಂತೆ ನಿರೀಕ್ಷಿತ ಪ್ರತಿಕ್ರಿಯೆ: %s.','Use This Page'=>'ಈ ಪುಟವನ್ನು ಬಳಸಿ','Select a Privacy Policy page'=>'ಗೌಪ್ಯತಾ ನೀತಿ ಪುಟವನ್ನು ಆಯ್ಕೆಮಾಡಿ','<a href="%1$s">Edit</a> or <a href="%2$s">view</a> your Privacy Policy page content.'=>'ನಿಮ್ಮ ಗೌಪ್ಯತೆ ನೀತಿ ಪುಟದ ವಿಷಯವನ್ನು <a href="%1$s">ಸಂಪಾದಿಸಿ</a> ಅಥವಾ <a href="%2$s">ವೀಕ್ಷಿಸಿ</a>.','Change your Privacy Policy page'=>'ನಿಮ್ಮ ಗೌಪ್ಯತೆ ನೀತಿ ಪುಟವನ್ನು ಬದಲಾಯಿಸಿ','If you already have a Privacy Policy page, please select it below. If not, please create one.'=>'ನೀವು ಈಗಾಗಲೇ ಗೌಪ್ಯತೆ ನೀತಿ ಪುಟವನ್ನು ಹೊಂದಿದ್ದರೆ, ದಯವಿಟ್ಟು ಅದನ್ನು ಕೆಳಗೆ ಆಯ್ಕೆ ಮಾಡಿ. ಇಲ್ಲದಿದ್ದರೆ, ದಯವಿಟ್ಟು ಒಂದನ್ನು ರಚಿಸಿ.','The currently selected Privacy Policy page does not exist. Please create or select a new page.'=>'ಪ್ರಸ್ತುತ ಆಯ್ಕೆ ಮಾಡಿದ ಗೌಪ್ಯತೆ ನೀತಿ ಪುಟ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ. ದಯವಿಟ್ಟು ಹೊಸ ಪುಟವನ್ನು ರಚಿಸಿ ಅಥವಾ ಆಯ್ಕೆಮಾಡಿ.','Unable to create a Privacy Policy page.'=>'ಗೌಪ್ಯತಾ ನೀತಿ ಪುಟವನ್ನು ರಚಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Privacy Policy page setting updated successfully. Remember to <a href="%s">update your menus</a>!'=>'ಗೌಪ್ಯತೆ ನೀತಿ ಪುಟದ ಸೆಟ್ಟಿಂಗನ್ನು ಯಶಸ್ವಿಯಾಗಿ ನವೀಕರಿಸಲಾಗಿದೆ. ನಿಮ್ಮ <a href="%s">ಮೆನುಗಳನ್ನು ನವೀಕರಿಸಲು</a> ಮರೆಯದಿರಿ!','The currently selected Privacy Policy page is in the Trash. Please create or select a new Privacy Policy page or <a href="%s">restore the current page</a>.'=>'ಪ್ರಸ್ತುತ ಆಯ್ಕೆ ಮಾಡಿದ ಗೌಪ್ಯತೆ ನೀತಿ ಪುಟವು ಅನುಪಯುಕ್ತದಲ್ಲಿದೆ. ದಯವಿಟ್ಟು ಹೊಸ ಗೌಪ್ಯತಾ ನೀತಿ ಪುಟವನ್ನು ರಚಿಸಿ ಅಥವಾ ಆಯ್ಕೆಮಾಡಿ ಅಥವಾ <a href="%s">ಪ್ರಸ್ತುತ ಪುಟವನ್ನು ಪುನಃಸ್ಥಾಪಿಸಿ</a>.','privacy-policy'=>'privacy-policy','Copy suggested policy text