###SITEURL###','Email sent.'=>'ಇಮೇಲ್ ಕಳುಹಿಸಲಾಗಿದೆ.','Unable to send personal data export email.'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ರಫ್ತು ಇಮೇಲ್ ಕಳುಹಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Sending email...'=>'ಇಮೇಲ್ ಕಳುಹಿಸಲಾಗುತ್ತಿದೆ...','Download personal data again'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಮತ್ತೊಮ್ಮೆ ಡೌನ್‌ಲೋಡ್ ಮಾಡಿ','[%s] Personal Data Export'=>'[%s] ವೈಯಕ್ತಿಕ ಡೇಟಾ ರಫ್ತು','Personal Data Export'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ರಫ್ತು','Personal Data Export for %s'=>'%s ಗಾಗಿ ವೈಯಕ್ತಿಕ ಡೇಟಾ ರಫ್ತು','A valid email address must be given.'=>'ಮಾನ್ಯವಾದ ಇಮೇಲ್ ವಿಳಾಸವನ್ನು ನೀಡಬೇಕು.','Invalid request ID when sending personal data export email.'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ರಫ್ತು ಇಮೇಲ್ ಕಳುಹಿಸುವಾಗ ಅಮಾನ್ಯ ವಿನಂತಿ ID.','Remove request'=>'ವಿನಂತಿಯನ್ನು ತೆಗೆದುಹಾಕಿ','Waiting for confirmation'=>'ದೃಢೀಕರಣಕ್ಕಾಗಿ ನಿರೀಕ್ಷಿಸಲಾಗುತ್ತಿದೆ','Download personal data'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾವನ್ನು ಡೌನ್ಲೋಡ್ ಮಾಡಿ','Requested'=>'ವಿನಂತಿಸಲಾಗಿದೆ','Send Request'=>'ಕೊರಿಕೆ ಕಳಿಸು','Username or email address'=>'ಬಳಕೆದಾರಹೆಸರು ಅಥವಾ ಇಮೇಲ್ ವಿಳಾಸ','Add Data Export Request'=>'ಡೇಟಾ ರಫ್ತು ವಿನಂತಿ ಸೇರಿಸಿ','Confirmation request initiated successfully.'=>'ದೃಢೀಕರಣ ವಿನಂತಿಯನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಪ್ರಾರಂಭಿಸಲಾಗಿದೆ.','Unable to initiate confirmation request.'=>'ದೃಢೀಕರಣ ವಿನಂತಿಯನ್ನು ಪ್ರಾರಂಭಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Page index cannot be less than one.'=>'ಪುಟ ಸೂಚ್ಯಂಕವು ಒಂದಕ್ಕಿಂತ ಕಡಿಮೆ ಇರುವಂತಿಲ್ಲ.','Eraser index cannot be less than one.'=>'ಎರೇಸರ್ ಸೂಚ್ಯಂಕವು ಒಂದಕ್ಕಿಂತ ಕಡಿಮೆ ಇರುವಂತಿಲ್ಲ.','Invalid email address in request.'=>'ವಿನಂತಿಯಲ್ಲಿ ಅಮಾನ್ಯವಾದ ಇಮೇಲ್ ವಿಳಾಸ.','Force erase personal data'=>'ವೈಯಕ್ತಿಕ ಡೇಟಾ ಅಳಿಸಲು ಒತ್ತಾಯಿಸು','Invalid request ID.'=>'ಅಮಾನ್ಯವಾದ ವಿನಂತಿ ID.','Requester'=>'ವಿನಂತಿಸುವವರು','Unable to add this request. A valid email address or username must be supplied.'=>'ಈ ವಿನಂತಿಯನ್ನು ಸೇರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. ಮಾನ್ಯವಾದ ಇಮೇಲ್ ವಿಳಾಸ ಅಥವಾ ಬಳಕೆದಾರ ಹೆಸರನ್ನು ಒದಗಿಸಬೇಕು.','Confirmation request sent again successfully.'=>'ದೃಢೀಕರಣ ವಿನಂತಿಯನ್ನು ಮತ್ತೊಮ್ಮೆ ಯಶಸ್ವಿಯಾಗಿ ಕಳುಹಿಸಲಾಗಿದೆ.','Retry'=>'ಮರುಪ್ರಯತ್ನಿಸಿ','Downloading data...'=>'ಡೇಟಾ ಡೌನ್ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ...','Expected done flag in response array from %1$s eraser (index %2$d).'=>'%1$s ಎರೇಸರ್ (ಸೂಚ್ಯಂಕ %2$d) ನಿಂದ ನಿರೀಕ್ಷಿತ ಫ್ಲ್ಯಾಗ್ ರೆಸ್ಪಾನ್ಸ್ ಅರೇ.','Expected an array describing the eraser at index %d.'=>'ಸೂಚಕ %d ನಲ್ಲಿ ಎರೇಸರ್ ಅನ್ನು ವಿವರಿಸುವ ಒಂದು ಶ್ರೇಣಿಯನ್ನು ನಿರೀಕ್ಷಿಸಲಾಗಿದೆ.','Expected messages key to reference an array in response array from %1$s eraser (index %2$d).'=>'%1$s ಎರೇಸರ್ (ಸೂಚ್ಯಂಕ %2$d) ನಿಂದ ಪ್ರತಿಕ್ರಿಯೆ ಸರಣಿಯಲ್ಲಿ ಸರಣಿಯನ್ನು ಉಲ್ಲೇಖಿಸಲು ನಿರೀಕ್ಷಿತ ಸಂದೇಶಗಳು ಕೀಲಿ.','Expected messages key in response array from %1$s eraser (index %2$d).'=>'%1$s ಎರೇಸರ್ (ಸೂಚ್ಯಂಕ %2$d) ನಿಂದ ಪ್ರತಿಕ್ರಿಯೆ ಸರಣಿಯಲ್ಲಿ ನಿರೀಕ್ಷಿತ ಸಂದೇಶಗಳ ಕೀಲಿ.','Expected items_retained key in response array from %1$s eraser (index %2$d).'=>'%1$s ಎರೇಸರ್ (ಸೂಚ್ಯಂಕ %2$d) ನಿಂದ ಪ್ರತಿಕ್ರಿಯೆ ಸರಣಿಯಲ್ಲಿ ನಿರೀಕ್ಷಿತ items_retained ಕೀಲಿ.','Expected items_removed key in response array from %1$s eraser (index %2$d).'=>'%1$s ಎರೇಸರ್ (ಸೂಚ್ಯಂಕ %2$d) ನಿಂದ ಪ್ರತಿಕ್ರಿಯೆ ಸರಣಿಯಲ್ಲಿ ನಿರೀಕ್ಷಿತ items_removed ಕೀಲಿ.','Did not receive array from %1$s eraser (index %2$d).'=>'%1$s ಎರೇಸರ್ (ಸೂಚ್ಯಂಕ %2$d) ನಿಂದ ಸರಣಿಯನ್ನು ಸ್ವೀಕರಿಸಲಿಲ್ಲ.','Eraser array at index %d does not include a friendly name.'=>'ಸೂಚ್ಯಂಕ %d ಎರೇಸರ್ ಸರಣಿಯು ಸ್ನೇಹಪರ ಹೆಸರನ್ನು ಒಳಗೊಂಡಿಲ್ಲ.','Requires PHP Version:'=>'PHP ಆವೃತ್ತಿ ಅಗತ್ಯವಿದೆ:','This changeset cannot be further modified.'=>'ಈ ಬದಲಾವಣೆಗಳನ್ನು ಮತ್ತಷ್ಟು ಮಾರ್ಪಡಿಸಲಾಗುವುದಿಲ್ಲ.','This data is used to provide general enhancements to WordPress, which includes helping to protect your site by finding and automatically installing new updates. It is also used to calculate statistics, such as those shown on the <a href="%s">WordPress.org stats page</a>.'=>'ಈ ಡೇಟಾವನ್ನು ವರ್ಡ್ಪ್ರೆಸ್ಗೆ ಸಾಮಾನ್ಯ ವರ್ಧನೆಗಳನ್ನು ಒದಗಿಸಲು ಬಳಸಲಾಗುತ್ತದೆ, ಇದು ಹೊಸ ನವೀಕರಣಗಳನ್ನು ಹುಡುಕುವ ಮತ್ತು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಸ್ಥಾಪಿಸುವ ಮೂಲಕ ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ರಕ್ಷಿಸಲು ಸಹಾಯ ಮಾಡುತ್ತದೆ. ಇದನ್ನು <a href="%s">WordPress.org ಅಂಕಿಅಂಶಗಳ ಪುಟ</a>ದಲ್ಲಿ ತೋರಿಸಿರುವಂತಹ ಅಂಕಿಅಂಶಗಳನ್ನು ಲೆಕ್ಕಹಾಕಲು ಸಹ ಬಳಸಲಾಗುತ್ತದೆ.','Did you know?'=>'ನಿನಗೆ ಗೊತ್ತಿತ್ತೇ?','Noteworthy Contributors'=>'ಗಮನಾರ್ಹ ಕೊಡುಗೆದಾರರು','If you decide to go ahead with direct edits anyway, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.'=>'ಹೇಗಾದರೂ ನೇರ ಸಂಪಾದನೆಗಳನ್ನು ಮುಂದುವರಿಸಲು ನೀವು ನಿರ್ಧರಿಸಿದರೆ, ಒಂದು ಹೊಸ ಹೆಸರಿನೊಂದಿಗೆ ನಕಲನ್ನು ರಚಿಸಲು ಮತ್ತು ಮೂಲಕ್ಕೆ ಸ್ಥಗಿತಗೊಳ್ಳಲು ಫೈಲ್ ನಿರ್ವಾಹಕವನ್ನು ಬಳಸಿ. ಆ ರೀತಿಯಲ್ಲಿ, ಏನಾದರೂ ತಪ್ಪಾದಲ್ಲಿ ನೀವು ಕ್ರಿಯಾತ್ಮಕ ಆವೃತ್ತಿಯನ್ನು ಮರು-ಸಕ್ರಿಯಗೊಳಿಸಬಹುದು.','If you absolutely have to make direct edits to this plugin, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.'=>'ನೀವು ಈ ಪ್ಲಗಿನ್ಗೆ ನೇರವಾಗಿ ಸಂಪಾದನೆಗಳನ್ನು ಮಾಡಬೇಕಾದರೆ, ಹೊಸ ಹೆಸರಿನೊಂದಿಗೆ ನಕಲನ್ನು ರಚಿಸಲು ಮತ್ತು ಮೂಲಕ್ಕೆ ಸ್ಥಗಿತಗೊಳ್ಳಲು ಫೈಲ್ ನಿರ್ವಾಹಕವನ್ನು ಬಳಸಿ. ಆ ರೀತಿಯಲ್ಲಿ, ಏನಾದರೂ ತಪ್ಪಾದಲ್ಲಿ ನೀವು ಕ್ರಿಯಾತ್ಮಕ ಆವೃತ್ತಿಯನ್ನು ಮರು-ಸಕ್ರಿಯಗೊಳಿಸಬಹುದು.','You appear to be making direct edits to your plugin in the WordPress dashboard. Editing plugins directly is not recommended as it may introduce incompatibilities that break your site and your changes may be lost in future updates.'=>'ನೀವು WordPress ಡ್ಯಾಶ್‌ಬೋರ್ಡ್‌ನಲ್ಲಿ ನಿಮ್ಮ ಪ್ಲಗಿನ್‌ಗೆ ನೇರ ಸಂಪಾದನೆಗಳನ್ನು ಮಾಡುತ್ತಿರುವಂತೆ ತೋರುತ್ತಿದೆ. ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನೇರವಾಗಿ ಸಂಪಾದಿಸುವುದನ್ನು ಶಿಫಾರಸು ಮಾಡುವುದಿಲ್ಲ ಏಕೆಂದರೆ ಇದು ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಒಡೆಯುವ ಅಸಾಮರಸ್ಯತೆಯನ್ನು ಪರಿಚಯಿಸಬಹುದು ಮತ್ತು ಭವಿಷ್ಯದ ನವೀಕರಣಗಳಲ್ಲಿ ನಿಮ್ಮ ಬದಲಾವಣೆಗಳು ಕಳೆದುಹೋಗಬಹುದು.','WordPress is not notifying any <a href="%1$s">Update Services</a> because of your site&#8217;s <a href="%2$s">visibility settings</a>.'=>'ನಿಮ್ಮ ಸೈಟ್‌ನ <a href="%2$s">ಗೋಚರತೆ ಸೆಟ್ಟಿಂಗ್‌</a>ಗಳಿಂದಾಗಿ ವರ್ಡ್‌ಪ್ರೆಸ್ ಯಾವುದೇ <a href="%1$s">ಅಪ್‌ಡೇಟ್ ಸೇವೆಗಳಿಗೆ</a> ಸೂಚನೆ ನೀಡುತ್ತಿಲ್ಲ.','We take privacy and transparency very seriously. To learn more about what data we collect, and how we use it, please visit <a href="%s">our Privacy Policy</a>.'=>'ನಾವು ಗೌಪ್ಯತೆ ಮತ್ತು ಪಾರದರ್ಶಕತೆಯನ್ನು ಬಹಳ ಗಂಭೀರವಾಗಿ ಪರಿಗಣಿಸುತ್ತೇವೆ. ನಾವು ಯಾವ ಡೇಟಾವನ್ನು ಸಂಗ್ರಹಿಸುತ್ತೇವೆ ಮತ್ತು ಅದನ್ನು ಹೇಗೆ ಬಳಸುತ್ತೇವೆ ಎಂಬುದರ ಕುರಿತು ಇನ್ನಷ್ಟು ತಿಳಿದುಕೊಳ್ಳಲು, ದಯವಿಟ್ಟು <a href="%s"> ನಮ್ಮ ಗೌಪ್ಯತೆ ನೀತಿ </a> ಗೆ ಭೇಟಿ ನೀಡಿ.','https://wordpress.org/about/license/'=>'https://wordpress.org/about/license/','Uploaded on: %s'=>'ಅಪ್ಲೋಡ್ ಮಾಡಲಾಗಿದೆ: %s','Downloading update from %s&#8230;'=>'%s ನಿಂದ ನವೀಕರಣವನ್ನು ಡೌನ್ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ&#8230;','Downloading installation package from %s&#8230;'=>'%s ನಿಂದ ಅನುಸ್ಥಾಪನ ಪ್ಯಾಕೇಜ್ ಅನ್ನು ಡೌನ್ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ&#8230;','Downloading translation from %s&#8230;'=>'%s ನಿಂದ ಅನುವಾದವನ್ನು ಡೌನ್ಲೋಡ್ ಮಾಡಲಾಗುತ್ತಿದೆ&#8230;','Likely direct inclusion of %1$s in order to use %2$s. This is very wrong. Hook the %2$s call into the %3$s action instead.'=>'$s ಅನ್ನು ಬಳಸಲು %2$s %1$s ನ ನೇರ ಸೇರ್ಪಡೆ. ಇದು ಬಹಳ ತಪ್ಪು. ಬದಲಿಗೆ %3$s ಕ್ರಿಯೆಯೊಳಗೆ %2$s ಕರೆ ಅನ್ನು ಹುಕ್ ಮಾಡಿ.','Customization Draft'=>'ಗ್ರಾಹಕೀಕರಣ ಡ್ರಾಫ್ಟ್','folder'=>'ಫೋಲ್ಡರ್','Theme Files'=>'ಥೀಮ್ ಫೈಲ್‌ಗಳು','Unable to communicate back with site to check for fatal errors, so the PHP change was reverted. You will need to upload your PHP file change by some other means, such as by using SFTP.'=>'ಮಾರಣಾಂತಿಕ ದೋಷಗಳನ್ನು ಪರಿಶೀಲಿಸಲು ಸೈಟ್ ನೊಂದಿಗೆ ಮತ್ತೆ ಸಂವಹನ ನಡೆಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ, ಆದ್ದರಿಂದ ಪಿಎಚ್ ಪಿ ಬದಲಾವಣೆಯನ್ನು ಹಿಂತಿರುಗಿಸಲಾಯಿತು. ನೀವು ನಿಮ್ಮ PAP ಫೈಲ್ ಬದಲಾವಣೆಯನ್ನು ಬೇರೆ ಯಾವುದಾದರೂ ವಿಧಾನಗಳ ಮೂಲಕ ಅಪ್ ಲೋಡ್ ಮಾಡಬೇಕಾಗುತ್ತದೆ, ಉದಾಹರಣೆಗೆ ಎಸ್ ಎಫ್ ಟಿಪಿ ಯನ್ನು ಬಳಸುವ ಮೂಲಕ.','Installation Required'=>'ಅನುಸ್ಥಾಪನೆಯ ಅಗತ್ಯವಿದೆ','Could not fully remove the plugin %s.'=>'%s ಪ್ಲಗಿನ್ ಅನ್ನು ಸಂಪೂರ್ಣವಾಗಿ ತೆಗೆದುಹಾಕಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','User has been created, but could not be added to this site.'=>'ಬಳಕೆದಾರನನ್ನು ರಚಿಸಲಾಗಿದೆ, ಆದರೆ ಈ ಸೈಟ್ಗೆ ಸೇರಿಸಲಾಗಲಿಲ್ಲ.','That user could not be added to this site.'=>'ಆ ಬಳಕೆದಾರರನ್ನು ಈ ಸೈಟ್‌ಗೆ ಸೇರಿಸಲಾಗುವುದಿಲ್ಲ.','Disable syntax highlighting when editing code'=>'ಕೋಡ್ ಸಂಪಾದಿಸುವಾಗ ಸಿಂಟ್ಯಾಕ್ಸ್ ಹೈಲೈಟ್ ಮಾಡುವುದನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಿ','Syntax Highlighting'=>'ಸಿಂಟ್ಯಾಕ್ಸ್ ಹೈಲೈಟಿಂಗ್','Run the installation'=>'ಅನುಸ್ಥಾಪನೆಯನ್ನು ಚಲಾಯಿಸಿ','https://wordpress.org/about/privacy/'=>'https://wordpress.org/about/privacy/','Press This is not available. Please contact your site administrator.'=>'ಪ್ರೆಸ್ ದಿಸ್ ಲಭ್ಯವಿಲ್ಲ. ದಯವಿಟ್ಟು ನಿಮ್ಮ ಸೈಟ್ ನಿರ್ವಾಹಕರನ್ನು ಸಂಪರ್ಕಿಸಿ.','Press This is not installed. Please install Press This from <a href="%s">the main site</a>.'=>'ಪ್ರೆಸ್ ದಿಸ್ ಸ್ಥಾಪಿಸಲಾಗಿಲ್ಲ. <a href="%s">ಮುಖ್ಯ ಸೈಟ್‌ನಿಂದ</a> ಪ್ರೆಸ್ ದಿಸ್ ಅನ್ನು ದಯವಿಟ್ಟು ಸ್ಥಾಪಿಸಿ.','Activate Press This'=>'ಪ್ರೆಸ್ ದಿಸ್ ಸಕ್ರಿಯಗೊಳಿಸಿ','I understand'=>'ನನಗೆ ಅರ್ಥವಾಗಿದೆ','Heads up!'=>'ತಲೆ ಎತ್ತಿ!','<strong>Warning:</strong> Making changes to active plugins is not recommended.'=>'<strong>ಎಚ್ಚರಿಕೆ:</strong> ಸಕ್ರಿಯ ಪ್ಲಗಿನ್‌ಗಳಿಗೆ ಬದಲಾವಣೆಗಳನ್ನು ಮಾಡುವುದು ಸೂಕ್ತವಲ್ಲ.','Selected file content:'=>'ಆಯ್ದ ಫೈಲ್ ವಿಷಯ:','There was an error while trying to update the file. You may need to fix something and try updating again.'=>'ಫೈಲ್ ನವೀಕರಣ ಮಾಡಲು ಪ್ರಯತ್ನಿಸುವಾಗ ದೋಷ ಕಂಡುಬಂದಿದೆ. ನೀವು ಏನನ್ನಾದರೂ ಸರಿಪಡಿಸಬೇಕಾಗಬಹುದು ಮತ್ತು ಮತ್ತೊಮ್ಮೆ ನವೀಕರಣ ಮಾಡಲು ಪ್ರಯತ್ನಿಸಿ.','Homepage: %s'=>'ಮುಖಪುಟ: %s','%s (already used in permalink structure)'=>'%s (ಈಗಾಗಲೇ ಪರ್ಮಾಲಿಂಕ್ ರಚನೆಯಲ್ಲಿ ಬಳಸಲಾಗಿದೆ)','%s added to permalink structure'=>'%s ಪರ್ಮಾಲಿಂಕ್ ರಚನೆಗೆ ಸೇರಿಸಲಾಗಿದೆ','%s (A sanitized version of the author name.)'=>'%s (ಲೇಖಕರ ಹೆಸರಿನ ಪರಿಶುದ್ಧ ಆವೃತ್ತಿ.)','%s (Day of the month, for example 28.)'=>'%s (ತಿಂಗಳ ದಿನ, ಉದಾಹರಣೆಗೆ 28.)','%s (Month of the year, for example 05.)'=>'%s (ವರ್ಷದ ತಿಂಗಳು, ಉದಾಹರಣೆಗೆ 05.)','Available tags:'=>'ಲಭ್ಯವಿರುವ ಟ್ಯಾಗ್‌ಗಳು:','%s (Minute of the hour, for example 43.)'=>'%s (ಗಂಟೆಯ ನಿಮಿಷ, ಉದಾಹರಣೆಗೆ 43.)','%s (Hour of the day, for example 15.)'=>'%s (ದಿನದ ಗಂಟೆ, ಉದಾಹರಣೆಗೆ 15.)','%s (Category slug. Nested sub-categories appear as nested directories in the URL.)'=>'%s (ವರ್ಗ ಸ್ಲಗ್. ನೆಸ್ಟೆಡ್ ಉಪ-ವರ್ಗಗಳು URL ನಲ್ಲಿ ನೆಸ್ಟೆಡ್ ಡೈರೆಕ್ಟರಿಯಂತೆ ಕಾಣುತ್ತವೆ.)','%s (The sanitized post title (slug).)'=>'%s (ನೈರ್ಮಲ್ಯಗೊಳಿಸಿದ ಪೋಸ್ಟ್ ಶೀರ್ಷಿಕೆ (ಸ್ಲಗ್).)','%s (The unique ID of the post, for example 423.)'=>'%s (ಪೋಸ್ಟ್‌ನ ಅನನ್ಯ ID, ಉದಾಹರಣೆಗೆ 423.)','%s (Second of the minute, for example 33.)'=>'%s (ನಿಮಿಷದ ಎರಡನೇ, ಉದಾಹರಣೆಗೆ 33.)','%s (The year of the post, four digits, for example 2004.)'=>'%s (ಪೋಸ್ಟ್ನ ವರ್ಷ, ನಾಲ್ಕು ಅಂಕೆಗಳು, ಉದಾಹರಣೆಗೆ 2004.)','Theme Installation'=>'ಥೀಮ್ ಅನುಸ್ಥಾಪನ','%s is currently editing this post.'=>'%s ಪ್ರಸ್ತುತ ಈ ಪೋಸ್ಟ್ ಅನ್ನು ಸಂಪಾದಿಸುತ್ತಿದ್ದಾರೆ.','%s is currently editing this post. Do you want to take over?'=>'%s ಪ್ರಸ್ತುತ ಈ ಪೋಸ್ಟ್ ಅನ್ನು ಸಂಪಾದಿಸುತ್ತಿದ್ದಾರೆ.  ನೀವು ತೆಗೆದುಕೊಳ್ಳಲು ಬಯಸುವಿರಾ?','Plugin Installation'=>'ಪ್ಲಗಿನ್ ಅನುಸ್ಥಾಪನ','Custom installation script.'=>'ಕಸ್ಟಮ್ ಅನುಸ್ಥಾಪನಾ ಸ್ಕ್ರಿಪ್ಟ್.','Active Installations:'=>'ಸಕ್ರಿಯ ಅನುಸ್ಥಾಪನೆಗಳು:','<strong>Settings</strong> &mdash; This page shows a list of all settings associated with this site. Some are created by WordPress and others are created by plugins you activate. Note that some fields are grayed out and say Serialized Data. You cannot modify these values due to the way the setting is stored in the database.'=>'<strong>ಸೆಟ್ಟಿಂಗ್‌ಗಳು</strong> &mdash; ಈ ಪುಟವು ಈ ಸೈಟ್‌ಗೆ ಸಂಬಂಧಿಸಿದ ಎಲ್ಲಾ ಸೆಟ್ಟಿಂಗ್‌ಗಳ ಪಟ್ಟಿಯನ್ನು ತೋರಿಸುತ್ತದೆ. ಕೆಲವನ್ನು ವರ್ಡ್‌ಪ್ರೆಸ್‌ನಿಂದ ರಚಿಸಲಾಗಿದೆ ಮತ್ತು ಇತರವುಗಳನ್ನು ನೀವು ಸಕ್ರಿಯಗೊಳಿಸುವ ಪ್ಲಗಿನ್‌ಗಳಿಂದ ರಚಿಸಲಾಗಿದೆ. ಕೆಲವು ಕ್ಷೇತ್ರಗಳು ಬೂದುಬೀಳುತ್ತವೆ ಮತ್ತು ಸೀರಿಯಲ್ ಮಾಡಲಾದ ಡೇಟಾವನ್ನು ಹೇಳುತ್ತವೆ ಎಂಬುದನ್ನು ಗಮನಿಸಿ. ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಸೆಟ್ಟಿಂಗ್ ಅನ್ನು ಸಂಗ್ರಹಿಸುವ ವಿಧಾನದಿಂದಾಗಿ ನೀವು ಈ ಮೌಲ್ಯಗಳನ್ನು ಮಾರ್ಪಡಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','<strong>Themes</strong> &mdash; This area shows themes that are not already enabled across the network. Enabling a theme in this menu makes it accessible to this site. It does not activate the theme, but allows it to show in the site&#8217;s Appearance menu. To enable a theme for the entire network, see the <a href="%s">Network Themes</a> screen.'=>'<strong> ಥೀಮ್ಗಳು </strong> - ಈ ಪ್ರದೇಶವು ಈಗಾಗಲೇ ಜಾಲಬಂಧದಲ್ಲಿ ಸಕ್ರಿಯಗೊಳಿಸದ ಥೀಮ್ಗಳನ್ನು ತೋರಿಸುತ್ತದೆ. ಈ ಮೆನುವಿನಲ್ಲಿ ಒಂದು ಥೀಮ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸುವುದರಿಂದ ಈ ಸೈಟ್ಗೆ ಅದನ್ನು ಪ್ರವೇಶಿಸಬಹುದು. ಅದು ಥೀಮ್ ಅನ್ನು ಕ್ರಿಯಾತ್ಮಕಗೊಳಿಸುವುದಿಲ್ಲ, ಆದರೆ ಇದು ಸೈಟ್ ನ ಗೋಚರತೆ ಮೆನುವಿನಲ್ಲಿ ತೋರಿಸಲು ಅನುಮತಿಸುತ್ತದೆ. ಸಂಪೂರ್ಣ ನೆಟ್ವರ್ಕ್ಗಾಗಿ ಥೀಮ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು, <a href="%s"> ನೆಟ್ವರ್ಕ್ ಥೀಮ್ಗಳು </a> ಪರದೆಯನ್ನು ನೋಡಿ.','<strong>Users</strong> &mdash; This displays the users associated with this site. You can also change their role, reset their password, or remove them from the site. Removing the user from the site does not remove the user from the network.'=>'<strong> ಬಳಕೆದಾರರು </strong> & mdash; ಇದು ಈ ಸೈಟ್‌ಗೆ ಸಂಬಂಧಿಸಿದ ಬಳಕೆದಾರರನ್ನು ತೋರಿಸುತ್ತದೆ. ನೀವು ಅವರ ಪಾತ್ರವನ್ನು ಬದಲಾಯಿಸಬಹುದು, ಅವರ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಮರುಹೊಂದಿಸಬಹುದು ಅಥವಾ ಅವುಗಳನ್ನು ಸೈಟ್‌ನಿಂದ ತೆಗೆದುಹಾಕಬಹುದು. ಬಳಕೆದಾರರನ್ನು ಸೈಟ್‌ನಿಂದ ತೆಗೆದುಹಾಕುವುದರಿಂದ ಬಳಕೆದಾರರನ್ನು ನೆಟ್‌ವರ್ಕ್‌ನಿಂದ ತೆಗೆದುಹಾಕುವುದಿಲ್ಲ.','<strong>Info</strong> &mdash; The site URL is rarely edited as this can cause the site to not work properly. The Registered date and Last Updated date are displayed. Network admins can mark a site as archived, spam, deleted and mature, to remove from public listings or disable.'=>'<strong> ಮಾಹಿತಿ </strong> & - ; ಸೈಟ್ ಸರಿಯಾಗಿ ಕಾರ್ಯನಿರ್ವಹಿಸದಿರಲು ಕಾರಣವಾಗಬಹುದು ಎಂದು ಸೈಟ್ URL ಅನ್ನು ಅಪರೂಪವಾಗಿ ಸಂಪಾದಿಸಲಾಗಿದೆ. ನೋಂದಾಯಿತ ದಿನಾಂಕ ಮತ್ತು ಕೊನೆಯ ನವೀಕೃತ ದಿನಾಂಕ ಪ್ರದರ್ಶಿಸಲಾಗುತ್ತದೆ. ಸಾರ್ವಜನಿಕ ನಿರ್ವಾಹಕರು ಅಥವಾ ಅಶಕ್ತಗೊಳಿಸುವುದರಿಂದ ತೆಗೆದುಹಾಕಲು, ನೆಟ್ವರ್ಕ್ ನಿರ್ವಾಹಕರು ಆರ್ಕೈವ್ ಮಾಡಲಾದ, ಸ್ಪ್ಯಾಮ್, ಅಳಿಸಿದ ಮತ್ತು ಪ್ರಬುದ್ಧವಾಗಿ ಸೈಟ್ ಅನ್ನು ಗುರುತಿಸಬಹುದು.','Unable to write to file.'=>'ಫೈಲ್‌ಗೆ ಬರೆಯಲು ಸಾಧ್ಯವಾಗುತ್ತಿಲ್ಲ.','The menu is for editing information specific to individual sites, particularly if the admin area of a site is unavailable.'=>'ಪ್ರತ್ಯೇಕ ಸೈಟ್‌ಗಳಿಗೆ ನಿರ್ದಿಷ್ಟವಾದ ಮಾಹಿತಿಯನ್ನು ಸಂಪಾದಿಸಲು ಮೆನುಆಗಿದೆ,ನಿರ್ದಿಷ್ಟವಾಗಿ ಒಂದು ಸೈಟ್‌ನ ನಿರ್ವಾಹಕ ಪ್ರದೇಶವು ಲಭ್ಯವಿಲ್ಲದಿದ್ದರೆ.','Events and News dashboard widgethttps://wordpress.org/news/'=>'https://wordpress.org/news/','Your Recent Drafts'=>'ನಿಮ್ಮ ಇತ್ತೀಚಿನ ಕರಡುಗಳು','nameUnknown'=>'ಅಜ್ಞಾತ','View posts by %s'=>'%s ಮೂಲಕ ಪೋಸ್ಟ್ಗಳನ್ನು ವೀಕ್ಷಿಸಿ','%s Active Installations'=>'%s ಸಕ್ರಿಯ ಅನುಸ್ಥಾಪನೆಗಳು','No description'=>'ಯಾವುದೇ ವಿವರಣೆ ಇಲ್ಲ','Theme installation failed.'=>'ಥೀಮ್ ಸ್ಥಾಪನೆ ವಿಫಲವಾಗಿದೆ.','Plugin installation failed.'=>'ಪ್ಲಗಿನ್ ಸ್ಥಾಪನೆ ವಿಫಲವಾಗಿದೆ.','Activate Plugin &amp; Go to Press This'=>'ಪ್ಲಗಿನ್ ಸಕ್ರಿಯಗೊಳಿಸಿ ಮತ್ತು ಪ್ರೆಸ್ ದಿಸ್ ಗೆ ಹೋಗಿ','Your scheduled changes just published'=>'ನಿಮ್ಮ ನಿಗದಿತ ಬದಲಾವಣೆಗಳನ್ನು ಈಗಷ್ಟೇ ಪ್ರಕಟಿಸಲಾಗಿದೆ','Collapse Main menu'=>'ಮುಖ್ಯ ಮೆನು ಸಂಕುಚಿಸಿ','Allow link notifications from other blogs (pingbacks and trackbacks) on new posts'=>'ಹೊಸ ಪೋಸ್ಟ್‌ಗಳಲ್ಲಿ ಇತರ ಬ್ಲಾಗ್‌ಗಳಿಂದ (ಪಿಂಗ್‌ಬ್ಯಾಕ್‌ಗಳು ಮತ್ತು ಟ್ರ್ಯಾಕ್‌ಬ್ಯಾಕ್‌ಗಳು) ಲಿಂಕ್ ಅಧಿಸೂಚನೆಗಳನ್ನು ಅನುಮತಿಸಿ','pluginActivate %s'=>'%s ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿ','pluginNetwork Activate %s'=>'ನೆಟ್ವರ್ಕ್ ಸಕ್ರಿಯಗೊಳಿಸಿ %s','Run %s'=>'ಓಡಿಸು %s','No media files found.'=>'ಯಾವುದೇ ಮಾಧ್ಯಮ ಕಡತಗಳು ಕಂಡುಬಂದಿಲ್ಲ.','Run Importer'=>'ಆಮದುದಾರವನ್ನು ಚಲಾಯಿಸಿ','comment statusOpen'=>'ತೆರೆಯಿರಿ','Image Rotation'=>'ಚಿತ್ರ ತಿರುಗುವಿಕೆ','Edit User %s'=>'ಬಳಕೆದಾರ %s ಅನ್ನು ಸಂಪಾದಿಸಿ','Edit widget: %s'=>'ವಿಜೆಟ್ ಸಂಪಾದಿಸಿ: %s','https://make.wordpress.org/community/handbook/meetup-organizer/welcome/'=>'https://make.wordpress.org/community/handbook/meetup-organizer/welcome/','Cincinnati'=>'ಸಿನ್ಸಿನಾಟಿ','Meetups'=>'ಮೀಟ್ಅಪ್ಗಳು','Unknown API error.'=>'ಅಜ್ಞಾತ API ದೋಷ.','An error occurred. Please try again.'=>'ಒಂದು ದೋಷ ಸಂಭವಿಸಿದೆ. ದಯವಿಟ್ಟು ಪುನಃ ಪ್ರಯತ್ನಿಸಿ.','City:'=>'ನಗರ:','WordCamps'=>'ವರ್ಡ್‌ಕ್ಯಾಂಪ್‌ಗಳು','WordPress Events and News'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಕಾರ್ಯಕ್ರಮಗಳು ಮತ್ತು ಸುದ್ದಿ','l, M j, Y'=>'l, M j, Y','Invalid API response code (%d).'=>'ಅಮಾನ್ಯವಾದ API ಪ್ರತಿಕ್ರಿಯೆ ಕೋಡ್ (%d).','Attend an upcoming event near %s.'=>'%s ಬಳಿ ಮುಂಬರುವ ಈವೆಂಟ್‌ಗೆ ಹಾಜರಾಗಿ.','Sorry, you are not allowed to delete users.'=>'ಕ್ಷಮಿಸಿ, ಬಳಕೆದಾರರನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to create users.'=>'ಕ್ಷಮಿಸಿ, ನಿಮಗೆ ಬಳಕೆದಾರರನ್ನು ರಚಿಸಲು ಅನುಮತಿ ಇಲ್ಲ.','short (~12 characters) label for hide controls buttonHide Controls'=>'ನಿಯಂತ್ರಣಗಳನ್ನು ಮರೆಮಾಡಿ','Expand Sidebar'=>'ಪಾರ್ಶ್ವಪಟ್ಟಿ ವಿಸ್ತರಿಸಿ','Display location'=>'ಸ್ಥಳವನ್ನು ಪ್ರದರ್ಶಿಸಿ','ID #%1$s: %2$s <strong>Sorry, you are not allowed to remove this user.</strong>'=>'ID #%1$s: %2$s <strong>ಕ್ಷಮಿಸಿ, ಈ ಬಳಕೆದಾರನನ್ನು ತೆಗೆದುಹಾಕಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.</strong>','You can select the language you wish to use while using the WordPress administration screen without affecting the language site visitors see.'=>'ಸಂದರ್ಶಕರು ನೋಡುವ ಭಾಷೆಯ ಮೇಲೆ ಪರಿಣಾಮ ಬೀರದಂತೆ ವರ್ಡ್ಪ್ರೆಸ್ ಆಡಳಿತ ಪರದೆಯನ್ನು ಬಳಸುವಾಗ ನೀವು ಬಳಸಲು ಬಯಸುವ ಭಾಷೆಯನ್ನು ನೀವು ಆಯ್ಕೆ ಮಾಡಬಹುದು.','Edit Filters'=>'ಫಿಲ್ಟರ್‌ಗಳನ್ನು ಸಂಪಾದಿಸಿ','Clear current filters'=>'ಪ್ರಸ್ತುತ ಫಿಲ್ಟರ್‌ಗಳನ್ನು ತೆರವುಗೊಳಿಸಿ','Select one or more Theme features to filter by'=>'ಫಿಲ್ಟರ್ ಮಾಡಲು ಒಂದು ಅಥವಾ ಹೆಚ್ಚಿನ ಥೀಮ್ ವೈಶಿಷ್ಟ್ಯಗಳನ್ನು ಆಯ್ಕೆಮಾಡಿ','Current Background Image'=>'ಪ್ರಸ್ತುತ ಹಿನ್ನೆಲೆ ಚಿತ್ರ','Current Header Image'=>'ಪ್ರಸ್ತುತ ಶಿರೋಲೇಖ ಚಿತ್ರ','Set status'=>'ಸ್ಥಿತಿಯನ್ನು ಹೊಂದಿಸಿ','&#8220;%s&#8221; is locked'=>'&#8220;%s&#8221; ಅನ್ನು ಲಾಕ್ ಮಾಡಲಾಗಿದೆ','(%s ratings)'=>'(%s ರೇಟಿಂಗ್ಗಳು)','Sorry, you are not allowed to attach files to this post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಪೋಸ್ಟ್ಗೆ ಫೈಲ್ಗಳನ್ನು ಲಗತ್ತಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Active plugin installationsLess Than 10'=>'೧೦ ಕ್ಕಿಂತ ಕಡಿಮೆ','https://wordpress.org/plugins/'=>'https://wordpress.org/plugins/','Customize New Changes'=>'ಹೊಸ ಬದಲಾವಣೆಗಳನ್ನು ಕಸ್ಟಮೈಸ್ ಮಾಡಿ','Background ScrollScroll'=>'ಸ್ಕ್ರಾಲ್','Background RepeatRepeat'=>'ಪುನರಾವರ್ತಿಸಿ','<a href="https://wordpress.org/support/forums">Support</a>'=>'<a href="https://wordpress.org/support/forums">ಬೆಂಬಲ</a>','You can find new plugins to install by searching or browsing the directory right here in your own Plugins section.'=>'ನಿಮ್ಮ ಸ್ವಂತ ಪ್ಲಗಿನ್‌ಗಳ ವಿಭಾಗದಲ್ಲಿ ಇಲ್ಲಿಯೇ ಡೈರೆಕ್ಟರಿಯನ್ನು ಹುಡುಕುವ ಅಥವಾ ಬ್ರೌಸ್ ಮಾಡುವ ಮೂಲಕ ನೀವು ಸ್ಥಾಪಿಸಲು ಹೊಸ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಕಾಣಬಹುದು.','Plugins hook into WordPress to extend its functionality with custom features. Plugins are developed independently from the core WordPress application by thousands of developers all over the world. All plugins in the official <a href="%s">WordPress Plugin Directory</a> are compatible with the license WordPress uses.'=>'ಕಸ್ಟಮ್ ವೈಶಿಷ್ಟ್ಯಗಳೊಂದಿಗೆ ಅದರ ಕಾರ್ಯವನ್ನು ವಿಸ್ತರಿಸಲು ಪ್ಲಗಿನ್‌ಗಳು ವರ್ಡ್ಪ್ರೆಸ್‌ಗೆ ಸೇರಿಕೊಳ್ಳುತ್ತವೆ. ಪ್ರಪಂಚದಾದ್ಯಂತದ ಸಾವಿರಾರು ಡೆವಲಪರ್‌ಗಳಿಂದ ಪ್ಲಗ್‌ಇನ್‌ಗಳನ್ನು ಕೋರ್ ವರ್ಡ್‌ಪ್ರೆಸ್ ಅಪ್ಲಿಕೇಶನ್‌ನಿಂದ ಸ್ವತಂತ್ರವಾಗಿ ಅಭಿವೃದ್ಧಿಪಡಿಸಲಾಗಿದೆ. ಅಧಿಕೃತ <a href="%s"> ವರ್ಡ್ಪ್ರೆಸ್ ಪ್ಲಗಿನ್ ಡೈರೆಕ್ಟರಿಯಲ್ಲಿ </a> ಎಲ್ಲಾ ಪ್ಲಗ್‌ಇನ್‌ಗಳು ವರ್ಡ್‌ಪ್ರೆಸ್ ಬಳಸುವ ಪರವಾನಗಿಗೆ ಹೊಂದಿಕೊಳ್ಳುತ್ತವೆ.','Search plugins by:'=>'ಇದರಿಂದ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಹುಡುಕಿ:','Import posts, pages, comments, custom fields, categories, and tags from a WordPress export file.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ರಫ್ತು ಫೈಲ್‌ನಿಂದ ಪೋಸ್ಟ್‌ಗಳು, ಪುಟಗಳು, ಕಾಮೆಂಟ್‌ಗಳು, ಕಸ್ಟಮ್ ಕ್ಷೇತ್ರಗಳು, ವರ್ಗಗಳು ಮತ್ತು ಟ್ಯಾಗ್‌ಗಳನ್ನು ಆಮದು ಮಾಡಿ.','Import posts &amp; media from Tumblr using their API.'=>'ಅವರ API ಬಳಸಿಕೊಂಡು Tumblr ನಿಂದ ಪೋಸ್ಟ್‌ಗಳು ಮತ್ತು ಮಾಧ್ಯಮವನ್ನು ಆಮದು ಮಾಡಿ.','Import posts from an RSS feed.'=>'RSS ಫೀಡ್‌ನಿಂದ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಆಮದು ಮಾಡಿ.','Import posts and comments from a Movable Type or TypePad blog.'=>'ಮೂವಬಲ್ ಟೈಪ್ ಅಥವಾ ಟೈಪ್‌ಪ್ಯಾಡ್ ಬ್ಲಾಗ್‌ನಿಂದ ಪೋಸ್ಟ್‌ಗಳು ಮತ್ತು ಕಾಮೆಂಟ್‌ಗಳನ್ನು ಆಮದು ಮಾಡಿ.','Import posts from LiveJournal using their API.'=>'ಅವರ API ಬಳಸಿಕೊಂಡು LiveJournal ನಿಂದ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಆಮದು ಮಾಡಿ.','Convert existing categories to tags or tags to categories, selectively.'=>'ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ವರ್ಗಗಳನ್ನು ಟ್ಯಾಗ್‌ಗಳಾಗಿ ಅಥವಾ ಟ್ಯಾಗ್‌ಗಳನ್ನು ವರ್ಗಗಳಾಗಿ, ಆಯ್ದವಾಗಿ ಪರಿವರ್ತಿಸಿ.','Import posts, comments, and users from a Blogger blog.'=>'ಬ್ಲಾಗರ್ ಬ್ಲಾಗ್‌ನಿಂದ ಪೋಸ್ಟ್‌ಗಳು, ಕಾಮೆಂಟ್‌ಗಳು ಮತ್ತು ಬಳಕೆದಾರರನ್ನು ಆಮದು ಮಾಡಿ.','pluginDelete %s'=>'%s ಅನ್ನು ಅಳಿಸು','pluginDeactivate %s'=>'%s ನಿಷ್ಕ್ರಿಯಗೊಳಿಸು','pluginNetwork Deactivate %s'=>'%s ನೆಟ್ವರ್ಕ್ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸು','New users are automatically assigned a password, which they can change after logging in. You can view or edit the assigned password by clicking the Show Password button. The username cannot be changed once the user has been added.'=>'ಹೊಸ ಬಳಕೆದಾರರಿಗೆ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಪಾಸ್‌ವರ್ಡ್ ನೀಡಲಾಗುತ್ತದೆ,ಅದನ್ನು ಲಾಗ್ ಇನ್ ಮಾಡಿದ ನಂತರ ಬದಲಾಯಿಸಬಹುದು. ನೀವು ಪಾಸ್‌ವರ್ಡ್ ತೋರಿಸು ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡುವ ಮೂಲಕ ನಿಯೋಜಿಸಲಾದ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ವೀಕ್ಷಿಸಬಹುದು ಅಥವಾ ಎಡಿಟ್ ಮಾಡಬಹುದು.  ಬಳಕೆದಾರರನ್ನು ಸೇರಿಸಿದ ನಂತರ ಬಳಕೆದಾರ ಹೆಸರನ್ನು ಬದಲಾಯಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','plugin%s was successfully deleted.'=>'%s ಅನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಅಳಿಸಲಾಗಿದೆ.','The search for installed plugins will search for terms in their name, description, or author.'=>'ಸ್ಥಾಪಿಸಲಾದ ಪ್ಲಗ್ಇನ್ಗಳ ಹುಡುಕಾಟವು ಅವರ ಹೆಸರು, ವಿವರಣೆ, ಅಥವಾ ಲೇಖಕರಲ್ಲಿ ಪದಗಳಿಗಾಗಿ ಹುಡುಕುತ್ತದೆ.','Custom Logo'=>'ಕಸ್ಟಮ್ ಲೋಗೋ','Sorry, you are not allowed to remove users.'=>'ಕ್ಷಮಿಸಿ, ಬಳಕೆದಾರರನ್ನು ತೆಗೆದುಹಾಕಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to add users to this network.'=>'ಕ್ಷಮಿಸಿ, ಈ ನೆಟ್ವರ್ಕ್ಗೆ ಬಳಕೆದಾರರನ್ನು ಸೇರಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to edit this changeset.'=>'ಕ್ಷಮಿಸಿ, ಈ ಬದಲಾವಣೆಗಳನ್ನು ಸಂಪಾದಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to update themes for this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್ಗಾಗಿ ಥೀಮ್ಗಳನ್ನು ನವೀಕರಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to update this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್ ಅನ್ನು ನವೀಕರಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','New version available. <button class="button-link" type="button">Update now</button>'=>'ಹೊಸ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ. <button class="button-link" type="button">ಈಗ ನವೀಕರಿಸಿ</button>','The Theme Installer screen requires JavaScript.'=>'ಥೀಮ್ ಸ್ಥಾಪಕ ಪರದೆಗೆ JavaScript ಅಗತ್ಯವಿದೆ.','Sorry, you are not allowed to edit templates for this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್ಗಾಗಿ ಟೆಂಪ್ಲೆಟ್ಗಳನ್ನು ಸಂಪಾದಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to deactivate plugins for this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್ಗಾಗಿ ಪ್ಲಗಿನ್ಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to activate plugins for this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್ಗಾಗಿ ಪ್ಲಗಿನ್ಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to edit plugins for this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್ಗಾಗಿ ಪ್ಲಗಿನ್ಗಳನ್ನು ಸಂಪಾದಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to modify unregistered settings for this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್ಗಾಗಿ ನೋಂದಾಯಿಸದ ಸೆಟ್ಟಿಂಗ್ಗಳನ್ನು ಮಾರ್ಪಡಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to manage options for this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್ಗಾಗಿ ಆಯ್ಕೆಗಳನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to delete this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್ ಅನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Manage with Live Preview'=>'ಲೈವ್ ಪೂರ್ವವೀಕ್ಷಣೆಯೊಂದಿಗೆ ನಿರ್ವಹಿಸಿ','Sorry, you are not allowed to add links to this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್ಗೆ ಲಿಂಕ್ಗಳನ್ನು ಸೇರಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','theme%s was successfully deleted.'=>'%s ಅನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಅಳಿಸಲಾಗಿದೆ.','Please update WordPress now'=>'ದಯವಿಟ್ಟು ಈಗ ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ನವೀಕರಿಸಿ','Photography'=>'ಛಾಯಾಗ್ರಹಣ','News'=>'ಸುದ್ದಿ','Entertainment'=>'ಮನರಂಜನೆ','Education'=>'ಶಿಕ್ಷಣ','E-Commerce'=>'ಇ-ಕಾಮರ್ಸ್','Blog'=>'ಬ್ಲಾಗ್‌','Grid Layout'=>'ಗ್ರಿಡ್ ವಿನ್ಯಾಸ',