date plugins for this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ಗಾಗಿ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನವೀಕರಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Theme could not be deleted.'=>'ಥೀಮ್ ಅನ್ನು ಅಳಿಸಲಾಗಲಿಲ್ಲ.','Sorry, you are not allowed to install themes on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್ನಲ್ಲಿ ಥೀಮ್ಗಳನ್ನು ಸ್ಥಾಪಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','No theme specified.'=>'ಯಾವುದೇ ಥೀಮ್ ನಿರ್ದಿಷ್ಟಪಡಿಸಲಾಗಿಲ್ಲ.','Sorry, you are not allowed to import content into this site.'=>'ಕ್ಷಮಿಸಿ, ನಿಮಗೆ ಈ ತಾಣದ ಮಾಹಿತಿಯನ್ನು ರಫ್ತು ಮಾಡುಲು ಅ‌ನುಮತಿಯಿಲ್ಲ.','Sorry, you are not allowed to delete themes on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನಲ್ಲಿ ಥೀಮ್‌ಗಳನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to export the content of this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನ ವಿಷಯವನ್ನು ರಫ್ತು ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','You can filter the list of posts by post status using the text links above the posts list to only show posts with that status. The default view is to show all posts.'=>'ಪೋಸ್ಟ್‌ಗಳ ಪಟ್ಟಿಯ ಮೇಲಿನ ಪಠ್ಯ ಲಿಂಕ್‌ಗಳನ್ನು ಬಳಸಿಕೊಂಡು ನೀವು ಪೋಸ್ಟ್‌ಗಳ ಸ್ಥಿತಿಯನ್ನು ಪೋಸ್ಟ್‌ಗಳ ಪಟ್ಟಿಯನ್ನು ಫಿಲ್ಟರ್ ಮಾಡಬಹುದು.ಎಲ್ಲಾ ಪೋಸ್ಟ್‌ಗಳನ್ನು ತೋರಿಸುವುದು ಡೀಫಾಲ್ಟ್ ವೀಕ್ಷಣೆಯಾಗಿದೆ.','Close the Customizer and go back to the previous page'=>'ಕಸ್ಟೊಮೈಜರ್ ಅನ್ನು ಮುಚ್ಚಿ ಮತ್ತು ಹಿಂದಿನ ಪುಟಕ್ಕೆ ಹಿಂತಿರುಗಿ','Sorry, you are not allowed to customize headers.'=>'ಕ್ಷಮಿಸಿ, ಹೆಡರ್‌ಗಳನ್ನು ಕಸ್ಟಮೈಸ್ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Release Design Lead'=>'ಬಿಡುಗಡೆ ವಿನ್ಯಾಸ ಲೀಡ್','Release Deputy'=>'ಬಿಡುಗಡೆ ಉಪನಾಯಕ','Custom fields can be used to add extra metadata to a post that you can <a href="%s">use in your theme</a>.'=>'ನೀವು <a href="%s"> ನಿಮ್ಮ ಥೀಮ್‌ನಲ್ಲಿ </a> ಬಳಸಬಹುದಾದ ಪೋಸ್ಟ್‌ಗೆ ಹೆಚ್ಚುವರಿ ಮೆಟಾಡೇಟಾವನ್ನು ಸೇರಿಸಲು ಕಸ್ಟಮ್ ಕ್ಷೇತ್ರಗಳನ್ನು ಬಳಸಬಹುದು.','Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. If you link other WordPress sites, they&#8217;ll be notified automatically using <a href="%s">pingbacks</a>, no other action necessary.'=>'ಟ್ರ್ಯಾಕ್‌ಬ್ಯಾಕ್‌ಗಳು ನೀವು ಅವರಿಗೆ ಲಿಂಕ್ ಮಾಡಿರುವ ಪರಂಪರೆಯ ಬ್ಲಾಗ್ ವ್ಯವಸ್ಥೆಗಳನ್ನು ಸೂಚಿಸುವ ಒಂದು ಮಾರ್ಗವಾಗಿದೆ. ನೀವು ಇತರ ವರ್ಡ್ಪ್ರೆಸ್ ಸೈಟ್‌ಗಳನ್ನು ಲಿಂಕ್ ಮಾಡಿದರೆ, ಅವರಿಗೆ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಸೂಚಿಸಲಾಗುತ್ತದೆ <a href="%s"> pingbacks </a>, ಬೇರೆ ಯಾವುದೇ ಕ್ರಮ ಅಗತ್ಯವಿಲ್ಲ.','Excerpts are optional hand-crafted summaries of your content that can be used in your theme. <a href="%s">Learn more about manual excerpts</a>.'=>'ಆಯ್ದ ಭಾಗಗಳು ನಿಮ್ಮ ಥೀಮ್‌ನಲ್ಲಿ ಬಳಸಬಹುದಾದ ನಿಮ್ಮ ವಿಷಯದ ಐಚ್ಛಿಕ ಕೈಯಿಂದ ರಚಿಸಲಾದ ಸಾರಾಂಶಗಳಾಗಿವೆ. <a href="%s">ಹಸ್ತಚಾಲಿತ ಆಯ್ದ ಭಾಗಗಳ ಬಗ್ಗೆ ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ</a>.','The Text mode allows you to enter HTML along with your post text. Note that &lt;p&gt; and &lt;br&gt; tags are converted to line breaks when switching to the Text editor to make it less cluttered. When you type, a single line break can be used instead of typing &lt;br&gt;, and two line breaks instead of paragraph tags. The line breaks are converted back to tags automatically.'=>'ನಿಮ್ಮ ಪಠ್ಯದ ಜೊತೆಗೆ HTML ಅನ್ನು ನಮೂದಿಸಲು ಪಠ್ಯ ಕ್ರಮವು ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ.  ಕಡಿಮೆ ಸಂಪಾದನೆ ಮಾಡಲು ಪಠ್ಯ ಸಂಪಾದಕಕ್ಕೆ ಬದಲಾಯಿಸುವಾಗ ಮತ್ತು ಟ್ಯಾಗ್‌ಗಳನ್ನು ಲೈನ್ ಬ್ರೇಕ್‌ಗಳಾಗಿ ಪರಿವರ್ತಿಸಲಾಗುತ್ತದೆ ಎಂಬುದನ್ನು ಗಮನಿಸಿ.  ನೀವು ಟೈಪ್ ಮಾಡುವಾಗ, ಟೈಪ್ ಮಾಡುವ ಬದಲು ಒಂದೇ ಸಾಲಿನ ಬ್ರೇಕ್ ಅನ್ನು ಬಳಸಬಹುದು, ಮತ್ತು ಪ್ಯಾರಾಗ್ರಾಫ್ ಟ್ಯಾಗ್‌ಗಳ ಬದಲಿಗೆ ಎರಡು ಲೈನ್ ಬ್ರೇಕ್‌ಗಳನ್ನು ಬಳಸಬಹುದು.  ಲೈನ್ ಬ್ರೇಕ್‌ಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಟ್ಯಾಗ್‌ಗಳಾಗಿ ಪರಿವರ್ತಿಸಲಾಗುತ್ತದೆ..','Visual mode gives you an editor that is similar to a word processor. Click the Toolbar Toggle button to get a second row of controls.'=>'ವಿಷುಯಲ್ ಮೋಡ್ ನಿಮಗೆ ವರ್ಡ್ ಪ್ರೊಸೆಸರ್ ನಂತೆಯೇ ಇರುವ ಎಡಿಟರ್ ಅನ್ನು ನೀಡುತ್ತದೆ.  ಎರಡನೇ ಸಾಲಿನ ನಿಯಂತ್ರಣಗಳನ್ನು ಪಡೆಯಲು ಟೂಲ್‌ಬಾರ್ ಟಾಗಲ್ ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಿ.','Error saving media file.'=>'ಮಾಧ್ಯಮ ಫೈಲ್ ಉಳಿಸುವಲ್ಲಿ ದೋಷ.','%s media file restored from the Trash.'=>'ಅನುಪಯುಕ್ತದಿಂದ %s ಮೀಡಿಯಾ ಫೈಲ್ ಅನ್ನು ಮರುಸ್ಥಾಪಿಸಲಾಗಿದೆ.' . "\0" . 'ಅನುಪಯುಕ್ತದಿಂದ %s ಮೀಡಿಯಾ ಫೈಲ್‌ಗಳನ್ನು ಮರುಸ್ಥಾಪಿಸಲಾಗಿದೆ.','%s media file moved to the Trash.'=>'%s ಮೀಡಿಯಾ ಫೈಲ್ ಅನ್ನು ಅನುಪಯುಕ್ತಕ್ಕೆ ಸರಿಸಲಾಗಿದೆ.' . "\0" . '%s ಮಾಧ್ಯಮ ಫೈಲ್‌ಗಳನ್ನು ಅನುಪಯುಕ್ತಕ್ಕೆ ಸರಿಸಲಾಗಿದೆ.','Media file attached.'=>'ಮಾಧ್ಯಮ ಕಡತ ಲಗತ್ತಿಸಲಾಗಿದೆ.','%s media file attached.'=>'%s ಮಾಧ್ಯಮ ಕಡತ ಲಗತ್ತಿಸಲಾಗಿದೆ.' . "\0" . '%s ಮಾಧ್ಯಮ ಕಡತಗಳನ್ನು ಲಗತ್ತಿಸಲಾಗಿದೆ.','%s media file permanently deleted.'=>'%s ಮಾಧ್ಯಮ ಕಡತ ಶಾಶ್ವತವಾಗಿ ಅಳಿಸಲಾಗಿದೆ.' . "\0" . '%s ಮಾಧ್ಯಮ ಕಡತಗಳನ್ನು ಶಾಶ್ವತವಾಗಿ ಅಳಿಸಲಾಗಿದೆ.','%s media file detached.'=>'%s ಮಾಧ್ಯಮ ಕಡತ ಬೇರ್ಪಡಿಸಲಾಗಿದೆ.' . "\0" . '%s ಮಾಧ್ಯಮ ಕಡತಗಳನ್ನು ಬೇರ್ಪಡಿಸಲಾಗಿದೆ.','Media file detached.'=>'ಮಾಧ್ಯಮ ಕಡತ ಬೇರ್ಪಡಿಸಲಾಗಿದೆ.','Media file updated.'=>'ಮಾಧ್ಯಮ ಕಡತವನ್ನು ಪರಿಷ್ಕರಿಸಲಾಗಿದೆ.','View %1$s version %2$s details'=>'ನೋಟ %1$s ಆವೃತ್ತಿ %2$s ವಿವರಗಳು','dashboard%1$s, %2$s'=>'%1$s, %2$s','<strong>Publish</strong> &mdash; You can set the terms of publishing your post in the Publish box. For Status, Visibility, and Publish (immediately), click on the Edit link to reveal more options. Visibility includes options for password-protecting a post or making it stay at the top of your blog indefinitely (sticky). The Password protected option allows you to set an arbitrary password for each post. The Private option hides the post from everyone except editors and administrators. Publish (immediately) allows you to set a future or past date and time, so you can schedule a post to be published in the future or backdate a post.'=>'<strong> ಪ್ರಕಟಿಸಿ </strong>- ನಿಮ್ಮ ಪೋಸ್ಟ್ ಅನ್ನು ಪ್ರಕಟಿಸುವ ನಿಯಮಗಳನ್ನು ನೀವು ಪ್ರಕಟಣೆ ಪೆಟ್ಟಿಗೆಯಲ್ಲಿ ಹೊಂದಿಸಬಹುದು. ಸ್ಥಿತಿ, ಗೋಚರತೆ ಮತ್ತು ಪ್ರಕಟಣೆಗಾಗಿ (ತಕ್ಷಣ), ಹೆಚ್ಚಿನ ಆಯ್ಕೆಗಳನ್ನು ಬಹಿರಂಗಪಡಿಸಲು ಎಡಿಟ್ ಲಿಂಕ್ ಮೇಲೆ ಕ್ಲಿಕ್ ಮಾಡಿ. ಗೋಚರತೆಯು ಪೋಸ್ಟ್ ಅನ್ನು ಪಾಸ್ವರ್ಡ್-ರಕ್ಷಿಸುವ ಅಥವಾ ನಿಮ್ಮ ಬ್ಲಾಗ್‌ನ ಮೇಲ್ಭಾಗದಲ್ಲಿ ಅನಿರ್ದಿಷ್ಟವಾಗಿ ಉಳಿಯುವಂತೆ ಮಾಡುವ ಆಯ್ಕೆಗಳನ್ನು ಒಳಗೊಂಡಿದೆ. ಪಾಸ್‌ವರ್ಡ್ ಸಂರಕ್ಷಿತ ಆಯ್ಕೆಯು ಪ್ರತಿ ಪೋಸ್ಟ್‌ಗೆ ಅನಿಯಂತ್ರಿತ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಹೊಂದಿಸಲು ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ. ಸಂಪಾದಕರು ಮತ್ತು ನಿರ್ವಾಹಕರನ್ನು ಹೊರತುಪಡಿಸಿ ಎಲ್ಲರಿಗೂ ಖಾಸಗಿ ಆಯ್ಕೆಯು ಪೋಸ್ಟ್ ಅನ್ನು ಮರೆಮಾಡುತ್ತದೆ. ಪ್ರಕಟಿಸಿ (ತಕ್ಷಣ) ಭವಿಷ್ಯ ಅಥವಾ ಹಿಂದಿನ ದಿನಾಂಕ ಮತ್ತು ಸಮಯವನ್ನು ಹೊಂದಿಸಲು ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ, ಆದ್ದರಿಂದ ನೀವು ಭವಿಷ್ಯದಲ್ಲಿ ಪ್ರಕಟಿಸಲು ಪೋಸ್ಟ್ ಅನ್ನು ನಿಗದಿಪಡಿಸಬಹುದು ಅಥವಾ ಪೋಸ್ಟ್ ಅನ್ನು ಬ್ಯಾಕ್‌ಡೇಟ್ ಮಾಡಬಹುದು.','Error while saving the new email address. Please try again.'=>'ಹೊಸ ಇಮೇಲ್ ವಿಳಾಸವನ್ನು ಉಳಿಸುವಾಗ ದೋಷ. ದಯವಿಟ್ಟು ಪುನಃ ಪ್ರಯತ್ನಿಸಿ.','There is a pending change of your email to %s.'=>'ನಿಮ್ಮ ಇಮೇಲ್ %s ಗೆ ಬಾಕಿ ಇರುವ ಬದಲಾವಣೆ ಇದೆ.','You can narrow the list by file type/status or by date using the dropdown menus above the media table.'=>'ಮಾಧ್ಯಮದ ಟೇಬಲ್ ಮೇಲಿರುವ ಡ್ರಾಪ್‌ಡೌನ್ ಮೆನುಗಳನ್ನು ಬಳಸಿಕೊಂಡು ನೀವು ಫೈಲ್ ಪ್ರಕಾರ/ಸ್ಥಿತಿ ಅಥವಾ ದಿನಾಂಕದ ಮೂಲಕ ಪಟ್ಟಿಯನ್ನು ಸಂಕುಚಿತಗೊಳಿಸಬಹುದು.','New theme activated.'=>'‍ಹೊಸ ಥೀಮ್ ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','The following themes are installed but incomplete.'=>'ಕೆಳಗಿನ ಥೀಮ್‌ಗಳನ್ನು ಸ್ಥಾಪಿಸಲಾಗಿದೆ ಆದರೆ ಅಪೂರ್ಣವಾಗಿದೆ.','Settings saved and theme activated.'=>'ಸೆಟ್ಟಿಂಗ್‌ಗಳನ್ನು ಉಳಿಸಲಾಗಿದೆ ಮತ್ತು ಥೀಮ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ.','https://wordpress.org/themes/'=>'https://wordpress.org/themes/','Sorry, you are not allowed to delete that user.'=>'ಕ್ಷಮಿಸಿ, ಆ ಬಳಕೆದಾರನನ್ನು ಅಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Your database password.'=>'ನಿಮ್ಮ ಡೇಟಾಬೇಸ್ ಪಾಸ್ವರ್ಡ್.','Your database username.'=>'ನಿಮ್ಮ ಡೇಟಾಬೇಸ್ ಬಳಕೆದಾರಹೆಸರು.','The name of the database you want to use with WordPress.'=>'ನೀವು ವರ್ಡ್ಪ್ರೆಸ್‌ನೊಂದಿಗೆ ಬಳಸಲು ಬಯಸುವ ಡೇಟಾಬೇಸ್‌ನ ಹೆಸರು.','plugin%1$s by %2$s'=>'%2$s ರಿಂದ %1$s ','%1$s by %2$s (will also <strong>delete its data</strong>)'=>'%1$s %2$s ರ ಮೂಲಕ (ಅದರ <strong>ಡೇಟಾವನ್ನು ಅಳಿಸುತ್ತದೆ </strong>)','There is a pending change of the admin email to %s.'=>'ನಿರ್ವಾಹಕ ಇಮೇಲ್ %s ಗೆ ಬಾಕಿ ಇರುವ ಬದಲಾವಣೆ ಇದೆ.','WordPress has been installed. Thank you, and enjoy!'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಸ್ಥಾಪನೆ ಮಾಡಲಾಗಿದೆ. ಧನ್ಯವಾದಗಳು, ಮತ್ತು ಆನಂದಿಸಿ!','Dismiss the welcome panel'=>'ಸ್ವಾಗತ ಫಲಕ ವಜಾಗೊಳಿಸಿ','The constant %s cannot be defined when installing WordPress.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ಸ್ಥಾಪಿಸುವಾಗ ಸ್ಥಿರವಾದ %s ಅನ್ನು ವ್ಯಾಖ್ಯಾನಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Your %s file has an empty database table prefix, which is not supported.'=>'ನಿಮ್ಮ %s ಫೈಲ್ ಖಾಲಿ ಡೇಟಾಬೇಸ್ ಟೇಬಲ್ ಪೂರ್ವಪ್ರತ್ಯಯವನ್ನು ಹೊಂದಿದೆ, ಅದನ್ನು ಬೆಂಬಲಿಸುವುದಿಲ್ಲ.','Reviews'=>'‍ವಿಮರ್ಶೆಗಳು‍','Read all reviews on WordPress.org or write your own!'=>'‍WordPress.org ಎಲ್ಲಾ ವಿಮರ್ಶೆಗಳನ್ನು ಓದಿ ಅಥವಾ ನಿಮ್ಮ ಸ್ವಂತದ್ದನ್ನು ಬರೆಯಿರಿ!','Theme zip file'=>'ಥೀಮ್ ಜಿಪ್ ಫೈಲ್','Click the image to edit or update'=>'ಸಂಪಾದಿಸಲು ಅಥವಾ ನವೀಕರಿಸಲು ಚಿತ್ರದ ಮೇಲೆ ಕ್ಲಿಕ್ ಮಾಡಿ','Attach to existing content'=>'ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ವಿಷಯಕ್ಕೆ ಲಗತ್ತಿಸಿ.','You are using a development version of WordPress. These feature plugins are also under development. <a href="%s">Learn more</a>.'=>'ನೀವು ವರ್ಡ್ಪ್ರೆಸ್ನ ಅಭಿವೃದ್ಧಿ ಆವೃತ್ತಿಯನ್ನು ಬಳಸುತ್ತಿರುವಿರಿ. ಈ ವೈಶಿಷ್ಟ್ಯದ ಪ್ಲಗ್ಇನ್ಗಳೂ ಅಭಿವೃದ್ಧಿಯ ಹಂತದಲ್ಲಿವೆ. <a href="%s"> ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ</a>.','Reviews with %1$d star: %2$s. Opens in a new tab.'=>'%1$d ನಕ್ಷತ್ರಗಳೊಂದಿಗೆ ವಿಮರ್ಶೆಗಳು: %2$s. ಹೊಸ ಟ್ಯಾಬ್‌ನಲ್ಲಿ ತೆರೆಯುತ್ತದೆ.' . "\0" . '%1$d ನಕ್ಷತ್ರದೊಂದಿಗೆ ವಿಮರ್ಶೆಗಳು: %2$s . ಹೊಸ ವಿಂಡೋದಲ್ಲಿ ತೆರೆಯುತ್ತದೆ.','selection height'=>'ಆಯ್ಕೆ ಎತ್ತರ','selection width'=>'ಆಯ್ಕೆ ಅಗಲ','Image Crop Help'=>'ಚಿತ್ರ ಕ್ರಾಪ್ ಸಹಾಯ','scale height'=>'ಪ್ರಮಾಣದ ಎತ್ತರ','New dimensions:'=>'ಹೊಸ ಆಯಾಮಗಳು:','Thumbnail Settings Help'=>'ಥಂಬ್‌ನೇಲ್ ಸೆಟ್ಟಿಂಗ್‌ಗಳ ಸಹಾಯ','crop ratio height'=>'ಕ್ರಾಪ್ ಅನುಪಾತ ಎತ್ತರ','crop ratio width'=>'ಕ್ರಾಪ್ ಅನುಪಾತ ಅಗಲ','Scale Image Help'=>'ಚಿತ್ರ ಅಳತೆ ಸಹಾಯ','Single Page'=>'ಒಂಟಿ ಪುಟ','Singular Template'=>'ಸಿಂಗ್ಯುಲರ್ ಟೆಂಪ್ಲೇಟು','Date Template'=>'ದಿನಾಂಕ ಟೆಂಪ್ಲೇಟು','Dismiss the browser warning panel'=>'ಬ್ರೌಸರ್ ಎಚ್ಚರಿಕೆ ಫಲಕವನ್ನು ವಜಾಗೊಳಿಸಿ','Taxonomy Template'=>'ಟ್ಯಾಕ್ಸಾನಮಿ ಟೆಂಪ್ಲೇಟು','View more comments'=>'ಹೆಚ್ಚಿನ ಕಾಮೆಂಟ್‌ಗಳನ್ನು ವೀಕ್ಷಿಸಿ','dashboard%1$s on %2$s %3$s'=>'%1$s ಮೇಲೆ %2$s %3$s','View this comment'=>'ಈ ಕಾಮೆಂಟ್ ನೋಡಿ','Update progress'=>'ನವೀಕರಣ ಪ್ರಗತಿ','Another update is currently in progress.'=>'ಮತ್ತೊಂದು ನವೀಕರಣ ಪ್ರಸ್ತುತ ಪ್ರಗತಿಯಲ್ಲಿದೆ.','View &#8220;%s&#8221; archive'=>'&#8220;%s&#8221; ಆರ್ಕೈವ್ ಅನ್ನು ವೀಕ್ಷಿಸಿ','Delete &#8220;%s&#8221;'=>'&#8220;%s&#8221; ಅನ್ನು ಅಳಿಸಿ','Quick edit &#8220;%s&#8221; inline'=>'ತ್ವರಿತ ಸಂಪಾದನೆ &#8220;%s&#8221; ಇನ್ಲೈನ್','Search for plugins in the WordPress Plugin Directory.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಪ್ಲಗಿನ್ ಡೈರೆಕ್ಟರಿಯಲ್ಲಿ ಪ್ಲಗಿನ್‌ಗಳಿಗಾಗಿ ಹುಡುಕಿ.','Restore &#8220;%s&#8221; from the Trash'=>'ಅನುಪಯುಕ್ತದಿಂದ &#8220;%s&#8221; ಅನ್ನು ಮರುಸ್ಥಾಪಿಸಿ','Delete &#8220;%s&#8221; permanently'=>'&#8220;%s&#8221; ಅನ್ನು ಶಾಶ್ವತವಾಗಿ ಅಳಿಸಿ','Move &#8220;%s&#8221; to the Trash'=>'&#8220;%s&#8221; ಅನ್ನು ಅನುಪಯುಕ್ತಕ್ಕೆ ಸರಿಸಿ','Attach &#8220;%s&#8221; to existing content'=>'ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ವಿಷಯಕ್ಕೆ &#8220;%s&#8221; ಲಗತ್ತಿಸಿ','Edit this comment'=>'ಈ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ಸಂಪಾದಿಸಿ','attachment filterTrash'=>'ಕಸದಬುಟ್ಟಿ','Quick edit this comment inline'=>'ಈ ಕಾಮೆಂಟ್ ಇನ್ಲೈನ್ ಅನ್ನು ತ್ವರಿತವಾಗಿ ಸಂಪಾದಿಸಿ','&#8220;%s&#8221; (Edit)'=>'&#8220;%s&#8221; (ಸಂಪಾದಿಸು)','Detach from &#8220;%s&#8221;'=>'&#8220;%s&#8221; ನಿಂದ ಬೇರ್ಪಡಿಸಿ','Restore this comment from the spam'=>'ಸ್ಪ್ಯಾಮ್‌ನಿಂದ ಈ ಕಾಮೆಂಟ್ ಅನ್ನು ಮರುಸ್ಥಾಪಿಸಿ','user autocomplete result%1$s (%2$s)'=>'%1$s (%2$s)','The %s importer is invalid or is not installed.'=>'%s ಆಮದುದಾರವು ಅಮಾನ್ಯವಾಗಿದೆ ಅಥವಾ ಸ್ಥಾಪಿಸಲಾಗಿಲ್ಲ.','comment statusPending'=>'ಬಾಕಿಯಿರುವ','Images should be at least %s tall.'=>'ಚಿತ್ರಗಳು ಕನಿಷ್ಠ %s ಎತ್ತರವಾಗಿರಬೇಕು.','%d pixels'=>'%d ಪಿಕ್ಸೆಲ್ಗಳು','Images should be at least %s wide.'=>'ಚಿತ್ರಗಳು ಕನಿಷ್ಠ %s ಅಗಲವಾಗಿರಬೇಕು.','Suggested height is %s.'=>'ಸೂಚಿಸಲಾದ ಎತ್ತರವು %s ಆಗಿದೆ.','Suggested width is %s.'=>'ಸೂಚಿಸಲಾದ ಅಗಲ %s.','Send User Notification'=>'ಬಳಕೆದಾರರ ಅಧಿಸೂಚನೆಯನ್ನು ಕಳುಹಿಸಿ','menu location(Currently set to: %s)'=>'(ಪ್ರಸ್ತುತ ಇದಕ್ಕೆ ಹೊಂದಿಸಲಾಗಿದೆ: %s)','<strong>Version %s</strong> addressed one security issue.'=>'<strong>ಆವೃತ್ತಿ %s</strong> ಒಂದು ಭದ್ರತಾ ಸಮಸ್ಯೆಯನ್ನು ಪರಿಹರಿಸಿದೆ.','Profile Picture'=>'ಪ್ರೊಫೈಲ್ ಚಿತ್ರ','Security Releases'=>'ಭದ್ರತಾ ಬಿಡುಗಡೆಗಳು','Maintenance Releases'=>'ನಿರ್ವಹಣೆ ಬಿಡುಗಡೆಗಳು','Maintenance and Security Releases'=>'ನಿರ್ವಹಣೆ ಮತ್ತು ಭದ್ರತಾ ಬಿಡುಗಡೆಗಳು','Plain'=>'ಸರಳ','WordPress offers you the ability to create a custom URL structure for your permalinks and archives. Custom URL structures can improve the aesthetics, usability, and forward-compatibility of your links. A <a href="%s">number of tags are available</a>, and here are some examples to get you started.'=>'ನಿಮ್ಮ ಪರ್ಮಾಲಿಂಕ್‌ಗಳು ಮತ್ತು ಆರ್ಕೈವ್‌ಗಳಿಗಾಗಿ ಕಸ್ಟಮ್ URL ರಚನೆಯನ್ನು ರಚಿಸುವ ಸಾಮರ್ಥ್ಯವನ್ನು ವರ್ಡ್‌ಪ್ರೆಸ್ ನಿಮಗೆ ನೀಡುತ್ತದೆ. ಕಸ್ಟಮ್ URL ರಚನೆಗಳು ನಿಮ್ಮ ಲಿಂಕ್‌ಗಳ ಸೌಂದರ್ಯಶಾಸ್ತ್ರ, ಉಪಯುಕ್ತತೆ ಮತ್ತು ಫಾರ್ವರ್ಡ್-ಹೊಂದಾಣಿಕೆಯನ್ನು ಸುಧಾರಿಸಬಹುದು. A <a href="%s"> ಸಂಖ್ಯೆಯ ಟ್ಯಾಗ್‌ಗಳು ಲಭ್ಯವಿದೆ </a>, ಮತ್ತು ನೀವು ಪ್ರಾರಂಭಿಸಲು ಕೆಲವು ಉದಾಹರಣೆಗಳು ಇಲ್ಲಿವೆ.','Permalinks can contain useful information, such as the post date, title, or other elements. You can choose from any of the suggested permalink formats, or you can craft your own if you select Custom Structure.'=>'ಪರ್ಮಾಲಿಂಕ್ಸ್ ಪೋಸ್ಟ್ ದಿನಾಂಕ, ಶೀರ್ಷಿಕೆ ಅಥವಾ ಇತರ ಅಂಶಗಳಂತಹ ಉಪಯುಕ್ತ ಮಾಹಿತಿಯನ್ನು ಒಳಗೊಂಡಿರಬಹುದು.  ನೀವು ಸೂಚಿಸಿದ ಯಾವುದೇ ಪರ್ಮಾಲಿಂಕ್ ಸ್ವರೂಪಗಳಿಂದ ಆಯ್ಕೆ ಮಾಡಬಹುದು, ಅಥವಾ ನೀವು ಕಸ್ಟಮ್ ರಚನೆಯನ್ನು ಆರಿಸಿದರೆ ನಿಮ್ಮದೇ ಆದದನ್ನು ನೀವು ರಚಿಸಬಹುದು.','You can create the %s file manually and paste the following text into it.'=>'ನೀವು %s ಫೈಲ್ ಅನ್ನು ಹಸ್ತಚಾಲಿತವಾಗಿ ರಚಿಸಬಹುದು ಮತ್ತು ಕೆಳಗಿನ ಪಠ್ಯವನ್ನು ಅದರಲ್ಲಿ ಅಂಟಿಸಬಹುದು.','Default is %s'=>'%s ಪೂರ್ವನಿಯೋಜಿತವಾಗಿದೆ','The theme is missing the %s stylesheet.'=>'ಥೀಮ್ %s ಸ್ಟೈಲ್‌ಶೀಟ್ ಅನ್ನು ಕಳೆದುಕೊಂಡಿದೆ.','If you have marked themes as favorites on WordPress.org, you can browse them here.'=>'ನೀವು WordPress.org ನಲ್ಲಿ ಥೀಮ್‌ಗಳನ್ನು ಮೆಚ್ಚಿನವುಗಳೆಂದು ಗುರುತಿಸಿದ್ದರೆ, ನೀವು ಅವುಗಳನ್ನು ಇಲ್ಲಿ ಬ್ರೌಸ್ ಮಾಡಬಹುದು.','themesFavorites'=>'ಮೆಚ್ಚಿನವುಗಳು','Database repair results'=>'ಡೇಟಾಬೇಸ್ ದುರಸ್ತಿ ಫಲಿತಾಂಶಗಳು','Allow automatic database repair'=>'ಸ್ವಯಂಚಾಲಿತ ಡೇಟಾಬೇಸ್ ದುರಸ್ತಿಗೆ ಅನುಮತಿಸಿ','Before getting started'=>'ಪ್ರಾರಂಭಿಸುವ ಮುನ್ನ','Successful database connection'=>'ಯಶಸ್ವಿ ಡೇಟಾಬೇಸ್ ಸಂಪರ್ಕ','Set up your database connection'=>'ನಿಮ್ಮ ಡೇಟಾಬೇಸ್ ಸಂಪರ್ಕವನ್ನು ಹೊಂದಿಸಿ','WordPress database repair'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಡೇಟಾಬೇಸ್ ದುರಸ್ತಿ','Check secret keys'=>'ರಹಸ್ಯ ಕೀಲಿಗಳನ್ನು ಪರಿಶೀಲಿಸಿ','%s has been updated.'=>'%s ಅನ್ನು ಅಪ್ಡೇಟ್ ಮಾಡಲಾಗಿದೆ.','The Walker class named %s does not exist.'=>'%s ಹೆಸರಿನ ವಾಕರ್ ವರ್ಗ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','Requires %1$s in %2$s file.'=>'%2$s ಫೈಲ್ನಲ್ಲಿ %1$s ಅಗತ್ಯವಿದೆ.','You are about to delete %s.'=>'ನೀವು %s ಅನ್ನು ಅಳಿಸಲಿರುವಿರಿ.','Standard time begins on: %s.'=>'ಸ್ಟ್ಯಾಂಡರ್ಡ್ ಸಮಯ ಆರಂಭವಾಗುವುದು: %s.','Daylight saving time begins on: %s.'=>'ಡೇಲೈಟ್ ಉಳಿಸುವ ಸಮಯವು ಪ್ರಾರಂಭವಾಗುತ್ತದೆ: %s.','Files in the %s directory are executed automatically.'=>'%s ಡೈರೆಕ್ಟರಿಯಲ್ಲಿನ ಫೈಲ್‌ಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಕಾರ್ಯಗತಗೊಳಿಸಲಾಗುತ್ತದೆ.','This will clear all items from the inactive widgets list. You will not be able to restore any customizations.'=>'ಇದು ನಿಷ್ಕ್ರಿಯ ವಿಜೆಟ್‌ಗಳ ಪಟ್ಟಿಯಿಂದ