y (and approve), quick edit, edit, spam mark, or trash that comment.'=>'<strong> ಕಾಮೆಂಟ್ </strong> ಕಾಲಂನಲ್ಲಿ, ಯಾವುದೇ ಕಾಮೆಂಟ್ ಮೇಲೆ ಸುಳಿದಾಡುವುದು ನಿಮಗೆ ಅನುಮೋದನೆ, ಪ್ರತ್ಯುತ್ತರ (ಮತ್ತು ಅನುಮೋದನೆ), ತ್ವರಿತ ಎಡಿಟ್, ಎಡಿಟ್, ಸ್ಪ್ಯಾಮ್ ಮಾರ್ಕ್, ಅಥವಾ ಆ ಕಮೆಂಟ್ ಅನ್ನು ಅನುಪಯುಕ್ತಗೊಳಿಸಲು ಆಯ್ಕೆಗಳನ್ನು ನೀಡುತ್ತದೆ.','Comments (%s)'=>'ಪ್ರತಿಕ್ರಿಯೆಗಳು (%s)','Sorry, you are not allowed to modify themes.'=>'ಕ್ಷಮಿಸಿ, ಥೀಮ್‌ಗಳನ್ನು ಮಾರ್ಪಡಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Comments (%1$s) on &#8220;%2$s&#8221;'=>'ಕಾಮೆಂಟ್ಗಳು ( %1$s ) ನಲ್ಲಿ & # 8220; %2$s & # 8221;','You have specified this user for removal:'=>'ತೆಗೆದುಹಾಕಲು ನೀವು ಈ ಬಳಕೆದಾರರನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ್ದೀರಿ:','Log %s out of all locations.'=>'ಎಲ್ಲಾ ಸ್ಥಳಗಳಿಂದ %s ಅನ್ನು ಲಾಗ್ ಔಟ್ ಮಾಡಿ.','Did you lose your phone or leave your account logged in at a public computer? You can log out everywhere else, and stay logged in here.'=>'ನಿಮ್ಮ ಫೋನ್ ಕಳೆದುಕೊಂಡಿದೆಯೇ ಅಥವಾ ಸಾರ್ವಜನಿಕ ಕಂಪ್ಯೂಟರ್ನಲ್ಲಿ ನಿಮ್ಮ ಖಾತೆಯನ್ನು ಲಾಗ್ ಇನ್ ಮಾಡಿದ್ದೀರಾ? ನೀವು ಎಲ್ಲೆಡೆ ಬೇರೆಡೆ ಲಾಗ್ ಔಟ್ ಮಾಡಬಹುದು, ಮತ್ತು ಇಲ್ಲಿ ಲಾಗ್ ಇನ್ ಆಗಿರಿ.','Generate password'=>'ಪಾಸ್ವರ್ಡ್ ರಚಿಸಿ','Account Management'=>'ಖಾತೆ ನಿರ್ವಹಣೆ','Sessions'=>'ಸೆಷನ್‌ಗಳು','Cancel password change'=>'ಪಾಸ್ವರ್ಡ್ ಬದಲಾವಣೆಯನ್ನು ರದ್ದುಗೊಳಿಸಿ','Log Out Everywhere Else'=>'ಎಲ್ಲೆಡೆಯೂ ಲಾಗ್-ಔಟ್','You will need this password to log&nbsp;in. Please store it in a secure location.'=>'ಪ್ರವೇಶಿಸಲು & nbsp; ಈ ಪಾಸ್ವರ್ಡ್ ನಿಮಗೆ ಬೇಕಾಗುತ್ತದೆ. ದಯವಿಟ್ಟು ಅದನ್ನು ಸುರಕ್ಷಿತ ಸ್ಥಳದಲ್ಲಿ ಸಂಗ್ರಹಿಸಿ.','No approved comments'=>'ಯಾವುದೇ ಅನುಮೋದಿತ ಕಾಮೆಂಟ್‌ಗಳಿಲ್ಲ','%s pending comment'=>'%s ಬಾಕಿ ಉಳಿದಿರುವ ಕಾಮೆಂಟ್' . "\0" . '%s ಬಾಕಿ ಉಳಿದಿರುವ ಕಾಮೆಂಟ್‌ಗಳು','%s approved comment'=>'%s ಅನುಮೋದಿತ ಕಾಮೆಂಟ್' . "\0" . '%s ಅನುಮೋದಿತ ಕಾಮೆಂಟ್‌ಗಳು','Image could not be processed.'=>'ಚಿತ್ರವನ್ನು ಪ್ರಕ್ರಿಯೆಗೊಳಿಸಲಾಗಲಿಲ್ಲ.','Confirm Password'=>'ಪಾಸ್ವರ್ಡ್ ದೃಢೀಕರಿಸಿ','Remove Site Icon'=>'ಸೈಟ್ ಐಕಾನ್ ತೆಗೆದುಹಾಕಿ','While you are editing your %1$s file, take a moment to make sure you have all 8 keys and that they are unique. You can generate these using the <a href="%2$s">WordPress.org secret key service</a>.'=>'ನಿಮ್ಮ %1$s ಫೈಲ್ ಅನ್ನು ನ