wordpress.org/Dashboard_My_Sites_Screen">ನನ್ನ ಸೈಟ್‌ಗಳ ಕುರಿತು ದಾಖಲೆ</a>','example: www.wordpress.org'=>'ಉದಾಹರಣೆಗೆ: www.wordpress.org','Number of Themes found: %d'=>'ಕಂಡುಬಂದ ಥೀಮ್‌ಗಳ ಸಂಖ್ಯೆ: %d','The search for installed themes will search for terms in their name, description, author, or tag.'=>'ಸ್ಥಾಪಿಸಲಾದ ಥೀಮ್‌ಗಳ ಹುಡುಕಾಟವು ಅದರ ಹೆಸರು, ವಿವರಣೆ, ಲೇಖಕ ಅಥವಾ ಟ್ಯಾಗ್‌ನಲ್ಲಿ ಪದಗಳನ್ನು ಹುಡುಕುತ್ತದೆ.','You can Search for themes by keyword, author, or tag, or can get more specific and search by criteria listed in the feature filter.'=>'ಕೀವರ್ಡ್, ಲೇಖಕರು ಅಥವಾ ಟ್ಯಾಗ್ ಮೂಲಕ ಥೀಮ್ಗಳಿಗಾಗಿ ನೀವು ಹುಡುಕಬಹುದು, ಅಥವಾ ವೈಶಿಷ್ಟ್ಯ ಫಿಲ್ಟರ್ನಲ್ಲಿ ಪಟ್ಟಿ ಮಾಡಲಾದ ಮಾನದಂಡಗಳ ಮೂಲಕ ಹೆಚ್ಚು ನಿರ್ದಿಷ್ಟವಾದ ಮತ್ತು ಹುಡುಕಾಟವನ್ನು ಪಡೆಯಬಹುದು.','Alternately, you can browse the themes that are Popular or Latest. When you find a theme you like, you can preview it or install it.'=>'ಪರ್ಯಾಯವಾಗಿ, ವೈಶಿಷ್ಟ್ಯಗೊಳಿಸಿದ, ಜನಪ್ರಿಯ, ಅಥವಾ ಇತ್ತೀಚಿನ ವಿಷಯಗಳನ್ನು ನೀವು ಬ್ರೌಸ್ ಮಾಡಬಹುದು. ನೀವು ಇಷ್ಟಪಡುವ ಥೀಮ್ ಅನ್ನು ನೀವು ಹುಡುಕಿದಾಗ, ನೀವು ಅದನ್ನು ಪೂರ್ವವೀಕ್ಷಿಸಬಹುದು ಅಥವಾ ಸ್ಥಾಪಿಸಬಹುದು.','Custom date format:'=>'ಕಸ್ಟಮ್ ದಿನಾಂಕ ಸ್ವರೂಪ:','Custom time format:'=>'ಕಸ್ಟಮ್ ಸಮಯ ಸ್ವರೂಪ:','enter a custom date format in the following field'=>'ಕೆಳಗಿನ ಕ್ಷೇತ್ರದಲ್ಲಿ ಕಸ್ಟಮ್ ದಿನಾಂಕ ಸ್ವರೂಪವನ್ನು ನಮೂದಿಸಿ','enter a custom time format in the following field'=>'ಕೆಳಗಿನ ಕ್ಷೇತ್ರದಲ್ಲಿ ಕಸ್ಟಮ್ ಸಮಯ ಸ್ವರೂಪವನ್ನು ನಮೂದಿಸಿ','Plugins updated successfully.'=>'ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಯಶಸ್ವಿಯಾಗಿ ನವೀಕರಿಸಲಾಗಿದೆ.','Active plugin installations%s+ Million'=>'%s+ ಮಿಲಿಯನ್' . "\0" . '%s+ ಮಿಲಿಯನ್','XML Error: %1$s at line %2$s'=>'XML ದೋಷ: %1$s %2$s ನೇ ಸಾಲಿನಲ್ಲಿ','Main menu'=>'ಮುಖ್ಯ ಮೆನು','Enter the location on the server where the public and private keys are located. If a passphrase is needed, enter that in the password field above.'=>'ಸಾರ್ವಜನಿಕ ಮತ್ತು ಖಾಸಗಿ ಕೀಲಿಗಳು ಇರುವ ಸರ್ವರ್ನಲ್ಲಿ ಸ್ಥಳವನ್ನು ನಮೂದಿಸಿ. ಪಾಸ್ಫ್ರೇಸ್ ಅಗತ್ಯವಿದ್ದರೆ, ಮೇಲೆ ಪಾಸ್ವರ್ಡ್ ಕ್ಷೇತ್ರದಲ್ಲಿ ನಮೂದಿಸಿ.','%s user deleted.'=>'%s ಬಳಕೆದಾರರನನ್ನು ಅಳಿಸಲಾಗಿದೆ.' . "\0" . '%s ಬಳಕೆದಾರರನ್ನು ಅಳಿಸಲಾಗಿದೆ.','What should be done with content owned by these users?'=>'ಈ ಬಳಕೆದಾರರ 