','Mystery Person'=>'ರಹಸ್ಯ ವ್ಯಕ್ತಿ','Usernames can have only alphanumeric characters, spaces, underscores, hyphens, periods, and the @ symbol.'=>'ಬಳಕೆದಾರ ಹೆಸರುಗಳು ಆಲ್ಫಾನ್ಯೂಮರಿಕ್ ಅಕ್ಷರಗಳು, ಸ್ಪೇಸ್‌ಗಳು, ಅಂಡರ್‌ಸ್ಕೋರ್‌ಗಳು, ಹೈಫನ್‌ಗಳು, ಪಿರಿಯಡ್‌ಗಳು ಮತ್ತು @ ಚಿಹ್ನೆಯನ್ನು ಮಾತ್ರ ಹೊಂದಿರಬಹುದು.','You cannot delete a theme while it has an active child theme.'=>'ಸಕ್ರಿಯ ಮಗು ಥೀಮ್ ಹೊಂದಿದ್ದರೂ ನೀವು ಥೀಮ್ ಅನ್ನು ಅಳಿಸಲಾಗುವುದಿಲ್ಲ.','Enable full-height editor and distraction-free functionality.'=>'ಪೂರ್ಣ-ಎತ್ತರದ ಸಂಪಾದಕ ಮತ್ತು ವ್ಯಾಕುಲತೆ-ಮುಕ್ತ ಕಾರ್ಯವನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿ.','https://planet.wordpress.org/'=>'https://planet.wordpress.org/','https://planet.wordpress.org/feed/'=>'https://planet.wordpress.org/feed/','Untested with your version of WordPress'=>'ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿಯೊಂದಿಗೆ ಪರೀಕ್ಷಿಸಲಾಗಿಲ್ಲ','This preview is unavailable in the editor.'=>'ಈ ಪೂರ್ವವೀಕ್ಷಣೆ ಸಂಪಾದಕದಲ್ಲಿ ಲಭ್ಯವಿಲ್ಲ.','Could not log out user sessions. Please try again.'=>'ಬಳಕೆದಾರರ ಸೆಷನ್ಗಳನ್ನು ಲಾಗ್ ಔಟ್ ಮಾಡಲಾಗಲಿಲ್ಲ. ದಯವಿಟ್ಟು ಪುನಃ ಪ್ರಯತ್ನಿಸಿ.','%s has been logged out.'=>'%s ಅನ್ನು ಲಾಗ್ ಔಟ್ ಮಾಡಲಾಗಿದೆ.','You are now logged out everywhere else.'=>'ನೀವು ಇದೀಗ ಎಲ್ಲೆಡೆಯೂ ಲಾಗ್ ಔಟ್ ಮಾಡಿದ್ದೀರಿ.','Filter by comment type'=>'ಕಾಮೆಂಟ್ ಪ್ರಕಾರದಿಂದ ಫಿಲ್ಟರ್ ಮಾಡಿ','All categories'=>'ಎಲ್ಲಾ ವರ್ಗಗಳು','<strong>Post editor</strong> &mdash; Enter the text for your post. There are two modes of editing: Visual and Text. Choose the mode by clicking on the appropriate tab.'=>'<strong> ಪೋಸ್ಟ್ ಸಂಪಾದಕ </strong> & mdash; ನಿಮ್ಮ ಪೋಸ್ಟ್ಗಾಗಿ ಪಠ್ಯವನ್ನು ನಮೂದಿಸಿ. ಎರಡು ವಿಧಾನಗಳ ಸಂಪಾದನೆಗಳಿವೆ: ವಿಷುಯಲ್ ಮತ್ತು ಪಠ್ಯ. ಸರಿಯಾದ ಟ್ಯಾಬ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವುದರ ಮೂಲಕ ಮೋಡ್ ಅನ್ನು ಆರಿಸಿ.','You can now manage and live-preview Custom Header in the <a href="%s">Customizer</a>.'=>'ನೀವು ಇದೀಗ ನಿರ್ವಹಿಸಬಹುದು ಮತ್ತು ಲೈವ್ ಪೂರ್ವವೀಕ್ಷಣೆಯನ್ನು <a href="%s"> ಕಸ್ಟೊಮೈಜರ್ </a> ನಲ್ಲಿ ಕಸ್ಟಮ್ ಶಿರೋಲೇಖ ಮಾಡಬಹುದು.','You can now manage and live-preview Custom Backgrounds in the <a href="%s">Customizer</a>.'=>'ನೀವು ಈಗ <a href="%s">ಕಸ್ಟೊಮೈಜರ್</a> ನಲ್ಲಿ ಕಸ್ಟಮ್ ಹಿನ್ನೆಲೆಗಳನ್ನು ನಿರ್ವಹಿಸಬಹುದು ಮತ್ತು ಲೈವ್ ಪೂರ್ವವೀಕ್ಷಣೆ ಮಾಡಬಹುದು.','You can insert media files by clicking the button above the post editor and following the directions. You can align or edit images using the inline formatting toolbar available in Visual mode.'=>'ನೀವು ಪೋಸ್ಟ್ ಸಂಪಾದಕರ ಮೇಲಿರುವ ಐಕಾನ್ಗಳನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವ ಮೂಲಕ ಮತ್ತು ನಿರ್ದೇಶನಗಳನ್ನು ಅನುಸರಿಸುವ ಮೂಲಕ ಮಾಧ್ಯಮ ಫೈಲ್ಗಳನ್ನು ಸೇರಿಸಬಹುದಾಗಿದೆ. ವಿಷುಯಲ್ ಮೋಡ್ನಲ್ಲಿ ಲಭ್ಯವಿರುವ ಇನ್ಲೈನ್ ಫಾರ್ಮ್ಯಾಟಿಂಗ್ ಟೂಲ್ಬಾರ್ ಬಳಸಿಕೊಂಡು ನೀವು ಚಿತ್ರಗಳನ್ನು ಒಗ್ಗೂಡಿಸಬಹುದು ಅಥವಾ ಸಂಪಾದಿಸಬಹುದು.','link nameName'=>'ಹೆಸರು','usersAll <span class="count">(%s)</span>'=>'ಎಲ್ಲಾ <span class="count">(%s)</span>' . "\0" . 'ಎಲ್ಲಾ <span class="count">(%s)</span>','Welcome panelWelcome'=>'ಸ್ವಾಗತ','If you like, you may enter custom structures for your category and tag URLs here. For example, using <code>topics</code> as your category base would make your category links like <code>%s/topics/uncategorized/</code>. If you leave these blank the defaults will be used.'=>'ನೀವು ಬಯಸಿದರೆ, ನಿಮ್ಮ ವರ್ಗಕ್ಕೆ ಕಸ್ಟಮ್ ರಚನೆಗಳನ್ನು ನೀವು ನಮೂದಿಸಬಹುದು ಮತ್ತು URL ಗಳನ್ನು ಇಲ್ಲಿ ಟ್ಯಾಗ್ ಮಾಡಬಹುದು. ಉದಾಹರಣೆಗೆ, <code>ವಿಷಯಗಳು</code> ಅನ್ನು ನಿಮ್ಮ ವರ್ಗದ ಆಧಾರವಾಗಿ ಬಳಸುವುದು ನಿಮ್ಮ ವರ್ಗ ಲಿಂಕ್‌ಗಳನ್ನು <code>%s/topics/uncategorized/</code> ನಂತೆ ಮಾಡುತ್ತದೆ. ನೀವು ಇವುಗಳನ್ನು ಖಾಲಿ ಬಿಟ್ಟರೆ ಡೀಫಾಲ್ಟ್‌ಗಳನ್ನು ಬಳಸಲಾಗುತ್ತದೆ.','Release Lead'=>'ಬಿಡುಗಡೆ ಲೀಡ್','Use the arrow buttons at the top of the dialog, or the left and right arrow keys on your keyboard, to navigate between media items quickly.'=>'ಮಾಧ್ಯಮದ ಐಟಂಗಳ ನಡುವೆ ನ್ಯಾವಿಗೇಟ್ ಮಾಡಲು, ಸಂವಾದದ ಮೇಲಿನ ಬಾಣದ ಬಟನ್ಗಳನ್ನು ಅಥವಾ ನಿಮ್ಮ ಕೀಬೋರ್ಡ್ನಲ್ಲಿ ಎಡ ಮತ್ತು ಬಲ ಬಾಣದ ಕೀಲಿಗಳನ್ನು ಬಳಸಿ.','You can also delete individual items and access the extended edit screen from the details dialog.'=>'ನೀವು ಪ್ರತ್ಯೇಕ ಐಟಂಗಳನ್ನು ಸಹ ಅಳಿಸಬಹುದು ಮತ್ತು ವಿವರಗಳ ಸಂವಾದದಿಂದ ವಿಸ್ತೃತ ಸಂಪಾದನೆ ಪರದೆಯನ್ನು ಪ್ರವೇಶಿಸಬಹುದು.','You can view your media in a simple visual grid or a list with columns. Switch between these views using the icons to the left above the media.'=>'ನಿಮ್ಮ ಮಾಧ್ಯಮವನ್ನು ಸರಳ ದೃಶ್ಯ ಗ್ರಿಡ್ ಅಥವಾ ಕಾಲಮ್ಗಳೊಂದಿಗೆ ಪಟ್ಟಿಯನ್ನು ವೀಕ್ಷಿಸಬಹುದು. ಮಾಧ್ಯಮದ ಮೇಲಿನ ಎಡಭಾಗದಲ್ಲಿರುವ ಐಕಾನ್ಗಳನ್ನು ಬಳಸಿ ಈ ವೀಕ್ಷಣೆಗಳು ನಡುವೆ ಬದಲಾಯಿಸಿ.','Clicking an item will display an Attachment Details dialog, which allows you to preview media and make quick edits. Any changes you make to the attachment details will be automatically saved.'=>'ಐಟಂ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವುದು ಲಗತ್ತು ವಿವರಗಳು ಡೈಲಾಗ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ, ಇದು ಮಾಧ್ಯಮವನ್ನು ಪೂರ್ವವೀಕ್ಷಣೆ ಮಾಡಲು ಮತ್ತು ತ್ವರಿತ ಸಂಪಾದನೆಗಳನ್ನು ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ. ಲಗತ್ತು ವಿವರಗಳಿಗೆ ನೀವು ಮಾಡಿದ ಯಾವುದೇ ಬದಲಾವಣೆಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಉಳಿಸಲಾಗುತ್ತದೆ.','To delete media items, click the Bulk Select button at the top of the screen. Select any items you wish to delete, then click the Delete Selected button. Clicking the Cancel Selection button takes you back to viewing your media.'=>'ಮಾಧ್ಯಮ ವಸ್ತುಗಳನ್ನು ಅಳಿಸಲು, ಪರದೆಯ ಮೇಲಿರುವ ದೊಡ್ಡ ಆಯ್ಕೆ ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಿ. ನೀವು ಅಳಿಸಲು ಬಯಸುವ ಯಾವುದೇ ಐಟಂಗಳನ್ನು ಆಯ್ಕೆ ಮಾಡಿ, ನಂತರ ಆಯ್ಕೆಮಾಡಿದ ಬಟನ್ ಅಳಿಸಿ ಕ್ಲಿಕ್ ಮಾಡಿ. ರದ್ದು ಆಯ್ಕೆ ಗುಂಡಿಯನ್ನು ಕ್ಲಿಕ್ಕಿಸುವುದರಿಂದ ನಿಮ್ಮ ಮಾಧ್ಯಮವನ್ನು ವೀಕ್ಷಿಸಲು ನಿಮ್ಮನ್ನು ಹಿಂತಿರುಗಿಸುತ್ತದೆ.','Browse Plugins'=>'ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಬ್ರೌಸ್ ಮಾಡಿ','All the files you&#8217;ve uploaded are listed in the Media Library, with the most recent uploads listed first.'=>'ನೀವು ಅಪ್ಲೋಡ್ ಮಾಡಲಾದ ಎಲ್ಲ ಫೈಲ್ಗಳು ಮಾಧ್ಯಮ ಲೈಬ್ರರಿಯಲ್ಲಿ ಪಟ್ಟಿ ಮಾಡಲಾಗಿವೆ, ಇತ್ತೀಚಿನವುಗಳಲ್ಲಿ ಇತ್ತೀಚಿನ ಅಪ್ಲೋಡ್ಗಳು.','If you just want to get an idea of what&#8217;s available, you can browse Featured and Popular plugins by using the links above the plugins list. These sections rotate regularly.'=>'ನೀವು ಯಾವ & # 8217; ಗಳು ಲಭ್ಯವಿದೆಯೋ ಆಲೋಚನೆಯನ್ನು ಪಡೆಯಲು ಬಯಸಿದರೆ, ಪ್ಲಗ್ಇನ್ಗಳ ಪಟ್ಟಿಯ ಮೇಲಿರುವ ಲಿಂಕ್ಗಳನ್ನು ಬಳಸಿಕೊಂಡು ನೀವು ವೈಶಿಷ್ಟ್ಯಗೊಳಿಸಿದ ಮತ್ತು ಜನಪ್ರಿಯ ಪ್ಲಗಿನ್ಗಳನ್ನು ಬ್ರೌಸ್ ಮಾಡಬಹುದು. ಈ ವಿಭಾಗಗಳು ನಿಯಮಿತವಾಗಿ ತಿರುಗುತ್ತವೆ.','Add Plugins'=>'ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಸೇರಿಸಿ','Invalid translation type.'=>'ಅಮಾನ್ಯ ಅನುವಾದ ಪ್ರಕಾರ.','The %1$s constant in your %2$s file is no longer needed.'=>'ನಿಮ್ಮ %2$s ಕಡತದಲ್ಲಿರುವ %1$s ಸ್ಥಿರಾಂಕವು ಇನ್ನು ಮುಂದೆ ಅಗತ್ಯವಿಲ್ಲ.','Welcome to the famous five-minute WordPress installation process! Just fill in the information below and you&#8217;ll be on your way to using the most extendable and powerful personal publishing platform in the world.'=>'ಪ್ರಸಿದ್ಧ ಐದು ನಿಮಿಷಗಳ ವರ್ಡ್ಪ್ರೆಸ್ ಅನುಸ್ಥಾಪನಾ ಪ್ರಕ್ರಿಯೆಗೆ ಸುಸ್ವಾಗತ! ಕೆಳಗಿರುವ ಮಾಹಿತಿಯನ್ನು ಭರ್ತಿ ಮಾಡಿ ಮತ್ತು ಪ್ರಪಂಚದ ಅತ್ಯಂತ ವಿಸ್ತಾರವಾದ ಮತ್ತು ಶಕ್ತಿಯುತವಾದ ವೈಯಕ್ತಿಕ ಪ್ರಕಟಣಾ ವೇದಿಕೆಯನ್ನು ಬಳಸುವುದಕ್ಕಾಗಿ ನಿಮ್ಮ ದಾರಿಯಲ್ಲಿರುವಿರಿ.','<strong>Compatible</strong> with your version of WordPress'=>'ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿಗೆ <strong>ಹೊಂದಿಕೊಳ್ಳುತ್ತದೆ</strong>','<strong>Incompatible</strong> with your version of WordPress'=>'ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಆವೃತ್ತಿಯೊಂದಿಗೆ <strong> ಹೊಂದಾಣಿಕೆಯಾಗದ </strong>','%d star'=>'%d ಸ್ಟಾರ್' . "\0" . '%d ಸ್ಟಾರ್ಸ್','Select bulk action'=>'ಬೃಹತ್ ಕ್ರಿಯೆಯನ್ನು ಆಯ್ಕೆಮಾಡಿ','The grid view for the Media Library requires JavaScript. <a href="%s">Switch to the list view</a>.'=>'ಮೀಡಿಯಾ ಲೈಬ್ರರಿಗಾಗಿ ಗ್ರಿಡ್ ವೀಕ್ಷಣೆಗೆ ಜಾವಾಸ್ಕ್ರಿಪ್ಟ್ ಅಗತ್ಯವಿದೆ. <a href="%s"> ಪಟ್ಟಿಯ ವೀಕ್ಷಣೆಗೆ ಬದಲಿಸಿ </a>.','Plugin installer section titleReviews'=>'‍ವಿಮರ್ಶೆಗಳು‍','Plugin installer group titleTools'=>'ಉಪಕರಣಗಳು','Contributors'=>'ಕೊಡುಗೆದಾರರು','themesRecently Updated'=>'ಇತ್ತೀಚೆಗೆ ನವೀಕರಿಸಲಾಗಿದೆ','Number/count of itemsCount'=>'ಎಣಿಕೆ','View details'=>'ವಿವರಗಳನ್ನು ವೀಕ್ಷಿಸಿ','More Details'=>'ಹೆಚ್ಚಿನ ವಿವರಗಳಿಗಾಗಿ','Plugin installer group titleSocial'=>'ಸಾಮಾಜಿಕ','Plugin InstallerBeta Testing'=>'ಬೀಟಾ ಪರೀಕ್ಷೆ','%s failed to embed.'=>'ಎಂಬೆಡ್ ಮಾಡಲು %s ವಿಫಲವಾಗಿದೆ.','Plugin installer group titlePerformance'=>'ಕಾರ್ಯಕ್ಷಮತೆ','Donate to this plugin &#187;'=>'ಈ ಪ್ಲಗ್‌ಇನ್‌ಗೆ ದೇಣಿಗೆ ನೀಡಿ &#187;','The WordPress team is willing to help you. Forward this email to %s and the team will work with you to make sure your site is working.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ತಂಡವು ನಿಮಗೆ ಸಹಾಯ ಮಾಡಲು ಸಿದ್ಧವಾಗಿದೆ. ಈ ಇಮೇಲ್ ಅನ್ನು %s ಗೆ ಫಾರ್ವರ್ಡ್ ಮಾಡಿ ಮತ್ತು ನಿಮ್ಮ ಸೈಟ್ ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತಿದೆ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಲು ತಂಡವು ನಿಮ್ಮೊಂದಿಗೆ ಕೆಲಸ ಮಾಡುತ್ತದೆ.','Filtering by:'=>'ಇದರ ಮೂಲಕ ಫಿಲ್ಟರಿಂಗ್:','Displayed on attachment pages.'=>'ಲಗತ್ತು ಪುಟಗಳಲ್ಲಿ ಪ್ರದರ್ಶಿಸಲಾಗುತ್ತದೆ.','To crop the image, click on it and drag to make your selection.'=>'ಚಿತ್ರವನ್ನು ಕ್ರಾಪ್ ಮಾಡಲು, ಅದರ ಮೇಲೆ ಕ್ಲಿಕ್ ಮಾಡಿ ಮತ್ತು ನಿಮ್ಮ ಆಯ್ಕೆಯನ್ನು ಮಾಡಲು ಡ್ರ್ಯಾಗ್ ಮಾಡಿ.','You can edit the image while preserving the thumbnail. For example, you may wish to have a square thumbnail that displays just a section of the image.'=>'ಥಂಬ್ನೇಲ್ ಸಂರಕ್ಷಿಸುವ ಸಂದರ್ಭದಲ್ಲಿ ನೀವು ಚಿತ್ರವನ್ನು ಸಂಪಾದಿಸಬಹುದು. ಉದಾಹರಣೆಗೆ, ಚಿತ್ರದ ಕೇವಲ ಒಂದು ವಿಭಾಗವನ್ನು ಪ್ರದರ್ಶಿಸುವ ಚೌಕಾಕಾರದ ಥಂಬ್ನೇಲ್ ಅನ್ನು ನೀವು ಹೊಂದಲು ಬಯಸಬಹುದು.','A red bar on the left means the comment is waiting for you to moderate it.'=>'ಎಡಭಾಗದಲ್ಲಿರುವ ಕೆಂಪು ಬಾರ್ ಎಂದರೆ ಅದನ್ನು ಮಧ್ಯಮಗೊಳಿಸಲು ಕಾಮೆಂಟ್ ನಿರೀಕ್ಷಿಸುತ್ತಿದೆ.','You can proportionally scale the original image. For best results, scaling should be done before you crop, flip, or rotate. Images can only be scaled down, not up.'=>'ನೀವು ಮೂಲ ಚಿತ್ರವನ್ನು ಪ್ರಮಾಣಾನುಗುಣವಾಗಿ ಅಳೆಯಬಹುದು. ಉತ್ತಮ ಫಲಿತಾಂಶಗಳಿಗಾಗಿ, ನೀವು ಕ್ರಾಪ್, ಫ್ಲಿಪ್ ಅಥವಾ ತಿರುಗುವ ಮೊದಲು ಸ್ಕೇಲಿಂಗ್ ಮಾಡಬೇಕು. ಚಿತ್ರಗಳನ್ನು ಮಾತ್ರ ಅಪ್ಗ್ರೇಡ್ ಮಾಡಬಹುದು, ಆದರೆ ಅಪ್ ಅಲ್ಲ.','Once you have made your selection, you can adjust it by entering the size in pixels. The minimum selection size is the thumbnail size as set in the Media settings.'=>'ಒಮ್ಮೆ ನೀವು ನಿಮ್ಮ ಆಯ್ಕೆಯನ್ನು ಮಾಡಿದ ನಂತರ, ಪಿಕ್ಸೆಲ್ಗಳಲ್ಲಿ ಗಾತ್ರವನ್ನು ನಮೂದಿಸುವ ಮೂಲಕ ನೀವು ಅದನ್ನು ಸರಿಹೊಂದಿಸಬಹುದು. ಮಾಧ್ಯಮ ಸೆಟ್ಟಿಂಗ್ಗಳಲ್ಲಿ ಹೊಂದಿಸಿದಂತೆ ಕನಿಷ್ಠ ಆಯ್ಕೆ ಗಾತ್ರ ಥಂಬ್ನೇಲ್ ಗಾತ್ರವಾಗಿರುತ್ತದೆ.','The aspect ratio is the relationship between the width and height. You can preserve the aspect ratio by holding down the shift key while resizing your selection. Use the input box to specify the aspect ratio, e.g. 1:1 (square), 4:3, 16:9, etc.'=>'ಆಕಾರ ಅನುಪಾತ ಅಗಲ ಮತ್ತು ಎತ್ತರ ನಡುವಿನ ಸಂಬಂಧವಾಗಿದೆ. ನಿಮ್ಮ ಆಯ್ಕೆಯನ್ನು ಮರುಗಾತ್ರಗೊಳಿಸುವಾಗ ಶಿಫ್ಟ್ ಕೀಲಿಯನ್ನು ಹಿಡಿದಿಟ್ಟುಕೊಂಡು ಆಕಾರ ಅನುಪಾತವನ್ನು ನೀವು ಉಳಿಸಿಕೊಳ್ಳಬಹುದು. ಆಕಾರ ಅನುಪಾತವನ್ನು ಸೂಚಿಸಲು ಇನ್ಪುಟ್ ಪೆಟ್ಟಿಗೆಯನ್ನು ಬಳಸಿ, ಉದಾ: 1: 1 (ಚದರ), 4: 3, 16: 9, ಇತ್ಯಾದಿ.','All comment types'=>'ಎಲ್ಲಾ ಕಾಮೆಂಟ್ ಪ್ರಕಾರಗಳು','themesLatest'=>'ಇತ್ತೀಚಿನ','themesPopular'=>'ಜನಪ್ರಿಯ','themesFeatured'=>'ವೈಶಿಷ್ಟ್ಯಗೊಳಿಸಿದ','https://wordpress.org/support/forum/how-to-and-troubleshooting'=>'https://wordpress.org/support/forum/how-to-and-troubleshooting','Delete all content.'=>'ಎಲ್ಲಾ ವಿಷಯವನ್ನು ಅಳಿಸಿ.','What should be done with content owned by this user?'=>'ಈ ಬಳಕೆದಾರರ ಒಡೆತನದ ವಿಷಯದೊಂದಿಗೆ ಏನು ಮಾಡಬೇಕು?','Add Themes'=>'ಥೀಮ್ಗಳನ್ನು ಸೇರಿಸಿ','Sorry, you are not allowed to resume this theme.'=>'ಕ್ಷಮಿಸಿ, ಈ ಥೀಮ್ ಅನ್ನು ಪುನರಾರಂಭಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','themeDetails &amp; Preview'=>'ವಿವರಗಳು ಮತ್ತು ಪೂರ್ವವೀಕ್ಷಣೆ','Search Themes'=>'ಥೀಮ್‌ಗಳನ್ನು ಹುಡುಕಿ','<strong>Delete</strong> brings you to the Delete Users screen for confirmation, where you can permanently remove a user from your site and delete their content. You can also delete multiple users at once by using bulk actions.'=>'<strong> ಅಳಿಸು </strong> ನಿಮ್ಮನ್ನು ದೃಢೀಕರಿಸಲು ಬಳಕೆದಾರರನ್ನು ತೆರೆಗೆ ತರುತ್ತದೆ, ಅಲ್ಲಿ ನೀವು ನಿಮ್ಮ ಸೈಟ್ನಿಂದ ಬಳಕೆದಾರರನ್ನು ಶಾಶ್ವತವಾಗಿ ತೆಗೆದುಹಾಕಬಹುದು ಮತ್ತು ಅವರ ವಿಷಯವನ್ನು ಅಳಿಸಬಹುದು. ದೊಡ್ಡ ಚಟುವಟಿಕೆಗಳನ್ನು ಬಳಸುವುದರ ಮೂಲಕ ನೀವು ಅನೇಕ ಬಳಕೆದಾರರನ್ನು ಸಹ ಒಮ್ಮೆ ಅಳಿಸಬಹುದು.','<strong>Remove</strong> allows you to remove a user from your site. It does not delete their content. You can also remove multiple users at once by using bulk actions.'=>'ನಿಮ್ಮ ಸೈಟ್ನಿಂದ ಬಳಕೆದಾರರನ್ನು ತೆಗೆದುಹಾಕಲು <strong> ತೆಗೆದುಹಾಕಿ </strong> ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ. ಇದು ಅವರ ವಿಷಯವನ್ನು ಅಳಿಸುವುದಿಲ್ಲ. ದೊಡ್ಡ ಕ್ರಿಯೆಗಳನ್ನು ಬಳಸುವುದರ ಮೂಲಕ ನೀವು ಅನೇಕ ಬಳಕೆದಾರರನ್ನು ಕೂಡ ಒಮ್ಮೆ ತೆಗೆದುಹಾಕಬಹುದು.','<strong>Box Controls</strong> &mdash; Click the title bar of the box to expand or collapse it. Some boxes added by plugins may have configurable content, and will show a &#8220;Configure&#8221; link in the title bar if you hover over it.'=>'<strong> ಬಾಕ್ಸ್ ನಿಯಂತ್ರಣಗಳು </strong> - ಪೆಟ್ಟಿಗೆಯನ್ನು ವಿಸ್ತರಿಸಲು ಅಥವಾ ಕುಗ್ಗಿಸಲು ಶೀರ್ಷಿಕೆ ಪಟ್ಟಿಯನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ.  ಪ್ಲಗಿನ್‌ಗಳಿಂದ ಸೇರಿಸಲಾದ ಕೆಲವು ಪೆಟ್ಟಿಗೆಗಳು ಕಾನ್ಫಿಗರ್ ಮಾಡಬಹುದಾದ ವಿಷಯವನ್ನು ಹೊಂದಿರಬಹುದು ಮತ್ತು ನೀವು ಅದರ ಮೇಲೆ ಸುಳಿದಾಡಿದರೆ ಶೀರ್ಷಿಕೆ ಪಟ್ಟಿಯಲ್ಲಿ "ಕಾನ್ಫಿಗರ್" ಲಿಂಕ್ ಅನ್ನು ತೋರಿಸುತ್ತದೆ.','<strong>At a Glance</strong> &mdash; Displays a summary of the content on your site and identifies which theme and version of WordPress you are using.'=>'<strong> ಒಂದು ನೋಟದಲ್ಲಿ </strong> - ನಿಮ್ಮ ಸೈಟ್ನಲ್ಲಿನ ವಿಷಯದ ಸಾರಾಂಶವನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ ಮತ್ತು ನೀವು ಬಳಸುತ್ತಿರುವ ವರ್ಡ್ಪ್ರೆಸ್ನ ಥೀಮ್ ಮತ್ತು ಆವೃತ್ತಿಯನ್ನು ಗುರುತಿಸುತ್ತದೆ.','Attribute all content to:'=>'ಎಲ್ಲಾ ವಿಷಯವನ್ನು ಈ ವಿಷಯಕ್ಕೆ ಗುಣಲಕ್ಷಣ ಮಾಡಿ:','Edit date and time'=>'ದಿನಾಂಕ ಮತ್ತು ಸಮಯವನ್ನು ಸಂಪಾದಿಸಿ','Browse revisions'=>'ಪರಿಷ್ಕರಣೆಗಳನ್ನು ಬ್ರೌಸ್ ಮಾಡಿ','Edit visibility'=>'ಗೋಚರತೆಯನ್ನು ಸಂಪಾದಿಸಿ','Edit status'=>'ಸ್ಥಿತಿಯನ್ನು ಸಂಪಾದಿಸಿ','Thank you for creating with <a href="%s">WordPress</a>.'=>'<a href="%s">ವರ್ಡ್ಪ್ರೆಸ್</a>ನೊಂದಿಗೆ ರಚಿಸಿದ್ದಕ್ಕಾಗಿ ಧನ್ಯವಾದಗಳು.','<a href="https://wordpress.org/support/forum/multisite/">Support forums</a>'=>'<a href="https://wordpress.org/support/forum/multisite/">ಬೆಂಬಲ ವೇದಿಕೆಗಳು</a>','In most cases, WordPress will automatically apply maintenance and security updates in the background for you.'=>'ಹೆಚ್ಚಿನ ಸಂದರ್ಭಗಳಲ್ಲಿ, ವರ್ಡ್ಪ್ರೆಸ್ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ನಿರ್ವಹಣೆ ಮತ್ತು ಭದ್ರತಾ ನವೀಕರಣಗಳನ್ನು ನಿಮ್ಮ ಹಿನ್ನೆಲೆಯಲ್ಲಿ ಅನ್ವಯಿಸುತ್ತದೆ.','<strong>WordPress</strong> &mdash; Updating your WordPress installation is a simple one-click procedure: just <strong>click on the &#8220;Update now&#8221; button</strong> when you are notified that a new version is available.'=>'<strong>ವರ್ಡ್ಪ್ರೆಸ್</strong> &mdash; ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಅನುಸ್ಥಾಪನೆಯನ್ನು ನವೀಕರಿಸುವುದು ಸರಳವಾದ ಒಂದು ಕ್ಲಿಕ್ ವಿಧಾನವಾಗಿದೆ: ಹೊಸ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ ಎಂದು ನಿಮಗೆ ಸೂಚನೆ ನೀಡಿದಾಗ <strong>&#8220;ಈಗ ನವೀಕರಿಸಿ&#8221; ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಿ</strong>.','<strong>Translations</strong> &mdash; The files translating WordPress into your language are updated for you whenever any other updates occur. But if these files are out of date, you can <strong>click the &#8220;Update Translations&#8221;</strong> button.'=>'<strong> ಅನುವಾದಗಳು </strong> - ಯಾವುದೇ ಇತರ ನವೀಕರಣಗಳು ಸಂಭವಿಸಿದಾಗಲೆಲ್ಲಾ ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ನಿಮ್ಮ ಭಾಷೆಯಲ್ಲಿ ಭಾಷಾಂತರಿಸುವ ಫೈಲ್ಗಳನ್ನು ನವೀಕರಿಸಲಾಗುತ್ತದೆ. ಆದರೆ ಈ ಫೈಲ್ಗಳು ಹಳೆಯದಾಗಿದ್ದರೆ, ನೀವು <strong> "ನವೀಕರಣ ಅನುವಾದಗಳು"; </strong> ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಿ.','If an update is available, you&#8127;ll see a notification appear in the Toolbar and navigation menu.'=>'ಒಂದು ಅಪ್ಡೇಟ್ ಲಭ್ಯವಿದ್ದರೆ, ಟೂಲ್ಬಾರ್ ಮತ್ತು ನ್ಯಾವಿಗೇಷನ್ ಮೆನುವಿನಲ್ಲಿ ಅಧಿಸೂಚನೆ ಕಾಣಿಸಿಕೊಳ್ಳುವಿರಿ.','<strong>Themes and Plugins</strong> &mdash; To update individual themes or plugins from this screen, use the checkboxes to make your selection, then <strong>click on the appropriate &#8220;Update&#8221; button</strong>. To update all of your themes or plugins at once, you can check the box at the top of the section to select all before clicking the update button.'=>'<strong> ಥೀಮ್ಗಳು ಮತ್ತು ಪ್ಲಗ್ಇನ್ಗಳು</strong> - ಈ ಪರದೆಯಿಂದ ಪ್ರತ್ಯೇಕ ಥೀಮ್ಗಳು ಅಥವಾ ಪ್ಲಗ್ಇನ್ಗಳನ್ನು ನವೀಕರಿಸಲು, ನಿಮ್ಮ ಆಯ್ಕೆಯನ್ನು ಮಾಡಲು ಚೆಕ್ಬಾಕ್ಸ್ಗಳನ್ನು ಬಳಸಿ, ನಂತರ <strong> ಸೂಕ್ತವಾದ "ನವೀಕರಣ" ಬಟನ್ </strong>. ನಿಮ್ಮ ಎಲ್ಲ ಥೀಮ್ಗಳು ಅಥವಾ ಪ್ಲಗ್ಇನ್ಗಳನ್ನು ಒಮ್ಮೆಗೇ ನವೀಕರಿಸಲು, ಅಪ್ಡೇಟ್ ಬಟನ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವ ಮೊದಲು ಎಲ್ಲವನ್ನೂ ಆಯ್ಕೆ ಮಾಡಲು ನೀವು ವಿಭಾಗದ ಮೇಲ್ಭಾಗದಲ್ಲಿ ಬಾಕ್ಸ್ ಅನ್ನು ಪರಿಶೀಲಿಸಬಹುದು.','On this screen, you can update to the latest version of WordPress, as well as update your themes, plugins, and translations from the WordPress.org repositories.'=>'ಈ ಪರದೆಯ ಮೇಲೆ, ನೀವು ವರ್ಡ್ಪ್ರೆಸ್ನ ಇತ್ತೀಚಿನ ಆವೃತ್ತಿಗೆ ನವೀಕರಿಸಬಹುದು, ಅಲ್ಲದೇ WordPress.org ರೆಪೊಸಿಟರಿಗಳಿಂದ ನಿಮ್ಮ ಥೀಮ್ಗಳು, ಪ್ಲಗಿನ್ಗಳು, ಮತ್ತು ಅನುವಾದಗಳನ್ನು ನವೀಕರಿಸಬಹುದು.','M jS'=>'M jS','%s Page'=>'%s ಪುಟ' . "\0" . '%s ಪುಟಗಳು','%s Post'=>'%s ಪೋಸ್ಟ್' . "\0" . '%s ಪೋಸ್ಟ್‌ಗಳು','%s MB Space Allowed'=>'%s MB ಜಾಗವನ್ನು ಅನುಮತಿಸಲಾಗಿದೆ','%1$s MB (%2$s%%) Space Used'=>'%1$s MB (%2$s%%) ಸ್ಪೇಸ್ ಬಳಸಲಾಗಿದೆ','At a Glance'=>'ಒಂದು ನೋಟದಲ್ಲಿ','When this setting is in effect, a reminder is shown in the At a Glance box of the Dashboard that says, &#8220;Search engines discouraged&#8221;, to remind you that you have directed search engines to not crawl your site.'=>'ಈ ಸೆಟ್ಟಿಂಗ್ ಪರಿಣಾಮಕಾರಿಯಾಗಿದ್ದಾಗ, ಡ್ಯಾಶ್ಬೋರ್ಡ್ನ ಗ್ಲಾನ್ಸ್ ಪೆಟ್ಟಿಗೆಯಲ್ಲಿ ಒಂದು ಜ್ಞಾಪನೆಯನ್ನು ತೋರಿಸಲಾಗಿದೆ, & # 8220; ಹುಡುಕಾಟ ಇಂಜಿನ್ಗಳು ನಿರುತ್ಸಾಹಗೊಳಿಸಲಾಗುವುದಿಲ್ಲ, & # 8221; ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಕ್ರಾಲ್ ಮಾಡಲಾಗುವುದಿಲ್ಲ ಎಂದು ನಿಮಗೆ ನೆನಪಿಸಲು.','themeActive:'=>'ಸಕ್ರಿಯ:','Accessibility Ready'=>'ಪ್ರವೇಶಿಸುವಿಕೆ ಸಿದ್ಧವಾಗಿದೆ','This is a child theme of %s.'=>'ಇದು %s ಮಗುವಿನ ವಿಷಯವಾಗಿದೆ.','Hover or tap to see Activate and Live Preview buttons'=>'ಸಕ್ರಿಯಗೊಳಿಸಲು ಮತ್ತು ಲೈವ್ ಪೂರ್ವವೀಕ್ಷಣೆ ಬಟನ್ ನೋಡಲು ಹೋವರ್ ಅಥವಾ ಟ್ಯಾಪ್ ಮಾಡಿ','Click on the theme to see the theme name, version, author, description, tags, and the Delete link'=>'ಥೀಮ್ ಹೆಸರು, ಆವೃತ್ತಿ, ಲೇಖಕ, ವಿವರಣೆ, ಟ್ಯಾಗ್‌ಗಳು ಮತ್ತು ಅಳಿಸುವ ಲಿಂಕ್ ಅನ್ನು ನೋಡಲು ಥೀಮ್ ಮೇಲೆ ಕ್ಲಿಕ್ ಮಾಡಿ','When previewing on smaller monitors, you can use the collapse icon at the bottom of the left-hand pane. This will hide the pane, giving you more room to preview your site in the new theme. To bring the pane back, click on the collapse icon again.'=>'ಸಣ್ಣ ಮಾನಿಟರ್ಗಳಲ್ಲಿ ಪೂರ್ವವೀಕ್ಷಣೆ ಮಾಡುವಾಗ, ಎಡಗೈ ಫಲಕದ ಕೆಳಭಾಗದಲ್ಲಿ ಕುಸಿತದ ಐಕಾನ್ ಅನ್ನು ನೀವು ಬಳಸಬಹುದು. ಇದು ಹೊಸ ಫಲಕದಲ್ಲಿ ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಪೂರ್ವವೀಕ್ಷಣೆ ಮಾಡಲು ಹೆಚ್ಚಿನ ಕೋಣೆಯನ್ನು ನೀಡುವ ಫಲಕವನ್ನು ಮರೆಮಾಡುತ್ತದೆ. ಫಲಕವನ್ನು ಹಿಂತಿರುಗಿಸಲು, ಕುಸಿತ ಐಕಾನ್ ಅನ್ನು ಮತ್ತೊಮ್ಮೆ ಕ್ಲಿಕ್ ಮಾಡಿ.','The theme being previewed is fully interactive &mdash; navigate to different pages to see how the theme handles posts, archives, and other page templates. The settings may differ depending on what theme features the theme being previewed supports. To accept the new settings and activate the theme all in one step, click the Activate &amp; Publish button above the menu.'=>'ಪೂರ್ವಾವಲೋಕನಗೊಳ್ಳುತ್ತಿರುವ ಥೀಮ್ ಸಂಪೂರ್ಣ ಸಂವಾದಾತ್ಮಕವಾಗಿದೆ & mdash; ಥೀಮ್ಗಳು ಪೋಸ್ಟ್ಗಳು, ಆರ್ಕೈವ್ಗಳು, ಮತ್ತು ಇತರ ಪುಟ ಟೆಂಪ್ಲೆಟ್ಗಳನ್ನು ಹೇಗೆ ನಿರ್ವಹಿಸುತ್ತದೆ ಎಂಬುದನ್ನು ನೋಡಲು ವಿಭಿನ್ನ ಪುಟಗಳಿಗೆ ನ್ಯಾವಿಗೇಟ್ ಮಾಡಿ. ಥೀಮ್ ಪೂರ್ವವೀಕ್ಷಣೆಯನ್ನು ಬೆಂಬಲಿಸುವ ಯಾವ ಥೀಮ್ ಅನ್ನು ಅವಲಂಬಿಸಿದೆ ಎಂಬುದನ್ನು ಅವಲಂಬಿಸಿ ಸೆಟ್ಟಿಂಗ್ಗಳು ಭಿನ್ನವಾಗಿರುತ್ತವೆ. ಹೊಸ ಸೆಟ್ಟಿಂಗ್ಗಳನ್ನು ಸ್ವೀಕರಿಸಲು ಮತ್ತು ಎಲ್ಲಾ ಹಂತದಲ್ಲೂ ಥೀಮ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು, ಪ್ರಕಟಣೆ & amp; ಮೆನುವಿನ ಮೇಲಿರುವ ಬಟನ್ ಸಕ್ರಿಯಗೊಳಿಸಿ.','Tap or hover on any theme then click the Live Preview button to see a live preview of that theme and change theme options in a separate, full-screen view. You can also find a Live Preview button at the bottom of the theme details screen. Any installed theme can be previewed and customized in this way.'=>'ಯಾವುದೇ ಥೀಮ್ ಮೇಲೆ ಟ್ಯಾಪ್ ಮಾಡಿ ಅಥವಾ ಮೇಲಿದ್ದು ನಂತರ ಆ ಥೀಮ್ನ ಲೈವ್ ಪೂರ್ವವೀಕ್ಷಣೆಯನ್ನು ನೋಡಲು ಲೈವ್ ಪೂರ್ವವೀಕ್ಷಣೆ ಬಟನ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ ಮತ್ತು ಪ್ರತ್ಯೇಕ, ಪೂರ್ಣ-ಸ್ಕ್ರೀನ್ ವೀಕ್ಷಣೆಯಲ್ಲಿ ಥೀಮ್ ಆಯ್ಕೆಗಳನ್ನು ಬದಲಾಯಿಸಿ. ಥೀಮ್ ವಿವರ ಪರದೆಯ ಕೆಳಭಾಗದಲ್ಲಿ ಲೈವ್ ಪೂರ್ವವೀಕ್ಷಣೆ ಬಟನ್ ಅನ್ನು ನೀವು ಕಾಣಬಹುದು. ಯಾವುದೇ ಸ್ಥಾಪಿತ ಥೀಮ್ ಪೂರ್ವವೀಕ್ಷಣೆ ಮತ್ತು ಈ ರೀತಿಯಲ್ಲಿ ಕಸ್ಟಮೈಸ್ ಮಾಡಬಹುದು.','This screen is used for managing your installed themes. Aside from the default theme(s) included with your WordPress installation, themes are designed and developed by third parties.'=>'ನಿಮ್ಮ ತೆರೆಯಲಾದ ಥೀಮ್ಗಳನ್ನು ನಿರ್ವಹಿಸಲು ಈ ಪರದೆಯನ್ನು ಬಳಸಲಾಗುತ್ತದೆ. ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಸ್ಥಾಪನೆಯೊಂದಿಗೆ ಡೀಫಾಲ್ಟ್ ಥೀಮ್ (ಗಳನ್ನು) ಹೊರತುಪಡಿಸಿ, ಥೀಮ್ಗಳು ಮೂರನೇ ವ್ಯಕ್ತಿಗಳಿಂದ ವಿನ್ಯಾಸಗೊಳಿಸಲ್ಪಟ್ಟಿವೆ ಮತ್ತು ಅಭಿವೃದ್ಧಿಪಡಿಸಲ್ಪಟ್ಟಿವೆ.','To activate a widget drag it to a sidebar or click on it. To deactivate a widget and delete its settings, drag it back.'=>'ಒಂದು widget ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು ಅದನ್ನು ಸೈಡ್ಬಾರ್ನಲ್ಲಿ ಎಳೆಯಿರಿ ಅಥವಾ ಅದರ ಮೇಲೆ ಕ್ಲಿಕ್ ಮಾಡಿ. ಒಂದು widget ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲು ಮತ್ತು ಅದರ ಸೆಟ್ಟಿಂಗ್ಗಳನ್ನು ಅಳಿಸಲು, ಅದನ್ನು ಹಿಂದಕ್ಕೆ ಎಳೆಯಿರಿ.','%s rating'=>'%s ರೇಟಿಂಗ್','%1$s rating based on %2$s rating'=>'%1$s ರೇಟಿಂಗ್ ಆಧಾರದ ಮೇಲೆ %2$s ರೇಟಿಂಗ್' . "\0" . '%1$s ರೇಟಿಂಗ್ ಆಧಾರದ ಮೇಲೆ %2$s ರೇಟಿಂಗ್','This screen shows an individual user all of their sites in this network, and also allows that user to set a primary site. They can use the links under each site to visit either the front end or the dashboard for that site.'=>'ಈ ಪರದೆಯು ಒಂದು ವೈಯಕ್ತಿಕ ಬಳಕೆದಾರರನ್ನು ತಮ್ಮ ಎಲ್ಲಾ ಜಾಲತಾಣಗಳಲ್ಲಿ ಈ ನೆಟ್ವರ್ಕ್ನಲ್ಲಿ ತೋರಿಸುತ್ತದೆ ಮತ್ತು ಬಳಕೆದಾರನು ಪ್ರಾಥಮಿಕ ಸೈಟ್ ಅನ್ನು ಹೊಂದಿಸಲು ಸಹ ಅನುಮತಿಸುತ್ತದೆ. ಆ ಸೈಟ್ಗಾಗಿ ಫ್ರಂಟ್ ಎಂಡ್ ಅಥವಾ ಡ್ಯಾಶ್ಬೋರ್ಡ್ ಅನ್ನು ಭೇಟಿ ಮಾಡಲು ಪ್ರತಿ ಸೈಟ್ನ ಅಡಿಯಲ್ಲಿರುವ ಲಿಂಕ್ಗಳನ್ನು ಅವರು ಬಳಸಬಹುದು.','Error: [%1$s] %2$s'=>'ದೋಷ: [%1$s] %2$s','Rollback Error: [%1$s] %2$s'=>'ರೋಲ್ಬ್ಯಾಕ್ ದೋಷ: [%1$s] %2$s','The following translations failed to update:'=>'ಕೆಳಗಿನ ಅನುವಾದಗಳು ನವೀಕರಿಸಲು ವಿಫಲವಾಗಿದೆ:','The following themes failed to update:'=>'ಕೆಳಗಿನ ಥೀಮ್ಗಳು ನವೀಕರಿಸಲು ವಿಫಲವಾಗಿದೆ:','The following plugins failed to update:'=>'ಕೆಳಗಿನ ಪ್ಲಗ್ಇನ್ಗಳನ್ನು ನವೀಕರಿಸಲು ವಿಫಲವಾಗಿದೆ:','The following plugins were successfully updated:'=>'ಕೆಳಗಿನ ಪ್ಲಗ್ಇನ್ಗಳನ್ನು ಯಶಸ್ವಿಯಾಗಿ ನವೀಕರಿಸಲಾಗಿದೆ:','The following translations were successfully updated:'=>'ಕೆಳಗಿನ ಅನುವಾದಗಳನ್ನು ಯಶಸ್ವಿಯಾಗಿ ನವೀಕರಿಸಲಾಗಿದೆ:','The following themes were successfully updated:'=>'ಕೆಳಗಿನ ಥೀಮ್‌ಗಳನ್ನು ಯಶಸ್ವಿಯಾಗಿ ನವೀಕರಿಸಲಾಗಿದೆ:','Add Widget'=>'ವಿಜೆಟ್ ಸೇರಿಸಿ','Show next theme'=>'ಮುಂದಿನ ಥೀಮ್ ತೋರಿಸಿ','Show previous theme'=>'ಹಿಂದಿನ ಥೀಮ್ ತೋರಿಸಿ','Add New Theme'=>'ಹೊಸ ಥೀಮ್ ಸೇರಿಸಿ','Update Available'=>'ನವೀಕರಣವು ಲಭ್ಯವಿದೆ','Unable to submit this form, please refresh and try again.'=>'ಈ ಫಾರ್ಮ್ ಅನ್ನು ಸಲ್ಲಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ, ದಯವಿಟ್ಟು ರಿಫ್ರೆಶ್ ಮಾಡಿ ಮತ್ತು ಮತ್ತೊಮ್ಮೆ ಪ್ರಯತ್ನಿಸಿ.','<strong>Quick Draft</strong> &mdash; Allows you to create a new post and save it as a draft. Also displays links to the 3 most recent draft posts you\'ve started.'=>'<strong> ಶೀಘ್ರ ಡ್ರಾಫ್ಟ್</strong> - ಹೊಸ ಪೋಸ್ಟ್ ಅನ್ನು ರಚಿಸಲು ಮತ್ತು ಡ್ರಾಫ್ಟ್ನಂತೆ ಉಳಿಸಲು ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ. ನೀವು ಪ್ರಾರಂಭಿಸಿದ 5 ಇತ್ತೀಚಿನ ಡ್ರಾಫ್ಟ್ ಪೋಸ್ಟ್ಗಳಿಗೆ ಕೂಡ ಲಿಂಕ್ಗಳನ್ನು ತೋರಿಸುತ್ತದೆ.','<strong>Screen Options</strong> &mdash; Use the Screen Options tab to choose which Dashboard boxes to show.'=>'<strong> ಸ್ಕ್ರೀನ್ ಆಯ್ಕೆಗಳು</strong>-ಯಾವ ಡ್ಯಾಶ್ಬೋರ್ಡ್ ಪೆಟ್ಟಿಗೆಗಳನ್ನು ತೋರಿಸಲು ಆಯ್ಕೆ ಮಾಡಲು ಸ್ಕ್ರೀನ್ ಆಯ್ಕೆಗಳು ಟ್ಯಾಬ್ ಬಳಸಿ.','<strong>Activity</strong> &mdash; Shows the upcoming scheduled posts, recently published posts, and the most recent comments on your posts and allows you to moderate them.'=>'<strong> ಚಟುವಟಿಕೆ</strong>-ಮುಂಬರುವ ನಿಗದಿತ ಪೋಸ್ಟ್ಗಳು, ಇತ್ತೀಚೆಗೆ ಪ್ರಕಟವಾದ ಪೋಸ್ಟ್ಗಳು ಮತ್ತು ನಿಮ್ಮ ಪೋಸ್ಟ್ಗಳಲ್ಲಿ ಇತ್ತೀಚಿನ ಕಾಮೆಂಟ್ಗಳನ್ನು ತೋರಿಸುತ್ತದೆ ಮತ್ತು ಅವುಗಳನ್ನು ಮಿತಗೊಳಿಸುವಂತೆ ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ.','Are you sure you want to delete this theme?

Click \'Cancel\' to go back, \'OK\' to confirm the delete.'=>'ಈ ಥೀಮ್ ಅಳಿಸಲು ನೀವು ಖಚಿತವಾಗಿ ಬಯಸುವಿರಾ?  N  n ಮರಳಿ ಹೋಗಲು \'ರದ್ದುಮಾಡು\' ಕ್ಲಿಕ್ ಮಾಡಿ, ಅಳಿಸಲು ಖಚಿತಪಡಿಸಲು \'ಸರಿ\' ಕ್ಲಿಕ್ ಮಾಡಿ.','Popular Plugin'=>'ಜನಪ್ರಿಯ ಪ್ಲಗಿನ್','Tomorrow'=>'ನಾಳೆ','No activity yet!'=>'ಇನ್ನೂ ಯಾವುದೇ ಚಟುವಟಿಕೆ ಇಲ್ಲ!','Recently Published'=>'ಇತ್ತೀಚೆಗೆ ಪ್ರಕಟಿಸಲಾಗಿದೆ','Publishing Soon'=>'ಶೀಘ್ರದಲ್ಲೇ ಪ್ರಕಟಿಸಲಾಗುತ್ತಿದೆ','Quick Draft'=>'ತ್ವರಿತ ಡ್ರಾಫ್ಟ್','SUCCESS: %s'=>'ಯಶಸ್ಸು: %s','WordPress site: %s'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಸೈಟ್: %s','Activity'=>'ಚಟುವಟಿಕೆ','Manage Uploads'=>'ಅಪ್‌ಲೋಡ್‌ಗಳನ್ನು ನಿರ್ವಹಿಸಿ','FAILED: WordPress failed to update to %s'=>'ವಿಫಲವಾಗಿದೆ: %s ಗೆ ನವೀಕರಿಸಲು ಮಾಡಲು ವರ್ಡ್‌ಪ್ರೆಸ್ ವಿಫಲವಾಗಿದೆ','SUCCESS: WordPress was successfully updated to %s'=>'ಯಶಸ್ಸು: ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ಯಶಸ್ವಿಯಾಗಿ %s ಗೆ ಅಪ್‌ಡೇಟ್ ನವೀಕರಿಸಲಾಗಿದೆ','What&#8217;s on your mind?'=>'ನಿಮ್ಮ ಮನದೊಳಗೇನಿದೆ?','FAILED: %s'=>'ವಿಫಲವಾಗಿದೆ: %s','WordPress %1$s running %2$s theme.'=>'ವರ್ಡ್ಪ್ರೆಸ್ %1$s ಚಾಲನೆಯಲ್ಲಿರುವ %2$s ಥೀಮ್.','Your site at %1$s experienced a critical failure while trying to update WordPress to version %2$s.'=>'%1$s ನಲ್ಲಿರುವ ನಿಮ್ಮ ಸೈಟ್ ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು %2$s ಆವೃತ್ತಿಗೆ ನವೀಕರಿಸಲು ಪ್ರಯತ್ನಿಸುತ್ತಿರುವಾಗ ನಿರ್ಣಾಯಕ ವಿಫಲತೆಯನ್ನು ಅನುಭವಿಸಿದೆ.','Your site was running version %s.'=>'ನಿಮ್ಮ ಸೈಟ್ ಆವೃತ್ತಿ %s ಅನ್ನು ಚಲಾಯಿಸುತ್ತಿದೆ.','WordPress %s is also now available.'=>'ವರ್ಡ್ಪ್ರೆಸ್ %s ಕೂಡ ಈಗ ಲಭ್ಯವಿದೆ.','Your translations are all up to date.'=>'ನಿಮ್ಮ ಅನುವಾದಗಳು ಎಲ್ಲಾ ನವೀಕೃತವಾಗಿವೆ.','Translations'=>'ಭಾಷಾಂತರಗಳು','Error code: %s'=>'ದೋಷ ಕೋಡ್: %s','The WordPress Team'=>'ವರ್ಡ್ಪ್ರೆಸ್ ತಂಡ','Translations for %s'=>'%s ಗಾಗಿ ಅನುವಾದಗಳು','Update Translations'=>'ಅನುವಾದಗಳನ್ನು ನವೀಕರಿಸಿ','Background updates'=>'ಹಿನ್ನೆಲೆ ನವೀಕರಣಗಳು','No further action is needed on your part.'=>'ನಿಮ್ಮ ಕಡೆಯಿಂದ ಯಾವುದೇ ಮುಂದಿನ ಕ್ರಮದ ಅಗತ್ಯವಿಲ್ಲ.','Updating is easy and only takes a few moments:'=>'ನವೀಕರಿಸುವುದು ಸುಲಭ ಮತ್ತು ಕೆಲವೇ ಕ್ಷಣಗಳನ್ನು ತೆಗೆದುಕೊಳ್ಳುತ್ತದೆ:','This means your site may be offline or broken. Don\'t panic; this can be fixed.'=>'ಇದರರ್ಥ ನಿಮ್ಮ ಸೈಟ್ ಆಫ್‌ಲೈನ್ ಅಥವಾ ಮುರಿದಿರಬಹುದು. ಭಯಪಡಬೇಡಿ; ಇದನ್ನು ಸರಿಪಡಿಸಬಹುದು.','For more on version %s, see the About WordPress screen:'=>'ಆವೃತ್ತಿ %s ಕುರಿತು ಹೆಚ್ಚಿನ ಮಾಹಿತಿಗಾಗಿ, ವರ್ಡ್ಪ್ರೆಸ್ ಬಗ್ಗೆ ಸ್ಕ್ರೀನ್ ನೋಡಿ:','Your hosting company, support forum volunteers, or a friendly developer may be able to use this information to help you:'=>'ನಿಮ್ಮ ಹೋಸ್ಟಿಂಗ್ ಕಂಪನಿ, ಬೆಂಬಲ ವೇದಿಕೆ ಸ್ವಯಂಸೇವಕರು ಅಥವಾ ಸ್ನೇಹಪರ ಡೆವಲಪರ್ ನಿಮಗೆ ಸಹಾಯ ಮಾಡಲು ಈ ಮಾಹಿತಿಯನ್ನು ಬಳಸಬಹುದು:','You also have some plugins or themes with updates available. Update them now:'=>'ನೀವು ಕೆಲವು ಲಭ್ಯವಿರುವ ನವೀಕರಣಗಳನ್ನು ಒಳಗೊಂಡ  ಪ್ಲಗ್‌ಇನ್‌ಗಳು ಅಥವಾ ಥೀಮ್‌ಗಳನ್ನು ಸಹ ಹೊಂದಿದ್ದೀರಿ. ಅವುಗಳನ್ನು ಈಗ ನವೀಕರಿಸಿ:','If you experience any issues or need support, the volunteers in the WordPress.org support forums may be able to help.'=>'ನೀವು ಯಾವುದೇ ಸಮಸ್ಯೆಗಳನ್ನು ಎದುರಿಸುತ್ತಿದ್ದರೆ ಅಥವಾ ಬೆಂಬಲ ಅಗತ್ಯವಿದ್ದರೆ, WordPress.org ಬೆಂಬಲ ವೇದಿಕೆಗಳಲ್ಲಿ ಸ್ವಯಂಸೇವಕರು ಸಹಾಯ ಮಾಡಬಹುದು.','Keeping your site updated is important for security. It also makes the internet a safer place for you and your readers.'=>'ಸುರಕ್ಷತೆಗಾಗಿ ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ನವೀಕರಿಸುವುದು ಮುಖ್ಯವಾಗಿದೆ. ಇದು ಅಂತರ್ಜಾಲವನ್ನು ನಿಮಗೆ ಮತ್ತು ನಿಮ್ಮ ಓದುಗರಿಗೆ ಸುರಕ್ಷಿತ ಸ್ಥಳವಾಗಿಸುತ್ತದೆ.','Please update your site at %1$s to WordPress %2$s.'=>'ದಯವಿಟ್ಟು %1$s ನಲ್ಲಿನ ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ವರ್ಡ್ಪ್ರೆಸ್ %2$s ಗೆ ನವೀಕರಿಸಿ ','Please check out your site now. It\'s possible that everything is working. If it says you need to update, you should do so:'=>'ದಯವಿಟ್ಟು ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಇದೀಗ ಪರಿಶೀಲಿಸಿ. ಎಲ್ಲವೂ ಕೆಲಸ ಮಾಡುವ ಸಾಧ್ಯತೆಯಿದೆ. ನೀವು ನವೀಕರಿಸಬೇಕಾದರೆ, ನೀವು ಹೀಗೆ ಮಾಡಬೇಕು:','Your site at %1$s experienced a critical failure while trying to update to the latest version of WordPress, %2$s.'=>'%1$s ನಲ್ಲಿರುವ ನಿಮ್ಮ ಸೈಟ್ ವರ್ಡ್ಪ್ರೆಸ್ನ ಇತ್ತೀಚಿನ ಆವೃತ್ತಿಯ, %2$s ಗೆ ನವೀಕರಿಸಲು ಪ್ರಯತ್ನಿಸುತ್ತಿರುವಾಗ ನಿರ್ಣಾಯಕ ವಿಫಲತೆಯನ್ನು ಅನುಭವಿಸಿದೆ.','Howdy! Your site at %1$s has been updated automatically to WordPress %2$s.'=>'ಹೇಗಿದ್ದೀರಾ! %1$s ನಲ್ಲಿರುವ ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ವರ್ಡ್ಪ್ರೆಸ್ %2$s ಗೆ ನವೀಕರಿಸಲಾಗಿದೆ.','[%1$s] URGENT: Your site may be down due to a failed update'=>'[ %1$s ] ಅರ್ಜೆಂಟ್: ವಿಫಲಗೊಂಡ ಕಾರಣದಿಂದಾಗಿ ನಿಮ್ಮ ಸೈಟ್ ಕೆಳಗಿಳಿಯಬಹುದು','[%1$s] WordPress %2$s is available. Please update!'=>'[ %1$s ] ವರ್ಡ್ಪ್ರೆಸ್ %2$s ಲಭ್ಯವಿದೆ. ದಯವಿಟ್ಟು ನವೀಕರಿಸಿ!','[%1$s] Your site has updated to WordPress %2$s'=>'[ %1$s ] ನಿಮ್ಮ ಸೈಟ್ ವರ್ಡ್ಪ್ರೆಸ್ %2$s ಗೆ ನವೀಕರಿಸಿದೆ','Updating translations for %1$s (%2$s)&#8230;'=>'%1$s (%2$s) ಅನುವಾದಗಳನ್ನು ನವೀಕರಿಸಲಾಗುತ್ತಿದೆ...','Updating theme: %s'=>'ಥೀಮ್ ನವೀಕರಿಸಲಾಗುತ್ತಿದೆ: %s','Translation update failed.'=>'ಅನುವಾದ ನವೀಕರಣ ವಿಫಲವಾಗಿದೆ.','There is not enough free disk space to complete the update.'=>'ನವೀಕರಣವನ್ನು ಪೂರ್ಣಗೊಳಿಸಲು ಸಾಕಷ್ಟು ಉಚಿತ ಡಿಸ್ಕ್ ಸ್ಥಳವಿಲ್ಲ.','Updating plugin: %s'=>'ಪ್ಲಗಿನ್ ಅನ್ನು ನವೀಕರಿಸಲಾಗುತ್ತಿದೆ: %s','Translation updated successfully.'=>'ಅನುವಾದವನ್ನು ಯಶಸ್ವಿಯಾಗಿ ನವೀಕರಿಸಲಾಗಿದೆ.','Comment must be manually approved'=>'ಕಾಮೆಂಟ್ ಅನ್ನು ಹಸ್ತಚಾಲಿತವಾಗಿ ಅನುಮೋದಿಸಬೇಕು','Create a brand new user and add them to this site.'=>'ಹೊಚ್ಚ ಹೊಸ ಬಳಕೆದಾರರನ್ನು ರಚಿಸಿ ಮತ್ತು ಅವರನ್ನು ಈ ಸೈಟ್‌ಗೆ ಸೇರಿಸಿ.','Upgrading to a newer version of the same theme will override changes made here. To avoid this, consider creating a <a href="%s">child theme</a> instead.'=>'ಒಂದೇ ಥೀಮ್ನ ಹೊಸ ಆವೃತ್ತಿಯನ್ನು ನವೀಕರಿಸುವುದು ಇಲ್ಲಿ ಮಾಡಿದ ಬದಲಾವಣೆಗಳನ್ನು ಅತಿಕ್ರಮಿಸುತ್ತದೆ. ಇದನ್ನು ತಪ್ಪಿಸಲು, ಬದಲಿಗೆ <a href="%s">ಮಕ್ಕಳ ಥೀಮ್ </a> ಅನ್ನು ರಚಿಸುವುದನ್ನು ಪರಿಗಣಿಸಿ.','The sizes listed below determine the maximum dimensions in pixels to use when adding an image to the Media Library.'=>'ಕೆಳಗೆ ಪಟ್ಟಿಮಾಡಲಾದ ಗಾತ್ರಗಳು ಮಾಧ್ಯಮ ಲೈಬ್ರರಿಗೆ ಇಮೇಜ್ ಸೇರಿಸುವಾಗ ಬಳಸಲು ಪಿಕ್ಸೆಲ್ಗಳಲ್ಲಿ ಗರಿಷ್ಠ ಆಯಾಮಗಳನ್ನು ನಿರ್ಧರಿಸುತ್ತದೆ.','You must provide an email address.'=>'ನೀವು ಇಮೇಲ್ ವಿಳಾಸವನ್ನು ಒದಗಿಸಬೇಕು.','WordPress %s'=>'ವರ್ಡ್ಪ್ರೆಸ್ %s','Updating to WordPress %s'=>'ವರ್ಡ್ಪ್ರೆಸ್ %s ಗೆ ನವೀಕರಿಸಲಾಗುತ್ತಿದೆ','Your passwords do not match. Please try again.'=>'ನಿಮ್ಮ ಪಾಸ್‌ವರ್ಡ್‌ಗಳು ಹೊಂದಾಣಿಕೆಯಾಗುತ್ತಿಲ್ಲ. ದಯವಿಟ್ಟು ಪುನಃ ಪ್ರಯತ್ನಿಸಿ.','The username you provided has invalid characters.'=>'ನೀವು ಒದಗಿಸಿದ ಬಳಕೆದಾರ ಹೆಸರು ಅಮಾನ್ಯ ಅಕ್ಷರಗಳನ್ನು ಹೊಂದಿದೆ.','Please provide a valid username.'=>'ದಯವಿಟ್ಟು ಮಾನ್ಯವಾದ ಬಳಕೆದಾರ ಹೆಸರನ್ನು ನೀಡಿ.','This password will not be stored on the server.'=>'ಈ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಸರ್ವರ್‌ನಲ್ಲಿ ಸಂಗ್ರಹಿಸಲಾಗುವುದಿಲ್ಲ.','<strong>Clicking the arrow to the right of any menu item</strong> in the editor will reveal a standard group of settings. Additional settings such as link target, CSS classes, link relationships, and link descriptions can be enabled and disabled via the Screen Options tab.'=>'ಸಂಪಾದಕದಲ್ಲಿರುವ <strong> ಯಾವುದೇ ಮೆನು ಐಟಂನ ಬಲಕ್ಕೆ ಬಾಣವನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವುದರಿಂದ </strong>ಸೆಟ್ಟಿಂಗ್ಗಳ ಪ್ರಮಾಣಿತ ಗುಂಪನ್ನು ತೋರಿಸುತ್ತದೆ. ಲಿಂಕ್ ಗುರಿ, ಸಿಎಸ್ಎಸ್ ತರಗತಿಗಳು, ಲಿಂಕ್ ಸಂಬಂಧಗಳು, ಮತ್ತು ಲಿಂಕ್ ವಿವರಣೆಗಳಂತಹ ಹೆಚ್ಚುವರಿ ಸೆಟ್ಟಿಂಗ್ಗಳನ್ನು ಸ್ಕ್ರೀನ್ ಆಯ್ಕೆಗಳು ಟ್ಯಾಬ್ ಮೂಲಕ ಸಕ್ರಿಯಗೊಳಿಸಬಹುದು ಮತ್ತು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಬಹುದು.','Your theme does not natively support menus, but you can use them in sidebars by adding a &#8220;Navigation Menu&#8221; widget on the <a href="%s">Widgets</a> screen.'=>'ನಿಮ್ಮ ಥೀಮ್ ಸ್ಥಳೀಯವಾಗಿ ಮೆನುಗಳಿಗೆ ಬೆಂಬಲಿಸುವುದಿಲ್ಲ, ಆದರೆ ನೀವು "ನ್ಯಾವಿಗೇಷನ್ ಮೆನು" ಅನ್ನು ಸೇರಿಸುವ ಮೂಲಕ ಅಡ್ಡಪಟ್ಟಿಗಳಲ್ಲಿ ಅವುಗಳನ್ನು ಬಳಸಬಹುದು<a href="%s">ಹಿಂದಿನ </a> ಪರದೆಯ ಮೇಲೆ ವಿಜೆಟ್.','Copying the required files&#8230;'=>'ಅಗತ್ಯವಿರುವ ಫೈಲ್‌ಗಳನ್ನು ನಕಲಿಸಲಾಗುತ್ತಿದೆ&#8230;','Preparing to install the latest version&#8230;'=>'ಇತ್ತೀಚಿನ ಆವೃತ್ತಿಯನ್ನು ಸ್ಥಾಪಿಸಲು ತಯಾರಾಗುತ್ತಿದೆ&#8230;','The checksum of the file (%1$s) does not match the expected checksum value (%2$s).'=>'ಫೈಲ್ನ ಚೆಕ್ಸಮ್ ( %1$s ) ನಿರೀಕ್ಷಿತ ಚೆಕ್ಸಮ್ ಮೌಲ್ಯದೊಂದಿಗೆ ( %2$s ) ಹೊಂದಿಕೆಯಾಗುವುದಿಲ್ಲ.','Looking for %1$s in %2$s'=>'%2$s ನಲ್ಲಿ %1$s ಗಾಗಿ ನೋಡಲಾಗುತ್ತಿದೆ','Sorry, that is not a valid email address. Email addresses look like <code>username@example.com</code>.'=>'ಕ್ಷಮಿಸಿ, ಅದು ಮಾನ್ಯವಾದ ಇಮೇಲ್ ವಿಳಾಸವಲ್ಲ. ಇಮೇಲ್ ವಿಳಾಸಗಳು <code>username@example.com</code> ನಂತೆ ಕಾಣುತ್ತವೆ.','Tag not updated.'=>'ಟ್ಯಾಗ್ ನವೀಕರಿಸಲಾಗಿಲ್ಲ.','Tag not added.'=>'ಟ್ಯಾಗ್ ಸೇರಿಸಲಾಗಿಲ್ಲ.','Tag updated.'=>'ಟ್ಯಾಗ್ ನವೀಕರಿಸಲಾಗಿದೆ.','Tag deleted.'=>'ಟ್ಯಾಗ್ ಅಳಿಸಲಾಗಿದೆ.','Tag added.'=>'ಟ್ಯಾಗ್ ಸೇರಿಸಲಾಗಿದೆ.','Categories deleted.'=>'ವರ್ಗಗಳನ್ನು ಅಳಿಸಲಾಗಿದೆ.','Category not updated.'=>'ವರ್ಗವನ್ನು ನವೀಕರಿಸಲಾಗಿಲ್ಲ.','Category not added.'=>'ವರ್ಗವನ್ನು ಸೇರಿಸಲಾಗಿಲ್ಲ.','Category deleted.'=>'ವರ್ಗವನ್ನು ಅಳಿಸಲಾಗಿದೆ.','%s page updated.'=>'%s ಪುಟವನ್ನು ನವೀಕರಿಸಲಾಗಿದೆ.' . "\0" . '%s ಪುಟಗಳನ್ನು ನವೀಕರಿಸಲಾಗಿದೆ.','%s page not updated, somebody is editing it.'=>'%s ಪುಟವನ್ನು ನವೀಕರಿಸಲಾಗಿಲ್ಲ, ಯಾರೋ ಅದನ್ನು ಸಂಪಾದಿಸುತ್ತಿದ್ದಾರೆ.' . "\0" . '%s ಪುಟಗಳನ್ನು ನವೀಕರಿಸಲಾಗಿಲ್ಲ, ಯಾರೋ ಅವುಗಳನ್ನು ಸಂಪಾದಿಸುತ್ತಿದ್ದಾರೆ.','Tags deleted.'=>'ಟ್ಯಾಗ್‌ಗಳನ್ನು ಅಳಿಸಲಾಗಿದೆ.','Category updated.'=>'ವರ್ಗವನ್ನು ನವೀಕರಿಸಲಾಗಿದೆ.','Category added.'=>'ವರ್ಗವನ್ನು ಸೇರಿಸಲಾಗಿದೆ.','%s page restored from the Trash.'=>'%s ಪುಟವನ್ನು ಅನುಪಯುಕ್ತದಿಂದ ಮರುಸ್ಥಾಪಿಸಲಾಗಿದೆ.' . "\0" . '%s ಪುಟವನ್ನು ಅನುಪಯುಕ್ತದಿಂದ ಮರುಸ್ಥಾಪಿಸಲಾಗಿದೆ.','%s page moved to the Trash.'=>'%s ಪುಟವನ್ನು ಅನುಪಯುಕ್ತಕ್ಕೆ ಸರಿಸಲಾಗಿದೆ.' . "\0" . '%s ಪುಟವನ್ನು ಅನುಪಯುಕ್ತಕ್ಕೆ ಸರಿಸಲಾಗಿದೆ.','%s page permanently deleted.'=>'%s ಪುಟವನ್ನು ಶಾಶ್ವತವಾಗಿ ಅಳಿಸಲಾಗಿದೆ.' . "\0" . '%s ಪುಟವನ್ನು ಶಾಶ್ವತವಾಗಿ ಅಳಿಸಲಾಗಿದೆ.','%s post restored from the Trash.'=>'%s ಪೋಸ್ಟ್ ಅನ್ನು ಅನುಪಯುಕ್ತದಿಂದ ಮರುಸ್ಥಾಪಿಸಲಾಗಿದೆ.' . "\0" . '%s ಪೋಸ್ಟ್ ಅನ್ನು ಅನುಪಯುಕ್ತದಿಂದ ಮರುಸ್ಥಾಪಿಸಲಾಗಿದೆ.','%s post moved to the Trash.'=>'%s ಪೋಸ್ಟ್ ಅನ್ನು ಅನುಪಯುಕ್ತಕ್ಕೆ ಸರಿಸಲಾಗಿದೆ.' . "\0" . '%s ಪೋಸ್ಟ್ ಅನ್ನು ಅನುಪಯುಕ್ತಕ್ಕೆ ಸರಿಸಲಾಗಿದೆ.','%s post permanently deleted.'=>'%s ಪೋಸ್ಟ್ ಅನ್ನು ಶಾಶ್ವತವಾಗಿ ಅಳಿಸಲಾಗಿದೆ.' . "\0" . '%s ಪೋಸ್ಟ್ ಅನ್ನು ಶಾಶ್ವತವಾಗಿ ಅಳಿಸಲಾಗಿದೆ.','%s post not updated, somebody is editing it.'=>'%s ಪೋಸ್ಟ್ ಅನ್ನು ನವೀಕರಿಸಲಾಗಿಲ್ಲ, ಯಾರಾದರೂ ಇದನ್ನು ಸಂಪಾದಿಸುತ್ತಿದ್ದಾರೆ.' . "\0" . '%s ಪೋಸ್ಟ್ ಅನ್ನು ನವೀಕರಿಸಲಾಗಿಲ್ಲ, ಯಾರಾದರೂ ಇದನ್ನು ಸಂಪಾದಿಸುತ್ತಿದ್ದಾರೆ.','Compare two different revisions by <strong>selecting the &#8220;Compare any two revisions&#8221; box</strong> to the side.'=>'<strong> ಆಯ್ಕೆಮಾಡಿ "ಯಾವುದೇ ಎರಡು ಪರಿಷ್ಕರಣೆಗಳನ್ನು ಹೋಲಿಸಿ" ಎರಡು ವಿಭಿನ್ನ ಪರಿಷ್ಕರಣೆಗಳನ್ನು ಹೋಲಿಸಿ; ಪೆಟ್ಟಿಗೆಯಲ್ಲಿ </strong> ಬದಲಾಗುತ್ತದೆ.','Compare any two revisions'=>'ಯಾವುದೇ ಎರಡು ಪರಿಷ್ಕರಣೆಗಳನ್ನು ಹೋಲಿಕೆ ಮಾಡಿ','Revisions: %s'=>'ಪರಿಷ್ಕರಣೆಗಳು: %s','Restore This Autosave'=>'ಈ ಆಟೋಸೇವ್ ಅನ್ನು ಮರುಸ್ಥಾಪಿಸಿ','Current Revision by %s'=>'%s ರಿಂದ ಪ್ರಸ್ತುತ ಪರಿಷ್ಕರಣೆ','revisionsBrowse'=>'ಬ್ರೌಸ್','"%s".'=>'"%s".','Autosave by %s'=>'%s ನಿಂದ ಸ್ವಯಂಉಳಿಸುವಿಕೆ','"%1$s" by %2$s.'=>'"%1$s" ರಿಂದ %2$s.','"%1$s" from %2$s.'=>'%2$s ನಿಂದ  " %1$s ".','"%1$s" from %2$s by %3$s.'=>'%3$s ರಿಂದ %2$s ರಿಂದ  " %1$s ".','Revision by %s'=>'%s ಪರಿಷ್ಕರಣೆ','Sorry, something went wrong. The requested comparison could not be loaded.'=>'ಕ್ಷಮಿಸಿ, ಏನೋ ತಪ್ಪಾಗಿದೆ. ವಿನಂತಿಸಿದ ಹೋಲಿಕೆಯನ್ನು ಲೋಡ್ ಮಾಡಲಾಗಲಿಲ್ಲ.','Repeat New Password'=>'ಹೊಸ ಪ್ರವೇಶಪದವನ್ನು ಪುನಾರಾವರ್ತಿಸಿ','Repeat Password'=>'ಗುಪದವನ್ನು ಪುನಾರಾವರ್ತಿಸಿ','Add menu items from the column on the left.'=>'ಬಲ ಬದಿಯ ಅಂಕಣದಿಂದ ಆಯ್ಕೆಪಟ್ಟಿಯ ಅಂಶಗಳನ್ನು ಸೇರಿಸಿ.','Plugins extend and expand the functionality of WordPress. You may install plugins in the <a href="%s">WordPress Plugin Directory</a> right from here, or upload a plugin in .zip format by clicking the button at the top of this page.'=>'ಪ್ಲಗಿನ್‌ಗಳು WordPress ನ ಕಾರ್ಯವನ್ನು ವಿಸ್ತರಿಸುತ್ತವೆ ಮತ್ತು ವಿಸ್ತರಿಸುತ್ತವೆ. ನೀವು ಇಲ್ಲಿಂದಲೇ <a href="%s">WordPress ಪ್ಲಗಿನ್ ಡೈರೆಕ್ಟರಿ</a> ನಲ್ಲಿ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಸ್ಥಾಪಿಸಬಹುದು ಅಥವಾ ಈ ಪುಟದ ಮೇಲ್ಭಾಗದಲ್ಲಿರುವ ಬಟನ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವ ಮೂಲಕ .zip ಸ್ವರೂಪದಲ್ಲಿ ಪ್ಲಗಿನ್ ಅನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಬಹುದು.','http://wordpress.org/plugins/hello-dolly/'=>'http://wordpress.org/plugins/hello-dolly/','The package contains no files.'=>'ಈ ಕಂತೆಯಲ್ಲಿ ಯಾವುದೇ ಕಡತಗಳಿಲ್ಲ.','The theme contains no files.'=>'ಈ ಥೀಮ್ ಯಾವುದೇ ಕಡತಗಳನ್ನು ಹೊಂದಿಲ್ಲ.','To navigate between revisions, <strong>drag the slider handle left or right</strong> or <strong>use the Previous or Next buttons</strong>.'=>'ಪರಿಷ್ಕರಣೆಗಳ ನಡುವೆ ಜಾಲಾಡಲು, <strong>ಸ್ಲೈಡರ್ ಹ್ಯಾಂಡಲ್ ಅನ್ನು ಬಲ ಅಥವಾ ಎಡಕ್ಕೆ ಎಳೆಯಿರಿ</strong>   ಅಥವಾ <strong>ಹಿಂದಕ್ಕೆ ಅಥವಾ ಮುಂದಕ್ಕೆ ಗುಂಡಿಗಳನ್ನು ಬಳಸಿ</strong>.','Loading&hellip;'=>'ತುಂಬುತ್ತಿದೆ&hellip;','This item has already been deleted.'=>'ಈ ವಸ್ತುವು ಈಗಾಗಲೇ ಅಳಿಸಲ್ಪಟ್ಟಿದೆ.','The item you are trying to restore from the Trash no longer exists.'=>'ನೀವು ಕಸದಿಂದ ಮರುಬಳಸಲು ಪ್ರಯತ್ನಿಸುತ್ತಿರುವ ವಸ್ತು ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ. ','The item you are trying to move to the Trash no longer exists.'=>'ನೀವು ಕಸಕ್ಕೆ ಸಾಗಿಸಲು ಪ್ರಯತ್ನಿಸುತ್ತಿರುವ ವಸ್ತು ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','Drag the items into the order you prefer. Click the arrow on the right of the item to reveal additional configuration options.'=>'ನೀವು ಬಯಸಿದಂತೆ ಪ್ರತಿ ಐಟಂ ಅನ್ನು ಎಳೆಯಿರಿ. ಹೆಚ್ಚುವರಿ ಸಂರಚನಾ ಆಯ್ಕೆಗಳನ್ನು ಬಹಿರಂಗಪಡಿಸಲು ಐಟಂನ ಬಲಭಾಗದಲ್ಲಿರುವ ಬಾಣವನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ.','If you have not yet created any menus, <strong>click the &#8217;create a new menu&#8217; link</strong> to get started'=>'ನೀವು ಇನ್ನೂ ಯಾವುದೇ ಮೆನುಗಳನ್ನು ರಚಿಸದಿದ್ದರೆ, <strong>ಕ್ಲಿಕ್ ಮಾಡಿ &#8217;ಹೊಸ ಮೆನು ರಚಿಸಿ&#8217; ಪ್ರಾರಂಭಿಸಲು ಲಿಂಕ್</strong>','This screen is used for managing your content revisions.'=>'ಈ ಪರದೆಯನ್ನು ನಿಮ್ಮ ವಸ್ತುವಿಷಯಗಳ ಪರಿಷ್ಕರಣೆಗಳನ್ನು ನಿರ್ವಹಿಸಲು ಬಳಸಲಾಗುತ್ತದೆ.','Revisions are saved copies of your post or page, which are periodically created as you update your content. The red text on the left shows the content that was removed. The green text on the right shows the content that was added.'=>'ಪರಿಷ್ಕರಣೆಗಳು ನಿಮ್ಮ ಉಳಿಸಲಾದ ಲೇಖನ ಅಥವಾ ಪುಟದ ಪ್ರತಿಗಳಾಗಿರುತ್ತವೆ, ಇವು ನೀವು ನಿಮ್ಮ ವಸ್ತುವಿಷಯವನ್ನು ನವೀಕರಿಸಿದಾಗ ನಿರ್ದಿಷ್ಟ ಅವಧಿಗಳಲ್ಲಿ ರಚನೆಯಾಗುತ್ತವೆ. ಎಡದಲ್ಲಿರುವ ಕೆಂಪು ಪಠ್ಯ ತೆಗೆದುಹಾಕಲಾಗಿರುವ ವಸ್ತುವಿಷಯವನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ. ಬಲದಲ್ಲಿರುವ ಹಸಿರು ಪಠ್ಯ ಸೇರಿಸಲಾಗಿರುವ ವಸ್ತುವಿಷಯವನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ. ','To restore a revision, <strong>click Restore This Revision</strong>.'=>'ಪರಿಷ್ಕರಣೆಯನ್ನು ಪುನಃಸ್ಥಾಪಿಸಲು, <strong>ಈ ಪರಿಷ್ಕರಣೆಯನ್ನು ಮರುಸ್ಥಾಪಿಸಿ ಕ್ಲಿಕ್ ಮಾಡಿ</strong>.','From this screen you can review, compare, and restore revisions:'=>'ಈ ಪರದೆಯಿಂದ ನೀವು ಪರಿಷ್ಕರಣೆಗಳನ್ನು ಪರಿಶೀಲಿಸಬಹುದು, ಹೋಲಿಸಬಹುದು ಮತ್ತು ಮರುಸ್ಥಾಪಿಸಬಹುದು:','Followed by post revision infoTo:'=>'ತನಕ:','Followed by post revision infoFrom:'=>'ಇಂದ:','Button label for a next revisionNext'=>'ಮುಂದಿನ','Button label for a previous revisionPrevious'=>'ಹಿಂದಿನ','%1$s by %2$s.'=>'%2$s ರಿಂದ %1$s .','Released: %d.'=>'ಬಿಡುಗಡೆಯಾಗಿದ್ದು: %d.','Menu Management'=>'ಆಯ್ಕೆಪಟ್ಟಿ ನಿರ್ವಹಣೆ','Editing Menus'=>'ಆಯ್ಕೆಪಟ್ಟಿ ಸಂಪಾದನೆ','Edit Menus'=>'ಆಯ್ಕೆಪಟ್ಟಿ ಸಂಪಾದನೆ ','Manage Locations'=>'ಸ್ಥಾನಗಳ ನಿರ್ವಹಣೆ','Theme Location'=>'ಥೀಮ್ ನ ಸ್ಥಾನ','Assigned Menu'=>'ನಿಯೋಜಿಸಿರುವ ಆಯ್ಕೆಪಟ್ಟಿ','Select a Menu'=>'ಆಯ್ಕೆಪಟ್ಟಿಯನ್ನು ಆರಿಸಿ','menuUse new menu'=>'ಹೊಸ ಆಯ್ಕೆಪಟ್ಟಿಯನ್ನು ಬಳಸಿ ','Audio Format:'=>'ಧ್ವನಿ ನಮೂನೆ:','Your latest changes were saved as a revision.'=>'ನಿಮ್ಮ ಇತ್ತೀಚಿನ ಬದಲಾವಣೆಗಳನ್ನು ಪರಿಷ್ಕರಣೆಯಂತೆ ಉಳಿಸಲಾಗಿದೆ.','This screen is used for managing your navigation menus.'=>'ಈ ಪರದೆಯನ್ನು ನಿಮ್ಮ ಸ್ವಯೋಜಿತ ಜಾಲಾಟ ಆಯ್ಕೆಪಟ್ಟಿಗಳನ್ನು ನಿರ್ವಹಿಸಲು ಬಳಸಲಾಗುತ್ತದೆ.','From this screen you can:'=>'ಈ ಪರದೆಯಿಂದ ನೀವು ಇದನ್ನು ಮಾಡಬಹುದು:','Create, edit, and delete menus'=>'ರಚಿಸಿ, ಸಂಪಾದಿಸಿ ಮತ್ತು ಆಯ್ಕೆಪಟ್ಟಿಗಳನ್ನು ಅಳಿಸಿ.','Add, organize, and modify individual menu items'=>'ಪ್ರತಿಯೊಂದು ಆಯ್ಕೆಪಟ್ಟಿ ಅಂಶವನ್ನು ಸೇರಿಸಿ, ನಿಯೋಜಿಸಿ ಮತ್ತು ಬದಲಾಯಿಸಿ.','The menu management box at the top of the screen is used to control which menu is opened in the editor below.'=>'ಪರದೆಯ ಮೇಲ್ಭಾಗದಲ್ಲಿರುವ ಆಯ್ಕೆಪಟ್ಟಿ ನಿರ್ವಹಣಾ ಚೌಕಟ್ಟು, ಈ ಕೆಳಗಿನ ಸಂಪಾದಕದಲ್ಲಿ ಯಾವ ಆಯ್ಕೆಪಟ್ಟಿಯನ್ನು ತೆರೆಯಲಾಗಿದೆ ಎಂಬುದನ್ನು ನಿಯಂತ್ರಿಸಲು ಬಳಕೆಯಾಗುತ್ತದೆ.','Add one or several items at once by <strong>selecting the checkbox next to each item and clicking Add to Menu</strong>'=>'ಒಂದು ಅಥವಾ ಹಲವು ವಸ್ತುಗಳನ್ನು <strong>ಪ್ರತಿಯೊಂದು ವಸ್ತುವಿನ ಪಕ್ಕದಲ್ಲಿರುವ ಆಯ್ಕೆಚೌಕಟ್ಟನ್ನು ಆರಿಸಿ ಮತ್ತು ಆಯ್ಕೆಪಟ್ಟಿಗೆ ಸೇರಿಸಿ ಅನ್ನು ಕ್ಲಿಕ್ </strong> ಮಾಡುವುದರ ಮೂಲಕ ಒಮ್ಮೆಲೆ ಸೇರಿಸಬಹುದು. ','This screen is used for globally assigning menus to locations defined by your theme.'=>'ಈ ಪರದೆಯನ್ನು,  ನಿಮ್ಮ ಥೀಮ್ ನಿಂದ ಗೊತ್ತುಪಡಿಸಲಾದ ಜಾಗಗಳಿಗೆ ಆಯ್ಕೆಪಟ್ಟಿಗಳನ್ನು ಜಾಗತಿಕವಾಗಿ ಹೊಂದಿಸಲು ಬಳಸಲಾಗುತ್ತದೆ.','menuEdit'=>'ಸಂಪಾದಿಸಿ','Genre: %s.'=>'ಶೈಲಿ: %s.','Menu locations updated.'=>'ಮೆನು ಸ್ಥಳಗಳನ್ನು ನವೀಕರಿಸಲಾಗಿದೆ.','Track %1$s of %2$s.'=>'%2$s ರಲ್ಲಿ ಟ್ರ್ಯಾಕ್ %1$s. ','Audio Codec:'=>'ಆಡಿಯೋ ಕೋಡೆಕ್:','Delete a menu item by <strong>expanding it and clicking the Remove link</strong>'=>'ಮೆನು ಐಟಂ ಅನ್ನು ಅಳಿಸಲು <strong> ಅದನ್ನು ವಿಸ್ತರಿಸಿ ಮತ್ತು ಲಿಂಕ್ ತೆಗೆದುಹಾಕಿ </strong> ಕ್ಲಿಕ್ ಮಾಡಿ','You can assign theme locations to individual menus by <strong>selecting the desired settings</strong> at the bottom of the menu editor. To assign menus to all theme locations at once, <strong>visit the Manage Locations tab</strong> at the top of the screen.'=>'ನೀವು ಮೆನು ಸಂಪಾದಕನ ಕೆಳಭಾಗದಲ್ಲಿ <strong> ಬಯಸಿದ ಸೆಟ್ಟಿಂಗ್ಗಳನ್ನು ಆಯ್ಕೆಮಾಡಿ </strong> ಮೂಲಕ ವೈಯಕ್ತಿಕ ಸ್ಥಳಗಳಿಗೆ ಥೀಮ್ ಸ್ಥಳಗಳನ್ನು ನಿಯೋಜಿಸಬಹುದು. ಏಕಕಾಲದಲ್ಲಿ ಎಲ್ಲಾ ಥೀಮ್ ಸ್ಥಳಗಳಿಗೆ ಮೆನುಗಳನ್ನು ನಿಯೋಜಿಸಲು, ಪರದೆಯ ಮೇಲ್ಭಾಗದಲ್ಲಿರುವ <strong> ಸ್ಥಳಗಳ ಟ್ಯಾಬ್ ಅನ್ನು ನಿರ್ವಹಿಸಿ</strong> ಅನ್ನು ಭೇಟಿ ಮಾಡಿ.','To reorganize menu items, <strong>drag and drop items with your mouse or use your keyboard</strong>. Drag or move a menu item a little to the right to make it a submenu'=>'ಮೆನು ಐಟಂಗಳನ್ನು ಮರುಸಂಘಟಿಸಲು, <strong>ನಿಮ್ಮ ಮೌಸ್‌ನೊಂದಿಗೆ ಐಟಂಗಳನ್ನು ಎಳೆಯಿರಿ ಮತ್ತು ಬಿಡಿ ಅಥವಾ ನಿಮ್ಮ ಕೀಬೋರ್ಡ್ ಬಳಸಿ</strong>. ಉಪಮೆನು ಮಾಡಲು ಮೆನು ಐಟಂ ಅನ್ನು ಸ್ವಲ್ಪ ಬಲಕ್ಕೆ ಎಳೆಯಿರಿ ಅಥವಾ ಸರಿಸಿ','To edit a menu currently assigned to a theme location, <strong>click the adjacent &#8217;Edit&#8217; link</strong>'=>'ಪ್ರಸ್ತುತ ಥೀಮ್ ಸ್ಥಳಕ್ಕೆ ನಿಗದಿಪಡಿಸಲಾದ ಮೆನುವನ್ನು ಸಂಪಾದಿಸಲು, <strong> ಪಕ್ಕದಲ್ಲಿರುವ "ಸಂಪಾದಿಸು" ಲಿಂಕ್</strong>','Each navigation menu may contain a mix of links to pages, categories, custom URLs or other content types. Menu links are added by selecting items from the expanding boxes in the left-hand column below.'=>'ಪ್ರತಿ ಸಂಚರಣೆ ಮೆನುವು ಪುಟಗಳು, ವಿಭಾಗಗಳು, ಕಸ್ಟಮ್ URL ಗಳು ಅಥವಾ ಇತರ ವಿಷಯ ಪ್ರಕಾರಗಳಿಗೆ ಲಿಂಕ್ಗಳ ಮಿಶ್ರಣವನ್ನು ಹೊಂದಿರಬಹುದು. ಕೆಳಗಿನ ಎಡಗಡೆಯ ಕಾಲಮ್ನಲ್ಲಿ ವಿಸ್ತರಿಸುವ ಪೆಟ್ಟಿಗೆಗಳಿಂದ ಐಟಂಗಳನ್ನು ಆಯ್ಕೆ ಮಾಡುವ ಮೂಲಕ ಮೆನು ಲಿಂಕ್ಗಳನ್ನು ಸೇರಿಸಲಾಗುತ್ತದೆ.','To add a new menu instead of assigning an existing one, <strong>click the &#8217;Use new menu&#8217; link</strong>. Your new menu will be automatically assigned to that theme location'=>'ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಮೆನುವನ್ನು ನಿಯೋಜಿಸುವ ಬದಲು ಹೊಸ ಮೆನುವನ್ನು ಸೇರಿಸಲು, <strong>&#8217;ಹೊಸ ಮೆನು ಬಳಸಿ&#8217; ಲಿಂಕ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ</strong> . ನಿಮ್ಮ ಹೊಸ ಮೆನುವನ್ನು ಆ ಥೀಮ್ ಸ್ಥಳಕ್ಕೆ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ನಿಯೋಜಿಸಲಾಗುತ್ತದೆ','To edit an existing menu, <strong>choose a menu from the dropdown and click Select</strong>'=>'ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಮೆನುವನ್ನು ಸಂಪಾದಿಸಲು, <strong>ಡ್ರಾಪ್‌ಡೌನ್‌ನಿಂದ ಮೆನುವನ್ನು ಆರಿಸಿ ಮತ್ತು ಆಯ್ಕೆಮಾಡಿ</strong> ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ','Restore This Revision'=>'ಈ ಪರಿಷ್ಕರಣೆಯನ್ನು ಮರುಬಳಸಿ','Capabilities'=>'ಅರ್ಹತೆಗಳು','Denied: %s'=>'ನಿರಾಕರಿಸಿದ್ದು: %s','Up one'=>'ಒಂದು ಮೇಲೆ ','Move'=>'ಸರಿಸಿ','Menu structure'=>'ಮೆನು ರಚನೆ','To the top'=>'ಮೇಲಕ್ಕೆ','Menu Settings'=>'ಮೆನು ಸೆಟ್ಟಿಂಗ್‌ಗಳು','Down one'=>'ಒಂದು ಕೆಳಗೆ','Draft created on %1$s at %2$s'=>'%2$s ನಲ್ಲಿ %1$s ನಲ್ಲಿ ಕರಡು ರಚಿಸಲಾಗಿದೆ','%s has taken over and is currently editing.'=>'%s ಅವರು ಕೈಗೆತ್ತಿಕೊಂಡಿದ್ದಾರೆ ಮತ್ತು ಪ್ರಸ್ತುತ ಅದನ್ನು ಸಂಪಾದಿಸುತ್ತಿದ್ದಾರೆ.','You cannot move this item to the Trash. %s is currently editing.'=>'ನೀವು ಈ ಐಟಂ ಅನ್ನು ಕಸಕ್ಕೆ ಸರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ. %s ಪ್ರಸ್ತುತ ಸಂಪಾದಿಸುತ್ತಿದ್ದಾರೆ.','Select a menu to edit:'=>'ಎಡಿಟ್ ಮಾಡಲು ಮೆನು ಆಯ್ಕೆ ಮಾಡಿ:','Thank you for Updating! Please visit the <a href="%s">Upgrade Network</a> page to update all your sites.'=>'ನವೀಕರಿಸಿದ್ದಕ್ಕಾಗಿ ಧನ್ಯವಾದಗಳು! ನಿಮ್ಮ ಎಲ್ಲಾ ಸೈಟ್ಗಳನ್ನು ನವೀಕರಿಸಲು ದಯವಿಟ್ಟು <a href="%s">ಅಪ್ಗ್ರೇಡ್ ನೆಟ್ವರ್ಕ್</a> ಪುಟಕ್ಕೆ ಭೇಟಿ ನೀಡಿ.','All right, sparky! You&#8217;ve made it through this part of the installation. WordPress can now communicate with your database. If you are ready, time now to&hellip;'=>'ಸರಿ, ಮಿಂಚುಮತಿ! ಅನುಸ್ಥಾಪನೆಯ ಈ ಭಾಗದ ಮೂಲಕ ನೀವು ಇದನ್ನು ಮಾಡಿದ್ದೀರಿ. ವರ್ಡ್ಪ್ರೆಸ್ ಈಗ ನಿಮ್ಮ ಡೇಟಾಬೇಸ್‌ನೊಂದಿಗೆ ಸಂವಹನ ಮಾಡಬಹುದು. ನೀವು ಸಿದ್ಧರಾಗಿದ್ದರೆ, ಈಗ ಇದು &hellip;ಕ್ಕೆ ಸಮಯ','Client version'=>'ಕ್ಲೈಂಟ್ ಆವೃತ್ತಿ','Selected menus have been successfully deleted.'=>'ಆರಿಸಿದ ಆಯ್ಕೆಪಟ್ಟಿಗಳನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಅಳಿಸಲಾಗಿದೆ.','Auto add pages'=>'ಸ್ವಯಂಚಾಲಿತ ಪುಟಗಳ ಸೇರ್ಪಡೆ','Give your menu a name, then click Create Menu.'=>'ನಿಮ್ಮ ಮೆನುಗೆ ಹೆಸರನ್ನು ನೀಡಿ, ನಂತರ ಮೆನು ರಚಿಸಿ ಕ್ಲಿಕ್ ಮಾಡಿ.','Edit your default menu by adding or removing items. Drag the items into the order you prefer. Click Create Menu to save your changes.'=>'ಐಟಂಗಳನ್ನು ಸೇರಿಸುವ ಮೂಲಕ ಅಥವಾ ತೆಗೆದುಹಾಕುವ ಮೂಲಕ ನಿಮ್ಮ ಡೀಫಾಲ್ಟ್ ಮೆನು ಸಂಪಾದಿಸಿ. ನೀವು ಬಯಸಿದಂತೆ ಪ್ರತಿ ಐಟಂ ಅನ್ನು ಎಳೆಯಿರಿ. ನಿಮ್ಮ ಬದಲಾವಣೆಗಳನ್ನು ಉಳಿಸಲು ಮೆನು ರಚಿಸಿ ಕ್ಲಿಕ್ ಮಾಡಿ.','Look Up'=>'ಹುಡುಕಿ','%s is currently editing'=>'%s ಅವರು ಪ್ರಸ್ತುತ ಸಂಪಾದಿಸುತ್ತಿದ್ದಾರೆ','You can upload and insert media (images, audio, documents, etc.) by clicking the Add Media button. You can select from the images and files already uploaded to the Media Library, or upload new media to add to your page or post. To create an image gallery, select the images to add and click the &#8220;Create a new gallery&#8221; button.'=>'ಸೇರಿಸು ಮಾಧ್ಯಮ ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡುವ ಮೂಲಕ ನೀವು ಮಾಧ್ಯಮವನ್ನು (ಚಿತ್ರಗಳು, ಆಡಿಯೋ, ಡಾಕ್ಯುಮೆಂಟ್ಗಳು, ಇತ್ಯಾದಿ) ಅಪ್ಲೋಡ್ ಮಾಡಬಹುದು ಮತ್ತು ಸೇರಿಸಬಹುದು. ಮಾಧ್ಯಮ ಲೈಬ್ರರಿಗೆ ಈಗಾಗಲೇ ಅಪ್ಲೋಡ್ ಮಾಡಿದ ಚಿತ್ರಗಳು ಮತ್ತು ಫೈಲ್ಗಳಿಂದ ನೀವು ಆಯ್ಕೆ ಮಾಡಬಹುದು, ಅಥವಾ ನಿಮ್ಮ ಪುಟ ಅಥವಾ ಪೋಸ್ಟ್ಗೆ ಸೇರಿಸಲು ಹೊಸ ಮಾಧ್ಯಮವನ್ನು ಅಪ್ಲೋಡ್ ಮಾಡಿ. ಚಿತ್ರ ಗ್ಯಾಲರಿಯನ್ನು ರಚಿಸಲು, ಸೇರಿಸಲು ಮತ್ತು ಆಯ್ಕೆ ಮಾಡಲು ಚಿತ್ರಗಳನ್ನು ಆಯ್ಕೆಮಾಡಿ & # 8220; ಹೊಸ ಗ್ಯಾಲರಿಯನ್ನು ರಚಿಸಿ & # 8221; ಬಟನ್.','Introducing Twenty Twenty-Five'=>'ಟ್ವೆಂಟಿ ಟ್ವೆಂಟಿ-ಫೈವ್ ಅನ್ನು ಪರಿಚಯಿಸಲಾಗುತ್ತಿದೆ','Image rotation is not supported by your web host.'=>'ಚಿತ್ರದ ತಿರುಗುವಿಕೆಯನ್ನು ನಿಮ್ಮ ವೆಬ್ ಹೋಸ್ಟ್ ಬೆಂಬಲಿಸುವುದಿಲ್ಲ.','If you are looking to use the link manager, please install the <a href="%s">Link Manager plugin</a>.'=>'ನೀವು ಲಿಂಕ್ ಮ್ಯಾನೇಜರ್ ಅನ್ನು ಬಳಸಲು ಬಯಸಿದರೆ, ದಯವಿಟ್ಟು<a href="%s">ಲಿಂಕ್ ನಿರ್ವಾಹಕ </a> ಪ್ಲಗ್ಇನ್ ಅನ್ನು ಸ್ಥಾಪಿಸಿ.','Inserting Media'=>'ಮಾಧ್ಯಮವನ್ನು ಸೇರಿಸುತ್ತಿದೆ','Several boxes on this screen contain settings for how your content will be published, including:'=>'ಈ ಪರದೆಯಲ್ಲಿನ ಹಲವಾರು ಚೌಕಟ್ಟುಗಳು ನಿಮ್ಮ ವಸ್ತುವಿಷಯ ಹೇಗೆ ಪ್ರಕಟವಾಗಬೇಕೆಂಬ ಸಂಯೋಜನೆಗಳನ್ನು ಹೊಂದಿವೆ, ಇವನ್ನೂ ಒಳಗೊಂಡಂತೆ: ','To use a background image, simply upload it or choose an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button. You can display a single instance of your image, or tile it to fill the screen. You can have your background fixed in place, so your site content moves on top of it, or you can have it scroll with your site.'=>'ಹಿನ್ನೆಲೆ ಚಿತ್ರವನ್ನು ಉಪಯೋಗಿಸಲು, ಸುಮ್ಮನೆ ಅದನ್ನು ವರ್ಗಾಯಿಸಿ ಅಥವಾ &#8220;ಚಿತ್ರವನ್ನು ಆರಿಸಿ&#8221;  ಗುಂಡಿಯನ್ನು ಒತ್ತುವುದರ ಮೂಲಕ ಈಗಾಗಲೇ ನಿಮ್ಮ ಮಾಧ್ಯಮ ಸಂಗ್ರಹಕ್ಕೆ  ವರ್ಗಾವಣೆಯಾಗಿರುವ ಚಿತ್ರವನ್ನು ಆರಿಸಿ. ನೀವು ನಿಮ್ಮ ಚಿತ್ರವನ್ನು ಪ್ರತ್ಯೇಕ ಪ್ರತಿಯಂತೆ ಅಥವಾ ಪರದೆಯನ್ನು ತುಂಬುವ ಚೌಕಟ್ಟುಗಳಂತೆಯೂ ಪ್ರದರ್ಶಿಸಬಹುದು. ನೀವು ನಿಮ್ಮ ಹಿನ್ನೆಲೆಯನ್ನು ಒಂದೇ ಸ್ಥಳದಲ್ಲಿ ಹಚ್ಚಿದಂತೆ ಇರಿಸಬಹುದು, ಇದರಿಂದಾಗಿ, ನಿಮ್ಮ ಜಾಲತಾಣದ ವಸ್ತುವಿಷಯವು ಅದರ ಮೇಲೆ ಸಾಗುತ್ತದೆ, ಅಥವಾ ಅದನ್ನು ನಿಮ್ಮ ಜಾಲತಾಣದ ಜೊತೆ ಜಾರುವಂತೆಯೂ ಮಾಡಬಹುದು.','<strong>Parent</strong> &mdash; Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have child categories for Bebop and Big Band. Totally optional. To create a subcategory, just choose another category from the Parent dropdown.'=>'<strong>ಪೋಷಕ</strong> &mdash; ಟ್ಯಾಗ್‌ಗಳಂತಲ್ಲದೆ ವರ್ಗಗಳು ಕ್ರಮಾನುಗತವನ್ನು ಹೊಂದಿರಬಹುದು. ನೀವು ಜಾಝ್ ವರ್ಗವನ್ನು ಹೊಂದಿರಬಹುದು ಮತ್ತು ಅದರ ಅಡಿಯಲ್ಲಿ ಬೇಬೊಪ್ ಮತ್ತು ಬಿಗ್ ಬ್ಯಾಂಡ್‌ಗಾಗಿ ಮಕ್ಕಳ ವಿಭಾಗಗಳನ್ನು ಹೊಂದಿರಬಹುದು. ಸಂಪೂರ್ಣವಾಗಿ ಐಚ್ಛಿಕ. ಉಪವರ್ಗವನ್ನು ರಚಿಸಲು, ಪೋಷಕ ಡ್ರಾಪ್‌ಡೌನ್‌ನಿಂದ ಇನ್ನೊಂದು ವರ್ಗವನ್ನು ಆಯ್ಕೆ ಮಾಡಿ.','When changing themes, there is often some variation in the number and setup of widget areas/sidebars and sometimes these conflicts make the transition a bit less smooth. If you changed themes and seem to be missing widgets, scroll down on this screen to the Inactive Widgets area, where all of your widgets and their settings will have been saved.'=>'ಥೀಮ್ಗಳನ್ನು ಬದಲಾಯಿಸುವಾಗ, ವಿಜೆಟ್ ಪ್ರದೇಶಗಳು / ಅಡ್ಡಪಟ್ಟಿಗಳ ಸಂಖ್ಯೆ ಮತ್ತು ಸೆಟಪ್ನಲ್ಲಿ ಕೆಲವು ಬದಲಾವಣೆಗಳಿರುತ್ತವೆ ಮತ್ತು ಕೆಲವೊಮ್ಮೆ ಈ ಘರ್ಷಣೆಗಳು ಸ್ವಲ್ಪಮಟ್ಟಿಗೆ ಕಡಿಮೆ ಮೃದುಗೊಳಿಸುತ್ತವೆ. ನೀವು ಥೀಮ್ಗಳನ್ನು ಬದಲಾಯಿಸಿದರೆ ಮತ್ತು ವಿಜೆಟ್ಗಳನ್ನು ಕಾಣೆಯಾಗಿರುವಂತೆ ತೋರುತ್ತಿದ್ದರೆ, ಈ ಪರದೆಯ ಮೇಲೆ ನಿಷ್ಕ್ರಿಯ ವಿಜೆಟ್ಗಳ ಪ್ರದೇಶಕ್ಕೆ ಸ್ಕ್ರಾಲ್ ಮಾಡಿ, ಅಲ್ಲಿ ನಿಮ್ಮ ಎಲ್ಲಾ ವಿಜೆಟ್ಗಳು ಮತ್ತು ಅವರ ಸೆಟ್ಟಿಂಗ್ಗಳು ಉಳಿಸಲ್ಪಡುತ್ತವೆ.','The title field and the big Post Editing Area are fixed in place, but you can reposition all the other boxes using drag and drop. You can also minimize or expand them by clicking the title bar of each box. Use the Screen Options tab to unhide more boxes (Excerpt, Send Trackbacks, Custom Fields, Discussion, Slug, Author) or to choose a 1- or 2-column layout for this screen.'=>'ಶೀರ್ಷಿಕೆಯ ಕ್ಷೇತ್ರ ಮತ್ತು ದೊಡ್ಡ ಪೋಸ್ಟ್ ಎಡಿಟಿಂಗ್ ಪ್ರದೇಶವನ್ನು ಸ್ಥಳದಲ್ಲಿ ನಿವಾರಿಸಲಾಗಿದೆ, ಆದರೆ ನೀವು ಎಲ್ಲಾ ಇತರ ಪೆಟ್ಟಿಗೆಗಳನ್ನು ಡ್ರ್ಯಾಗ್ ಮತ್ತು ಡ್ರಾಪ್ ಬಳಸಿ ಮರುಹೊಂದಿಸಬಹುದು. ಪ್ರತಿ ಪೆಟ್ಟಿಗೆಯ ಶೀರ್ಷಿಕೆಪಟ್ಟಿಯನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವ ಮೂಲಕ ನೀವು ಅವುಗಳನ್ನು ಕಡಿಮೆ ಮಾಡಬಹುದು ಅಥವಾ ವಿಸ್ತರಿಸಬಹುದು. ಹೆಚ್ಚಿನ ಪೆಟ್ಟಿಗೆಗಳನ್ನು (ಆಯ್ದ ಭಾಗಗಳು, ಟ್ರ್ಯಾಕ್ಬ್ಯಾಕ್ಗಳು, ಕಸ್ಟಮ್ ಫೀಲ್ಡ್ಸ್, ಚರ್ಚೆ, ಸ್ಲಗ್, ಲೇಖಕ) ಮರೆಮಾಡಲು ಅಥವಾ ಈ ಪರದೆಯ 1- ಅಥವಾ 2-ಕಾಲಮ್ ವಿನ್ಯಾಸವನ್ನು ಆಯ್ಕೆ ಮಾಡಲು ಸ್ಕ್ರೀನ್ ಆಯ್ಕೆಗಳು ಟ್ಯಾಬ್ ಬಳಸಿ.','You are using the multi-file uploader. Problems? Try the <a href="%1$s" %2$s>browser uploader</a> instead.'=>'ನೀವು ಬಹು-ಫೈಲ್ ಅಪ್ಲೋಡರ್ ಅನ್ನು ಬಳಸುತ್ತಿರುವಿರಿ. ತೊಂದರೆಗಳು? ಬದಲಿಗೆ <a href="%1$s" %2$s> ಬ್ರೌಸರ್ ಅಪ್ಲೋಡರ್ </a> ಅನ್ನು ಪ್ರಯತ್ನಿಸಿ.','media itemEdit'=>'ಸಂಪಾದಿಸಿ','colorDefault: %s'=>'ಪೂರ್ವನಿಯೋಜಿತ: %s','column nameUploaded to'=>'ಇದಕ್ಕೆ ಅಪ್‌ಲೋಡ್ ಮಾಡಲಾಗಿದೆ','The uploaded file is not a valid image. Please try again.'=>'ಅಪ್‌ಲೋಡ್ ಮಾಡಿದ ಫೈಲ್ ಮಾನ್ಯ ಚಿತ್ರವಲ್ಲ. ದಯವಿಟ್ಟು ಪುನಃ ಪ್ರಯತ್ನಿಸಿ.','Choose a Background Image'=>'ಹಿನ್ನೆಲೆ ಚಿತ್ರವನ್ನು ಆರಿಸಿ','Choose a Custom Header'=>'ಕಸ್ಟಮ್ ಹೆಡರ್ ಅನ್ನು ಆಯ್ಕೆ ಮಾಡಿ','You can also choose a background color by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.'=>'ನೀವು ಆಯ್ದ ಬಣ್ಣವನ್ನು ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡುವ ಮೂಲಕ ಮತ್ತು ಕಾನೂನುಬದ್ಧ HTML ಹೆಕ್ಸ್ ಮೌಲ್ಯವನ್ನು ಟೈಪ್ ಮಾಡುವ ಮೂಲಕ ಹಿನ್ನೆಲೆ ಬಣ್ಣವನ್ನು ಆಯ್ಕೆ ಮಾಡಬಹುದು, ಉದಾ. &#8220;#ff0000 &#8221; ಕೆಂಪು ಬಣ್ಣಕ್ಕಾಗಿ, ಅಥವಾ ಬಣ್ಣ ಪಿಕ್ಕರ್ ಬಳಸಿ ಬಣ್ಣವನ್ನು ಆರಿಸುವ ಮೂಲಕ.','In the Header Text section of this page, you can choose whether to display this text or hide it. You can also choose a color for the text by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.'=>'ಈ ಪುಟದ ಹೆಡರ್ ಪಠ್ಯ ವಿಭಾಗದಲ್ಲಿ, ಈ ಪಠ್ಯವನ್ನು ಪ್ರದರ್ಶಿಸಲು ಅಥವಾ ಮರೆಮಾಡಲು ನೀವು ಆರಿಸಬಹುದು. ಪಠ್ಯ ಬಣ್ಣವನ್ನು ಆಯ್ಕೆ ಮಾಡಿ ಮತ್ತು ಕಾನೂನುಬದ್ಧ ಎಚ್ಟಿಎಮ್ಎಲ್ ಹೆಕ್ಸ್ ಮೌಲ್ಯದಲ್ಲಿ ಟೈಪ್ ಮಾಡುವ ಮೂಲಕ ಪಠ್ಯಕ್ಕಾಗಿ ಬಣ್ಣವನ್ನು ನೀವು ಆಯ್ಕೆ ಮಾಡಬಹುದು, ಉದಾ. & # 8220; # ff0000 & # 8221; ಕೆಂಪು ಬಣ್ಣಕ್ಕಾಗಿ ಅಥವಾ ಬಣ್ಣದ ಪಿಕ್ಕರ್ ಬಳಸಿ ಬಣ್ಣವನ್ನು ಆರಿಸುವ ಮೂಲಕ.','In the <strong>In response to</strong> column, there are three elements. The text is the name of the post that inspired the comment, and links to the post editor for that entry. The View Post link leads to that post on your live site. The small bubble with the number in it shows the number of approved comments that post has received. If there are pending comments, a red notification circle with the number of pending comments is displayed. Clicking the notification circle will filter the comments screen to show only pending comments on that post.'=>'<strong>, ಪ್ರತಿಕ್ರಿಯೆಗೆ </strong> ಕಾಲಮ್ನಲ್ಲಿ, ಮೂರು ಅಂಶಗಳಿವೆ. ಪಠ್ಯವು ಕಾಮೆಂಟ್ಗೆ ಸ್ಫೂರ್ತಿ ನೀಡಿರುವ ಪೋಸ್ಟ್ನ ಹೆಸರು ಮತ್ತು ಆ ನಮೂದುಗಾಗಿ ಪೋಸ್ಟ್ ಎಡಿಟರ್ಗೆ ಲಿಂಕ್ಗಳು. ವೀಕ್ಷಣೆ ಪೋಸ್ಟ್ ಲಿಂಕ್ ನಿಮ್ಮ ಲೈವ್ ಸೈಟ್ನಲ್ಲಿನ ಪೋಸ್ಟ್ಗೆ ಕಾರಣವಾಗುತ್ತದೆ. ಅದರಲ್ಲಿರುವ ಸಣ್ಣ ಗುಳ್ಳೆಯು ಪೋಸ್ಟ್ ಸ್ವೀಕರಿಸಿದ ಅನುಮೋದಿತ ಕಾಮೆಂಟ್ಗಳ ಸಂಖ್ಯೆಯನ್ನು ತೋರಿಸುತ್ತದೆ. ಬಾಕಿ ಇರುವ ಕಾಮೆಂಟ್ಗಳನ್ನು ಹೊಂದಿದ್ದರೆ, ಬಾಕಿ ಇರುವ ಕಾಮೆಂಟ್ಗಳ ಸಂಖ್ಯೆಯೊಂದಿಗೆ ಕೆಂಪು ಅಧಿಸೂಚನೆಯ ವಲಯವನ್ನು ಪ್ರದರ್ಶಿಸಲಾಗುತ್ತದೆ. ಅಧಿಸೂಚನೆ ವಲಯವನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವುದರಿಂದ ಆ ಪೋಸ್ಟ್ನಲ್ಲಿ ಬಾಕಿ ಇರುವ ಕಾಮೆಂಟ್ಗಳನ್ನು ಮಾತ್ರ ತೋರಿಸಲು ಕಾಮೆಂಟ್ಗಳ ಪರದೆಯನ್ನು ಫಿಲ್ಟರ್ ಮಾಡುತ್ತದೆ.','ID #%1$s: %2$s'=>'ID #%1$s: %2$s','ID #%1$s: %2$s <strong>The current user will not be deleted.</strong>'=>'ID #%1$s: %2$s <strong> ಪ್ರಸ್ತುತ ಬಳಕೆದಾರನನ್ನು ಅಳಿಸಲಾಗುವುದಿಲ್ಲ </strong>.','Used: %1$s%% of %2$s'=>'ಬಳಸಿದ್ದು : %2$s ರ  %1$s%% ','Please select an option.'=>'ದಯವಿಟ್ಟು ಒಂದು ಆಯ್ಕೆಯನ್ನು ಆರಿಸಿ.','Get Favorites'=>'ಮೆಚ್ಚಿನವುಗಳನ್ನು ಪಡೆಯಿರಿ','Your WordPress.org username:'=>'ನಿಮ್ಮ WordPress.org ಬಳಕೆದಾರಹೆಸರು:','Welcome to WordPress!'=>'ವರ್ಡ್‌ಪ್ರೆಸ್‌ಗೆ ಸುಸ್ವಾಗತ!','If you have marked plugins as favorites on WordPress.org, you can browse them here.'=>'WordPress.org ನಲ್ಲಿ ನೀವು ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಮೆಚ್ಚಿನವುಗಳೆಂದು ಗುರುತಿಸಿದ್ದರೆ, ನೀವು ಅವುಗಳನ್ನು ಇಲ್ಲಿ ಬ್ರೌಸ್ ಮಾಡಬಹುದು.','Search engine visibility'=>'ಸರ್ಚ್ ಎಂಜಿನ್ ಗೋಚರತೆ','Welcome to WordPress %1$s. You will be redirected to the About WordPress screen. If not, click <a href="%2$s">here</a>.'=>'ವರ್ಡ್ಪ್ರೆಸ್ %1$s ಗೆ ಸುಸ್ವಾಗತ. ನಿಮ್ಮನ್ನು ವರ್ಡ್ಪ್ರೆಸ್ ಸ್ಕ್ರೀನ್‌ಗೆ ಮರುನಿರ್ದೇಶಿಸಲಾಗುತ್ತದೆ. ಇಲ್ಲದಿದ್ದರೆ, <a href="%2$s"> ಇಲ್ಲಿ </a> ಕ್ಲಿಕ್ ಮಾಡಿ.','Allow search engines to index this site'=>'ಈ ಸೈಟ್ ಅನ್ನು ಇಂಡೆಕ್ಸ್ ಮಾಡಲು ಸರ್ಚ್ ಇಂಜಿನ್ಗಳಿಗೆ ಅನುಮತಿಸಿ','It is up to search engines to honor this request.'=>'ಈ ವಿನಂತಿಯನ್ನು ಗೌರವಿಸುವುದು ಸರ್ಚ್ ಇಂಜಿನ್ ಗಳಿಗೆ ಬಿಟ್ಟದ್ದು.','After you&#8217;ve done that, click &#8220;Run the installation&#8221;.'=>'ನೀವು ಅದನ್ನು ಮಾಡಿದ ನಂತರ, &#8220;ಅನುಸ್ಥಾಪನೆಯನ್ನು ರನ್ ಮಾಡಿ&#8221; ಕ್ಲಿಕ್ ಮಾಡಿ.','Search engines discouraged'=>'ಸರ್ಚ್ ಇಂಜಿನ್ ಗಳನ್ನು ನಿರುತ್ಸಾಹಗೊಳಿಸಲಾಗಿದೆ','Discourage search engines from indexing this site'=>'ಈ ಸೈಟ್ ಅನ್ನು ಇಂಡೆಕ್ಸ್ ಮಾಡುವುದರಿಂದ ಸರ್ಚ್ ಇಂಜಿನ್ಗಳನ್ನು ನಿರುತ್ಸಾಹಗೊಳಿಸಿ','You can also browse a user&#8217;s favorite plugins, by using the Favorites link above the plugins list and entering their WordPress.org username.'=>'ಪ್ಲಗಿನ್ಗಳ ಪಟ್ಟಿಯ ಮೇಲಿರುವ ಮೆಚ್ಚಿನವುಗಳು ಲಿಂಕ್ ಅನ್ನು ಬಳಸಿಕೊಂಡು ಮತ್ತು ಅವರ WordPress.org ಬಳಕೆದಾರ ಹೆಸರನ್ನು ನಮೂದಿಸುವ ಮೂಲಕ ನೀವು ಬಳಕೆದಾರರ ಮೆಚ್ಚಿನ ಪ್ಲಗ್ಇನ್ಗಳನ್ನು ಸಹ ಬ್ರೌಸ್ ಮಾಡಬಹುದು.','If you want to install a plugin that you&#8217;ve downloaded elsewhere, click the Upload Plugin button above the plugins list. You will be prompted to upload the .zip package, and once uploaded, you can activate the new plugin.'=>'ನೀವು ಬೇರೆಡೆ ಡೌನ್ಲೋಡ್ ಮಾಡಿದ ಪ್ಲಗ್ಇನ್ ಅನ್ನು ಸ್ಥಾಪಿಸಲು ನೀವು ಬಯಸಿದರೆ, ಪ್ಲಗಿನ್ಗಳ ಪಟ್ಟಿಯ ಮೇಲಿರುವ ಅಪ್ಲೋಡ್ ಪ್ಲಗಿನ್ ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಿ. ನೀವು .zip ಪ್ಯಾಕೇಜ್ ಅನ್ನು ಅಪ್ಲೋಡ್ ಮಾಡಲು ನಿಮ್ಮನ್ನು ಕೇಳಲಾಗುತ್ತದೆ ಮತ್ತು ಅಪ್ಲೋಡ್ ಮಾಡಿದ ನಂತರ, ನೀವು ಹೊಸ ಪ್ಲಗಿನ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಬಹುದು.','Plugin InstallerFavorites'=>'ಮೆಚ್ಚಿನವುಗಳು','This <a href="%1$s">child theme</a> requires its parent theme, %2$s.'=>'ಈ <a href="%1$s"> ಚೈಲ್ಡ್ ಥೀಮ್ </a> ಗೆ ಅದರ ಮೂಲ ಥೀಮ್, %2$s .','Search by keyword'=>'ಪದಗುಚ್ಛ ದಂತೆ ಹುಡುಕಿ ','Type of search'=>'ಹುಡುಕಾಟದ ವಿಧ','Screen Options Tab'=>'ಪರದೆ ಆಯ್ಕೆಗಳು ಟ್ಯಾಬ್','Contextual Help Tab'=>'ಸಂದರ್ಭಾಂಕಿತ ಸಹಾಯ ಟ್ಯಾಬ್ ','widgetEdit'=>'ಸಂಪಾದಿಸಿ','widgetAdd'=>'ಸೇರಿಸಿ','Search by author'=>'ಲೇಖಕರಿಂದ ಹುಡುಕಿ','Search by tag'=>'ಟ್ಯಾಗ್ ಮೂಲಕ ಹುಡುಕಿ','To install the theme so you can preview it with your site&#8217;s content and customize its theme options, click the "Install" button at the top of the left-hand pane. The theme files will be downloaded to your website automatically. When this is complete, the theme is now available for activation, which you can do by clicking the "Activate" link, or by navigating to your Manage Themes screen and clicking the "Live Preview" link under any installed theme&#8217;s thumbnail image.'=>'ಥೀಮ್ ಅನ್ನು ಸ್ಥಾಪಿಸಲು ನೀವು ನಿಮ್ಮ ಸೈಟ್ನ ವಿಷಯದೊಂದಿಗೆ ಅದನ್ನು ಪೂರ್ವವೀಕ್ಷಿಸಬಹುದು ಮತ್ತು ಅದರ ಥೀಮ್ ಆಯ್ಕೆಗಳನ್ನು ಕಸ್ಟಮೈಸ್ ಮಾಡಬಹುದು, ಎಡಗೈ ಫಲಕದ ಮೇಲ್ಭಾಗದಲ್ಲಿರುವ  "ಸ್ಥಾಪಿಸು " ಬಟನ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ. ಥೀಮ್ ಫೈಲ್ಗಳನ್ನು ನಿಮ್ಮ ವೆಬ್ಸೈಟ್ಗೆ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಡೌನ್ಲೋಡ್ ಮಾಡಲಾಗುತ್ತದೆ. ಇದು ಪೂರ್ಣಗೊಂಡಾಗ, ಥೀಮ್ ಸಕ್ರಿಯಗೊಳಿಸುವಿಕೆಗಾಗಿ ಇದೀಗ ಲಭ್ಯವಿದೆ, ನೀವು  "ಸಕ್ರಿಯಗೊಳಿಸು " ಲಿಂಕ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವ ಮೂಲಕ ಅಥವಾ ನಿಮ್ಮ ಥೀಮ್ಗಳ ಪರದೆಯನ್ನು ನಿರ್ವಹಿಸಿ ಮತ್ತು ಯಾವುದೇ ಸ್ಥಾಪಿಸಲಾದ ಥೀಮ್ನ ಅಡಿಯಲ್ಲಿ  "ಲೈವ್ ಪೂರ್ವವೀಕ್ಷಣೆ " ಲಿಂಕ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವುದರ ಮೂಲಕ ನೀವು ಮಾಡಬಹುದು. 8217; ಥಂಬ್ನೇಲ್ ಇಮೇಜ್.','Select comment'=>'ಟಿಪ್ಪಣಿಯನ್ನು ಆರಿಸಿ','Skip to main content'=>'ಪ್ರಧಾನ ವಸ್ತುವಿಷಯಕ್ಕೆ ಮುಂದೆಸಾಗಿ','Tags can be selectively converted to categories using the <a href="%s">tag to category converter</a>.'=>'<a href="%s">ಟ್ಯಾಗ್‌ನಿಂದ ವರ್ಗಕ್ಕೆ ಪರಿವರ್ತಕ</a>ವನ್ನು ಬಳಸಿಕೊಂಡು ಟ್ಯಾಗ್‌ಗಳನ್ನು ಆಯ್ದ ವರ್ಗಗಳಾಗಿ ಪರಿವರ್ತಿಸಬಹುದು.','You can delete Link Categories in the Bulk Action pull-down, but that action does not delete the links within the category. Instead, it moves them to the default Link Category.'=>'ದೊಡ್ಡ ಕ್ರಿಯೆಯ ಪುಲ್-ಡೌನ್ನಲ್ಲಿ ಲಿಂಕ್ ವರ್ಗಗಳನ್ನು ನೀವು ಅಳಿಸಬಹುದು, ಆದರೆ ಆ ವರ್ಗದವರು ವರ್ಗದಲ್ಲಿ ಇರುವ ಲಿಂಕ್ಗಳನ್ನು ಅಳಿಸುವುದಿಲ್ಲ. ಬದಲಿಗೆ, ಇದು ಡೀಫಾಲ್ಟ್ ಲಿಂಕ್ ವರ್ಗಕ್ಕೆ ಚಲಿಸುತ್ತದೆ.','You can select an image to be shown at the top of your site by uploading from your computer or choosing from your media library. After selecting an image you will be able to crop it.'=>'ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್ನಿಂದ ಅಪ್ಲೋಡ್ ಮಾಡುವ ಮೂಲಕ ಅಥವಾ ನಿಮ್ಮ ಮಾಧ್ಯಮ ಲೈಬ್ರರಿಯಿಂದ ಆಯ್ಕೆ ಮಾಡುವ ಮೂಲಕ ನಿಮ್ಮ ಸೈಟ್ನ ಮೇಲ್ಭಾಗದಲ್ಲಿ ತೋರಿಸಬೇಕಾದ ಚಿತ್ರವನ್ನು ನೀವು ಆಯ್ಕೆ ಮಾಡಬಹುದು. ಚಿತ್ರವನ್ನು ಆಯ್ಕೆ ಮಾಡಿದ ನಂತರ ನೀವು ಅದನ್ನು ಕ್ರಾಪ್ ಮಾಡಲು ಸಾಧ್ಯವಾಗುತ್ತದೆ.','Creating a Page is very similar to creating a Post, and the screens can be customized in the same way using drag and drop, the Screen Options tab, and expanding/collapsing boxes as you choose. This screen also has the distraction-free writing space, available in both the Visual and Text modes via the Fullscreen buttons. The Page editor mostly works the same as the Post editor, but there are some Page-specific features in the Page Attributes box.'=>'ಒಂದು ಪುಟವನ್ನು ರಚಿಸುವುದು ಒಂದು ಪೋಸ್ಟ್ ಅನ್ನು ರಚಿಸುವುದಕ್ಕೆ ಹೋಲುತ್ತದೆ, ಮತ್ತು ನೀವು ಆಯ್ಕೆ ಮಾಡಿದಂತೆ ಸ್ಕ್ರೀನ್ಗಳನ್ನು ಡ್ರ್ಯಾಗ್ ಮತ್ತು ಡ್ರಾಪ್ ಬಳಸಿ, ಸ್ಕ್ರೀನ್ ಆಯ್ಕೆಗಳು ಟ್ಯಾಬ್, ಮತ್ತು ವಿಸ್ತರಿಸುವ / ಕುಸಿಯುವ ಪೆಟ್ಟಿಗೆಗಳನ್ನು ಕಸ್ಟಮೈಸ್ ಮಾಡಬಹುದು. ಈ ಪರದೆಯು ದೃಷ್ಟಿ-ಮುಕ್ತ ಬರವಣಿಗೆಯ ಸ್ಥಳವನ್ನು ಹೊಂದಿದೆ, ಪೂರ್ಣಪರದೆ ಗುಂಡಿಗಳು ಮೂಲಕ ವಿಷುಯಲ್ ಮತ್ತು ಪಠ್ಯ ವಿಧಾನಗಳಲ್ಲಿ ಎರಡೂ ಲಭ್ಯವಿದೆ. ಪುಟ ಸಂಪಾದಕ ಹೆಚ್ಚಾಗಿ ಪೋಸ್ಟ್ ಎಡಿಟರ್ನಂತೆಯೇ ಕಾರ್ಯನಿರ್ವಹಿಸುತ್ತಾನೆ, ಆದರೆ ಪುಟದ ಗುಣಲಕ್ಷಣಗಳ ಪೆಟ್ಟಿಗೆಯಲ್ಲಿ ಕೆಲವು ಪುಟ-ನಿರ್ದಿಷ್ಟ ಲಕ್ಷಣಗಳಿವೆ.','You can set a custom image header for your site. Simply upload the image and crop it, and the new header will go live immediately. Alternatively, you can use an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button.'=>'ನಿಮ್ಮ ಸೈಟ್ಗಾಗಿ ಕಸ್ಟಮ್ ಇಮೇಜ್ ಶಿರೋಲೇಖವನ್ನು ನೀವು ಹೊಂದಿಸಬಹುದು. ಚಿತ್ರವನ್ನು ಅಪ್ಲೋಡ್ ಮಾಡಿ ಮತ್ತು ಅದನ್ನು ಕ್ರಾಪ್ ಮಾಡಿ, ಮತ್ತು ಹೊಸ ಹೆಡರ್ ತಕ್ಷಣವೇ ಲೈವ್ ಆಗುತ್ತದೆ. ಪರ್ಯಾಯವಾಗಿ, ನೀವು & # 8220; ಇಮೇಜ್ ಆಯ್ಕೆಮಾಡಿ & # 8221; ಕ್ಲಿಕ್ ಮಾಡುವ ಮೂಲಕ ಈಗಾಗಲೇ ನಿಮ್ಮ ಮೀಡಿಯಾ ಲೈಬ್ರರಿಗೆ ಅಪ್ಲೋಡ್ ಮಾಡಿದ ಚಿತ್ರವನ್ನು ಬಳಸಬಹುದು. ಬಟನ್.','Skip Cropping, Publish Image as Is'=>'ಚಿತ್ರ ಮುಂಡನಕಾರ್ಯವನ್ನು ಬದಿಗಿಟ್ಟು, ಚಿತ್ರವನ್ನು ಯಥಾರೀತಿ ಪ್ರಕಟಿಸಿ.','Select Image'=>'ಚಿತ್ರವನ್ನು ಆರಿಸಿರಿ ','Or choose an image from your media library:'=>'ಅಥವಾ ನಿಮ್ಮ ಮಾಧ್ಯಮ ಸಂಗ್ರಹದಿಂದ ಚಿತ್ರವನ್ನು ಆರಿಸಿರಿ:','Choose Image'=>'ಚಿತ್ರವನ್ನು ಆರಿಸಿರಿ ','Collapse'=>'ಕಿರಿದುಗೊಳಿಸಿ','This theme is already installed and is up to date'=>'ಈ ಥೀಮ್ ಈಗಾಗಲೇ ಸ್ಥಾಪನೆಯಾಗಿದೆ ಮತ್ತು ಅದು ನವೀಕೃತಗೊಂಡಿದೆ','pluginInstalled'=>'ಸ್ಥಾಪಿಸಲಾಗಿದೆ','Previewing and Installing'=>'ಮುನ್ನೋಟ ತೋರಿಸುತ್ತಿದೆ ಮತ್ತು ಸ್ಥಾಪನೆಯಾಗುತ್ತಿದೆ','Previewing and Customizing'=>'ಮುನ್ನೋಟ ತೋರಿಸುತ್ತಿದೆ ಮತ್ತು ಸ್ವಯೋಜಿಸಲಾಗುತ್ತಿದೆ','You are using the browser&#8217;s built-in file uploader. The WordPress uploader includes multiple file selection and drag and drop capability. <a href="#">Switch to the multi-file uploader</a>.'=>'ನೀವು ಬ್ರೌಸರ್ & # 8217; ಅಂತರ್ನಿರ್ಮಿತ ಫೈಲ್ ಅಪ್ಲೋಡರ್ ಅನ್ನು ಬಳಸುತ್ತಿರುವಿರಿ. ವರ್ಡ್ಪ್ರೆಸ್ ಅಪ್ಲೋಡರ್ ಬಹು ಫೈಲ್ ಆಯ್ಕೆ ಮತ್ತು ಡ್ರ್ಯಾಗ್ ಮತ್ತು ಡ್ರಾಪ್ ಸಾಮರ್ಥ್ಯವನ್ನು ಒಳಗೊಂಡಿದೆ. <a href="#"> ಬಹು-ಫೈಲ್ ಅಪ್ಲೋಡರ್ಗೆ ಬದಲಿಸಿ </a>.','Preview %s'=>'ಮುನ್ನೋಟ %s','The Categories and Tags Converter link on this screen will take you to the Import screen, where that Converter is one of the plugins you can install. Once that plugin is installed, the Activate Plugin &amp; Run Importer link will take you to a screen where you can choose to convert tags into categories or vice versa.'=>'ವರ್ಗಗಳು ಮತ್ತು ಟ್ಯಾಗ್ಗಳು ಈ ತೆರೆಯಲ್ಲಿ ಪರಿವರ್ತಕ ಲಿಂಕ್ ನಿಮ್ಮನ್ನು ಆಮದು ಪರದೆಗೆ ಕರೆದೊಯ್ಯುತ್ತದೆ, ಅಲ್ಲಿ ಪರಿವರ್ತಕವು ನೀವು ಸ್ಥಾಪಿಸಬಹುದಾದ ಪ್ಲಗಿನ್ಗಳಲ್ಲಿ ಒಂದಾಗಿದೆ. ಆ ಪ್ಲಗಿನ್ ಅನ್ನು ಒಮ್ಮೆ ಸ್ಥಾಪಿಸಿದ ನಂತರ, ಸಕ್ರಿಯಗೊಳಿಸು ಪ್ಲಗಿನ್ & amp; ರನ್ ಆಮದು ಮಾಡಿಕೊಳ್ಳುವ ಲಿಂಕ್ ನಿಮ್ಮನ್ನು ತೆರೆಯಲ್ಲಿಗೆ ಕರೆದೊಯ್ಯುತ್ತದೆ, ಅಲ್ಲಿ ನೀವು ಟ್ಯಾಗ್ಗಳನ್ನು ವರ್ಗಗಳಾಗಿ ಪರಿವರ್ತಿಸಲು ಅಥವಾ ಪ್ರತಿಯಾಗಿ ಬದಲಿಸಬಹುದು.','Categories have hierarchy, meaning that you can nest sub-categories. Tags do not have hierarchy and cannot be nested. Sometimes people start out using one on their posts, then later realize that the other would work better for their content.'=>'ವರ್ಗಗಳು ಕ್ರಮಾನುಗತ ಹೊಂದಿವೆ, ಅಂದರೆ ನೀವು ಗೂಡು ಉಪ ವಿಭಾಗಗಳನ್ನು ಮಾಡಬಹುದು. ಟ್ಯಾಗ್ಗಳಿಗೆ ಕ್ರಮಾನುಗತ ಇಲ್ಲ ಮತ್ತು ನೆಸ್ಟೆಡ್ ಮಾಡಲಾಗುವುದಿಲ್ಲ. ಕೆಲವೊಮ್ಮೆ ಜನರು ತಮ್ಮ ಪೋಸ್ಟ್ಗಳಲ್ಲಿ ಒಂದನ್ನು ಬಳಸುವುದನ್ನು ಪ್ರಾರಂಭಿಸುತ್ತಾರೆ, ತದನಂತರ ಇತರರು ತಮ್ಮ ವಿಷಯಕ್ಕಾಗಿ ಉತ್ತಮ ಕೆಲಸ ಮಾಡುತ್ತಾರೆ ಎಂದು ತಿಳಿದುಕೊಳ್ಳುತ್ತಾರೆ.','This screen is used to customize the header section of your theme.'=>'ಈ ಪರದೆಯನ್ನು ನಿಮ್ಮ ಥೀಮ್ ನ ಹೆಡರ್ ಭಾಗವನ್ನು ಸ್ವಯೋಜಿಸಲು ಬಳಸಲಾಗುತ್ತದೆ.','For most themes, the header text is your Site Title and Tagline, as defined in the <a href="%s">General Settings</a> section.'=>'ಹೆಚ್ಚಿನ ವಿಷಯಗಳಿಗಾಗಿ, <a href="%s"> ಸಾಮಾನ್ಯ ಸೆಟ್ಟಿಂಗ್ಗಳು </a> ವಿಭಾಗದಲ್ಲಿ ವಿವರಿಸಿದಂತೆ ಹೆಡರ್ ಪಠ್ಯವು ನಿಮ್ಮ ಸೈಟ್ ಶೀರ್ಷಿಕೆ ಮತ್ತು ಟ್ಯಾಗ್ಲೈನ್ ಆಗಿದೆ.','If your theme has more than one default header image, or you have uploaded more than one custom header image, you have the option of having WordPress display a randomly different image on each page of your site. Click the &#8220;Random&#8221; radio button next to the Uploaded Images or Default Images section to enable this feature.'=>'ನಿಮ್ಮ ಥೀಮ್ ಒಂದಕ್ಕಿಂತ ಹೆಚ್ಚು ಡೀಫಾಲ್ಟ್ ಶಿರೋಲೇಖ ಚಿತ್ರವನ್ನು ಹೊಂದಿದ್ದರೆ, ಅಥವಾ ನೀವು ಒಂದಕ್ಕಿಂತ ಹೆಚ್ಚು ಕಸ್ಟಮ್ ಹೆಡರ್ ಇಮೇಜ್ ಅನ್ನು ಅಪ್ಲೋಡ್ ಮಾಡಿದರೆ, ನಿಮ್ಮ ಸೈಟ್ನ ಪ್ರತಿ ಪುಟದಲ್ಲಿ ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ಯಾದೃಚ್ಛಿಕವಾಗಿ ವಿಭಿನ್ನ ಚಿತ್ರವನ್ನು ಪ್ರದರ್ಶಿಸುವ ಆಯ್ಕೆಯನ್ನು ನೀವು ಹೊಂದಿದ್ದೀರಿ. & # 8220; ಯಾದೃಚ್ಛಿಕ & # 8221; ಈ ವೈಶಿಷ್ಟ್ಯವನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು ಅಪ್ಲೋಡ್ ಮಾಡಿದ ಚಿತ್ರಗಳು ಅಥವಾ ಡೀಫಾಲ್ಟ್ ಇಮೇಜ್ಗಳ ವಿಭಾಗದ ಪಕ್ಕದಲ್ಲಿರುವ ರೇಡಿಯೋ ಬಟನ್.','You can choose from the theme&#8217;s default header images, or use one of your own. You can also customize how your Site Title and Tagline are displayed.'=>'ಥೀಮ್ & # 8217; ಡೀಫಾಲ್ಟ್ ಹೆಡರ್ ಇಮೇಜ್ಗಳಿಂದ ನೀವು ಆಯ್ಕೆ ಮಾಡಬಹುದು, ಅಥವಾ ನಿಮ್ಮದೇ ಆದ ಒಂದನ್ನು ಬಳಸಿ. ನಿಮ್ಮ ಸೈಟ್ ಶೀರ್ಷಿಕೆ ಮತ್ತು ಟ್ಯಾಗ್ಲೈನ್ ಅನ್ನು ಹೇಗೆ ಪ್ರದರ್ಶಿಸಲಾಗುತ್ತದೆ ಎಂಬುದನ್ನು ನೀವು ಗ್ರಾಹಕೀಯಗೊಳಿಸಬಹುದು.','Configuration Error'=>'ಕಾರ್ಯಸಿದ್ಧತಾ ದೋಷ','Revert to the <strong>Browser Uploader</strong> by clicking the link below the drag and drop box.'=>'ಡ್ರ್ಯಾಗ್ ಮತ್ತು ಡ್ರಾಪ್ ಪೆಟ್ಟಿಗೆಯ ಕೆಳಗಿನ ಲಿಂಕ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವ ಮೂಲಕ <strong> ಬ್ರೌಸರ್ ಅಪ್ಲೋಡರ್</strong>ಗೆ ಹಿಂದಿರುಗಿ.','User deleted.'=>'ಬಳಕೆದಾರರನ್ನು ಅಳಿಸಲಾಗಿದೆ.' . "\0" . '%s ಬಳಕೆದಾರರನ್ನು ಅಳಿಸಲಾಗಿದೆ.','Could not copy files. You may have run out of disk space.'=>'ಕಡತಗಳನ್ನು ನಕಲು ಮಾಡಲಾಗಲಿಲ್ಲ. ನಿಮ್ಮ ಡಿಸ್ಕ್ ಜಾಗ ತುಂಬಿಹೋಗಿರಬಹುದು.','Search for themes by keyword.'=>'ಪದಗುಚ್ಛದಂತೆ ಥೀಮ್ ಗಳನ್ನು ಹುಡುಕಿ.','Find a theme based on specific features.'=>'ನಿರ್ದಿಷ್ಟ ಲಕ್ಷಣಗಳ ಆಧಾರದ ಮೇಲೆ  ಥೀಮ್ ಗಳನ್ನು ಹುಡುಕಿ. ','This theme is broken.'=>'ಈ ಥೀಮ್ ಮುರಿದಿದೆ.','Set as background'=>'ಹಿನ್ನೆಲೆಯಂತೆ ಹೊಂದಿಸಿರಿ','Set as header'=>'ಹೆಡರ್ ನಂತೆ ಹೊಂದಿಸಿರಿ ','Customize &#8220;%s&#8221;'=>'ಸ್ವಯೋಜಿಸಿ &#8220;%s&#8221;','Collapse Sidebar'=>'ಪಕ್ಕಂಕಣವನ್ನು ಕಿರಿದುಗೊಳಿಸಿ','(required)'=>'(ಅಗತ್ಯವಿದೆ)','Select All'=>'ಎಲ್ಲವನ್ನೂ ಆಯ್ಕೆ ಮಾಡಿ','Plugin'=>'ಪ್ಲಗಿನ್','Word count: %s'=>'ಪದಗಳ ಎಣಿಕೆ: %s','Edit comment'=>'ಕಾಮೆಂಟ್ ಸಂಪಾದಿಸಿ','https://wordpress.org/about/'=>'https://wordpress.org/about/','Edit Link'=>'ಕೊಂಡಿಯನ್ನು ಸಂಪಾದಿಸಿ ','Privately Published'=>'ಖಾಸಗಿಯಾಗಿ ಪ್ರಕಟಿಸಲಾಗಿದೆ','Link URL'=>'ಲಿಂಕ್ URL','Save as Pending'=>'ನಿರೀಕ್ಷೆಯಲ್ಲಿರುವಂತೆ ಉಳಿಸಿ','Public, Sticky'=>'ಸಾರ್ವಜನಿಕ, ಸ್ಟಿಕಿ','Enter a link URL or click above for presets.'=>'ಲಿಂಕ್ URL ಅನ್ನು ನಮೂದಿಸಿ ಅಥವಾ ಪೂರ್ವನಿಗದಿಗಳಿಗಾಗಿ ಮೇಲೆ ಕ್ಲಿಕ್ ಮಾಡಿ.','No comments yet.'=>'ಇನ್ನೂ ಯಾವುದೇ ಕಾಮೆಂಟ್‌ಗಳಿಲ್ಲ.','Version:'=>'ಆವೃತ್ತಿ:','Preview:'=>'ಪೂರ್ವವೀಕ್ಷಣೆ:','<strong>Error:</strong> Please enter a nickname.'=>'<strong>ದೋಷ:</strong>: ದಯವಿಟ್ಟು ಅಡ್ಡಹೆಸರನ್ನು ನಮೂದಿಸಿ.','E-mail'=>'ಇ-ಮೇಲ್','All'=>'ಎಲ್ಲಾ','Preparing to install <strong>%1$s %2$s</strong>&#8230;'=>'<strong>%1$s %2$s</strong> ನ ಸ್ಥಾಪನೆಯು ಸಿಧ್ಧಗೊಳ್ಳುತ್ತಿದೆ&#8230; ','This theme requires a parent theme. Checking if it is installed&#8230;'=>'ಈ ಥೀಮ್ ಗೆ ಪೇರೆಂಟ್ ಥೀಮ್ ನ ಅಗತ್ಯವಿದೆ. ಇದು ಸ್ಥಾಪಿತವಾಗಿದೆಯೇ ಎಂದು ಪರೀಕ್ಷಿಸಿ &#8230;','The parent theme, <strong>%1$s %2$s</strong>, is currently installed.'=>'ಪೇರೆಂಟ್ ಥೀಮ್, <strong>%1$s %2$s</strong>, ಪ್ರಸ್ತುತ ಸ್ಥಾಪನೆಯಾಗಿದೆ.','Successfully installed the parent theme, <strong>%1$s %2$s</strong>.'=>'ಪೇರೆಂಟ್ ಥೀಮ್, <strong>%1$s %2$s</strong> ಅನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಸ್ಥಾಪಿಸಲಾಗಿದೆ.','<strong>The parent theme could not be found.</strong> You will need to install the parent theme, %s, before you can use this child theme.'=>'<strong> ಪೇರೆಂಟ್ ಥೀಮ್ ಅನ್ನು ಹುಡುಕಲಾಗಲಿಲ್ಲ.</strong> ಈ ಚೈಲ್ಡ್ ಥೀಮ್ ಅನ್ನು ನೀವು ಬಳಸುವ ಮುನ್ನ, ಪೇರೆಂಟ್ ಥೀಮ್, %s, ಅನ್ನು ಸ್ಥಾಪಿಸುವ ಅಗತ್ಯವಿದೆ. ','Header Text'=>'ಹೆಡರ್ ಪಠ್ಯ','Show header text with your image.'=>'ಹೆಡರ್ ಪಠ್ಯವನ್ನು ನಿಮ್ಮ ಚಿತ್ರದೊಡನೆ ಪ್ರದರ್ಶಿಸಿ ','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a> or <a href="%5$s" %6$s>update now</a>.'=>'%1$s ನ ಹೊಸ ಆವೃತ್ತಿ ಇದೀಗ ಲಭ್ಯವಿದೆ. <a href="%2$s" class="thickbox" title="%3$s">ಅವೃತ್ತಿ %4$s ಯ ವಿವರಗಳನ್ನು ನೋಡಿ</a> ಅಥವಾ <a href="%5$s">ಈಗ ನವೀಕರಿಸಿ</a>.','By %s.'=>'%s ದಿಂದ.','Add Comment'=>'ಟಿಪ್ಪಣಿಯನ್ನು ಸೇರಿಸಿ ','Add New Comment'=>'ಹೊಸ ಕಾಮೆಂಟ್ ಸೇರಿಸಿ','Hello Dolly'=>'ನಮಸ್ತೆ ಡಾಲಿ','http://ma.tt/'=>'http://ma.tt/','This is not just a plugin, it symbolizes the hope and enthusiasm of an entire generation summed up in two words sung most famously by Louis Armstrong: Hello, Dolly. When activated you will randomly see a lyric from <cite>Hello, Dolly</cite> in the upper right of your admin screen on every page.'=>'ಇದು ಕೇವಲ ಒಂದು ಪ್ಲಗ್ಇನ್ ಅಲ್ಲ, ಇದು ಲೂಯಿಸ್ ಆರ್ಮ್ಸ್ಟ್ರಾಂಗ್ನಿಂದ ಹಾಲೊಡಲಾದ ಎರಡು ಪದಗಳಲ್ಲಿ ಸಂಗ್ರಹಿಸಲ್ಪಟ್ಟ ಇಡೀ ಪೀಳಿಗೆಯ ಭರವಸೆ ಮತ್ತು ಉತ್ಸಾಹವನ್ನು ಸಂಕೇತಿಸುತ್ತದೆ: ಹಲೋ, ಡಾಲಿ. ಸಕ್ರಿಯಗೊಳಿಸಿದಾಗ ನೀವು ಯಾದೃಚ್ಛಿಕವಾಗಿ ಪ್ರತಿ ಪುಟದಲ್ಲಿ ನಿಮ್ಮ ನಿರ್ವಹಣೆ ಪರದೆಯ ಮೇಲಿನ ಬಲದಲ್ಲಿರುವ <cite> ಹಲೋ, ಡಾಲಿ </cite> ನಿಂದ ಒಂದು ಸಾಹಿತ್ಯವನ್ನು ನೋಡುತ್ತೀರಿ.','<strong>Welcome</strong> &mdash; Shows links for some of the most common tasks when setting up a new site.'=>'<strong>ಸುಸ್ವಾಗತ</strong> - ಹೊಸ ಜಾಲತಾಣವೊಂದರ ಸಿದ್ಧತೆಗೆ ಬೇಕಾದ ಕೆಲವು ಅತಿ ಸಾಮಾನ್ಯ ಕಾರ್ಯಗಳ ಲಿಂಕ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ.','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this theme.</em>'=>'%1$sನ ಹೊಸ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ.  <a href="%2$s" %3$s> ಆವೃತ್ತಿ %4$s ವಿವರಗಳನ್ನು ವೀಕ್ಷಿಸಿ </a>.  <em> ಈ ಥೀಮ್‌ಗಾಗಿ ಸ್ವಯಂಚಾಲಿತ ಅಪ್‌ಡೇಟ್ ಲಭ್ಯವಿಲ್ಲ. </em>','HowdyWelcome'=>'ಸುಸ್ವಾಗತ','Delete My Site Permanently'=>'ನನ್ನ ಜಾಲತಾಣವನ್ನು ಶಾಶ್ವತವಾಗಿ ಅಳಿಸಿ','Remember, once deleted your site cannot be restored.'=>'ನೆನಪಿಡಿ, ಒಮ್ಮೆ ಅಳಿಸಲಾದ ನಿಮ್ಮ ಜಾಲತಾಣವನ್ನು ಮತ್ತೆ ಮರುಬಳಸಲಾಗುವುದಿಲ್ಲ.','Thank you for using %s, your site has been deleted. Happy trails to you until we meet again.'=>'%s ಬಳಸಿದ್ದಕ್ಕಾಗಿ ಧನ್ಯವಾದಗಳು, ನಿಮ್ಮ ಜಾಲತಾಣವನ್ನು ಅಳಿಸಲಾಗಿದೆ. ನಾವು ಮತ್ತೆ ಭೇಟಿಮಾಡುವವರೆಗೆ ಸಂತಸಮಯ ಹಾದಿ ನಿಮ್ಮದಾಗಿರಲಿ. ','Thank you. Please check your email for a link to confirm your action. Your site will not be deleted until this link is clicked.'=>'ಧನ್ಯವಾದಗಳು. ದಯವಿಟ್ಟು  ಈ ಕ್ರಿಯೆಯನ್ನು ನಿರ್ಧರಿಸುವ ಲಿಂಕ್ ಗಾಗಿ  ನಿಮ್ಮ ಮಿಂಚೆಯನ್ನು ಪರೀಕ್ಷಿಸಿ. ನಿಮ್ಮ ಜಾಲತಾಣವನ್ನು ಈ ಲಿಂಕ್ ಕ್ಲಿಕ್ ಮಾಡುವವರೆಗೆ ಅಳಿಸುವುದಿಲ್ಲ.','I\'m sure I want to permanently delete my site, and I am aware I can never get it back or use %s again.'=>'ನಾನು ನನ್ನ ಜಾಲತಾಣವನ್ನು ಶಾಶ್ವತವಾಗಿ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸುತ್ತಿರುವೆ ಎಂಬ ಖಾತ್ರಿ ನನಗೆ ಇದೆ, ಮತ್ತು ನಾನು ಮತ್ತೊಮ್ಮೆ  %s ಅನ್ನು ಯಾವತ್ತೂ ಬಳಕೆಗೆ ತರಲಾರೆ ಎಂಬ ಅರಿವು ನನಗೆ ಇದೆ.','Sorry, the link you clicked is stale. Please select another option.'=>'ಕ್ಷಮಿಸಿ, ನೀವು ಕ್ಲಿಕ್ ಮಾಡಿದ ಲಿಂಕ್ ಹಳೆಯದು. ದಯವಿಟ್ಟು ಮತ್ತೊಂದು ಆಯ್ಕೆಯನ್ನು ಆರಿಸಿ.','If you do not want to use your %s site any more, you can delete it using the form below. When you click <strong>Delete My Site Permanently</strong> you will be sent an email with a link in it. Click on this link to delete your site.'=>'ನಿಮ್ಮ %s ಸೈಟ್ ಅನ್ನು ಮತ್ತಷ್ಟು ಬಳಸಲು ನೀವು ಬಯಸದಿದ್ದರೆ, ಕೆಳಗಿನ ಫಾರ್ಮ್ ಅನ್ನು ಬಳಸಿಕೊಂಡು ನೀವು ಅದನ್ನು ಅಳಿಸಬಹುದು. ನೀವು<strong>ನನ್ನ ಸೈಟ್ ಅನ್ನು ಶಾಶ್ವತವಾಗಿ ಅಳಿಸಿ</strong>ಕ್ಲಿಕ್ ಮಾಡಿದಾಗ ನೀವು ಅದರಲ್ಲಿರುವ ಲಿಂಕ್ನೊಂದಿಗೆ ಇಮೇಲ್ ಕಳುಹಿಸಲಾಗುತ್ತದೆ. ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ಅಳಿಸಲು ಈ ಲಿಂಕ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ.','[%s] New Admin Email Address'=>'[%s] ಹೊಸ ನಿರ್ವಹಣೆಗಾರರ ಮಿಂಚೆ ವಿಳಾಸ ','Visit Dashboard'=>'ಕಾರ್ಯದರ್ಶಿಕೆ ಗೆ ಭೇಟಿಕೊಡಿ','Your Sites'=>'ನಿಮ್ಮ ಜಾಲತಾಣಗಳು','MB (Leave blank for network default)'=>'MB (ಪೂರ್ವನಿಯೋಜಿತ ಸಂಪರ್ಕಜಾಲಕ್ಕೆ ಖಾಲಿ ಬಿಡಿ)','British English'=>'ಬ್ರಿಟಿಷ್ ಇಂಗ್ಲೀಶ್','View Site'=>'ಜಾಲತಾಣ ನೋಡಿ','Primary Site'=>'ಪ್ರಧಾನ ಜಾಲತಾಣ','American English'=>'ಅಮೇರಿಕನ್ ಇಂಗ್ಲೀಶ್','If you reached this screen by accident and meant to visit one of your own sites, here are some shortcuts to help you find your way.'=>'ನೀವು ಆಕಸ್ಮಿಕವಾಗಿ ಈ ಪರದೆಗೆ ಬಂದಿದ್ದು, ನಿಮ್ಮದೇ ಸ್ವಂತದ ಜಾಲತಾಣಕ್ಕೆ ಭೇಟಿಕೊಡುವ ಉದ್ದೇಶವಿದ್ದರೆ, ನಿಮ್ಮ ದಾರಿಯನ್ನು ಹುಡುಕುವುದಕ್ಕೆ ನಿಮಗೆ ಸಹಾಯ ಮಾಡಲು ಇಲ್ಲಿ ಕೆಲವು ಕಿರುಹಾದಿ (ಶಾರ್ಟ್ ಕಟ್) ಗಳಿವೆ.','Disabled'=>'ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ','Paused <span class="count">(%s)</span>'=>'ವಿರಾಮಗೊಳಿಸಲಾಗಿದೆ <span class="count">(%s)</span>' . "\0" . 'ವಿರಾಮಗೊಳಿಸಲಾಗಿದೆ <span class="count">(%s)</span>','You attempted to access the "%1$s" dashboard, but you do not currently have privileges on this site. If you believe you should be able to access the "%1$s" dashboard, please contact your network administrator.'=>'ನೀವು  " %1$s " ಡ್ಯಾಶ್ಬೋರ್ಡ್ ಅನ್ನು ಪ್ರವೇಶಿಸಲು ಪ್ರಯತ್ನಿಸಿದ್ದೀರಿ, ಆದರೆ ನೀವು ಈ ಸೈಟ್ನಲ್ಲಿ ಪ್ರಸ್ತುತ ಸವಲತ್ತುಗಳನ್ನು ಹೊಂದಿಲ್ಲ.  " %1$s " ಡ್ಯಾಶ್ಬೋರ್ಡ್ ಅನ್ನು ಪ್ರವೇಶಿಸಲು ನಿಮಗೆ ಸಾಧ್ಯವಾಗುತ್ತದೆ ಎಂದು ನೀವು ಭಾವಿಸಿದರೆ, ದಯವಿಟ್ಟು ನಿಮ್ಮ ನೆಟ್ವರ್ಕ್ ನಿರ್ವಾಹಕರನ್ನು ಸಂಪರ್ಕಿಸಿ.','You must be a member of at least one site to use this page.'=>'ಈ ಪುಟವನ್ನು ಬಳಸಲು ಕೊನೇಪಕ್ಷ ಒಂದು ಜಾಲತಾಣಕ್ಕಾದರೂ ನೀವು ಸದಸ್ಯರಾಗಿರಬೇಕಾಗುತ್ತದೆ. ','The primary site you chose does not exist.'=>'ನೀವು ಆಯ್ಕೆ ಮಾಡಿರುವ ಪ್ರಧಾನ ಜಾಲತಾಣ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ.','Global Settings'=>'ಜಾಗತಿಕ ಸೆಟ್ಟಿಂಗ್‌ಗಳು','Let&#8217;s go!'=>'ಬನ್ನಿ ಹೋಗೋಣ!','Database Name'=>'ಡೇಟಾಬೇಸ್ ಹೆಸರು','example usernameusername'=>'ಬಳಕೆದಾರರ ಹೆಸರು','Table Prefix'=>'ಟೇಬಲ್ ನ ಪೂರ್ವಪ್ರತ್ಯಯ','Database name'=>'ಡೇಟಾಬೇಸ್ ಹೆಸರು','Database username'=>'ಡೇಟಾಬೇಸ್ ಬಳಕೆದಾರರಹೆಸರು ','Database host'=>'ಡೇಟಾಬೇಸ್ ಹೋಸ್ಟ್','Table prefix (if you want to run more than one WordPress in a single database)'=>'ಟೇಬಲ್ ನ ಪೂರ್ವಪ್ರತ್ಯಯ (ನೀವು ಒಂದಕ್ಕಿಂತ ಹೆಚ್ಚು ವರ್ಡ್ ಪ್ರೆಸ್ ಗಳನ್ನು ಒಂದೇ ಡೇಟಾಬೇಸ್ ನಲ್ಲಿ ಚಾಲಿಸಬೇಕಿದ್ದಲ್ಲಿ ಮಾತ್ರ)','If you want to run multiple WordPress installations in a single database, change this.'=>'ನೀವು ಒಂದಕ್ಕಿಂತ ಹೆಚ್ಚು ವರ್ಡ್ ಪ್ರೆಸ್ ಗಳ ಸ್ಥಾಪನೆಯನ್ನು ಒಂದೇ ಡೇಟಾಬೇಸ್ ನಲ್ಲಿ ಚಾಲಿಸಬೇಕಿದ್ದಲ್ಲಿ, ಇದನ್ನು ಬದಲಾಯಿಸಿ.','Sorry, I need a %s file to work from. Please re-upload this file to your WordPress installation.'=>'ಕ್ಷಮಿಸಿ, ನನಗೆ ಕೆಲಸ ಮಾಡಲು %s ಕಡತದ ಅಗತ್ಯವಿದೆ. ದಯವಿಟ್ಟು ಈ ಕಡತವನ್ನು ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಸ್ಥಾಪನೆಗೆ ಮರು ಅಪ್ಲೋಡ್ ಮಾಡಿ.','example passwordpassword'=>'ಗುಪ್ತಪದ','Database Host'=>'ಡೇಟಾಬೇಸ್ ಹೋಸ್ಟ್','Database password'=>'ಡೇಟಾಬೇಸ್ ಗುಪ್ತಪದ','The file %1$s already exists one level above your WordPress installation. If you need to reset any of the configuration items in this file, please delete it first. You may try <a href="%2$s">installing now</a>.'=>'%1$s ಫೈಲ್ ಈಗಾಗಲೇ ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಇನ್‌ಸ್ಟಾಲ್‌ಗಿಂತ ಒಂದು ಮಟ್ಟಕ್ಕಿಂತಲೂ ಹೆಚ್ಚಾಗಿದೆ.  ಈ ಫೈಲ್‌ನಲ್ಲಿನ ಯಾವುದೇ ಸಂರಚನಾ ಐಟಂಗಳನ್ನು ನೀವು ಮರುಹೊಂದಿಸಬೇಕಾದರೆ, ದಯವಿಟ್ಟು ಮೊದಲು ಅದನ್ನು ಅಳಿಸಿ.  ನೀವು <a href="%2$s"> ಈಗ ಸ್ಥಾಪಿಸಲು </a> ಪ್ರಯತ್ನಿಸಬಹುದು.','WordPress &rsaquo; Setup Configuration File'=>'ವರ್ಡ್ಪ್ರೆಸ್ &rsaquo; ಸೆಟಪ್ ಕಾನ್ಫಿಗರೇಶನ್ ಫೈಲ್','The file %1$s already exists. If you need to reset any of the configuration items in this file, please delete it first. You may try <a href="%2$s">installing now</a>.'=>'%1$s ಫೈಲ್ ಈಗಾಗಲೇ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ. ಈ ಫೈಲ್ನಲ್ಲಿ ಯಾವುದೇ ಸಂರಚನಾ ಐಟಂಗಳನ್ನು ಮರುಹೊಂದಿಸಲು ನೀವು ಬಯಸಿದಲ್ಲಿ, ದಯವಿಟ್ಟು ಮೊದಲು ಅದನ್ನು ಅಳಿಸಿ. ನೀವು <a href="%2$s"> ಈಗ ಇನ್ಸ್ಟಾಲ್ ಮಾಡಿ </a> ಪ್ರಯತ್ನಿಸಬಹುದು.','Below you should enter your database connection details. If you are not sure about these, contact your host.'=>'ನಿಮ್ಮ ಡೇಟಾಬೇಸ್ ಸಂಪರ್ಕದ ವಿವರಗಳನ್ನು ನೀವು ಕೆಳಗೆ ನಮೂದಿಸಬೇಕು. ಇವುಗಳ ಬಗ್ಗೆ ನಿಮಗೆ ಖಚಿತವಿಲ್ಲದಿದ್ದರೆ, ನಿಮ್ಮ ಹೋಸ್ಟ್ ಅನ್ನು ಸಂಪರ್ಕಿಸಿ.','To allow use of this page to automatically repair database problems, please add the following line to your %s file. Once this line is added to your config, reload this page.'=>'ಡೇಟಾಬೇಸ್ ಸಮಸ್ಯೆಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ದುರಸ್ತಿ ಮಾಡಲು ಈ ಪುಟದ ಬಳಕೆಯನ್ನು ಅನುಮತಿಸಲು, ದಯವಿಟ್ಟು ಕೆಳಗಿನ ಫೈಲ್ ಅನ್ನು ನಿಮ್ಮ %s ಫೈಲ್ಗೆ ಸೇರಿಸಿ. ಈ ಸಾಲು ನಿಮ್ಮ ಸಂರಚನೆಗೆ ಸೇರಿಸಿದ ನಂತರ, ಈ ಪುಟವನ್ನು ಮರುಲೋಡ್ ಮಾಡಿ.','No comments awaiting moderation.'=>'ಯಾವುದೇ ಟಿಪ್ಪಣಿಗಳು ಅನುಮೋದನೆಗೆ ಕಾಯುತ್ತಿಲ್ಲ.','Plugin installer section titleOther Notes'=>'ಇತರೇ ಸೂಚನೆಗಳು','Plugin installer section titleFAQ'=>'FAQ','Plugin installer section titleInstallation'=>'ಸ್ಥಾಪನೆ','Plugin installer section titleScreenshots'=>'ಚಿತ್ರಿಕೆಗಳು (Screenshots)','Plugin installer section titleChangelog'=>'Changelog','Plugin installer section titleDescription'=>'ವಿವರಣೆ','Plugin Homepage &#187;'=>'ಪ್ಲಗ್ ಇನ್ ಮುಖಪುಟ &#187;','Failed to repair the %1$s table. Error: %2$s'=>'%1$s ಟೇಬಲ್ ನ  ದುರಸ್ತಿ ವಿಫಲವಾಗಿದೆ. ದೋಷ:  %2$s','You can export a file of your site&#8217;s content in order to import it into another installation or platform. The export file will be an XML file format called WXR. Posts, pages, comments, custom fields, categories, and tags can be included. You can choose for the WXR file to include only certain posts or pages by setting the dropdown filters to limit the export by category, author, date range by month, or publishing status.'=>'ಮತ್ತೊಂದು ಸ್ಥಾಪನೆ ಅಥವಾ ವೇದಿಕೆಗೆ ಆಮದು ಮಾಡಿಕೊಳ್ಳಲು ನೀವು ನಿಮ್ಮ ಸೈಟ್ನ ಫೈಲ್ನ ಫೈಲ್ ಅನ್ನು ರಫ್ತು ಮಾಡಬಹುದು. ರಫ್ತು ಫೈಲ್ WXR ಎಂಬ XML ಫೈಲ್ ಫಾರ್ಮ್ಯಾಟ್ ಆಗಿರುತ್ತದೆ. ಪೋಸ್ಟ್ಗಳು, ಪುಟಗಳು, ಕಾಮೆಂಟ್ಗಳು, ಕಸ್ಟಮ್ ಜಾಗ, ವಿಭಾಗಗಳು, ಮತ್ತು ಟ್ಯಾಗ್ಗಳನ್ನು ಸೇರಿಸಬಹುದಾಗಿದೆ. ವರ್ಗದಲ್ಲಿ, ಲೇಖಕರು, ದಿನಾಂಕ ವ್ಯಾಪ್ತಿಯಿಂದ ತಿಂಗಳು ಅಥವಾ ಪ್ರಕಟಣೆಯ ಸ್ಥಿತಿಯಿಂದ ರಫ್ತು ಮಾಡುವಿಕೆಯನ್ನು ಮಿತಿಗೊಳಿಸಲು ಡ್ರಾಪ್ಡೌನ್ ಫಿಲ್ಟರ್ಗಳನ್ನು ಹೊಂದಿಸುವ ಮೂಲಕ ಕೆಲವು ಪೋಸ್ಟ್ಗಳು ಅಥವಾ ಪುಟಗಳನ್ನು ಮಾತ್ರ ಸೇರಿಸಲು WXR ಫೈಲ್ಗೆ ನೀವು ಆಯ್ಕೆ ಮಾಡಬಹುದು.','There are unsaved changes that will be lost. \'OK\' to continue, \'Cancel\' to return to the Image Editor.'=>'ಉಳಿಸಲಾಗಿಲ್ಲದ ಬದಲಾವಣೆಗಳು ಕಳೆದುಹೋಗಲಿವೆ. ಮುಂದುವರಿಸಲು \'ಸರಿ\' ಅನ್ನು ಒತ್ತಿ. ಚಿತ್ರ ಸಂಪಾದಕಕ್ಕೆ ಹಿಂದಿರುಗಲು \'ರದ್ದುಗೊಳಿಸಿ\' ಅನ್ನು ಒತ್ತಿ.','In previous versions of WordPress, all importers were built-in. They have been turned into plugins since most people only use them once or infrequently.'=>'ವರ್ಡ್ಪ್ರೆಸ್ನ ಹಿಂದಿನ ಆವೃತ್ತಿಗಳಲ್ಲಿ, ಎಲ್ಲಾ ಆಮದುದಾರರು ಅಂತರ್ನಿರ್ಮಿತರಾಗಿದ್ದರು. ಹೆಚ್ಚಿನ ಜನರು ಒಮ್ಮೆ ಅಥವಾ ಅಪರೂಪವಾಗಿ ಬಳಸುವುದರಿಂದ ಅವುಗಳನ್ನು ಪ್ಲಗ್ಇನ್ಗಳಾಗಿ ಮಾರ್ಪಡಿಸಲಾಗಿದೆ.','Post via email settings allow you to send your WordPress installation an email with the content of your post. You must set up a secret email account with POP3 access to use this, and any mail received at this address will be posted, so it&#8217;s a good idea to keep this address very secret.'=>'ನಿಮ್ಮ ಪೋಸ್ಟ್ನ ವಿಷಯದೊಂದಿಗೆ ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಸ್ಥಾಪನೆಯನ್ನು ಇಮೇಲ್ ಕಳುಹಿಸಲು ಇಮೇಲ್ ಸೆಟ್ಟಿಂಗ್ಗಳ ಮೂಲಕ ಪೋಸ್ಟ್ ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ. ಇದನ್ನು ಬಳಸಲು ನೀವು POP3 ಪ್ರವೇಶದೊಂದಿಗೆ ರಹಸ್ಯ ಇಮೇಲ್ ಖಾತೆಯನ್ನು ಹೊಂದಿಸಬೇಕು, ಮತ್ತು ಈ ವಿಳಾಸದಲ್ಲಿ ಸ್ವೀಕರಿಸಿದ ಯಾವುದೇ ಮೇಲ್ ಅನ್ನು ಪೋಸ್ಟ್ ಮಾಡಲಾಗುವುದು, ಆದ್ದರಿಂದ ಈ ವಿಳಾಸವನ್ನು ರಹಸ್ಯವಾಗಿಡಲು ಒಳ್ಳೆಯದು.','You can filter the list of users by User Role using the text links above the users list to show All, Administrator, Editor, Author, Contributor, or Subscriber. The default view is to show all users. Unused User Roles are not listed.'=>'ಬಳಕೆದಾರರು, ಬಳಕೆದಾರ, ನಿರ್ವಾಹಕರು, ಸಂಪಾದಕರು, ಲೇಖಕರು, ಕೊಡುಗೆದಾರರು ಅಥವಾ ಚಂದಾದಾರರನ್ನು ತೋರಿಸಲು ಬಳಕೆದಾರರ ಪಟ್ಟಿಯ ಮೇಲಿನ ಪಠ್ಯ ಲಿಂಕ್ಗಳನ್ನು ಬಳಸಿಕೊಂಡು ಬಳಕೆದಾರರ ಪಟ್ಟಿಯಿಂದ ನೀವು ಬಳಕೆದಾರರ ಪಟ್ಟಿಯನ್ನು ಫಿಲ್ಟರ್ ಮಾಡಬಹುದು. ಪೂರ್ವನಿಯೋಜಿತ ವೀಕ್ಷಣೆ ಎಲ್ಲಾ ಬಳಕೆದಾರರನ್ನು ತೋರಿಸುವುದು. ಬಳಸದ ಬಳಕೆದಾರ ಪಾತ್ರಗಳನ್ನು ಪಟ್ಟಿ ಮಾಡಲಾಗಿಲ್ಲ.','The active theme is broken. Reverting to the default theme.'=>'ಸಕ್ರಿಯವಾಗಿದ್ದ ಥೀಮ್ ಮುರಿದಿದೆ. ಪೂರ್ವನಿಯೋಜಿತ ಥೀಮ್ ಗೆ ಮರುಹೊಂದಿಸುತ್ತಿದೆ.','The %1$s table is not okay. It is reporting the following error: %2$s. WordPress will attempt to repair this table&hellip;'=>'%1$s ಸರಿಯಾಗಿಲ್ಲ. ಇದು ಕೆಳಗಿನ ದೋಷವನ್ನು ವರದಿ ಮಾಡುತ್ತಿದೆ: %2$s. ವರ್ಡ್ ಪ್ರೆಸ್ಸ್ ಈ  ಟೇಬಲ್ ಅನ್ನು ಸರಿಪಡಿಸಲು ಯತ್ನಿಸುತ್ತದೆ &hellip;','Repairs complete. Please remove the following line from wp-config.php to prevent this page from being used by unauthorized users.'=>'ದುರಸ್ತಿಗಳು ಸಂಪೂರ್ಣವಾಗಿವೆ. ಈ ಪುಟವನ್ನು ಅನಧಿಕೃತ ಬಳಕೆದಾರರಿಂದ ದುರ್ಬಳಕೆಯಾಗುವುದನ್ನು ತಡೆಯಲು, ದಯವಿಟ್ಟು ಈ ಕೆಳಗಿನ ಸಾಲನ್ನು wp-config.php ನಿಂದ ತೆಗೆಯಿರಿ.','WordPress can automatically look for some common database problems and repair them. Repairing can take a while, so please be patient.'=>'ವರ್ಡ್ ಪ್ರೆಸ್ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಡೇಟಾಬೇಸ್ ನ ಸಾಮಾನ್ಯ ತೊಂದರೆಗಳನ್ನು ಗಮನಿಸುತ್ತದೆ ಮತ್ತು ಅವುಗಳನ್ನು ಸರಿಪಡಿಸುತ್ತದೆ. ದುರಸ್ತಿ ಕಾರ್ಯ ಸ್ವಲ್ಪ ಸಮಯ ತೆಗೆದುಕೊಳ್ಳಬಹುದು, ಆದ್ದರಿಂದ ದಯವಿಟ್ಟು ತಾಳ್ಮೆಯಿಂದಿರಿ.','There is an autosave of this post that is more recent than the version below. <a href="%s">View the autosave</a>'=>'ಈ ಕೆಳಗಿನ ಆವೃತ್ತಿಗಿಂತ ಹೊಸದಾಗಿರುವ ಸ್ವಯಂಚಾಲಿತ ಉಳಿಕೆಯೊಂದು ಈ ಲೇಖನಕ್ಕಿದೆ. <a href="%s">ಸ್ವಯಂಚಾಲಿತ ಉಳಿಕೆ ಯನ್ನು ನೋಡಿ</a>.','Enter the email address of an existing user on this network to invite them to this site. That person will be sent an email asking them to confirm the invite.'=>'ಬಳಕೆದಾರರನ್ನು ಈ ಜಾಲತಾಣಕ್ಕೆ ಆಹ್ವಾನಿಸಲು, ಈ ಸಂಪರ್ಕಜಾಲದಲ್ಲಿ ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಅವರ ಮಿಂಚೆ ವಿಳಾಸ ವನ್ನು ನಮೂದಿಸಿ. ಆಹ್ವಾನವನ್ನು ಖಾತ್ರಿಪಡಿಸಲು ಕೇಳಿಕೊಳ್ಳುವ ಮಿಂಚೆಯನ್ನು ಆ ವ್ಯಕ್ತಿಗಳಿಗೆ ಕಳುಹಿಸಲಾಗುತ್ತದೆ. ','Image could not be processed. Please go back and try again.'=>'ಚಿತ್ರವನ್ನು ಸಂಸ್ಕರಿಸಲಾಗಲಿಲ್ಲ. ದಯವಿಟ್ಟು ಹಿಂದಿರುಗಿ ಮತ್ತು ಇನ್ನೊಮ್ಮೆ ಪ್ರಯತ್ನಿಸಿ.','Enter the email address or username of an existing user on this network to invite them to this site. That person will be sent an email asking them to confirm the invite.'=>'ಈ ಸೈಟ್ಗೆ ಅವರನ್ನು ಆಮಂತ್ರಿಸಲು ಈ ನೆಟ್ವರ್ಕ್ನಲ್ಲಿ ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಬಳಕೆದಾರರ ಇಮೇಲ್ ವಿಳಾಸ ಅಥವಾ ಬಳಕೆದಾರ ಹೆಸರನ್ನು ನಮೂದಿಸಿ. ಆಹ್ವಾನವನ್ನು ಖಚಿತಪಡಿಸಲು ಆ ವ್ಯಕ್ತಿಗೆ ಇಮೇಲ್ ಕಳುಹಿಸಲಾಗುವುದು.','WordPress can also attempt to optimize the database. This improves performance in some situations. Repairing and optimizing the database can take a long time and the database will be locked while optimizing.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಸಹ ಡೇಟಾಬೇಸ್ ಅನ್ನು ಉತ್ತಮಗೊಳಿಸಲು ಪ್ರಯತ್ನಿಸಬಹುದು. ಇದು ಕೆಲವು ಸಂದರ್ಭಗಳಲ್ಲಿ ಕಾರ್ಯಕ್ಷಮತೆಯನ್ನು ಸುಧಾರಿಸುತ್ತದೆ. ಡೇಟಾಬೇಸ್ ಅನ್ನು ದುರಸ್ತಿ ಮಾಡುವುದು ಮತ್ತು ಸರಳೀಕರಿಸುವುದು ಬಹಳ ಸಮಯ ತೆಗೆದುಕೊಳ್ಳಬಹುದು ಮತ್ತು ಸರಳೀಕರಿಸುವಾಗ ಡೇಟಾಬೇಸ್ ಲಾಕ್ ಆಗುತ್ತದೆ.','Show Toolbar when viewing site'=>'ಜಾಲತಾಣವನ್ನು ಸಂದರ್ಶಿಸುವಾಗ ಟೂಲ್ ಬಾರ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸಿ','For more information, see <a href="%s">the release notes</a>.'=>'ಹೆಚ್ಚಿನ ಮಾಹಿತಿಗಾಗಿ, <a href="%s">ಬಿಡುಗಡೆ ಟಿಪ್ಪಣಿಗಳನ್ನು</a> ನೋಡಿ.','<strong>Version %1$s</strong> addressed %2$s bug.'=>'<strong> ಆವೃತ್ತಿ %1$s </strong> %2$s ದೋಷವನ್ನು ಸರಿಪಡಿಸಲಾಗಿದೆ.' . "\0" . '<strong> ಆವೃತ್ತಿ %1$s </strong> %2$s ದೋಷವನ್ನು ಸರಿಪಡಿಸಲಾಗಿದೆ.','<strong>Version %1$s</strong> addressed a security issue and fixed %2$s bug.'=>'<strong> ಆವೃತ್ತಿ %1$s </strong> ಭದ್ರತಾ ಸಮಸ್ಯೆಯನ್ನು ಮತ್ತು ಸ್ಥಿರ %2$s ದೋಷವನ್ನು ಉದ್ದೇಶಿಸಿದೆ.' . "\0" . '<strong> ಆವೃತ್ತಿ %1$s </strong> ಭದ್ರತಾ ಸಮಸ್ಯೆಯನ್ನು ಮತ್ತು ಸ್ಥಿರ %2$s ದೋಷವನ್ನು ಉದ್ದೇಶಿಸಿದೆ.','<strong>Version %1$s</strong> addressed some security issues and fixed %2$s bug.'=>'<strong> ಆವೃತ್ತಿ %1$s </strong> ಕೆಲವು ಭದ್ರತಾ ಸಮಸ್ಯೆಗಳನ್ನು ಮತ್ತು ಸ್ಥಿರವಾದ %2$s ದೋಷವನ್ನು ಉದ್ದೇಶಿಸಿದೆ.' . "\0" . '<strong> ಆವೃತ್ತಿ %1$s </strong> ಕೆಲವು ಭದ್ರತಾ ಸಮಸ್ಯೆಗಳನ್ನು ಮತ್ತು ಸ್ಥಿರವಾದ %2$s ದೋಷವನ್ನು ಉದ್ದೇಶಿಸಿದೆ.','What&#8217;s New'=>'ಹೊಸತೇನಿದೆ','Maintenance Release'=>'ನಿರ್ವಹಣಾ ಬಿಡುಗಡೆ' . "\0" . 'ನಿರ್ವಹಣಾ ಬಿಡುಗಡೆಗಳು','<strong>Version %s</strong> addressed some security issues.'=>'<strong>ಆವೃತ್ತಿ %1$s</strong>ಯು ಸುರಕ್ಷತಾ ದೋಷವನ್ನು ಪರಿಗಣಿಸಿದೆ' . "\0" . '<strong>ಆವೃತ್ತಿ %1$s</strong>ಯು ಕೆಲವು ಸುರಕ್ಷತಾ ದೋಷಗಳನ್ನು ಪರಿಗಣಿಸಿದೆ.','Maintenance and Security Release'=>'ನಿರ್ವಹಣಾ ಮತ್ತು ಸುರಕ್ಷತಾ ಬಿಡುಗಡೆ' . "\0" . 'ನಿರ್ವಹಣಾ ಮತ್ತು ಸುರಕ್ಷತಾ ಬಿಡುಗಡೆಗಳು','Security Release'=>'ಸುರಕ್ಷತಾ ಬಿಡುಗಡೆ' . "\0" . 'ಸುರಕ್ಷತಾ ಬಿಡುಗಡೆಗಳು','This screen allows you to choose your permalink structure. You can choose from common settings or create custom URL structures.'=>'ಈ ಪರದೆಯು ನಿಮಗೆ ನಿಮ್ಮ ಪೂರ್ವನಿಯೋಜಿತ permalink ಸ್ವರೂಪವನ್ನು ಆರಿಸಲು ಸಹಕರಿಸುತ್ತದೆ. ನೀವು ಸಾಮಾನ್ಯ ಸಂಯೋಜನೆಗಳಿಂದ ಆರಿಸಬಹುದು ಅಥವಾ ಸ್ವಯೋಜಿತ URL ಸ್ವರೂಪಗಳನ್ನು ರಚಿಸಬಹುದು.','Welcome to WordPress %1$s. <a href="%2$s">Learn more</a>.'=>'ವರ್ಡ್ಪ್ರೆಸ್ %1$s ಗೆ ಸುಸ್ವಾಗತ. <a href="%2$s">ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ</a>.','Adding Categories'=>'ವಿಭಾಗಗಳನ್ನು ಸೇರಿಸುತ್ತಿದೆ','Adding Tags'=>'ಟ್ಯಾಗ್ ಗಳನ್ನು ಸೇರಿಸುತ್ತಿದೆ ','Troubleshooting'=>'ನಿವಾರಣೆ','You can upload media files here without creating a post first. This allows you to upload files to use with posts and pages later and/or to get a web link for a particular file that you can share. There are three options for uploading files:'=>'ಮೊದಲು ಪೋಸ್ಟ್ ಅನ್ನು ರಚಿಸದೆ ನೀವು ಮಾಧ್ಯಮ ಫೈಲ್‌ಗಳನ್ನು ಇಲ್ಲಿ ಅಪ್‌ಲೋಡ್ ಮಾಡಬಹುದು. ಪೋಸ್ಟ್‌ಗಳು ಮತ್ತು ಪುಟಗಳ ನಂತರ ಬಳಸಲು ಫೈಲ್‌ಗಳನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲು ಮತ್ತು/ಅಥವಾ ನೀವು ಹಂಚಿಕೊಳ್ಳಬಹುದಾದ ನಿರ್ದಿಷ್ಟ ಫೈಲ್‌ಗಾಗಿ ವೆಬ್ ಲಿಂಕ್ ಪಡೆಯಲು ಇದು ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ. ಫೈಲ್‌ಗಳನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲು ಮೂರು ಆಯ್ಕೆಗಳಿವೆ:','Available Actions'=>'ಲಭ್ಯವಿರುವ ಕ್ರಿಯೆಗಳು','How to Update'=>'ನವೀಕರಿಸುವುದು ಹೇಗೆ','Adding Plugins'=>'ಪ್ಲಗ್ ಇನ್ ಗಳನ್ನು ಸೇರಿಸುತ್ತಿದೆ','Adding Themes'=>'ಥೀಮ್ ಗಳನ್ನು ಸೇರಿಸುತ್ತಿದೆ','Moderating Comments'=>'ಟಿಪ್ಪಣಿಗಳನ್ನು ಅನುಮೋದಿಸಲಾಗುತ್ತಿದೆ','User Roles'=>'ಬಳಕೆದಾರರ ಕರ್ತವ್ಯಗಳು','Attaching Files'=>'ಕಡತಗಳನ್ನು ಲಗತ್ತಿಸುತ್ತಿದೆ','Here is a basic overview of the different user roles and the permissions associated with each one:'=>'ಪ್ರತಿಯೊಬ್ಬ ಬಳಕೆದಾರರ ಕರ್ತವ್ಯ ಹಾಗೂ ಪ್ರತಿಯೊಬ್ಬರ ಜೊತೆಗೂ ಹೊಂದಿಸಲಾಗಿರುವ ಅನುಮತಿಗಳ ಬಗೆಗಿನ ಸಾಮಾನ್ಯ ಪಕ್ಷಿನೋಟ ಇಲ್ಲಿದೆ:','Subscribers can read comments/comment/receive newsletters, etc. but cannot create regular site content.'=>'ಚಂದಾದಾರರು ಟಿಪ್ಪಣಿಗಳನ್ನು ಓದಬಹುದು, ಟಿಪ್ಪಣಿಗಳನ್ನು ಬರೆಯಬಹುದು, ಸುದ್ದಿಪತ್ರ, ಇತ್ಯಾದಿಗಳನ್ನು ಪಡೆಯಬಹುದು. ಆದರೆ ನಿಯಮಿತ ಜಾಲತಾಣದ ವಸ್ತುವಿಷಯಗಳನ್ನು ರಚಿಸಲಾಗುವುದಿಲ್ಲ.','If the importer you need is not listed, <a href="%s">search the plugin directory</a> to see if an importer is available.'=>'ನಿಮಗೆ ಅಗತ್ಯವಿರುವ ಆಮದುಗಾರ ಪಟ್ಟಿಯಲ್ಲಿಲ್ಲದಿದ್ದರೆ, ಆಮದುಗಾರರ ಲಭ್ಯತೆಯನ್ನು ನೋಡಲು <a href="%s">ಪ್ಲಗ್ ಇನ್ ಡೈರೆಕ್ಟರಿಯನ್ನು ಹುಡುಕಿ</a>. ','Authors can publish and manage their own posts, and are able to upload files.'=>'ಲೇಖಕರು ತಮ್ಮ ಸ್ವಂತ ಲೇಖನಗಳನ್ನು ಪ್ರಕಟಿಸಬಹುದು ಮತ್ತು ನಿರ್ವಹಿಸಬಹುದು, ಹಾಗೂ ಅವರು ಕಡತಗಳನ್ನು ವರ್ಗಾಯಿಸಲೂಬಹುದು.','Screen Content'=>'ಪರದೆಯ ವಿಷಯ','If you want to convert your categories to tags (or vice versa), use the <a href="%s">Categories and Tags Converter</a> available from the Import screen.'=>'ನಿಮ್ಮ ವರ್ಗಗಳನ್ನು ಟ್ಯಾಗ್‌ಗಳಾಗಿ ಪರಿವರ್ತಿಸಲು ನೀವು ಬಯಸಿದರೆ (ಅಥವಾ ಪ್ರತಿಯಾಗಿ), ಆಮದು ಪರದೆಯಿಂದ ಲಭ್ಯವಿರುವ <a href="%s"> ವರ್ಗಗಳು ಮತ್ತು ಟ್ಯಾಗ್ ಪರಿವರ್ತಕವನ್ನು </a> ಬಳಸಿ.','Remember to click the Add New User button at the bottom of this screen when you are finished.'=>'ನೀವು ಮುಗಿಸಿದ ನಂತರ ಈ ಪರದೆಯ ಕೆಳಭಾಗದಲ್ಲಿರುವ ಹೊಸ ಬಳಕೆದಾರರನ್ನು ಸೇರಿಸಿ ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಲು ಮರೆಯದಿರಿ.','To add a new user to your site, fill in the form on this screen and click the Add New User button at the bottom.'=>'ನಿಮ್ಮ ಸೈಟ್‌ಗೆ ಹೊಸ ಬಳಕೆದಾರರನ್ನು ಸೇರಿಸಲು, ಈ ಪರದೆಯಲ್ಲಿ ಫಾರ್ಮ್ ಅನ್ನು ಭರ್ತಿ ಮಾಡಿ ಮತ್ತು ಕೆಳಭಾಗದಲ್ಲಿರುವ ಹೊಸ ಬಳಕೆದಾರರನ್ನು ಸೇರಿಸಿ ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಿ.','You can customize the display of this screen&#8217;s contents in a number of ways:'=>'ನೀವು ಈ ಪರದೆಯ ಪ್ರದರ್ಶಕವನ್ನು ಮತ್ತು ಹಲವಾರು ವಿಷಯಗಳಲ್ಲಿ # 8217; ನ ವಿಷಯಗಳನ್ನು ಗ್ರಾಹಕೀಯಗೊಳಿಸಬಹುದು:','This screen provides access to all of your posts. You can customize the display of this screen to suit your workflow.'=>'ಈ ಪರದೆಯು ನಿಮ್ಮ ಎಲ್ಲಾ ಪೋಸ್ಟ್ಗಳಿಗೆ ಪ್ರವೇಶವನ್ನು ಒದಗಿಸುತ್ತದೆ. ನಿಮ್ಮ ವರ್ಕ್ಫ್ಲೋಗೆ ಸರಿಹೊಂದುವಂತೆ ಈ ಪರದೆಯ ಪ್ರದರ್ಶನವನ್ನು ನೀವು ಗ್ರಾಹಕೀಯಗೊಳಿಸಬಹುದು.','Once you&#8217;ve saved the download file, you can use the Import function in another WordPress installation to import the content from this site.'=>'ನೀವು ಡೌನ್ಲೋಡ್ ಫೈಲ್ ಅನ್ನು ಉಳಿಸಿದ ನಂತರ, ಈ ಸೈಟ್ನಿಂದ ವಿಷಯವನ್ನು ಆಮದು ಮಾಡಿಕೊಳ್ಳಲು ನೀವು ಇನ್ನೊಂದು ವರ್ಡ್ಪ್ರೆಸ್ ಸ್ಥಾಪನೆಯಲ್ಲಿ ಆಮದು ಕಾರ್ಯವನ್ನು ಬಳಸಬಹುದು.','You can also edit or move multiple posts to the Trash at once. Select the posts you want to act on using the checkboxes, then select the action you want to take from the Bulk actions menu and click Apply.'=>'ನೀವು ಅನೇಕ ಪೋಸ್ಟ್ಗಳನ್ನು ಒಂದೇ ಬಾರಿಗೆ ಟ್ರ್ಯಾಶ್ಗೆ ಸಂಪಾದಿಸಬಹುದು ಅಥವಾ ಸರಿಸಬಹುದು. ನೀವು ಚೆಕ್ಬಾಕ್ಸ್ಗಳನ್ನು ಬಳಸಿಕೊಂಡು ಕಾರ್ಯನಿರ್ವಹಿಸಲು ಬಯಸುವ ಪೋಸ್ಟ್ಗಳನ್ನು ಆಯ್ಕೆ ಮಾಡಿ, ನಂತರ ನೀವು ದೊಡ್ಡ ಕ್ರಿಯೆಗಳ ಮೆನುವಿನಿಂದ ತೆಗೆದುಕೊಳ್ಳಲು ಬಯಸುವ ಕ್ರಮವನ್ನು ಆಯ್ಕೆ ಮಾಡಿ ಮತ್ತು ಅನ್ವಯಿಸು ಕ್ಲಿಕ್ ಮಾಡಿ.','Common Settings'=>'ಸಾಮಾನ್ಯ ಸಂಯೋಜನೆಗಳು ','Custom Structures'=>'ಸ್ವಯೋಜಿತ ಸ್ವರೂಪಗಳು','Permalinks are the permanent URLs to your individual pages and blog posts, as well as your category and tag archives. A permalink is the web address used to link to your content. The URL to each post should be permanent, and never change &#8212; hence the name permalink.'=>'Permalink ಗಳು ನಿಮ್ಮ ಪ್ರತ್ಯೇಕವಾದ ಪುಟಗಳಿಗೆ ಮತ್ತು ಬ್ಲಾಗ್ ಲೇಖನಗಳಿಗೆ, ಅಲ್ಲದೇ ನಿಮ್ಮ ವಿಭಾಗ ಮತ್ತು ಟ್ಯಾಗ್ ಸಂಗ್ರಹಗಳಿಗೂ ಸಹ ಶಾಶ್ವತ URL ಗಳಾಗಿರುತ್ತವೆ. Permalink ಒಂದು ಜಾಲ ವಿಳಾಸವಾಗಿದ್ದು ನಿಮ್ಮ ವಸ್ತುವಿಷಯಗಳಿಗೆ ಲಿಂಕ್ ಆಗಿ ಬಳಸಲ್ಪಡುತ್ತದೆ.  ಪ್ರತಿಯೊಂದು ಲೇಖನದ URL ಶಾಶ್ವತವಾಗಿದ್ದು, ಯಾವತ್ತೂ ಬದಲಾವಣೆಯಾಗುವುದಿಲ್ಲ &#8212; ಹಾಗೆಂದೇ ಇದರ ಹೆಸರು permalink.','Uploading Files allows you to choose the folder and path for storing your uploaded files.'=>'ಅಪ್ಲೋಡ್ ಮಾಡಲಾದ ಫೈಲ್ಗಳು ನಿಮ್ಮ ಅಪ್ಲೋಡ್ ಮಾಡಲಾದ ಫೈಲ್ಗಳನ್ನು ಸಂಗ್ರಹಿಸಲು ಫೋಲ್ಡರ್ ಮತ್ತು ಮಾರ್ಗವನ್ನು ಆಯ್ಕೆ ಮಾಡಲು ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ.','You can submit content in several different ways; this screen holds the settings for all of them. The top section controls the editor within the dashboard, while the rest control external publishing methods. For more information on any of these methods, use the documentation links.'=>'ನೀವು ವಿಷಯವನ್ನು ವಿವಿಧ ರೀತಿಗಳಲ್ಲಿ ಸಲ್ಲಿಸಬಹುದು; ಈ ಪರದೆಯು ಅವರಿಗೆ ಎಲ್ಲಾ ಸೆಟ್ಟಿಂಗ್ಗಳನ್ನು ಹೊಂದಿದೆ. ಮೇಲಿನ ವಿಭಾಗವು ಡ್ಯಾಶ್ಬೋರ್ಡ್ನಲ್ಲಿ ಸಂಪಾದಕವನ್ನು ನಿಯಂತ್ರಿಸುತ್ತದೆ, ಉಳಿದಿರುವ ಬಾಹ್ಯ ಪ್ರಕಟಣೆಯ ವಿಧಾನಗಳನ್ನು ನಿಯಂತ್ರಿಸುತ್ತದೆ. ಈ ಯಾವುದೇ ವಿಧಾನಗಳ ಬಗ್ಗೆ ಹೆಚ್ಚಿನ ಮಾಹಿತಿಗಾಗಿ, ದಸ್ತಾವೇಜನ್ನು ಲಿಂಕ್ಗಳನ್ನು ಬಳಸಿ.','Installing themes on Multisite can only be done from the Network Admin section.'=>'Multisite ಗಳಲ್ಲಿ ಥೀಮ್ ಗಳನ್ನು ಸ್ಥಾಪಿಸಲು ಸಂಪರ್ಕಜಾಲದ ನಿರ್ವಹಣೆಗಾರರ ವಿಭಾಗದಿಂದ ಮಾತ್ರ ಸಾಧ್ಯವಿದೆ.','If desired, WordPress will automatically alert various services of your new posts.'=>'ಬೇಕೆನಿಸಿದಲ್ಲಿ, ವರ್ಡ್ ಪ್ರೆಸ್ ನಿಮ್ಮ ಹೊಸ ಲೇಖನಗಳ ವಿವಿಧ ಸೇವೆಗಳನ್ನು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಎಚ್ಚರಿಸುತ್ತದೆ.','Post Via Email'=>'ಮಿಂಚೆಯ ಮೂಲಕ ಲೇಖನ ಕಳಿಸಿ','You can change your password, turn on keyboard shortcuts, change the color scheme of your WordPress administration screens, and turn off the WYSIWYG (Visual) editor, among other things. You can hide the Toolbar (formerly called the Admin Bar) from the front end of your site, however it cannot be disabled on the admin screens.'=>'ನೀವು ನಿಮ್ಮ ಪಾಸ್ವರ್ಡ್ ಬದಲಾಯಿಸಬಹುದು, ಕೀಬೋರ್ಡ್ ಶಾರ್ಟ್ಕಟ್ಗಳನ್ನು ಆನ್ ಮಾಡಿ, ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಆಡಳಿತ ಪರದೆಯ ಬಣ್ಣದ ಸ್ಕೀಮ್ ಅನ್ನು ಬದಲಿಸಬಹುದು, ಮತ್ತು ಡಬ್ಲ್ಯುವೈಎಸ್ಐಡಬ್ಲ್ಯುವೈಜಿ (ವಿಷುಯಲ್) ಸಂಪಾದಕವನ್ನು ಇತರ ವಿಷಯಗಳ ಜೊತೆಗೆ ಆಫ್ ಮಾಡಬಹುದು. ನಿಮ್ಮ ಸೈಟ್ನ ಮುಂಭಾಗದ ತುದಿಯಲ್ಲಿರುವ ಟೂಲ್ಬಾರ್ ಅನ್ನು (ಹಿಂದೆ ನಿರ್ವಹಣೆ ಬಾರ್ ಎಂದು ಕರೆಯಲಾಗುತ್ತದೆ) ನೀವು ಮರೆಮಾಡಬಹುದು, ಆದರೆ ನಿರ್ವಹಣೆ ಪರದೆಯಲ್ಲಿ ಅದನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗುವುದಿಲ್ಲ.','Inactive Sidebar (not used)'=>'ನಿಷ್ಕ್ರಿಯ ಪಕ್ಕದಂಕಣ (ಬಳಕೆಯಲ್ಲಿಲ್ಲ)','This sidebar is no longer available and does not show anywhere on your site. Remove each of the widgets below to fully remove this inactive sidebar.'=>'ಈ ಸೈಡ್ಬಾರ್ನಲ್ಲಿ ಇನ್ನು ಮುಂದೆ ಲಭ್ಯವಿಲ್ಲ ಮತ್ತು ನಿಮ್ಮ ಸೈಟ್ನಲ್ಲಿ ಎಲ್ಲಿಯಾದರೂ ತೋರಿಸುವುದಿಲ್ಲ. ಈ ನಿಷ್ಕ್ರಿಯ ಸೈಡ್ಬಾರ್ನಲ್ಲಿ ಸಂಪೂರ್ಣವಾಗಿ ತೆಗೆದುಹಾಕಲು ಕೆಳಗಿನ ಪ್ರತಿಯೊಂದು ವಿಜೆಟ್ಗಳನ್ನು ತೆಗೆದುಹಾಕಿ.','Missing Widgets'=>'ಕಾಣೆಯಾಗಿರುವ ವಿಜೆಟ್ ಗಳು','Removing and Reusing'=>'ತೆಗೆಯುತ್ತಿದೆ ಮತ್ತು ಮರುಬಳಸುತ್ತಿದೆ','<strong>Drag and drop</strong> your files into the area below. Multiple files are allowed.'=>'ಕೆಳಗಿನ ಪ್ರದೇಶಕ್ಕೆ ನಿಮ್ಮ ಫೈಲ್‌ಗಳನ್ನು <strong>ಡ್ರ್ಯಾಗ್ ಮತ್ತು ಡ್ರಾಪ್ ಮಾಡಿ</strong>. ಬಹು ಫೈಲ್‌ಗಳನ್ನು ಅನುಮತಿಸಲಾಗಿದೆ.','You can create groups of links by using Link Categories. Link Category names must be unique and Link Categories are separate from the categories you use for posts.'=>'ಲಿಂಕ್ ವರ್ಗಗಳನ್ನು ಬಳಸಿಕೊಂಡು ನೀವು ಲಿಂಕ್ಗಳ ಗುಂಪುಗಳನ್ನು ರಚಿಸಬಹುದು. ಲಿಂಕ್ ವರ್ಗ ಹೆಸರುಗಳು ಅನನ್ಯವಾಗಿರಬೇಕು ಮತ್ತು ಲಿಂಕ್ ವರ್ಗಗಳು ನೀವು ಪೋಸ್ಟ್ಗಳಿಗಾಗಿ ಬಳಸುವ ವರ್ಗಗಳಿಂದ ಪ್ರತ್ಯೇಕವಾಗಿರುತ್ತವೆ.','Clicking <strong>Select Files</strong> opens a navigation window showing you files in your operating system. Selecting <strong>Open</strong> after clicking on the file you want activates a progress bar on the uploader screen.'=>'ನಿಮ್ಮ ಆಪರೇಟಿಂಗ್ ಸಿಸ್ಟಂನಲ್ಲಿ ಫೈಲ್ಗಳನ್ನು ತೋರಿಸುವ ಒಂದು ನ್ಯಾವಿಗೇಷನ್ ವಿಂಡೋವನ್ನು <strong> ಫೈಲ್ಗಳನ್ನು ಆಯ್ಕೆ ಮಾಡಿ </strong> ಕ್ಲಿಕ್ ಮಾಡುವುದನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ. ಅಪ್ಲೋಡರ್ ಪರದೆಯಲ್ಲಿ ಪ್ರಗತಿ ಪಟ್ಟಿಯನ್ನು ಸಕ್ರಿಯಗೊಳಿಸುವ ಫೈಲ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿದ ನಂತರ <strong> ತೆರೆಯಿರಿ </strong> ಅನ್ನು ಆಯ್ಕೆಮಾಡಿ.','Deleting Links'=>'ಲಿಂಕ್ ಗಳನ್ನು ಅಳಿಸುತ್ತಿದೆ','Managing pages is very similar to managing posts, and the screens can be customized in the same way.'=>'ಪುಟಗಳ ನಿರ್ವಹಣೆ, ಲೇಖನಗಳ ನಿರ್ವಹಣೆ ರೀತಿಯಲ್ಲೇ ಇರುತ್ತದೆ, ಮತ್ತು ಪರದೆಗಳನ್ನು ಅದೇ ರೀತಿಯಲ್ಲೇ ಸ್ವಯೋಜಿಸಬಹುದು.','Many people take advantage of keyboard shortcuts to moderate their comments more quickly. Use the link to the side to learn more.'=>'ತಮ್ಮ ಕಾಮೆಂಟ್ಗಳನ್ನು ಹೆಚ್ಚು ತ್ವರಿತವಾಗಿ ಮಾಡರೇಟ್ ಮಾಡಲು ಅನೇಕ ಜನರು ಕೀಬೋರ್ಡ್ ಶಾರ್ಟ್ಕಟ್ಗಳನ್ನು ಬಳಸುತ್ತಾರೆ. ಇನ್ನಷ್ಟು ತಿಳಿದುಕೊಳ್ಳಲು ಬದಿಗೆ ಲಿಂಕ್ ಬಳಸಿ.','Pages are similar to posts in that they have a title, body text, and associated metadata, but they are different in that they are not part of the chronological blog stream, kind of like permanent posts. Pages are not categorized or tagged, but can have a hierarchy. You can nest pages under other pages by making one the &#8220;Parent&#8221; of the other, creating a group of pages.'=>'ಪುಟಗಳು ಶೀರ್ಷಿಕೆ, ದೇಹ ಪಠ್ಯ, ಮತ್ತು ಸಂಬಂಧಿತ ಮೆಟಾಡೇಟಾವನ್ನು ಹೊಂದಿದ ಪೋಸ್ಟ್ಗಳಿಗೆ ಹೋಲುತ್ತವೆ, ಆದರೆ ಅವೆಂದರೆ ಅವರು ಕಾಲಸೂಚಕ ಬ್ಲಾಗ್ ಸ್ಟ್ರೀಮ್ನ ಭಾಗವಲ್ಲ, ಅವು ಶಾಶ್ವತ ಪೋಸ್ಟ್ಗಳ ರೀತಿಯವು. ಪುಟಗಳನ್ನು ವರ್ಗೀಕರಿಸಲಾಗುವುದಿಲ್ಲ ಅಥವಾ ಟ್ಯಾಗ್ ಮಾಡಲಾಗುವುದಿಲ್ಲ, ಆದರೆ ಕ್ರಮಾನುಗತವನ್ನು ಹೊಂದಬಹುದು. ನೀವು ಇತರ ಪುಟಗಳ ಅಡಿಯಲ್ಲಿ ಗೂಡು ಪುಟಗಳನ್ನು ಮಾಡಬಹುದು & # 8220; ಪೋಷಕ & # 8221; ಇತರರ, ಪುಟಗಳ ಗುಂಪನ್ನು ರಚಿಸುತ್ತದೆ.','All the files you&#8217;ve uploaded are listed in the Media Library, with the most recent uploads listed first. You can use the Screen Options tab to customize the display of this screen.'=>'ನೀವು ಅಪ್ಲೋಡ್ ಮಾಡಲಾದ ಎಲ್ಲ ಫೈಲ್ಗಳು ಮಾಧ್ಯಮ ಲೈಬ್ರರಿಯಲ್ಲಿ ಪಟ್ಟಿ ಮಾಡಲಾಗಿವೆ, ಇತ್ತೀಚಿನವುಗಳಲ್ಲಿ ಇತ್ತೀಚಿನ ಅಪ್ಲೋಡ್ಗಳು. ಈ ಪರದೆಯ ಪ್ರದರ್ಶನವನ್ನು ಕಸ್ಟಮೈಸ್ ಮಾಡಲು ನೀವು ಸ್ಕ್ರೀನ್ ಆಯ್ಕೆಗಳು ಟ್ಯಾಬ್ ಅನ್ನು ಬಳಸಬಹುದು.','If a media file has not been attached to any content, you will see that in the Uploaded To column, and can click on Attach to launch a small popup that will allow you to search for existing content and attach the file.'=>'ಒಂದು ಮಾಧ್ಯಮ ಫೈಲ್ ಯಾವುದೇ ವಿಷಯಕ್ಕೆ ಲಗತ್ತಿಸದಿದ್ದರೆ, ಅಪ್ಲೋಡ್ ಮಾಡಲಾದ ಕಾಲಮ್ನಲ್ಲಿ ನೀವು ನೋಡುತ್ತೀರಿ, ಮತ್ತು ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಪಾಪ್ಅಪ್ ಅನ್ನು ಪ್ರಾರಂಭಿಸಲು ಲಗತ್ತಿಸಿ ಕ್ಲಿಕ್ ಮಾಡಿ ಅದು ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ವಿಷಯಕ್ಕಾಗಿ ಹುಡುಕಲು ಮತ್ತು ಫೈಲ್ ಅನ್ನು ಲಗತ್ತಿಸಬಹುದು.','You can also perform the same types of actions, including narrowing the list by using the filters, acting on a page using the action links that appear when you hover over a row, or using the Bulk actions menu to edit the metadata for multiple pages at once.'=>'ನೀವು ಫಿಲ್ಟರ್ಗಳನ್ನು ಬಳಸಿಕೊಂಡು ಪಟ್ಟಿಯನ್ನು ಸಂಕುಚಿತಗೊಳಿಸುವುದರೊಂದಿಗೆ, ಒಂದು ಸಾಲಿನ ಮೇಲೆ ಸುಳಿದಾದಾಗ, ಅಥವಾ ಅನೇಕ ಪುಟಗಳಿಗಾಗಿ ಮೆಟಾಡೇಟಾವನ್ನು ಸಂಪಾದಿಸಲು ದೊಡ್ಡ ಕ್ರಿಯೆಗಳ ಮೆನುವನ್ನು ಬಳಸುವ ಕ್ರಿಯೆಯ ಲಿಂಕ್ಗಳನ್ನು ಬಳಸಿಕೊಂಡು ಒಂದು ಪುಟದಲ್ಲಿ ಕಾರ್ಯನಿರ್ವಹಿಸುವುದನ್ನು ಒಳಗೊಂಡಂತೆ ನೀವು ಅದೇ ರೀತಿಯ ಕ್ರಿಯೆಗಳನ್ನು ಮಾಡಬಹುದು. ಒಮ್ಮೆ.','Links in the Toolbar at the top of the screen connect your dashboard and the front end of your site, and provide access to your profile and helpful WordPress information.'=>'ಪರದೆಯ ಮೇಲ್ಭಾಗದಲ್ಲಿರುವ ಟೂಲ್ಬಾರ್ನಲ್ಲಿರುವ ಲಿಂಕ್ಗಳು ನಿಮ್ಮ ಡ್ಯಾಶ್ಬೋರ್ಡ್ ಮತ್ತು ನಿಮ್ಮ ಸೈಟ್ನ ಮುಂಭಾಗದ ತುದಿಯನ್ನು ಸಂಪರ್ಕಿಸುತ್ತವೆ, ಮತ್ತು ನಿಮ್ಮ ಪ್ರೊಫೈಲ್ ಮತ್ತು ಉಪಯುಕ್ತ ವರ್ಡ್ಪ್ರೆಸ್ ಮಾಹಿತಿಗೆ ಪ್ರವೇಶವನ್ನು ಒದಗಿಸುತ್ತದೆ.','You can manage comments made on your site similar to the way you manage posts and other content. This screen is customizable in the same ways as other management screens, and you can act on comments using the on-hover action links or the bulk actions.'=>'ನೀವು ಪೋಸ್ಟ್ಗಳನ್ನು ಮತ್ತು ಇತರ ವಿಷಯವನ್ನು ನಿರ್ವಹಿಸುವ ರೀತಿಯಲ್ಲಿ ನಿಮ್ಮ ಸೈಟ್ನಲ್ಲಿ ಮಾಡಿದ ಕಾಮೆಂಟ್ಗಳನ್ನು ನೀವು ನಿರ್ವಹಿಸಬಹುದು. ಈ ಪರದೆಯು ಇತರ ನಿರ್ವಹಣೆ ಪರದೆಯಂತೆಯೇ ಗ್ರಾಹಕೀಯಗೊಳಿಸಬಲ್ಲದು, ಮತ್ತು ಆನ್-ಹೋವರ್ ಕ್ರಿಯೆಯ ಲಿಂಕ್ಗಳು ಅಥವಾ ದೊಡ್ಡ ಕ್ರಿಯೆಗಳನ್ನು ಬಳಸಿಕೊಂಡು ನೀವು ಕಾಮೆಂಟ್ಗಳನ್ನು ಮಾಡಬಹುದು.','Links may be separated into Link Categories; these are different than the categories used on your posts.'=>'ಲಿಂಕ್ಸ್ ವರ್ಗ ವರ್ಗಗಳಾಗಿ ಬೇರ್ಪಡಿಸಬಹುದು; ಇವುಗಳು ನಿಮ್ಮ ಪೋಸ್ಟ್ಗಳಲ್ಲಿ ಬಳಸಿದ ವರ್ಗಗಳಿಗಿಂತ ವಿಭಿನ್ನವಾಗಿವೆ.','<a href="%1$s">Learn more about WordPress %2$s</a>.'=>'<a href="%1$s">ವರ್ಡ್ಪ್ರೆಸ್ %2$s ಬಗ್ಗೆ ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ</a>.','Managing Pages'=>'ಪುಟಗಳನ್ನು ನಿರ್ವಹಿಸುತ್ತಿದೆ','<strong>Edit</strong> takes you to the editing screen for that post. You can also reach that screen by clicking on the post title.'=>'<strong>ಸಂಪಾದನೆ</strong> ಆಯ್ಕೆಯು ಈ ಲೇಖನದ ಸಂಪಾದನೆ ಪರದೆಗೆ ಕೊಂಡೊಯ್ಯುತ್ತದೆ. ನೀವು ಆ ಪರದೆಯನ್ನು ಲೇಖನದ ಶೀರ್ಷಿಕೆಯನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವುದರ ಮೂಲಕವೂ ತಲುಪಬಹುದು.','<strong>Edit</strong> takes you to the editable profile screen for that user. You can also reach that screen by clicking on the username.'=>'ಸಂಪಾದನೆ ಆಯ್ಕೆಯು ಈ ಬಳಕೆದಾರರ ಸಂಪಾದಿಸಬಹುದಾರ ಸ್ವವಿವರ ಪರದೆಗೆ ಕೊಂಡೊಯ್ಯುತ್ತದೆ. ನೀವು ಆ ಪರದೆಯನ್ನು  ಬಳಕೆದಾರರನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವುದರ ಮೂಲಕವೂ ತಲುಪಬಹುದು. ','You can view all posts made by a user by clicking on the number under the Posts column.'=>'ನೀವು ಬಳಕೆದಾರರು ಸಲ್ಲಿಸಿರುವ ಎಲ್ಲಾ ಲೇಖನಗಳನ್ನು ಲೇಖನಗಳು ಲಂಬಸಾಲಿನ ಕೆಳಗೆ ಇರುವ ಸಂಖ್ಯೆಯ ಮೇಲೆ ಕ್ಲಿಕ್ ಮಾಡುವುದರ ಮೂಲಕ ನೋಡಬಹುದು.','<strong>Trash</strong> removes your post from this list and places it in the Trash, from which you can permanently delete it.'=>'<strong> ಕಸ </strong> ಈ ಪಟ್ಟಿಯಿಂದ ನಿಮ್ಮ ಪೋಸ್ಟ್ ಅನ್ನು ತೆಗೆದುಹಾಕುತ್ತದೆ ಮತ್ತು ಅದನ್ನು ಕಸದಲ್ಲಿ ಇರಿಸುತ್ತದೆ, ಇದರಿಂದ ನೀವು ಅದನ್ನು ಶಾಶ್ವತವಾಗಿ ಅಳಿಸಬಹುದು.','<strong>Quick Edit</strong> provides inline access to the metadata of your post, allowing you to update post details without leaving this screen.'=>'<strong> ತ್ವರಿತ ಸಂಪಾದನೆ </strong> ನಿಮ್ಮ ಪೋಸ್ಟ್ನ ಮೆಟಾಡೇಟಾಗೆ ಇನ್ಲೈನ್ ಪ್ರವೇಶವನ್ನು ಒದಗಿಸುತ್ತದೆ, ಈ ಪರದೆಯನ್ನು ಬಿಡದೆಯೇ ಪೋಸ್ಟ್ ವಿವರಗಳನ್ನು ನವೀಕರಿಸಲು ನಿಮಗೆ ಅನುವು ಮಾಡಿಕೊಡುತ್ತದೆ.','Hovering over a row in the users list will display action links that allow you to manage users. You can perform the following actions:'=>'ಬಳಕೆದಾರರ ಪಟ್ಟಿಯಲ್ಲಿ ಸತತವಾಗಿ ಮೇಲಿದ್ದು, ಬಳಕೆದಾರರನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುವು ಮಾಡಿಕೊಡುವ ಕ್ರಿಯೆಯ ಲಿಂಕ್ಗಳನ್ನು ಪ್ರದರ್ಶಿಸುತ್ತದೆ. ನೀವು ಕೆಳಗಿನ ಕ್ರಮಗಳನ್ನು ಮಾಡಬಹುದು:','You can hide/display columns based on your needs and decide how many users to list per screen using the Screen Options tab.'=>'ನಿಮ್ಮ ಅಗತ್ಯತೆಗಳ ಆಧಾರದ ಮೇಲೆ ನೀವು ಪ್ರದರ್ಶಿಸಬಹುದು / ಪ್ರದರ್ಶಿಸಬಹುದು ಮತ್ತು ಸ್ಕ್ರೀನ್ ಆಯ್ಕೆಗಳು ಟ್ಯಾಬ್ನ ಮೂಲಕ ಎಷ್ಟು ಬಳಕೆದಾರರು ಪ್ರತಿ ಪರದೆಯ ಪಟ್ಟಿ ಮಾಡಬೇಕೆಂದು ನಿರ್ಧರಿಸಬಹುದು.','<strong>Preview</strong> will show you what your draft post will look like if you publish it. View will take you to your live site to view the post. Which link is available depends on your post&#8217;s status.'=>'<strong> ಪೂರ್ವವೀಕ್ಷಣೆ </strong> ನೀವು ಅದನ್ನು ಪ್ರಕಟಿಸಿದರೆ ನಿಮ್ಮ ಕರಡು ಪೋಸ್ಟ್ ಏನೆಂದು ಕಾಣುತ್ತದೆ ಎಂಬುದನ್ನು ನಿಮಗೆ ತೋರಿಸುತ್ತದೆ. ಪೋಸ್ಟ್ ಅನ್ನು ವೀಕ್ಷಿಸಲು ವೀಕ್ಷಣೆ ನಿಮ್ಮ ಲೈವ್ ಸೈಟ್ಗೆ ನಿಮ್ಮನ್ನು ತೆಗೆದುಕೊಳ್ಳುತ್ತದೆ. ಯಾವ ಲಿಂಕ್ ಲಭ್ಯವಿದೆ ನಿಮ್ಮ ಪೋಸ್ಟ್ & # 8217; ಸ್ಥಿತಿಯನ್ನು ಅವಲಂಬಿಸಿದೆ.','Because this is a multisite installation, you may add accounts that already exist on the Network by specifying a username or email, and defining a role. For more options, such as specifying a password, you have to be a Network Administrator and use the hover link under an existing user&#8217;s name to Edit the user profile under Network Admin > All Users.'=>'ಇದು ಮಲ್ಟಿಸೈಟ್ ಅನುಸ್ಥಾಪನೆಯ ಕಾರಣ, ನೀವು ಬಳಕೆದಾರರ ಹೆಸರು ಅಥವಾ ಇಮೇಲ್ ಅನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸುವ ಮೂಲಕ ಮತ್ತು ಈಗಾಗಲೇ ಪಾತ್ರದಲ್ಲಿ ವಿವರಿಸುವ ಮೂಲಕ ನೆಟ್ವರ್ಕ್ನಲ್ಲಿ ಈಗಾಗಲೇ ಇರುವ ಖಾತೆಗಳನ್ನು ಸೇರಿಸಬಹುದು. ನೆಟ್ವರ್ಕ್ ನಿರ್ವಹಣೆ> ಎಲ್ಲ ಬಳಕೆದಾರರ ಅಡಿಯಲ್ಲಿ ಬಳಕೆದಾರರ ಪ್ರೊಫೈಲ್ ಅನ್ನು ಸಂಪಾದಿಸಲು ಪಾಸ್ವರ್ಡ್ ಅನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸುವಂತಹ ಹೆಚ್ಚಿನ ಆಯ್ಕೆಗಳಿಗಾಗಿ, ನೀವು ನೆಟ್ವರ್ಕ್ ನಿರ್ವಾಹಕರಾಗಿರಬೇಕು ಮತ್ತು ಅಸ್ತಿತ್ವದಲ್ಲಿರುವ ಬಳಕೆದಾರರ ಹೆಸರಿನಲ್ಲಿ ಹೂವರ್ ಲಿಂಕ್ ಅನ್ನು ಬಳಸಬೇಕು.','Welcome to WordPress %s'=>'ವರ್ಡ್ಪ್ರೆಸ್ %s ಗೆ ಸುಸ್ವಾಗತ','Go to Dashboard &rarr; Home'=>'ಕಾರ್ಯದರ್ಶಿಕೆ ಗೆ ಹೋಗಿ &rarr; ಮುಖಪುಟ','Go to Dashboard &rarr; Updates'=>'ಕಾರ್ಯದರ್ಶಿಕೆ ಗೆ ಹಿಂದಿರುಗಿ &rarr; ನವೀಕರಣಗಳು','Profile updated.'=>'ಸ್ವವಿವರ ನವೀಕರಣಗೊಂಡಿದೆ.','Hi,

You\'ve been invited to join \'%1$s\' at
