%%s'=>'ಹಾಯ್,  n ನೀವು %3$s ನ ಪಾತ್ರದೊಂದಿಗೆ  n %2$s ನಲ್ಲಿ \' %1$s \' ಗೆ ಸೇರಲು ಆಹ್ವಾನಿಸಲಾಗಿದೆ.  N ಈ ಸೈಟ್ಗೆ ಸೇರಲು ನೀವು ಬಯಸದಿದ್ದರೆ ದಯವಿಟ್ಟು ಈ ಇಮೇಲ್ ಅನ್ನು  n ನಿರ್ಲಕ್ಷಿಸಿ. ಈ ಆಹ್ವಾನವು ಕೆಲವು ದಿನಗಳಲ್ಲಿ ಮುಕ್ತಾಯಗೊಳ್ಳುತ್ತದೆ.  N  n ದಯವಿಟ್ಟು ನಿಮ್ಮ ಬಳಕೆದಾರ ಖಾತೆಯನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲು ಕೆಳಗಿನ ಲಿಂಕ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ:  n %% s','Featured Images'=>'ವೈಶಿಷ್ಟ್ಯಗೊಳಿಸಿದ ಚಿತ್ರಗಳು','Full Width Template'=>'ಪೂರ್ಣ ಅಗಲ ಟೆಂಪ್ಲೇಟು','Post Formats'=>'ಪೋಸ್ಟ್ ಫಾರ್ಮ್ಯಾಟ್‌ಗಳು','Featured Image Header'=>'ವೈಶಿಷ್ಟ್ಯಗೊಳಿಸಿದ ಇಮೇಜ್ ಹೆಡರ್','It looks like you\'re using an old version of %s. For the best WordPress experience, please update your browser.'=>'ನೀವು %s ಹಳೆಯ ಆವೃತ್ತಿಯನ್ನು ಬಳಸುತ್ತಿರುವಂತೆ ತೋರುತ್ತಿದೆ. ಅತ್ಯುತ್ತಮ ವರ್ಡ್ಪ್ರೆಸ್ ಅನುಭವಕ್ಕಾಗಿ, ದಯವಿಟ್ಟು ನಿಮ್ಮ ಬ್ರೌಸರ್ ಅನ್ನು ನವೀಕರಿಸಿ.','It looks like you\'re using an insecure version of %s. Using an outdated browser makes your computer unsafe. For the best WordPress experience, please update your browser.'=>'ನೀವು %s ಅಸುರಕ್ಷಿತ ಆವೃತ್ತಿಯನ್ನು ಬಳಸುತ್ತಿರುವಂತೆ ತೋರುತ್ತಿದೆ. ಹಳೆಯ ಬ್ರೌಸರ್ ಬಳಸಿ ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್ ಅನ್ನು ಅಸುರಕ್ಷಿತಗೊಳಿಸುತ್ತದೆ. ಅತ್ಯುತ್ತಮ ವರ್ಡ್ಪ್ರೆಸ್ ಅನುಭವಕ್ಕಾಗಿ, ದಯವಿಟ್ಟು ನಿಮ್ಮ ಬ್ರೌಸರ್ ಅನ್ನು ನವೀಕರಿಸಿ.','There are some invalid menu items. Please check or delete them.'=>'ಕೆಲವು ಅಮಾನ್ಯವಾದ ಮೆನು ಐಟಂಗಳಿವೆ. ದಯವಿಟ್ಟು ಅವುಗಳನ್ನು ಪರಿಶೀಲಿಸಿ ಅಥವಾ ಅಳಿಸಿ.','term nameName'=>'ಹೆಸರು','meta nameName'=>'ಹೆಸರು','theme nameName'=>'ಹೆಸರು','You can find additional themes for your site by using the Theme Browser/Installer on this screen, which will display themes from the <a href="%s">WordPress Theme Directory</a>. These themes are designed and developed by third parties, are available free of charge, and are compatible with the license WordPress uses.'=>'<a href="%s">ವರ್ಡ್ಪ್ರೆಸ್ ಥೀಮ್ ಡೈರೆಕ್ಟರಿ </a> ನಿಂದ ಥೀಮ್ಗಳನ್ನು ಪ್ರದರ್ಶಿಸುವ ಈ ಪರದೆಯಲ್ಲಿ ಥೀಮ್ ಬ್ರೌಸರ್ / ಬಳಸಿಕೊಂಡು ನಿಮ್ಮ ಸೈಟ್ಗಾಗಿ ಹೆಚ್ಚುವರಿ ವಿಷಯಗಳನ್ನು ನೀವು ಕಾಣಬಹುದು. ಈ ವಿಷಯಗಳನ್ನು ವಿನ್ಯಾಸಗೊಳಿಸಲಾಗಿದೆ ಮತ್ತು ಮೂರನೇ ಪಕ್ಷಗಳು ಅಭಿವೃದ್ಧಿಪಡಿಸಲಾಗಿದೆ, ಉಚಿತವಾಗಿ ಲಭ್ಯವಿವೆ, ಮತ್ತು ವರ್ಡ್ಪ್ರೆಸ್ ಬಳಸುವ ಪರವಾನಗಿ ಹೊಂದಿಕೊಳ್ಳುತ್ತದೆ.','The uploaded file exceeds the %s directive that was specified in the HTML form.'=>'ಅಪ್ಲೋಡ್ ಮಾಡಿದ ಫೈಲ್ ಎಚ್ ಟಿಎಮ್ ಎಲ್ ರೂಪದಲ್ಲಿ ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ %s ನಿರ್ದೇಶನವನ್ನು ಮೀರುತ್ತದೆ.','External Libraries'=>'ಬಾಹ್ಯ ಲೈಬ್ರರೀಸ್','Available Tools'=>'ಲಭ್ಯವಿರುವ ಪರಿಕರಗಳು','Network Setup'=>'ನೆಟ್ವರ್ಕ್ ಸೆಟಪ್','Translate this to be the equivalent of English Translators in your language for the credits page Translators sectionTranslators'=>'ಅನುವಾದಕರು','All Comments'=>'ಎಲ್ಲಾ ಪ್ರತಿಕ್ರಿಯೆಗಳು','Lead Developer'=>'ಲೀಡ್ ಡೆವಲಪರ್','Credits'=>'ಪ್ರಶಂಸೆಗಳು','removing-widgetDeactivate'=>'ನಿಷ್ಕ್ರಿಯಗೊಳಿಸು','Cofounder, Project Lead'=>'ಕೋಫೌಂಡರ್, ಪ್ರಾಜೆಕ್ಟ್ ಲೀಡ್','Core Contributors to WordPress %s'=>'ವರ್ಡ್ಪ್ರೆಸ್ %s ಗೆ ಮೂಲ ಕೊಡುಗೆದಾರರು','Project Leaders'=>'ಯೋಜನಾ ನಾಯಕರು','Your browser is out of date!'=>'ನಿಮ್ಮ ಬ್ರೌಸರ್ ಹಳೆಯದು!','You are using an insecure browser!'=>'ನೀವು ಅಸುರಕ್ಷಿತ ಬ್ರೌಸರ್ ಅನ್ನು ಬಳಸುತ್ತಿರುವಿರಿ!','Freedoms'=>'ಫ್ರೀಡಮ್ಸ್','You can choose one of your previously uploaded headers, or show a random one.'=>'ನೀವು ಹಿಂದೆ ಅಪ್ಲೋಡ್ ಮಾಡಲಾದ ಹೆಡರ್ಗಳಲ್ಲಿ ಒಂದನ್ನು ಆಯ್ಕೆ ಮಾಡಬಹುದು, ಅಥವಾ ಯಾದೃಚ್ಛಿಕ ಒಂದನ್ನು ತೋರಿಸಬಹುದು.','You can use one of these cool headers or show a random one on each page.'=>'ನೀವು ಈ ತಂಪಾದ ಹೆಡರ್ಗಳಲ್ಲಿ ಒಂದನ್ನು ಬಳಸಬಹುದು ಅಥವಾ ಪ್ರತಿ ಪುಟದಲ್ಲಿ ಯಾದೃಚ್ಛಿಕ ಒಂದನ್ನು ತೋರಿಸಬಹುದು.','Collapse menu'=>'ಕುಗ್ಗಿಸು ಮೆನು','<strong>Random:</strong> Show a different image on each page.'=>'<strong>ಯಾದೃಚ್ಛಿಕ:</strong> ಪ್ರತಿ ಪುಟದಲ್ಲಿ ಬೇರೆ ಚಿತ್ರವನ್ನು ತೋರಿಸಿ.','Uploaded Images'=>'ಅಪ್ಲೋಡ್ ಮಾಡಿದ ಚಿತ್ರಗಳು','You have specified this user for deletion:'=>'ನೀವು ಅಳಿಸಲು ಈ ಬಳಕೆದಾರನನ್ನು ನಿರ್ದಿಷ್ಟಪಡಿಸಿರುವಿರಿ:','%s Page Template'=>'%s ಪುಟ ಟೆಂಪ್ಲೇಟ್','This plugin may be active on other sites in the network.'=>'ಈ ಪ್ಲಗ್ಇನ್ ನೆಟ್ವರ್ಕ್ನಲ್ಲಿರುವ ಇತರ ಸೈಟ್ಗಳಲ್ಲಿ ಸಕ್ರಿಯವಾಗಿರಬಹುದು.','You cannot delete a plugin while it is active on the main site.'=>'ಮುಖ್ಯ ಸೈಟ್ನಲ್ಲಿ ಸಕ್ರಿಯವಾಗಿರುವ ಸಮಯದಲ್ಲಿ ನೀವು ಅದನ್ನು ಅಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Default Post Format'=>'ಡೀಫಾಲ್ಟ್ ಪೋಸ್ಟ್ ಸ್ವರೂಪ','Any edits to files from this screen will be reflected on all sites in the network.'=>'ಈ ಪರದೆಯಿಂದ ಫೈಲ್ಗಳಿಗೆ ಯಾವುದೇ ಸಂಪಾದನೆಗಳು ನೆಟ್ವರ್ಕ್ನಲ್ಲಿರುವ ಎಲ್ಲ ಸೈಟ್ಗಳಲ್ಲಿ ಪ್ರತಿಫಲಿಸುತ್ತದೆ.','The boxes on your Dashboard screen are:'=>'ನಿಮ್ಮ ಡ್ಯಾಶ್ಬೋರ್ಡ್ ಪರದೆಯಲ್ಲಿರುವ ಪೆಟ್ಟಿಗೆಗಳು ಹೀಗಿವೆ:','This screen lists all the existing users for your site. Each user has one of five defined roles as set by the site admin: Site Administrator, Editor, Author, Contributor, or Subscriber. Users with roles other than Administrator will see fewer options in the dashboard navigation when they are logged in, based on their role.'=>'ಈ ಪರದೆಯು ಎಲ್ಲಾ ಸೈಟ್ಗಳನ್ನು ನಿಮ್ಮ ಸೈಟ್ಗಾಗಿ ಪಟ್ಟಿ ಮಾಡುತ್ತದೆ. ಸೈಟ್ ನಿರ್ವಾಹಕರಿಂದ ಹೊಂದಿಸಲ್ಪಟ್ಟಂತೆ ಪ್ರತಿ ಬಳಕೆದಾರರು ಐದು ನಿರ್ಧಾರಿತ ಪಾತ್ರಗಳಲ್ಲಿ ಒಂದನ್ನು ಹೊಂದಿದ್ದಾರೆ: ಸೈಟ್ ನಿರ್ವಾಹಕರು, ಸಂಪಾದಕರು, ಲೇಖಕರು, ಕೊಡುಗೆದಾರರು, ಅಥವಾ ಚಂದಾದಾರರು. ನಿರ್ವಾಹಕರನ್ನು ಹೊರತುಪಡಿಸಿ ಬೇರೆ ಪಾತ್ರಗಳನ್ನು ಹೊಂದಿರುವ ಬಳಕೆದಾರರು ತಮ್ಮ ಪಾತ್ರವನ್ನು ಆಧರಿಸಿ ಡ್ಯಾಶ್ಬೋರ್ಡ್ ನ್ಯಾವಿಗೇಶನ್ನಲ್ಲಿ ಪ್ರವೇಶಿಸಿದಾಗ ಕಡಿಮೆ ಆಯ್ಕೆಗಳನ್ನು ನೋಡುತ್ತಾರೆ.','Sample Page'=>'ಮಾದರಿ ಪುಟ','sample-page'=>'ಮಾದರಿ-ಪುಟ','Retro (Generated)'=>'ರೆಟ್ರೊ (ರಚಿಸಲಾಗಿದೆ)','You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%s">enable</a> more themes.'=>'ಈ ಸೈಟ್ಗಾಗಿ ಇದೀಗ ನೀವು ಒಂದು ಥೀಮ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿದ್ದೀರಿ. ಇನ್ನಷ್ಟು ಥೀಮ್ಗಳನ್ನು <a href="%s"> ಸಕ್ರಿಯಗೊಳಿಸಲು </a> ನೆಟ್ವರ್ಕ್ ನಿರ್ವಾಹಕರನ್ನು ಭೇಟಿ ಮಾಡಿ.','You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%1$s">enable</a> or <a href="%2$s">install</a> more themes.'=>'ಈ ಸೈಟ್ಗಾಗಿ ಇದೀಗ ನೀವು ಒಂದು ಥೀಮ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿದ್ದೀರಿ. ಇನ್ನಷ್ಟು <a href="%1$s"> ಸಕ್ರಿಯಗೊಳಿಸಿ </a> ಅಥವಾ <a href="%2$s"> ಸ್ಥಾಪಿಸಲು </a> ನೆಟ್ವರ್ಕ್ ನಿರ್ವಾಹಕರನ್ನು ಭೇಟಿ ಮಾಡಿ.','Super admin privileges cannot be removed because this user has the network admin email.'=>'ಸೂಪರ್ ನಿರ್ವಾಹಕ ಸೌಲಭ್ಯಗಳನ್ನು ತೆಗೆದುಹಾಕಲು ಸಾಧ್ಯವಿಲ್ಲ ಏಕೆಂದರೆ ಈ ಬಳಕೆದಾರರು ನೆಟ್ವರ್ಕ್ ನಿರ್ವಹಣೆ ಇಮೇಲ್ ಅನ್ನು ಹೊಂದಿದ್ದಾರೆ.','You only have one theme installed right now. Live a little! You can choose from over 1,000 free themes in the WordPress Theme Directory at any time: just click on the <a href="%s">Install Themes</a> tab above.'=>'ನೀವು ಇದೀಗ ಒಂದು ಥೀಮ್ ಅನ್ನು ಮಾತ್ರ ಸ್ಥಾಪಿಸಿದ್ದೀರಿ. ಸ್ವಲ್ಪ ಲೈವ್! ನೀವು ಯಾವುದೇ ಸಮಯದಲ್ಲಿ ವರ್ಡ್ಪ್ರೆಸ್ ಥೀಮ್ ಡೈರೆಕ್ಟರಿಯಲ್ಲಿ 1,000 ಕ್ಕೂ ಹೆಚ್ಚಿನ ಉಚಿತ ಥೀಮ್ಗಳನ್ನು ಆಯ್ಕೆ ಮಾಡಬಹುದು: ಮೇಲಿನ <a href="%s">ಥೀಮ್ಗಳು ಸ್ಥಾಪಿಸಿ </a> ಟ್ಯಾಬ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ.','One or more database tables are unavailable. To allow WordPress to attempt to repair these tables, press the &#8220;Repair Database&#8221; button. Repairing can take a while, so please be patient.'=>'ಒಂದು ಅಥವಾ ಹೆಚ್ಚಿನ ಡೇಟಾಬೇಸ್ ಕೋಷ್ಟಕಗಳು ಲಭ್ಯವಿಲ್ಲ. ಈ ಟೇಬಲ್ಗಳನ್ನು ಸರಿಪಡಿಸಲು ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ಪ್ರಯತ್ನಿಸಲು, & # 8220; ದುರಸ್ತಿ ಡೇಟಾಬೇಸ್ & # 8221; ಬಟನ್. ದುರಸ್ತಿ ಮಾಡಲು ಸ್ವಲ್ಪ ಸಮಯ ತೆಗೆದುಕೊಳ್ಳಬಹುದು, ಆದ್ದರಿಂದ ದಯವಿಟ್ಟು ತಾಳ್ಮೆಯಿಂದಿರಿ.','Visual Editor RTL Stylesheet'=>'ವಿಷುಯಲ್ ಸಂಪಾದಕ ಆರ್ಟಿಎಲ್ ಸ್ಟೈಲ್ಶೀಟ್','This is a file in your current parent theme.'=>'ಇದು ನಿಮ್ಮ ಪ್ರಸ್ತುತ ಪೋಷಕ ಥೀಮ್ನಲ್ಲಿ ಫೈಲ್ ಆಗಿದೆ.','This child theme inherits templates from a parent theme, %s.'=>'ಈ ಮಕ್ಕಳ ಥೀಮ್ ಪೋಷಕ ಥೀಮ್, %s ನಿಂದ ಟೆಂಪ್ಲೆಟ್ಗಳನ್ನು ಉತ್ತರಾಧಿಕಾರ ಮಾಡುತ್ತದೆ.','Network Enable'=>'ನೆಟ್ವರ್ಕ್ ಸಕ್ರಿಯಗೊಳಿಸಿ','No Update Required'=>'ಯಾವುದೇ ನವೀಕರಣ ಅಗತ್ಯವಿಲ್ಲ','Update WordPress Database'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಡೇಟಾಬೇಸ್ ನವೀಕರಿಸಿ','Your WordPress database has been successfully updated!'=>'ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಡೇಟಾಬೇಸ್ ಅನ್ನು ಯಶಸ್ವಿಯಾಗಿ ನವೀಕರಿಸಲಾಗಿದೆ!','WordPress &rsaquo; Update'=>'ವರ್ಡ್ಪ್ರೆಸ್ & rsaquo; ನವೀಕರಿಸಿ','The database update process may take a little while, so please be patient.'=>'ಡೇಟಾಬೇಸ್ ಅಪ್ಡೇಟ್ ಪ್ರಕ್ರಿಯೆಯು ಸ್ವಲ್ಪ ಸಮಯ ತೆಗೆದುಕೊಳ್ಳಬಹುದು, ಆದ್ದರಿಂದ ದಯವಿಟ್ಟು ತಾಳ್ಮೆಯಿಂದಿರಿ.','Database Update Required'=>'ಡೇಟಾಬೇಸ್ ಅಪ್ಡೇಟ್ ಅಗತ್ಯವಿದೆ','Update Complete'=>'ಪೂರ್ಣಗೊಂಡಿದೆ ನವೀಕರಿಸಿ','Update Theme'=>'ಥೀಮ್ ಅನ್ನು ನವೀಕರಿಸಿ','Plugin updated successfully.'=>'ಪ್ಲಗಿನ್ ಯಶಸ್ವಿಯಾಗಿ ನವೀಕರಿಸಲಾಗಿದೆ.','Plugin update failed.'=>'ಪ್ಲಗಿನ್ ಅಪ್ಡೇಟ್ ವಿಫಲವಾಗಿದೆ.','Theme update failed.'=>'ಥೀಮ್ ಅಪ್ಡೇಟ್ ವಿಫಲವಾಗಿದೆ.','Theme updated successfully.'=>'ಥೀಮ್ ಯಶಸ್ವಿಯಾಗಿ ನವೀಕರಿಸಲಾಗಿದೆ.','Update Plugin'=>'ಪ್ಲಗಿನ್ ನವೀಕರಿಸಿ','Update package not available.'=>'ಅಪ್ಡೇಟ್ ಪ್ಯಾಕೇಜ್ ಲಭ್ಯವಿಲ್ಲ.','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this plugin.</em>'=>'%1$s ಹೊಸ ಆವೃತ್ತಿಯು ಲಭ್ಯವಿದೆ. <a href="%2$s" %3$s>ಆವೃತ್ತಿ %4$s ವಿವರಗಳನ್ನು ವೀಕ್ಷಿಸಿ</a>. <em>ಈ ಪ್ಲಗಿನ್ ಗೆ ಸ್ವಯಂಚಾಲಿತ ನವೀಕರಣ ಲಭ್ಯವಿಲ್ಲ.</em>‍','Authors:'=>'ಲೇಖಕರು:','All content'=>'ಎಲ್ಲಾ ವಿಷಯ','Date range:'=>'ದಿನಾಂಕ ಶ್ರೇಣಿ:','Choose what to export'=>'ಏನು ರಫ್ತು ಮಾಡಬೇಕೆಂದು ಆರಿಸಿ','This will contain all of your posts, pages, comments, custom fields, terms, navigation menus, and custom posts.'=>'ಇದು ನಿಮ್ಮ ಎಲ್ಲಾ ಪೋಸ್ಟ್ಗಳು, ಪುಟಗಳು, ಕಾಮೆಂಟ್ಗಳು, ಕಸ್ಟಮ್ ಕ್ಷೇತ್ರಗಳು, ನಿಯಮಗಳು, ಸಂಚರಣೆ ಮೆನುಗಳು ಮತ್ತು ಕಸ್ಟಮ್ ಪೋಸ್ಟ್ಗಳನ್ನು ಒಳಗೊಂಡಿರುತ್ತದೆ.','commentsMine <span class="count">(%s)</span>'=>'ಎಲ್ಲಾ <span class="count">(%s)</span>' . "\0" . 'ಎಲ್ಲಾ <span class="count">(%s)</span>','%s &#8212; WordPress'=>'%s — ವರ್ಡ್ಪ್ರೆಸ್','column nameIn Response To'=>'ಪ್ರತಿಯಾಗಿ','This screen allows you to edit fields for metadata in a file within the media library.'=>'ಮಾಧ್ಯಮ ಪತ್ರಿಕೆಯಲ್ಲಿ ಫೈಲ್ನಲ್ಲಿ ಮೆಟಾಡೇಟಾಗಾಗಿ ಐದು ಕ್ಷೇತ್ರಗಳನ್ನು ಸಂಪಾದಿಸಲು ಈ ಪರದೆಯು ನಿಮಗೆ ಅವಕಾಶ ನೀಡುತ್ತದೆ.','For images only, you can click on Edit Image under the thumbnail to expand out an inline image editor with icons for cropping, rotating, or flipping the image as well as for undoing and redoing. The boxes on the right give you more options for scaling the image, for cropping it, and for cropping the thumbnail in a different way than you crop the original image. You can click on Help in those boxes to get more information.'=>'ಚಿತ್ರಗಳನ್ನು ಮಾತ್ರ, ನೀವು ಇಮೇಜ್ ಅನ್ನು ಕ್ರಾಪ್ ಮಾಡಲು, ತಿರುಗಿಸಲು, ಅಥವಾ ಫ್ಲಿಪ್ಪಿಂಗ್ ಮಾಡಲು ಮತ್ತು ರದ್ದುಗೊಳಿಸಲು ಮತ್ತು ಮರುರೂಪಿಸಲು ಐಕಾನ್ಗಳೊಂದಿಗೆ ಇನ್ಲೈನ್ ಇಮೇಜ್ ಎಡಿಟರ್ ಅನ್ನು ವಿಸ್ತರಿಸಲು ಥಂಬ್ನೇಲ್ ಅಡಿಯಲ್ಲಿ ಎಡಿಟ್ ಇಮೇಜ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಬಹುದು. ಬಲಭಾಗದಲ್ಲಿರುವ ಪೆಟ್ಟಿಗೆಗಳು ಚಿತ್ರವನ್ನು ಸ್ಕೇಲಿಂಗ್ ಮಾಡಲು, ಅದನ್ನು ಬೆಳೆಸಲು ಮತ್ತು ಮೂಲ ಇಮೇಜ್ ಅನ್ನು ಕ್ರಾಪ್ ಮಾಡುವುದಕ್ಕಿಂತ ವಿಭಿನ್ನ ರೀತಿಯಲ್ಲಿ ಥಂಬ್ನೇಲ್ ಅನ್ನು ಬೆಳೆಸಲು ನಿಮಗೆ ಹೆಚ್ಚಿನ ಆಯ್ಕೆಗಳನ್ನು ನೀಡುತ್ತದೆ. ಹೆಚ್ಚಿನ ಮಾಹಿತಿ ಪಡೆಯಲು ನೀವು ಆ ಪೆಟ್ಟಿಗೆಗಳಲ್ಲಿ ಸಹಾಯವನ್ನು ಕ್ಲಿಕ್ ಮಾಡಬಹುದು.','Note that you crop the image by clicking on it (the Crop icon is already selected) and dragging the cropping frame to select the desired part. Then click Save to retain the cropping.'=>'ಅದರ ಮೇಲೆ ಕ್ಲಿಕ್ ಮಾಡುವ ಮೂಲಕ ನೀವು ಚಿತ್ರವನ್ನು ಕ್ರಾಪ್ ಮಾಡಿ (ಕ್ರಾಪ್ ಐಕಾನ್ ಈಗಾಗಲೇ ಆಯ್ಕೆಮಾಡಲಾಗಿದೆ) ಮತ್ತು ಅಪೇಕ್ಷಿತ ಭಾಗವನ್ನು ಆಯ್ಕೆ ಮಾಡಲು ಕ್ರಾಪಿಂಗ್ ಫ್ರೇಮ್ ಅನ್ನು ಎಳೆಯಿರಿ ಎಂಬುದನ್ನು ಗಮನಿಸಿ. ನಂತರ ಕ್ರಾಪಿಂಗ್ ಉಳಿಸಿಕೊಳ್ಳಲು ಉಳಿಸು ಕ್ಲಿಕ್ ಮಾಡಿ.','The Available Widgets section contains all the widgets you can choose from. Once you drag a widget into a sidebar, it will open to allow you to configure its settings. When you are happy with the widget settings, click the Save button and the widget will go live on your site. If you click Delete, it will remove the widget.'=>'ಲಭ್ಯವಿರುವ ವಿಡ್ಜೆಟ್ ವಿಭಾಗವು ನೀವು ಆಯ್ಕೆ ಮಾಡಬಹುದಾದ ಎಲ್ಲಾ ವಿಜೆಟ್ಗಳನ್ನು ಹೊಂದಿರುತ್ತದೆ. ಒಮ್ಮೆ ನೀವು ವಿಜೆಟ್ ಅನ್ನು ಸೈಡ್ಬಾರ್ನಲ್ಲಿ ಎಳೆಯಿರಿ, ಅದರ ಸೆಟ್ಟಿಂಗ್ಗಳನ್ನು ಕಾನ್ಫಿಗರ್ ಮಾಡಲು ನಿಮಗೆ ಅವಕಾಶ ಕಲ್ಪಿಸುತ್ತದೆ. ವಿಜೆಟ್ ಸೆಟ್ಟಿಂಗ್ಗಳಲ್ಲಿ ನೀವು ಸಂತೋಷವಾಗಿದ್ದಾಗ, ಉಳಿಸು ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಿ ಮತ್ತು ವಿಜೆಟ್ ನಿಮ್ಮ ಸೈಟ್ನಲ್ಲಿ ಲೈವ್ ಆಗುತ್ತದೆ. ನೀವು ಅಳಿಸು ಕ್ಲಿಕ್ ಮಾಡಿದರೆ, ಅದು ವಿಜೆಟ್ ಅನ್ನು ತೆಗೆದುಹಾಕುತ್ತದೆ.','Email or Username'=>'ಇಮೇಲ್ ಅಥವಾ ಬಳಕೆದಾರ ಹೆಸರು','<strong>Please Note:</strong> Any customizations you have made to theme files will be lost. Please consider using <a href="%s">child themes</a> for modifications.'=>'<strong> ದಯವಿಟ್ಟು ಗಮನಿಸಿ: </strong>ನೀವು ಥೀಮ್ ಫೈಲ್ಗಳಿಗೆ ಮಾಡಿದ ಯಾವುದೇ ಕಸ್ಟಮೈಸೇಷನ್ಸ್ ಕಳೆದು ಹೋಗುತ್ತವೆ. ದಯವಿಟ್ಟು ಮಾರ್ಪಾಡುಗಳಿಗಾಗಿ <a href=" %s "> ಮಕ್ಕಳ ಥೀಮ್ಗಳನ್ನು </a> ಬಳಸಿ ಪರಿಗಣಿಸಿ.','postsSticky <span class="count">(%s)</span>'=>'ಸ್ಟಿಕಿ <span class="count">(%s)</span>' . "\0" . 'ಸ್ಟಿಕಿ <span class="count">( %s )</span>','Check again.'=>'ಮತ್ತೊಮ್ಮೆ ಪರೀಕ್ಷಿಸಿ.','Please select one or more plugins to update.'=>'ನವೀಕರಿಸಲು ದಯವಿಟ್ಟು ಒಂದು ಅಥವಾ ಹೆಚ್ಚಿನ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಆಯ್ಕೆ ಮಾಡಿ.','Please select one or more themes to update.'=>'ನವೀಕರಿಸಲು ದಯವಿಟ್ಟು ಒಂದು ಅಥವಾ ಹೆಚ್ಚಿನ ವಿಷಯಗಳನ್ನು ಆಯ್ಕೆಮಾಡಿ.','Last checked on %1$s at %2$s.'=>'%2$s ನಲ್ಲಿ %1$s ನಲ್ಲಿ ಕೊನೆಯದಾಗಿ ಪರಿಶೀಲಿಸಲಾಗಿದೆ.','The update process is starting. This process may take a while on some hosts, so please be patient.'=>'ನವೀಕರಣ ಪ್ರಕ್ರಿಯೆ ಪ್ರಾರಂಭವಾಗಿದೆ. ಈ ಪ್ರಕ್ರಿಯೆಯು ಕೆಲವು ಅತಿಥೇಯಗಳ ಮೇಲೆ ಸ್ವಲ್ಪ ಸಮಯ ತೆಗೆದುಕೊಳ್ಳಬಹುದು, ಆದ್ದರಿಂದ ದಯವಿಟ್ಟು ತಾಳ್ಮೆಯಿಂದಿರಿ.','Apply Filters'=>'ಶೋಧಕಗಳನ್ನು ಅನ್ವಯಿಸಿ','Editor Style'=>'ಸಂಪಾದಕ ಶೈಲಿ','Sorry, you are not allowed to edit users.'=>'ಕ್ಷಮಿಸಿ, ಬಳಕೆದಾರರನ್ನು ಸಂಪಾದಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','To perform the requested action, WordPress needs to access your web server.'=>'ವಿನಂತಿಸಿದ ಕ್ರಿಯೆಯನ್ನು ನಿರ್ವಹಿಸಲು, ವರ್ಡ್ಪ್ರೆಸ್ ಗೆ ನಿಮ್ಮ ವೆಬ್ ಸರ್ವರ್ ಅನ್ನು ಪ್ರವೇಶಿಸಬೇಕಾಗುತ್ತದೆ.','Current Page'=>'ಪ್ರಸ್ತುತ ಪುಟ','No themes match your request.'=>'ನಿಮ್ಮ ವಿನಂತಿಗೆ ಯಾವುದೇ ಥೀಮ್‌ಗಳು ಹೊಂದಿಕೆಯಾಗುವುದಿಲ್ಲ.','%s user'=>'%s ಬಳಕೆದಾರ' . "\0" . '%s ಬಳಕೆದಾರರು','Search Sites'=>'ಹುಡುಕಾಟ ಸೈಟ್ಗಳು','Create a New User'=>'ಹೊಸ ಬಳಕೆದಾರನನ್ನು ರಚಿಸಿ','You have %1$s and %2$s.'=>'ನಿಮ್ಮಲ್ಲಿ %1$s ಮತ್ತು %2$s .','%s site'=>'%s ಸೈಟ್' . "\0" . '%s ಸೈಟ್','https://wordpress.org/news/'=>'https://wordpress.org/news/','https://wordpress.org/news/feed/'=>'https://wordpress.org/news/feed/','(Signup has been disabled. Only members of this site can comment.)'=>'(ಸೈನ್ ಅಪ್ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ ಈ ಸೈಟ್ನ ಸದಸ್ಯರು ಮಾತ್ರ ಕಾಮೆಂಟ್ ಮಾಡಬಹುದು.)','There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>.'=>'%1$s ಹೊಸ ಆವೃತ್ತಿಯು ಲಭ್ಯವಿದೆ. <a href="%2$s" %3$s>ಆವೃತ್ತಿ %4$s ವಿವರಗಳನ್ನು ವೀಕ್ಷಿಸಿ</a>.','Go to Plugins page'=>'ಪ್ಲಗಿನ್‌ಗಳ ಪುಟಕ್ಕೆ ಹೋಗಿ','Go to Themes page'=>'ಥೀಮ್‌ಗಳ ಪುಟಕ್ಕೆ ಹೋಗಿ','Go to WordPress Updates page'=>'ವರ್ಡ್ಪ್ರೆಸ್ ನವೀಕರಣಗಳ ಪುಟಕ್ಕೆ ಹೋಗಿ','Click Save Menu to make pending menu items public.'=>'ಬಾಕಿ ಉಳಿದಿರುವ ಮೆನು ಐಟಂಗಳನ್ನು ಮಾಡಲು ಉಳಿಸು ಮೆನು ಕ್ಲಿಕ್ ಮಾಡಿ.','Storage Space'=>'ಶೇಖರಣಾ ಸ್ಥಳ','Create a New Site'=>'ಹೊಸ ಸೈಟ್ ರಚಿಸಿ','Images of exactly <strong>%1$d &times; %2$d pixels</strong> will be used as-is.'=>'ನಿಖರವಾಗಿ <strong> %1$d & times; %2$d ಪಿಕ್ಸೆಲ್ಗಳು </strong>ಎಂದು ಬಳಸಲಾಗುತ್ತದೆ.','Crop and Publish'=>'ಕ್ರಾಪ್ ಮತ್ತು ಪ್ರಕಟಿಸಿ','XFN stands for <a href="https://gmpg.org/xfn/">XHTML Friends Network</a>, which is optional. WordPress allows the generation of XFN attributes to show how you are related to the authors/owners of the site to which you are linking.'=>'ಎಕ್ಸ್ಎಫ್ಎನ್ ಐಚ್ಛಿಕವಾದ <a href="http://gmpg.org/xfn/"> XHTML ಫ್ರೆಂಡ್ಸ್ ನೆಟ್ವರ್ಕ್ </a> ಗೆ ಪ್ರತಿನಿಧಿಸುತ್ತದೆ. ನೀವು ಲಿಂಕ್ ಮಾಡುವ ಸೈಟ್ನ ಲೇಖಕರು / ಮಾಲೀಕರಿಗೆ ನೀವು ಹೇಗೆ ಸಂಬಂಧ ಹೊಂದಿದ್ದೀರಿ ಎಂಬುದನ್ನು XFN ಲಕ್ಷಣಗಳು ತೋರಿಸಲು ವರ್ಡ್ಪ್ರೆಸ್ ಅನುಮತಿಸುತ್ತದೆ.','FTP Username'=>'FTP ಬಳಕೆದಾರಹೆಸರು','FTP Password'=>'FTP ಪಾಸ್ವರ್ಡ್','FTP/SSH Password'=>'FTP/SSH ಪಾಸ್‌ವರ್ಡ್','FTP/SSH Username'=>'FTP/SSH ಬಳಕೆದಾರಹೆಸರು','When you assign multiple categories or tags to a post, only one can show up in the permalink: the lowest numbered category. This applies if your custom structure includes %1$s or %2$s.'=>'ನೀವು ಲೇಖನವೊಂದಕ್ಕೆ ಬಹು ವಿಭಾಗಗಳು ಅಥವಾ ಟ್ಯಾಗ್‌ಗಳನ್ನು ನಿಯೋಜಿಸಿದಾಗ, ಪರ್ಮಾಲಿಂಕ್‌ನಲ್ಲಿ ಒಂದನ್ನು ಮಾತ್ರ ತೋರಿಸಬಹುದು: ಅತಿ ಕಡಿಮೆ ಸಂಖ್ಯೆಯ ವರ್ಗ. ನಿಮ್ಮ ಕಸ್ಟಮ್ ರಚನೆಯು %1$s ಅಥವಾ %2$s ಅನ್ನು ಒಳಗೊಂಡಿದ್ದರೆ ಇದು ಅನ್ವಯಿಸುತ್ತದೆ.','Many themes show some sidebar widgets by default until you edit your sidebars, but they are not automatically displayed in your sidebar management tool. After you make your first widget change, you can re-add the default widgets by adding them from the Available Widgets area.'=>'ನಿಮ್ಮ ಅಡ್ಡಪಟ್ಟಿಗಳನ್ನು ನೀವು ಸಂಪಾದಿಸುವ ತನಕ ಹಲವಾರು ವಿಷಯಗಳು ಡೀಫಾಲ್ಟ್ ಆಗಿ ಕೆಲವು ಸೈಡ್ಬಾರ್ನಲ್ಲಿ ವಿಜೆಟ್ಗಳನ್ನು ತೋರಿಸುತ್ತವೆ, ಆದರೆ ಅವುಗಳನ್ನು ನಿಮ್ಮ ಸೈಡ್ಬಾರ್ನಲ್ಲಿ ನಿರ್ವಹಣಾ ಉಪಕರಣದಲ್ಲಿ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಪ್ರದರ್ಶಿಸಲಾಗುವುದಿಲ್ಲ. ನಿಮ್ಮ ಮೊದಲ ವಿಜೆಟ್ ಬದಲಾವಣೆಯನ್ನು ಮಾಡಿದ ನಂತರ, ನೀವು ಲಭ್ಯವಿರುವ ವಿಡ್ಜೆಟ್ ಪ್ರದೇಶದಿಂದ ಅವುಗಳನ್ನು ಸೇರಿಸುವ ಮೂಲಕ ಡೀಫಾಲ್ಟ್ ವಿಜೆಟ್ಗಳನ್ನು ಮರು-ಸೇರಿಸಬಹುದು.','If you pick an option other than Plain, your general URL path with structure tags (terms surrounded by %s) will also appear in the custom structure field and your path can be further modified there.'=>'ನೀವು ಪ್ಲೈನ್ ಹೊರತುಪಡಿಸಿ ಒಂದು ಆಯ್ಕೆಯನ್ನು ಆರಿಸಿದರೆ, ರಚನೆಯ ಟ್ಯಾಗ್ಗಳೊಂದಿಗೆ ನಿಮ್ಮ ಸಾಮಾನ್ಯ URL ಪಥವನ್ನು %s ಸುತ್ತಲೂ ಇರುವ ಪದಗಳು) ಸಹ ಕಸ್ಟಮ್ ರಚನೆ ಕ್ಷೇತ್ರದಲ್ಲಿ ಕಾಣಿಸಿಕೊಳ್ಳುತ್ತವೆ ಮತ್ತು ನಿಮ್ಮ ಮಾರ್ಗವನ್ನು ಮತ್ತಷ್ಟು ಮಾರ್ಪಡಿಸಬಹುದು.','The Optional fields let you customize the &#8220;category&#8221; and &#8220;tag&#8221; base names that will appear in archive URLs. For example, the page listing all posts in the &#8220;Uncategorized&#8221; category could be <code>/topics/uncategorized</code> instead of <code>/category/uncategorized</code>.'=>'ಐಚ್ಛಿಕ ಕ್ಷೇತ್ರಗಳು ನಿಮಗೆ & "ವರ್ಗ" ಮತ್ತು "ಟ್ಯಾಗ್" ಆರ್ಕೈವ್ URL ಗಳಲ್ಲಿ ಕಾಣಿಸಿಕೊಳ್ಳುವ ಬೇಸ್ ಹೆಸರುಗಳು. ಉದಾಹರಣೆಗೆ, "ವರ್ಗವಿಲ್ಲದ್ದು" ಎಲ್ಲ ಪೋಸ್ಟ್ಗಳನ್ನು ಪಟ್ಟಿ ಮಾಡುವ ಪುಟ. <code> / category / uncategorized </code>ಬದಲಿಗೆ <code> / topics / uncategorized </code> ಆಗಿರಬಹುದು.','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two <a href="%s">Pages</a>. One will become the homepage, and the other will be where your posts are displayed.'=>'ನಿಮ್ಮ ಸೈಟ್ನ ಮುಖಪುಟದಲ್ಲಿ ಏನನ್ನು ಪ್ರದರ್ಶಿಸಬೇಕೆಂದು ನೀವು ಆಯ್ಕೆ ಮಾಡಬಹುದು. ಇದು ರಿವರ್ಸ್ ಕಾಲಾನಲಾಜಿಕಲ್ ಆರ್ಡರ್ (ಕ್ಲಾಸಿಕ್ ಬ್ಲಾಗ್), ಅಥವಾ ಸ್ಥಿರ / ಸ್ಥಿರ ಪುಟದಲ್ಲಿ ಪೋಸ್ಟ್ ಆಗಿರಬಹುದು. ಸ್ಥಿರ ಮುಖಪುಟವನ್ನು ಹೊಂದಿಸಲು, ನೀವು ಮೊದಲು ಎರಡು <a href="%s">ಪುಟಗಳು </a> ರಚಿಸಬೇಕಾಗಿದೆ. ಒಂದು ಮುಖಪುಟಕ್ಕೆ ಪರಿಣಮಿಸುತ್ತದೆ, ಮತ್ತು ನಿಮ್ಮ ಪೋಸ್ಟ್ಗಳು ಎಲ್ಲಿ ಪ್ರದರ್ಶಿಸಲ್ಪಡುತ್ತವೆ ಅಲ್ಲಿ ಇತರವು ಇರುತ್ತದೆ.','If you want to remove the widget but save its setting for possible future use, just drag it into the Inactive Widgets area. You can add them back anytime from there. This is especially helpful when you switch to a theme with fewer or different widget areas.'=>'ನೀವು ವಿಜೆಟ್ ತೆಗೆದುಹಾಕಲು ಬಯಸಿದರೆ ಆದರೆ ಸಂಭವನೀಯ ಭವಿಷ್ಯದ ಬಳಕೆಗಾಗಿ ಅದರ ಸೆಟ್ಟಿಂಗ್ ಅನ್ನು ಉಳಿಸಿ, ಅದನ್ನು ನಿಷ್ಕ್ರಿಯ ಹಿಂದಿನ ಪ್ರದೇಶಕ್ಕೆ ಎಳೆಯಿರಿ. ನೀವು ಅಲ್ಲಿಂದ ಯಾವ ಸಮಯದಲ್ಲಾದರೂ ಅವರನ್ನು ಮರಳಿ ಸೇರಿಸಬಹುದು. ನೀವು ಕಡಿಮೆ ಅಥವಾ ವಿಭಿನ್ನ ವಿಜೆಟ್ ಪ್ರದೇಶಗಳೊಂದಿಗೆ ಥೀಮ್ಗೆ ಬದಲಾಯಿಸಿದಾಗ ಇದು ವಿಶೇಷವಾಗಿ ಸಹಾಯಕವಾಗುತ್ತದೆ.','You can set maximum sizes for images inserted into your written content; you can also insert an image as Full Size.'=>'ನಿಮ್ಮ ಲಿಖಿತ ವಿಷಯಕ್ಕೆ ಸೇರಿಸಲಾದ ಚಿತ್ರಗಳನ್ನು ಗರಿಷ್ಠ ಗಾತ್ರದಲ್ಲಿ ನೀವು ಹೊಂದಿಸಬಹುದು; ನೀವು ಪೂರ್ಣ ಗಾತ್ರದ ಚಿತ್ರವನ್ನು ಸಹ ಸೇರಿಸಬಹುದಾಗಿದೆ.','<strong>Order</strong> &mdash; Pages are usually ordered alphabetically, but you can choose your own order by entering a number (1 for first, etc.) in this field.'=>'<strong> ಆದೇಶ</strong>- ಪುಟಗಳು ಸಾಮಾನ್ಯವಾಗಿ ವರ್ಣಮಾಲೆಯಂತೆ ಆದೇಶಿಸಲ್ಪಡುತ್ತವೆ, ಆದರೆ ನೀವು ಈ ಕ್ಷೇತ್ರದಲ್ಲಿ ಸಂಖ್ಯೆಯನ್ನು (ಮೊದಲನೆಯದು, ಮೊದಲಿಗೆ) ನಮೂದಿಸುವುದರ ಮೂಲಕ ನಿಮ್ಮ ಸ್ವಂತ ಆದೇಶವನ್ನು ಆಯ್ಕೆ ಮಾಡಬಹುದು.','Please enter your FTP or SSH credentials to proceed.'=>'ಮುಂದುವರಿಯಲು ದಯವಿಟ್ಟು ನಿಮ್ಮ FTP ಅಥವಾ SSH ರುಜುವಾತುಗಳನ್ನು ನಮೂದಿಸಿ.','Please enter your FTP credentials to proceed.'=>'ಮುಂದುವರಿಯಲು ದಯವಿಟ್ಟು ನಿಮ್ಮ FTP ರುಜುವಾತುಗಳನ್ನು ನಮೂದಿಸಿ.','If you do not remember your credentials, you should contact your web host.'=>'ನಿಮ್ಮ ರುಜುವಾತುಗಳು ನಿಮಗೆ ನೆನಪಿಲ್ಲದಿದ್ದರೆ, ನೀವು ನಿಮ್ಮ ವೆಬ್ ಹೋಸ್ಟ್ ಅನ್ನು ಸಂಪರ್ಕಿಸಬೇಕು.','Your profile contains information about you (your &#8220;account&#8221;) as well as some personal options related to using WordPress.'=>'ನಿಮ್ಮ ಪ್ರೊಫೈಲ್ ನಿಮ್ಮ ಬಗ್ಗೆ ಮಾಹಿತಿಯನ್ನು (ನಿಮ್ಮ & # 8220; ಖಾತೆ & # 8221;) ಹಾಗೆಯೇ ವರ್ಡ್ಪ್ರೆಸ್ ಬಳಸಿ ಸಂಬಂಧಿಸಿದ ಕೆಲವು ವೈಯಕ್ತಿಕ ಆಯ್ಕೆಗಳನ್ನು ಹೊಂದಿರುತ್ತದೆ.','You can Upload a theme manually if you have already downloaded its ZIP archive onto your computer (make sure it is from a trusted and original source). You can also do it the old-fashioned way and copy a downloaded theme&#8217;s folder via FTP into your %s directory.'=>'ನೀವು ಈಗಾಗಲೇ ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್ಗೆ ಅದರ ZIP ಆರ್ಕೈವ್ ಅನ್ನು ಡೌನ್ಲೋಡ್ ಮಾಡಿದರೆ ನೀವು ಕೈಯಾರೆ ಥೀಮ್ ಅನ್ನು ಅಪ್ಲೋಡ್ ಮಾಡಬಹುದು (ಅದು ವಿಶ್ವಾಸಾರ್ಹ ಮತ್ತು ಮೂಲ ಮೂಲದಿಂದ ಖಚಿತವಾಗಿದೆ ಎಂದು ಖಚಿತಪಡಿಸಿಕೊಳ್ಳಿ). ನೀವು ಅದನ್ನು ಹಳೆಯ-ಶೈಲಿಯ ರೀತಿಯಲ್ಲಿ ಮಾಡಬಹುದು ಮತ್ತು ನಿಮ್ಮ %s ಡೈರೆಕ್ಟರಿಯಲ್ಲಿ FTP ಮೂಲಕ ಡೌನ್ಲೋಡ್ ಮಾಡಲಾದ ಥೀಮ್ & # 8217; ಫೋಲ್ಡರ್ ಅನ್ನು ನಕಲಿಸಬಹುದು.','<strong>Send Trackbacks</strong> &mdash; Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. Enter the URL(s) you want to send trackbacks. If you link to other WordPress sites they&#8217;ll be notified automatically using pingbacks, and this field is unnecessary.'=>'<strong> ಟ್ರ್ಯಾಕ್ಬ್ಯಾಕ್ಗಳನ್ನು ಕಳುಹಿಸಿ</strong>- ಟ್ರ್ಯಾಕ್ಬ್ಯಾಕ್ಗಳು ನೀವು ಅವರಿಗೆ ಲಿಂಕ್ ಮಾಡಿದ ಆಸ್ತಿ ಬ್ಲಾಗ್ ವ್ಯವಸ್ಥೆಗಳನ್ನು ತಿಳಿಸಲು ಒಂದು ಮಾರ್ಗವಾಗಿದೆ. ನೀವು ಟ್ರ್ಯಾಕ್ಬ್ಯಾಕ್ಗಳನ್ನು ಕಳುಹಿಸಲು ಬಯಸುವ URL (ಗಳನ್ನು) ನಮೂದಿಸಿ. ನೀವು ಪಿಂಗ್ಬ್ಯಾಕ್ಗಳನ್ನು ಬಳಸಿಕೊಂಡು ಇತರ ವರ್ಡ್ಪ್ರೆಸ್ ಸೈಟ್ಗಳಿಗೆ ಲಿಂಕ್ ಮಾಡಿದರೆ ಅವರು ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಸೂಚಿಸಲಾಗುತ್ತದೆ, ಮತ್ತು ಈ ಕ್ಷೇತ್ರ ಅನಗತ್ಯ.','Administrators have access to all the administration features.'=>'ನಿರ್ವಾಹಕರು ಎಲ್ಲಾ ಆಡಳಿತದ ವೈಶಿಷ್ಟ್ಯಗಳಿಗೆ ಪ್ರವೇಶವನ್ನು ಹೊಂದಿರುತ್ತಾರೆ.','Contributors can write and manage their posts but not publish posts or upload media files.'=>'ಕೊಡುಗೆದಾರರು ತಮ್ಮ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಬರೆಯಬಹುದು ಮತ್ತು ನಿರ್ವಹಿಸಬಹುದು ಆದರೆ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಪ್ರಕಟಿಸಲು ಅಥವಾ ಮಾಧ್ಯಮ ಫೈಲ್‌ಗಳನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡಲು ಸಾಧ್ಯವಿಲ್ಲ.','If you delete a link, it will be removed permanently, as Links do not have a Trash function yet.'=>'ನೀವು ಲಿಂಕ್ ಅನ್ನು ಅಳಿಸಿದರೆ, ಲಿಂಕುಗಳು ಇನ್ನೂ ಅನುಪಯುಕ್ತ ಕಾರ್ಯವನ್ನು ಹೊಂದಿಲ್ಲವಾದ್ದರಿಂದ ಅದನ್ನು ಶಾಶ್ವತವಾಗಿ ತೆಗೆದುಹಾಕಲಾಗುತ್ತದೆ.','You can add links here to be displayed on your site, usually using <a href="%s">Widgets</a>. By default, links to several sites in the WordPress community are included as examples.'=>'ನಿಮ್ಮ ಸೈಟ್ನಲ್ಲಿ ಪ್ರದರ್ಶಿಸಲು ಇಲ್ಲಿ ಲಿಂಕ್ಗಳನ್ನು ನೀವು ಸೇರಿಸಬಹುದು, ಸಾಮಾನ್ಯವಾಗಿ <a href="%s"> ವಿಡ್ಜೆಟ್ಗಳನ್ನು </a> ಬಳಸಿ. ಪೂರ್ವನಿಯೋಜಿತವಾಗಿ, ವರ್ಡ್ಪ್ರೆಸ್ ಸಮುದಾಯದಲ್ಲಿ ಹಲವಾರು ಸೈಟ್ಗಳಿಗೆ ಲಿಂಕ್ಗಳನ್ನು ಉದಾಹರಣೆಗಳಾಗಿ ಸೇರಿಸಲಾಗಿದೆ.','You can use the plugin file editor to make changes to any of your plugins&#8217; individual PHP files. Be aware that if you make changes, plugins updates will overwrite your customizations.'=>'ನಿಮ್ಮ ಯಾವುದೇ ಪ್ಲಗಿನ್&#8217; ಪ್ರತ್ಯೇಕ ಕಡತಗಳಿಗೆ ಬದಲಾವಣೆಗಳನ್ನು ಮಾಡಲು ನೀವು ಸಂಪಾದಕವನ್ನು ಬಳಸಬಹುದು. ನೀವು ಬದಲಾವಣೆಗಳನ್ನು ಮಾಡಿದರೆ, ಪ್ಲಗಿನ್‍ಗಳ ನವೀಕರಣಗಳು ನಿಮ್ಮ ಬದಲಾವಣೆಗಳನ್ನು ತಿದ್ದುತ್ತವೆ ಎಂದು ತಿಳಿದಿರಲಿ.','<strong>Slug</strong> &mdash; The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'<strong> ಸ್ಲಗ್ </strong>& mdash; ದಿ "ಸ್ಲಗ್" ಇದು ಹೆಸರಿನ URL- ಸ್ನೇಹಿ ಆವೃತ್ತಿಯಾಗಿದೆ. ಇದು ಸಾಮಾನ್ಯವಾಗಿ ಎಲ್ಲಾ ಲೋವರ್ಕೇಸ್ ಮತ್ತು ಅಕ್ಷರಗಳು, ಸಂಖ್ಯೆಗಳು, ಮತ್ತು ಹೈಫನ್ಗಳನ್ನು ಮಾತ್ರ ಹೊಂದಿರುತ್ತದೆ.','You can also create posts with the <a href="%s">Press This bookmarklet</a>.'=>'<a href="%s">ಈ ಬುಕ್ಮಾರ್ಕ್ಲೆಟ್ ಅನ್ನು ಒತ್ತಿ </a> ಜೊತೆಗೆ ನೀವು ಪೋಸ್ಟ್ಗಳನ್ನು ರಚಿಸಬಹುದು.','You can customize the look of your site without touching any of your theme&#8217;s code by using a custom background. Your background can be an image or a color.'=>'ಕಸ್ಟಮ್ ಹಿನ್ನೆಲೆಯನ್ನು ಬಳಸಿಕೊಂಡು ನಿಮ್ಮ ಥೀಮ್ನ ಯಾವುದೇ ಕೋಡ್ ಅನ್ನು ಮುಟ್ಟದೆ ನಿಮ್ಮ ಸೈಟ್ನ ನೋಟವನ್ನು ನೀವು ಗ್ರಾಹಕೀಯಗೊಳಿಸಬಹುದು. ನಿಮ್ಮ ಹಿನ್ನೆಲೆ ಚಿತ್ರವನ್ನು ಅಥವಾ ಬಣ್ಣವಾಗಿರಬಹುದು.','Do not forget to click on the Save Changes button when you are finished.'=>'ನೀವು ಪೂರ್ಣಗೊಳಿಸಿದಾಗ ಬದಲಾವಣೆಗಳನ್ನು ಉಳಿಸು ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಲು ಮರೆಯಬೇಡಿ.','Editors can publish posts, manage posts as well as manage other people&#8217;s posts, etc.'=>'ಸಂಪಾದಕರು ಪೋಸ್ಟ್ಗಳನ್ನು ಪ್ರಕಟಿಸಬಹುದು, ಪೋಸ್ಟ್ಗಳನ್ನು ನಿರ್ವಹಿಸಬಹುದು ಮತ್ತು ಇತರ ಜನರ & # 8217; ನ ಪೋಸ್ಟ್ಗಳನ್ನು ನಿರ್ವಹಿಸಬಹುದು.','Remember to click the Update Profile button when you are finished.'=>'ನೀವು ಮುಕ್ತಾಯಗೊಂಡಾಗ ನವೀಕರಣ ಪ್ರೊಫೈಲ್ ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಿ ನೆನಪಿಡಿ.','Required fields are indicated; the rest are optional. Profile information will only be displayed if your theme is set up to do so.'=>'ಅಗತ್ಯ ಕ್ಷೇತ್ರಗಳನ್ನು ಸೂಚಿಸಲಾಗಿದೆ; ಉಳಿದವು ಐಚ್ಛಿಕ. ನಿಮ್ಮ ಥೀಮ್ ಹಾಗೆ ಹೊಂದಿಸಿದ್ದರೆ ಪ್ರೊಫೈಲ್ ಮಾಹಿತಿಯನ್ನು ಮಾತ್ರ ಪ್ರದರ್ಶಿಸಲಾಗುತ್ತದೆ.','Your username cannot be changed, but you can use other fields to enter your real name or a nickname, and change which name to display on your posts.'=>'ನಿಮ್ಮ ಬಳಕೆದಾರ ಹೆಸರನ್ನು ಬದಲಾಯಿಸಲಾಗುವುದಿಲ್ಲ, ಆದರೆ ನಿಮ್ಮ ನೈಜ ಹೆಸರನ್ನು ಅಥವಾ ಉಪನಾಮವನ್ನು ನಮೂದಿಸಲು ನೀವು ಇತರ ಕ್ಷೇತ್ರಗಳನ್ನು ಬಳಸಬಹುದು, ಮತ್ತು ನಿಮ್ಮ ಪೋಸ್ಟ್ಗಳಲ್ಲಿ ಯಾವ ಹೆಸರನ್ನು ಪ್ರದರ್ಶಿಸಬೇಕು ಎಂದು ಬದಲಾಯಿಸಬಹುದು.','You can edit the information left in a comment if needed. This is often useful when you notice that a commenter has made a typographical error.'=>'ಅಗತ್ಯವಿದ್ದರೆ ಕಾಮೆಂಟ್ನಲ್ಲಿ ಉಳಿದಿರುವ ಮಾಹಿತಿಯನ್ನು ನೀವು ಸಂಪಾದಿಸಬಹುದು. ಕಾಮೆಂಟ್ ಮಾಡುವವರು ಮುದ್ರಣದ ದೋಷವನ್ನು ಮಾಡಿದ್ದಾರೆ ಎಂದು ಗಮನಿಸಿದಾಗ ಇದು ಸಾಮಾನ್ಯವಾಗಿ ಉಪಯುಕ್ತವಾಗಿದೆ.','You can also moderate the comment from this screen using the Status box, where you can also change the timestamp of the comment.'=>'ಸ್ಥಿತಿ ಪೆಟ್ಟಿಗೆಯನ್ನು ಬಳಸಿಕೊಂಡು ಈ ಪರದೆಯಿಂದ ಕಾಮೆಂಟ್ ಅನ್ನು ನೀವು ಮಧ್ಯವರ್ತಿಸಬಹುದು, ಅಲ್ಲಿ ನೀವು ಕಾಮೆಂಟ್ನ ಸಮಯಸ್ಟ್ಯಾಂಪ್ ಅನ್ನು ಬದಲಾಯಿಸಬಹುದು.','You can also control the display of your content in RSS feeds, including the maximum number of posts to display and whether to show full text or an excerpt. <a href="%s">Learn more about feeds</a>.'=>'RSS ಫೀಡ್‌ಗಳಲ್ಲಿ ನಿಮ್ಮ ವಿಷಯದ ಪ್ರದರ್ಶನವನ್ನು ಸಹ ನೀವು ನಿಯಂತ್ರಿಸಬಹುದು, ಇದರಲ್ಲಿ ಗರಿಷ್ಠ ಸಂಖ್ಯೆಯ ಪೋಸ್ಟ್‌ಗಳನ್ನು ಪ್ರದರ್ಶಿಸಬೇಕು ಮತ್ತು ಪೂರ್ಣ ಪಠ್ಯವನ್ನು ತೋರಿಸಬೇಕೇ ಅಥವಾ ಆಯ್ದ ಭಾಗವನ್ನು ತೋರಿಸಬಹುದೇ. <a href="%s"> ಫೀಡ್‌ಗಳ ಬಗ್ಗೆ ಇನ್ನಷ್ಟು ತಿಳಿಯಿರಿ </a>.','UTC means Coordinated Universal Time.'=>'UTC ಎಂದರೆ ಸಂಯೋಜಿತ ಸಾರ್ವತ್ರಿಕ ಸಮಯ.','You must click the Save Changes button at the bottom of the screen for new settings to take effect.'=>'ಹೊಸ ಸೆಟ್ಟಿಂಗ್ಗಳು ಕಾರ್ಯಗತಗೊಳ್ಳಲು ನೀವು ಪರದೆಯ ಕೆಳಭಾಗದಲ್ಲಿ ಉಳಿಸು ಬದಲಾವಣೆಗಳನ್ನು ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಬೇಕು.','This screen contains the settings that affect the display of your content.'=>'ನಿಮ್ಮ ಪರದೆಯ ಮೇಲೆ ಪರಿಣಾಮ ಬೀರುವ ಸೆಟ್ಟಿಂಗ್ಗಳನ್ನು ಈ ಪರದೆಯು ಒಳಗೊಂಡಿದೆ.','The fields on this screen determine some of the basics of your site setup.'=>'ಈ ಪರದೆಯಲ್ಲಿರುವ ಜಾಗವು ನಿಮ್ಮ ಸೈಟ್ ಸೆಟಪ್ನ ಕೆಲವು ಮೂಲಗಳನ್ನು ನಿರ್ಧರಿಸುತ್ತದೆ.','An updated version of WordPress is available.'=>'ವರ್ಡ್ಪ್ರೆಸ್ನ ನವೀಕರಿಸಿದ ಆವೃತ್ತಿ ಲಭ್ಯವಿದೆ.','Your plugins are all up to date.'=>'ನಿಮ್ಮ ಪ್ಲಗ್‌ಇನ್‌ಗಳೆಲ್ಲವೂ ನವೀಕೃತವಾಗಿವೆ.','You have the latest version of WordPress.'=>'ನೀವು ವರ್ಡ್ಪ್ರೆಸ್ ನ ಇತ್ತೀಚಿನ ಆವೃತ್ತಿಯನ್ನು ಹೊಂದಿದ್ದೀರಿ.','Your themes are all up to date.'=>'ನಿಮ್ಮ ಥೀಮ್ಗಳು ನವೀಕೃತವಾಗಿವೆ.','While your site is being updated, it will be in maintenance mode. As soon as your updates are complete, this mode will be deactivated.'=>'ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ನವೀಕರಿಸಲಾಗುತ್ತಿದೆ ಆದರೆ, ಅದು ನಿರ್ವಹಣೆ ಮೋಡ್ನಲ್ಲಿರುತ್ತದೆ. ನಿಮ್ಮ ನವೀಕರಣಗಳು ಪೂರ್ಣಗೊಂಡ ತಕ್ಷಣ, ನಿಮ್ಮ ಸೈಟ್ ಸಾಮಾನ್ಯ ಸ್ಥಿತಿಗೆ ಹಿಂತಿರುಗುವುದು.','Function Name&hellip;'=>'ಫಂಕ್ಷನ್ ಹೆಸರು & hellip;','Activate Plugin &amp; Run Importer'=>'ಪ್ಲಗಿನ್ ಸಕ್ರಿಯಗೊಳಿಸಿ & amp; ಆಮದು ಮಾಡಿಕೊಳ್ಳಿ','You can add or edit links on this screen by entering information in each of the boxes. Only the link&#8217;s web address and name (the text you want to display on your site as the link) are required fields.'=>'ಪ್ರತಿಯೊಂದು ಪೆಟ್ಟಿಗೆಗಳಲ್ಲಿ ಮಾಹಿತಿಯನ್ನು ನಮೂದಿಸುವ ಮೂಲಕ ನೀವು ಈ ತೆರೆಯಲ್ಲಿ ಲಿಂಕ್ಗಳನ್ನು ಸೇರಿಸಬಹುದು ಅಥವಾ ಸಂಪಾದಿಸಬಹುದು. ಕೇವಲ ಲಿಂಕ್ನ ವೆಬ್ ವಿಳಾಸ ಮತ್ತು ಹೆಸರು (ನಿಮ್ಮ ಸೈಟ್ನಲ್ಲಿ ಲಿಂಕ್ನಂತೆ ನೀವು ಪ್ರದರ್ಶಿಸಲು ಬಯಸುವ ಪಠ್ಯಕ್ಕೆ ಮಾತ್ರ) ಕ್ಷೇತ್ರಗಳ ಅಗತ್ಯವಿರುತ್ತದೆ.','Categories can be selectively converted to tags using the <a href="%s">category to tag converter</a>.'=>'<a href="%s">ಟ್ಯಾಗ್ ಪರಿವರ್ತಕಕ್ಕೆ ವರ್ಗವನ್ನು </a> ಬಳಸಿಕೊಂಡು ವರ್ಗಗಳನ್ನು ಆಯ್ದ ಟ್ಯಾಗ್ಗಳಾಗಿ ಪರಿವರ್ತಿಸಬಹುದು.','Once generated, your WXR file can be imported by another WordPress site or by another blogging platform able to access this format.'=>'ಒಮ್ಮೆ ರಚಿಸಿದ ನಂತರ, ನಿಮ್ಮ WXR ಫೈಲ್ ಅನ್ನು ಮತ್ತೊಂದು ವರ್ಡ್ಪ್ರೆಸ್ ಸೈಟ್ ಅಥವಾ ಈ ಸ್ವರೂಪವನ್ನು ಪ್ರವೇಶಿಸಲು ಮತ್ತೊಂದು ಬ್ಲಾಗಿಂಗ್ ವೇದಿಕೆ ಮೂಲಕ ಆಮದು ಮಾಡಬಹುದು.','This screen lists links to plugins to import data from blogging/content management platforms. Choose the platform you want to import from, and click Install Now when you are prompted in the popup window. If your platform is not listed, click the link to search the plugin directory for other importer plugins to see if there is one for your platform.'=>'ಈ ಪರದೆಯು ಬ್ಲಾಗಿಂಗ್ / ವಿಷಯ ನಿರ್ವಹಣೆ ವೇದಿಕೆಗಳಿಂದ ಡೇಟಾವನ್ನು ಆಮದು ಮಾಡಲು ಪ್ಲಗಿನ್ಗಳಿಗೆ ಲಿಂಕ್ಗಳನ್ನು ಪಟ್ಟಿ ಮಾಡುತ್ತದೆ. ನೀವು ಇಂಪೋರ್ಟ್ ಮಾಡಲು ಬಯಸುವ ಪ್ಲ್ಯಾಟ್ಫಾರ್ಮ್ ಆಯ್ಕೆಮಾಡಿ, ಮತ್ತು ನೀವು ಪಾಪ್ಅಪ್ ವಿಂಡೋದಲ್ಲಿ ಪ್ರಾಂಪ್ಟ್ ಮಾಡಿದಾಗ ಇನ್ಸ್ಟಾಲ್ ಮಾಡಿ ಕ್ಲಿಕ್ ಮಾಡಿ. ನಿಮ್ಮ ಪ್ಲ್ಯಾಟ್ಫಾರ್ಮ್ ಅನ್ನು ಪಟ್ಟಿ ಮಾಡದಿದ್ದರೆ, ನಿಮ್ಮ ಪ್ಲಾಟ್ಫಾರ್ಮ್ಗೆ ಯಾವುದಾದರೂ ಒಂದಿದೆಯೇ ಎಂದು ನೋಡಲು ಇತರ ಆಮದು ಪ್ಲಗ್ಇನ್ಗಳಿಗಾಗಿ ಪ್ಲಗಿನ್ ಕೋಶವನ್ನು ಹುಡುಕಲು ಲಿಂಕ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ.','You can customize the display of this screen using the Screen Options tab and/or the dropdown filters above the links table.'=>'ಸ್ಕ್ರೀನ್ ಪರದೆಯ ಟ್ಯಾಬ್ ಮತ್ತು / ಅಥವಾ ಲಿಂಕ್ ಮೇಜಿನ ಮೇಲಿನ ಡ್ರಾಪ್ಡೌನ್ ಫಿಲ್ಟರ್ಗಳನ್ನು ಬಳಸಿಕೊಂಡು ನೀವು ಈ ಪರದೆಯ ಪ್ರದರ್ಶನವನ್ನು ಗ್ರಾಹಕೀಯಗೊಳಿಸಬಹುದು.','Most of the time, plugins play nicely with the core of WordPress and with other plugins. Sometimes, though, a plugin&#8217;s code will get in the way of another plugin, causing compatibility issues. If your site starts doing strange things, this may be the problem. Try deactivating all your plugins and re-activating them in various combinations until you isolate which one(s) caused the issue.'=>'ಹೆಚ್ಚಿನ ಸಮಯ, ಪ್ಲಗಿನ್ಗಳು ವರ್ಡ್ಪ್ರೆಸ್ ಕೋರ್ ಮತ್ತು ಇತರ ಪ್ಲಗ್ಇನ್ಗಳೊಂದಿಗೆ ಚೆನ್ನಾಗಿ ಆಡುತ್ತವೆ. ಕೆಲವೊಮ್ಮೆ, ಒಂದು ಪ್ಲಗಿನ್ & # 8217; ಕೋಡ್ ಮತ್ತೊಂದು ಪ್ಲಗ್ಇನ್ನ ರೀತಿಯಲ್ಲಿ ಸಿಗುತ್ತದೆ, ಇದು ಹೊಂದಾಣಿಕೆ ಸಮಸ್ಯೆಗಳಿಗೆ ಕಾರಣವಾಗುತ್ತದೆ. ನಿಮ್ಮ ಸೈಟ್ ವಿಚಿತ್ರವಾದ ವಿಷಯಗಳನ್ನು ಮಾಡುವುದನ್ನು ಪ್ರಾರಂಭಿಸಿದರೆ, ಇದು ಸಮಸ್ಯೆಯಾಗಿರಬಹುದು. ನಿಮ್ಮ ಎಲ್ಲ ಪ್ಲಗ್ಇನ್ಗಳನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಿ ಮತ್ತು ಅವುಗಳನ್ನು (ಸಂಯೋಜಕರು) ಸಮಸ್ಯೆಯನ್ನು ಉಂಟುಮಾಡುವ ತನಕ ವಿವಿಧ ಸಂಯೋಜನೆಯಲ್ಲಿ ಮರು-ಸಕ್ರಿಯಗೊಳಿಸುವಿಕೆಯನ್ನು ಪ್ರಯತ್ನಿಸಿ.','After typing in your edits, click Update File.'=>'ನಿಮ್ಮ ಸಂಪಾದನೆಯಲ್ಲಿ ಟೈಪ್ ಮಾಡಿದ ನಂತರ, ಫೈಲ್ ನವೀಕರಿಸಿ ಕ್ಲಿಕ್ ಮಾಡಿ.','<strong>Advice:</strong> Think very carefully about your site crashing if you are live-editing the theme currently in use.'=>'<strong> ಸಲಹೆ: </strong>ನೀವು ಪ್ರಸ್ತುತ ಬಳಕೆಯಲ್ಲಿರುವ ಥೀಮ್ ಅನ್ನು ಲೈವ್-ಸಂಪಾದಿಸುತ್ತಿದ್ದರೆ ನಿಮ್ಮ ಸೈಟ್ ಕ್ರ್ಯಾಶಿಂಗ್ ಬಗ್ಗೆ ಜಾಗರೂಕತೆಯಿಂದ ಯೋಚಿಸಿ.','Enabling Accessibility Mode, via Screen Options, allows you to use Add and Edit buttons instead of using drag and drop.'=>'ಪ್ರವೇಶ ಆಯ್ಕೆಗಳು ಮೋಡ್ ಅನ್ನು ಸ್ಕ್ರೀನ್ ಆಯ್ಕೆಗಳನ್ನು ಮೂಲಕ ಸಕ್ರಿಯಗೊಳಿಸುವುದರಿಂದ, ಡ್ರ್ಯಾಗ್ ಮತ್ತು ಡ್ರಾಪ್ ಅನ್ನು ಬಳಸುವ ಬದಲು ಸೇರಿಸು ಮತ್ತು ಸಂಪಾದಿಸು ಗುಂಡಿಗಳನ್ನು ಬಳಸಲು ನಿಮಗೆ ಅನುಮತಿಸುತ್ತದೆ.','Widgets may be used multiple times. You can give each widget a title, to display on your site, but it&#8217;s not required.'=>'ವಿಜೆಟ್ಗಳನ್ನು ಅನೇಕ ಬಾರಿ ಬಳಸಬಹುದು. ನಿಮ್ಮ ಸೈಟ್ನಲ್ಲಿ ಪ್ರದರ್ಶಿಸಲು ನೀವು ಪ್ರತಿ ವಿಜೆಟ್ಗೆ ಶೀರ್ಷಿಕೆಯನ್ನು ನೀಡಬಹುದು, ಆದರೆ ಇದು & # 8217; ಅಗತ್ಯವಿಲ್ಲ.','Widgets are independent sections of content that can be placed into any widgetized area provided by your theme (commonly called sidebars). To populate your sidebars/widget areas with individual widgets, drag and drop the title bars into the desired area. By default, only the first widget area is expanded. To populate additional widget areas, click on their title bars to expand them.'=>'ಹಿಂದಿನವುಗಳು ನಿಮ್ಮ ಥೀಮ್ (ಸಾಮಾನ್ಯವಾಗಿ ಅಡ್ಡಪಟ್ಟಿಗಳು ಎಂದು ಕರೆಯಲ್ಪಡುವ) ಒದಗಿಸಿದ ಯಾವುದೇ widgetized ಪ್ರದೇಶಕ್ಕೆ ಇರಿಸಬಹುದಾದ ವಿಷಯವನ್ನು ಸ್ವತಂತ್ರ ವಿಭಾಗಗಳಾಗಿರುತ್ತವೆ. ವೈಯಕ್ತಿಕ ವಿಜೆಟ್ಗಳನ್ನು ಹೊಂದಿರುವ ನಿಮ್ಮ ಅಡ್ಡಪಟ್ಟಿಗಳು / ವಿಜೆಟ್ ಪ್ರದೇಶಗಳನ್ನು ಜನಪ್ರಿಯಗೊಳಿಸುವುದಕ್ಕಾಗಿ, ಶೀರ್ಷಿಕೆ ಬಾರ್ಗಳನ್ನು ಬಯಸಿದ ಪ್ರದೇಶಕ್ಕೆ ಎಳೆದು ಬಿಡಿ. ಪೂರ್ವನಿಯೋಜಿತವಾಗಿ, ಮೊದಲ ವಿಜೆಟ್ ಪ್ರದೇಶವನ್ನು ಮಾತ್ರ ವಿಸ್ತರಿಸಲಾಗಿದೆ. ಹೆಚ್ಚುವರಿ ವಿಜೆಟ್ ಪ್ರದೇಶಗಳನ್ನು ಜನಪ್ರಿಯಗೊಳಿಸುವುದಕ್ಕಾಗಿ, ಅವುಗಳನ್ನು ವಿಸ್ತರಿಸಲು ಅವರ ಶೀರ್ಷಿಕೆ ಪಟ್ಟಿಗಳನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿ.','Begin by choosing a theme to edit from the dropdown menu and clicking the Select button. A list then appears of the theme&#8217;s template files. Clicking once on any file name causes the file to appear in the large Editor box.'=>'ಡ್ರಾಪ್ಡೌನ್ ಮೆನುವಿನಿಂದ ಸಂಪಾದಿಸಲು ಮತ್ತು ಆಯ್ಕೆ ಬಟನ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವ ಮೂಲಕ ಥೀಮ್ ಅನ್ನು ಆಯ್ಕೆ ಮಾಡುವುದರ ಮೂಲಕ ಪ್ರಾರಂಭಿಸಿ. ನಂತರ ಪಟ್ಟಿಯು ಥೀಮ್ನ ಫೈಲ್ಗಳ ಫೈಲ್ಗಳ ಗೋಚರಿಸುತ್ತದೆ. ಯಾವುದೇ ಫೈಲ್ ಹೆಸರಿನ ಮೇಲೆ ಒಮ್ಮೆ ಕ್ಲಿಕ್ಕಿಸುವುದರಿಂದ ಫೈಲ್ ದೊಡ್ಡ ಸಂಪಾದಕ ಪೆಟ್ಟಿಗೆಯಲ್ಲಿ ಕಾಣಿಸಿಕೊಳ್ಳುತ್ತದೆ.','You can use the theme file editor to edit the individual CSS and PHP files which make up your theme.'=>'ನಿಮ್ಮ ಥೀಮ್ ಮಾಡುವ ಪ್ರತ್ಯೇಕ ಸಿಎಸ್ಎಸ್ ಮತ್ತು ಪಿಎಚ್‍ಪಿ ಫೈಲ್‍ಗಳನ್ನು  ಸಂಪಾದಿಸಲು ನೀವು ಥೀಮ್ ಸಂಪಾದಕವನ್ನು ಬಳಸಬಹುದು.','(no parent)'=>'(ಪೋಷಕರು ಇಲ್ಲ)','<strong>Parent</strong> &mdash; You can arrange your pages in hierarchies. For example, you could have an &#8220;About&#8221; page that has &#8220;Life Story&#8221; and &#8220;My Dog&#8221; pages under it. There are no limits to how many levels you can nest pages.'=>'<strong> ಪೋಷಕ </strong>-ನಿಮ್ಮ ಪುಟಗಳನ್ನು ಶ್ರೇಣಿಯಲ್ಲಿ ವ್ಯವಸ್ಥೆ ಮಾಡಬಹುದು. ಉದಾಹರಣೆಗೆ, ನೀವು "ಕುರಿತು" "ಲೈಫ್ ಸ್ಟೋರಿ" ಮತ್ತು "ಮೈ ಡಾಗ್" ದ  ರ ಅಡಿಯಲ್ಲಿ ಪುಟಗಳು. ನೀವು ಗೂಡು ಪುಟಗಳನ್ನು ಎಷ್ಟು ಮಟ್ಟಕ್ಕೆ ಮಿತಿಗೊಳಿಸುವುದಿಲ್ಲ.','<strong>Template</strong> &mdash; Some themes have custom templates you can use for certain pages that might have additional features or custom layouts. If so, you&#8217;ll see them in this dropdown menu.'=>'<strong> ಟೆಂಪ್ಲೇಟ್ </strong>- ಕೆಲವು ವಿಷಯಗಳು ನೀವು ಕೆಲವು ಪುಟಗಳಿಗಾಗಿ ಬಳಸಬಹುದಾದ ಕಸ್ಟಮ್ ಟೆಂಪ್ಲೇಟ್‌ಗಳನ್ನು  ಹೊಂದಿದ್ದು ಹೆಚ್ಚುವರಿ ವೈಶಿಷ್ಟ್ಯಗಳನ್ನು ಅಥವಾ ಕಸ್ಟಮ್ ವಿನ್ಯಾಸಗಳನ್ನು ಹೊಂದಿರಬಹುದು. ಹಾಗಿದ್ದಲ್ಲಿ, ಈ ಡ್ರಾಪ್ಡೌನ್ ಮೆನುವಿನಲ್ಲಿ ನೀವು ಅವರನ್ನು ನೋಡುತ್ತೀರಿ.','All updates have been completed.'=>'ಎಲ್ಲಾ ನವೀಕರಣಗಳನ್ನು ಪೂರ್ಣಗೊಳಿಸಲಾಗಿದೆ.','<strong>Description</strong> &mdash; The description is not prominent by default; however, some themes may display it.'=>'<strong> ವಿವರಣೆ </strong>-ಪೂರ್ವನಿಯೋಜಿತವಾಗಿ ವಿವರಣೆಯು ಪ್ರಮುಖವಾಗಿಲ್ಲ; ಆದಾಗ್ಯೂ, ಕೆಲವು ವಿಷಯಗಳು ಅದನ್ನು ಪ್ರದರ್ಶಿಸಬಹುದು.','You can use categories to define sections of your site and group related posts. The default category is &#8220;Uncategorized&#8221; until you change it in your <a href="%s">writing settings</a>.'=>'ನಿಮ್ಮ ಸೈಟ್ ಮತ್ತು ಗುಂಪು ಸಂಬಂಧಿತ ಪೋಸ್ಟ್ಗಳ ವಿಭಾಗಗಳನ್ನು ವ್ಯಾಖ್ಯಾನಿಸಲು ವಿಭಾಗಗಳನ್ನು ನೀವು ಬಳಸಬಹುದು. ಡೀಫಾಲ್ಟ್ ವರ್ಗವು "ವರ್ಗವಿಲ್ಲದ್ದು" ನಿಮ್ಮ<a href="%s"> ಅದನ್ನು ಬದಲಾಯಿಸುವವರೆಗೂ ಬರವಣಿಗೆ ಸೆಟ್ಟಿಂಗ್ಗಳನ್ನು </a>.','When adding a new category on this screen, you&#8217;ll fill in the following fields:'=>'ಈ ಪರದೆಯಲ್ಲಿ ಹೊಸ ವರ್ಗವನ್ನು ಸೇರಿಸುವಾಗ, ನೀವು ಈ ಕೆಳಗಿನ ಕ್ಷೇತ್ರಗಳನ್ನು ಭರ್ತಿ ಮಾಡುತ್ತೀರಿ:','<strong>Name</strong> &mdash; The name is how it appears on your site.'=>'<strong> ಹೆಸರು </strong> - ನಿಮ್ಮ ಸೈಟ್ನಲ್ಲಿ ಅದು ಹೇಗೆ ಗೋಚರಿಸುತ್ತದೆ ಎಂಬುದು.','When adding a new tag on this screen, you&#8217;ll fill in the following fields:'=>'ಈ ಪರದೆಯಲ್ಲಿ ಹೊಸ ಟ್ಯಾಗ್ ಸೇರಿಸುವಾಗ, ನೀವು ಈ ಕೆಳಗಿನ ಕ್ಷೇತ್ರಗಳನ್ನು ಭರ್ತಿ ಮಾಡುತ್ತೀರಿ:','You can change the display of this screen using the Screen Options tab to set how many items are displayed per screen and to display/hide columns in the table.'=>'ಪ್ರತಿ ಪರದೆಯ ಮೇಲೆ ಎಷ್ಟು ಐಟಂಗಳನ್ನು ಪ್ರದರ್ಶಿಸಲಾಗುತ್ತದೆ ಮತ್ತು ಟೇಬಲ್ನಲ್ಲಿ ಕಾಲಮ್ಗಳನ್ನು ಪ್ರದರ್ಶಿಸಲು / ಮರೆಮಾಡಲು ಹೊಂದಿಸಲು ನೀವು ಸ್ಕ್ರೀನ್ ಪರದೆಯ ಟ್ಯಾಬ್ ಬಳಸಿಕೊಂಡು ಈ ಪರದೆಯ ಪ್ರದರ್ಶನವನ್ನು ಬದಲಾಯಿಸಬಹುದು.','What&#8217;s the difference between categories and tags? Normally, tags are ad-hoc keywords that identify important information in your post (names, subjects, etc) that may or may not recur in other posts, while categories are pre-determined sections. If you think of your site like a book, the categories are like the Table of Contents and the tags are like the terms in the index.'=>'ವರ್ಗಗಳು ಮತ್ತು ಟ್ಯಾಗ್ಗಳ ನಡುವಿನ ವ್ಯತ್ಯಾಸವೇನು? ಸಾಮಾನ್ಯವಾಗಿ, ಟ್ಯಾಗ್ಗಳನ್ನು ಪೂರ್ವ-ನಿರ್ಧಾರಿತ ವಿಭಾಗಗಳಾಗಿರುವಾಗ, ನಿಮ್ಮ ಪೋಸ್ಟ್ನಲ್ಲಿ (ಹೆಸರುಗಳು, ವಿಷಯಗಳು, ಮುಂತಾದವು) ಇತರ ಪೋಸ್ಟ್ಗಳಲ್ಲಿ ಅಥವಾ ಪುನರಾವರ್ತಿಸದಿರುವ ಪ್ರಮುಖ ಮಾಹಿತಿಯನ್ನು ಗುರುತಿಸುವ ಆಡ್-ಹಾಕ್ ಕೀವರ್ಡ್ಗಳು. ಪುಸ್ತಕದಂತೆ ನಿಮ್ಮ ಸೈಟ್ ಅನ್ನು ನೀವು ಭಾವಿಸಿದರೆ, ವಿಭಾಗಗಳು ಪರಿವಿಡಿಯನ್ನು ಹೋಲುತ್ತವೆ ಮತ್ತು ಟ್ಯಾಗ್ಗಳು ಸೂಚ್ಯಂಕದಲ್ಲಿನ ನಿಯಮಗಳನ್ನು ಹೋಲುತ್ತವೆ.','Remove Header Image'=>'ಹೆಡರ್ ಚಿತ್ರವನ್ನು ತೆಗೆಯಿರಿ','Reset Image'=>'ಚಿತ್ರವನ್ನು ಮರುಹೊಂದಿಸಿ','Text Color'=>'ಪಠ್ಯದ ಬಣ್ಣ','Default Images'=>'ಡೀಫಾಲ್ಟ್ ಚಿತ್ರಗಳು','You need JavaScript to choose a part of the image.'=>'ಚಿತ್ರದ ಒಂದು ಭಾಗವನ್ನು ಆಯ್ಕೆ ಮಾಡಲು ನಿಮಗೆ JavaScript ಅಗತ್ಯವಿದೆ.','Image Upload Error'=>'ಚಿತ್ರ ಅಪ್ಲೋಡ್ ದೋಷ','Restore Original Header Image'=>'ಮೂಲ ಶಿರೋಲೇಖ ಚಿತ್ರ ಮರುಸ್ಥಾಪಿಸಿ','This will restore the original header image. You will not be able to restore any customizations.'=>'ಇದು ಮೂಲ ಶಿರೋಲೇಖ ಚಿತ್ರವನ್ನು ಮರುಸ್ಥಾಪಿಸುತ್ತದೆ. ಯಾವುದೇ ಗ್ರಾಹಕೀಕರಣವನ್ನು ನೀವು ಪುನಃಸ್ಥಾಪಿಸಲು ಸಾಧ್ಯವಾಗುವುದಿಲ್ಲ.','This will remove the header image. You will not be able to restore any customizations.'=>'ಇದು ಶಿರೋಲೇಖ ಚಿತ್ರವನ್ನು ತೆಗೆದುಹಾಕುತ್ತದೆ. ಯಾವುದೇ ಗ್ರಾಹಕೀಕರಣವನ್ನು ನೀವು ಪುನಃಸ್ಥಾಪಿಸಲು ಸಾಧ್ಯವಾಗುವುದಿಲ್ಲ.','Crop Header Image'=>'ಕ್ರಾಪ್ ಶಿರೋಲೇಖ ಚಿತ್ರ','Restore this comment from the Trash'=>'ಅನುಪಯುಕ್ತದಿಂದ ಈ ಕಾಮೆಂಟ್ ಅನ್ನು ಮರುಸ್ಥಾಪಿಸಿ','Delete this comment permanently'=>'ಈ ಕಾಮೆಂಟ್ ಅನ್ನು ಶಾಶ್ವತವಾಗಿ ಅಳಿಸಿ','Allow comments'=>'ಕಾಮೆಂಟ್‌ಗಳನ್ನು ಅನುಮತಿಸಿ','<strong>Discussion</strong> &mdash; You can turn comments and pings on or off, and if there are comments on the post, you can see them here and moderate them.'=>'<strong> ಚರ್ಚೆ</strong>-ನೀವು ಕಾಮೆಂಟ್ಗಳು ಮತ್ತು ಪಿಂಗ್ಗಳನ್ನು ಆನ್ ಅಥವಾ ಆಫ್ ಮಾಡಬಹುದು, ಮತ್ತು ಪೋಸ್ಟ್ನಲ್ಲಿ ಕಾಮೆಂಟ್ಗಳನ್ನು ಹೊಂದಿದ್ದರೆ, ನೀವು ಅವುಗಳನ್ನು ಇಲ್ಲಿ ನೋಡಬಹುದು ಮತ್ತು ಅವುಗಳನ್ನು ಮಾಡರೇಟ್ ಮಾಡಬಹುದು.','<strong>Title</strong> &mdash; Enter a title for your post. After you enter a title, you&#8217;ll see the permalink below, which you can edit.'=>'<strong> ಶೀರ್ಷಿಕೆ</strong>-ನಿಮ್ಮ ಪೋಸ್ಟ್ಗಾಗಿ ಶೀರ್ಷಿಕೆಯನ್ನು ನಮೂದಿಸಿ. ನೀವು ಶೀರ್ಷಿಕೆಯನ್ನು ನಮೂದಿಸಿದ ನಂತರ, ನೀವು ಸಂಪಾದಿಸಬಹುದಾದ ಕೆಳಗೆ ಪರ್ಮಾಲಿಂಕ್ ಅನ್ನು ನೀವು ನೋಡುತ್ತೀರಿ.','<strong>%s</strong> &mdash; This allows you to associate an image with your post without inserting it. This is usually useful only if your theme makes use of the image as a post thumbnail on the home page, a custom header, etc.'=>'<strong> %s</strong>- ನಿಮ್ಮ ಪೋಸ್ಟ್ನೊಂದಿಗೆ ಚಿತ್ರವನ್ನು ಸೇರಿಸದೆಯೇ ಅದನ್ನು ಸಂಯೋಜಿಸಲು ಇದು ನಿಮ್ಮನ್ನು ಅನುಮತಿಸುತ್ತದೆ. ನಿಮ್ಮ ಥೀಮ್ ಮುಖಪುಟದಲ್ಲಿ ಪೋಸ್ಟ್ ಥಂಬ್ನೇಲ್, ಕಸ್ಟಮ್ ಶಿರೋಲೇಖ, ಇತ್ಯಾದಿಗಳಂತೆ ನಿಮ್ಮ ಥೀಮ್ ಅನ್ನು ಬಳಸಿದರೆ ಮಾತ್ರ ಇದು ಸಾಮಾನ್ಯವಾಗಿ ಉಪಯುಕ್ತವಾಗಿದೆ.','Hovering over a row in the posts list will display action links that allow you to manage your post. You can perform the following actions:'=>'ಪೋಸ್ಟ್ಗಳ ಪಟ್ಟಿಯಲ್ಲಿ ಸತತವಾಗಿ ಅಡ್ಡಲಾಗಿ ಸುಳಿದಾಡುತ್ತಾ ನಿಮ್ಮ ಪೋಸ್ಟ್ ಅನ್ನು ನಿರ್ವಹಿಸಲು ನಿಮಗೆ ಅನುಮತಿಸುವ ಆಕ್ಷನ್ ಲಿಂಕ್ಗಳನ್ನು ಪ್ರದರ್ಶಿಸಲಾಗುತ್ತದೆ. ನೀವು ಕೆಳಗಿನ ಕ್ರಮಗಳನ್ನು ಮಾಡಬಹುದು:','You can customize the display of this screen in a number of ways:'=>'ನೀವು ಈ ಪರದೆಯ ಪ್ರದರ್ಶನವನ್ನು ಅನೇಕ ವಿಧಾನಗಳಲ್ಲಿ ಗ್ರಾಹಕೀಯಗೊಳಿಸಬಹುದು:','You can hide/display columns based on your needs and decide how many posts to list per screen using the Screen Options tab.'=>'ನಿಮ್ಮ ಅಗತ್ಯತೆಗಳ ಆಧಾರದ ಮೇಲೆ ನೀವು ಮರೆಮಾಡಲು / ಪ್ರದರ್ಶಿಸಬಹುದು ಮತ್ತು ಸ್ಕ್ರೀನ್ ಆಯ್ಕೆಗಳು ಟ್ಯಾಬ್ ಬಳಸಿ ಪ್ರತಿ ಪರದೆಯ ಪಟ್ಟಿಗೆ ಎಷ್ಟು ಪೋಸ್ಟ್ಗಳನ್ನು ನಿರ್ಧರಿಸಬಹುದು.','You can refine the list to show only posts in a specific category or from a specific month by using the dropdown menus above the posts list. Click the Filter button after making your selection. You also can refine the list by clicking on the post author, category or tag in the posts list.'=>'ಪೋಸ್ಟ್ಗಳ ಪಟ್ಟಿಯ ಮೇಲಿರುವ ಡ್ರಾಪ್ಡೌನ್ ಮೆನುಗಳನ್ನು ಬಳಸಿಕೊಂಡು ನಿರ್ದಿಷ್ಟ ವರ್ಗದಲ್ಲಿ ಅಥವಾ ನಿರ್ದಿಷ್ಟ ತಿಂಗಳಲ್ಲಿ ಪೋಸ್ಟ್ಗಳನ್ನು ಮಾತ್ರ ತೋರಿಸಲು ಪಟ್ಟಿಯನ್ನು ನೀವು ಸಂಸ್ಕರಿಸಬಹುದು. ನಿಮ್ಮ ಆಯ್ಕೆ ಮಾಡಿದ ನಂತರ ಫಿಲ್ಟರ್ ಬಟನ್ ಕ್ಲಿಕ್ ಮಾಡಿ. ಪೋಸ್ಟ್ಗಳ ಪಟ್ಟಿಯಲ್ಲಿ ಪೋಸ್ಟ್ ಲೇಖಕ, ವಿಭಾಗ ಅಥವಾ ಟ್ಯಾಗ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡುವುದರ ಮೂಲಕ ನೀವು ಪಟ್ಟಿಯನ್ನು ಸಂಸ್ಕರಿಸಬಹುದು.','Search installed plugins'=>'ಸ್ಥಾಪಿಸಲಾದ ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಹುಡುಕಿ','Your theme supports one menu. Select which menu you would like to use.'=>'ನಿಮ್ಮ ಥೀಮ್ ಒಂದು ಮೆನುವನ್ನು ಬೆಂಬಲಿಸುತ್ತದೆ. ಯಾವ ಮೆನುವನ್ನು ನೀವು ಬಳಸಲು ಬಯಸುತ್ತೀರಿ ಎಂಬುದನ್ನು ಆಯ್ಕೆ ಮಾಡಿ.','Your theme does not support navigation menus or widgets.'=>'ನ್ಯಾವಿಗೇಶನ್ ಮೆನುಗಳು ಅಥವಾ ವಿಜೆಟ್ಗಳನ್ನು ನಿಮ್ಮ ಥೀಮ್ ಬೆಂಬಲಿಸುವುದಿಲ್ಲ.','Categories and Tags Converter'=>'ವರ್ಗಗಳು ಮತ್ತು ಟ್ಯಾಗ್ಗಳು ಪರಿವರ್ತಕ','Most Recent'=>'ತೀರಾ ಇತ್ತೀಚಿನ','Start date:'=>'ಪ್ರಾರಂಭ ದಿನಾಂಕ:','Theme InstallerTag'=>'ಟ್ಯಾಗ್','Plugin InstallerTag'=>'ಟ್ಯಾಗ್','verbClear'=>'ತೆರವುಗೊಳಿಸಿ','commentMark as spam'=>'ಸ್ಪ್ಯಾಮ್ ಎಂದು ಗುರುತಿಸಿ','Remove Background Image'=>'ಹಿನ್ನೆಲೆ ಚಿತ್ರವನ್ನು ತೆಗೆದುಹಾಕಿ','Comments on &#8220;%s&#8221;'=>'&#8220;%s&#8221; ನ ಪ್ರತಿಕ್ರಿಯೆಗಳು‍‍‍‍‍','Show advanced menu properties'=>'ಸುಧಾರಿತ ಮೆನು ಗುಣಲಕ್ಷಣಗಳನ್ನು ತೋರಿಸು','You have version %1$s installed. Update to %2$s.'=>'ನೀವು ಆವೃತ್ತಿ %1$s ಸ್ಥಾಪಿಸಿದ್ದೀರಿ. %2$s ಗೆ ನವೀಕರಿಸಿ.','Enabled'=>'ಸಕ್ರಿಯಗೊಳಿಸಲಾಗಿದೆ','commentNot Spam'=>'ಸ್ಪ್ಯಾಮ್ ಅಲ್ಲ','This will restore the original background image. You will not be able to restore any customizations.'=>'ಇದು ಮೂಲ ಹಿನ್ನೆಲೆ ಚಿತ್ರವನ್ನು ಮರುಸ್ಥಾಪಿಸುತ್ತದೆ. ಯಾವುದೇ ಗ್ರಾಹಕೀಕರಣವನ್ನು ನೀವು ಪುನಃಸ್ಥಾಪಿಸಲು ಸಾಧ್ಯವಾಗುವುದಿಲ್ಲ.','WordPress Blog'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಬ್ಲಾಗ್','&mdash; No role for this site &mdash;'=>'&mdash; ಈ ಸೈಟ್ಗೆ ಯಾವುದೇ ಪಾತ್ರವಿಲ್ಲ &mdash;','Remove Users from Site'=>'ಸೈಟ್ನಿಂದ ಬಳಕೆದಾರರನ್ನು ತೆಗೆದುಹಾಕಿ','New WordPress Site'=>'ಹೊಸ ವರ್ಡ್ಪ್ರೆಸ್ ಸೈಟ್','My Site'=>'ನನ್ನ ಸೈಟ್','Sorry, you are not allowed to create pages on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್ನಲ್ಲಿ ಪುಟಗಳನ್ನು ರಚಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to create posts or drafts on this site.'=>'ಕ್ಷಮಿಸಿ, ಈ ಸೈಟ್‌ನಲ್ಲಿ ಪೋಸ್ಟ್‌ಗಳು ಅಥವಾ ಡ್ರಾಫ್ಟ್‌ಗಳನ್ನು ರಚಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Custom site deleted message.'=>'ಕಸ್ಟಮ್ ಸೈಟ್ ಅಳಿಸಿದ ಸಂದೇಶ.','Custom site suspended message.'=>'ಕಸ್ಟಮ್ ಸೈಟ್ ಸಂದೇಶವನ್ನು ಅಮಾನತುಗೊಳಿಸಲಾಗಿದೆ.','Custom site inactive message.'=>'ಕಸ್ಟಮ್ ಸೈಟ್ ನಿಷ್ಕ್ರಿಯ ಸಂದೇಶ.','If you have posts or comments in another system, WordPress can import those into this site. To get started, choose a system to import from below:'=>'ನೀವು ಇನ್ನೊಂದು ವ್ಯವಸ್ಥೆಯಲ್ಲಿ ಪೋಸ್ಟ್ಗಳು ಅಥವಾ ಕಾಮೆಂಟ್ಗಳನ್ನು ಹೊಂದಿದ್ದರೆ, ವರ್ಡ್ಪ್ರೆಸ್ ಈ ಸೈಟ್ಗೆ ಆಮದು ಮಾಡಿಕೊಳ್ಳಬಹುದು. ಪ್ರಾರಂಭಿಸಲು, ಕೆಳಗೆ ಇಂಪೋರ್ಟ್ ಮಾಡಲು ಒಂದು ವ್ಯವಸ್ಥೆಯನ್ನು ಆಯ್ಕೆ ಮಾಡಿ:','No items.'=>'ಯಾವುದೇ ಐಟಂಗಳಿಲ್ಲ.','The installer attempted to contact a random hostname (%s) on your domain.'=>'ನಿಮ್ಮ ಡೊಮೇನ್ನಲ್ಲಿ ಯಾದೃಚ್ಛಿಕ ಹೋಸ್ಟ್ಹೆಸರನ್ನು ( %s ) ಸಂಪರ್ಕಿಸಲು ಅನುಸ್ಥಾಪಕವು ಪ್ರಯತ್ನಿಸಿದೆ.','To use a subdomain configuration, you must have a wildcard entry in your DNS. This usually means adding a %s hostname record pointing at your web server in your DNS configuration tool.'=>'ಸಬ್ಡೊಮೈನ್ ಕಾನ್ಫಿಗರೇಶನ್ ಅನ್ನು ಬಳಸಲು, ನಿಮ್ಮ ಡಿಎನ್ಎಸ್ನಲ್ಲಿ ನೀವು ವೈಲ್ಡ್ಕಾರ್ಡ್ ಪ್ರವೇಶವನ್ನು ಹೊಂದಿರಬೇಕು. ಇದು ಸಾಮಾನ್ಯವಾಗಿ ನಿಮ್ಮ ಡಿಎನ್ಎಸ್ ಸಂರಚನಾ ಪರಿಕರದಲ್ಲಿ ನಿಮ್ಮ ವೆಬ್ ಸರ್ವರ್ನಲ್ಲಿ %s ಹೋಸ್ಟ್ ಹೆಸರಿನ ದಾಖಲೆಯನ್ನು ಸೇರಿಸುವುದನ್ನು ಸೇರಿಸುತ್ತದೆ.','The menu item has been successfully deleted.'=>'ಮೆನು ಐಟಂ ಅನ್ನು ಯಶಸ್ವಿಯಾಗಿ ಅಳಿಸಲಾಗಿದೆ.','Please provide a custom field name.'=>'ದಯವಿಟ್ಟು ಕಸ್ಟಮ್ ಫೀಲ್ಡ್ ಹೆಸರನ್ನು ಒದಗಿಸಿ.','Remove Image'=>'ಚಿತ್ರವನ್ನು ತೆಗೆಯಿರಿ','Display Options'=>'ಪ್ರದರ್ಶನ ಆಯ್ಕೆಗಳು','Confirm Removal'=>'ತೆಗೆದುಹಾಕುವಿಕೆಯನ್ನು ದೃಢೀಕರಿಸಿ','User deletion is not allowed from this screen.'=>'ಬಳಕೆದಾರರ ಅಳಿಸುವಿಕೆಗೆ ಈ ಪರದೆಯಿಂದ ಅನುಮತಿಸಲಾಗುವುದಿಲ್ಲ.','You have specified these users for removal:'=>'ತೆಗೆದುಹಾಕಲು ಈ ಬಳಕೆದಾರರನ್ನು ನೀವು ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ್ದೀರಿ:','There are no valid users selected for removal.'=>'ತೆಗೆದುಹಾಕಲು ಆಯ್ಕೆ ಮಾಡಲಾಗಿಲ್ಲ ಮಾನ್ಯ ಬಳಕೆದಾರರು ಇಲ್ಲ.','Other users have been removed.'=>'ಇತರ ಬಳಕೆದಾರರನ್ನು ತೆಗೆದುಹಾಕಲಾಗಿದೆ.','You cannot remove the current user.'=>'ನೀವು ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರನ್ನು ತೆಗೆದುಹಾಕಲು ಸಾಧ್ಯವಿಲ್ಲ.','%s updated successfully.'=>'%s ಅನ್ನು ಯಶಸ್ವಿಯಾಗಿ ನವೀಕರಿಸಲಾಗಿದೆ.','Your chosen password.'=>'ನೀವು ಆಯ್ಕೆ ಮಾಡಿದ ಪಾಸ್‌ವರ್ಡ್.','No thanks, do not remind me again'=>'ಇಲ್ಲ ಧನ್ಯವಾದಗಳು, ಮತ್ತೊಮ್ಮೆ ನನಗೆ ನೆನಪಿಸಬೇಡಿ','Yes, take me to my profile page'=>'ಹೌದು, ನನ್ನ ಪ್ರೊಫೈಲ್ ಪುಟಕ್ಕೆ ಕರೆದೊಯ್ಯಿರಿ','Sorry, you are not allowed to move this item to the Trash.'=>'ಕ್ಷಮಿಸಿ, ಈ ಐಟಂ ಅನ್ನು ಅನುಪಯುಕ್ತಕ್ಕೆ ಸರಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Sorry, you are not allowed to restore this item from the Trash.'=>'ಕ್ಷಮಿಸಿ, ಈ ಐಟಂ ಅನ್ನು ಅನುಪಯುಕ್ತದಿಂದ ಮರುಸ್ಥಾಪಿಸಲು ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','%s comment restored from the Trash.'=>'%s ಕಾಮೆಂಟ್ ಅನ್ನು ಕಸದ ಬುಟ್ಟಿಯಿಂದ ಪುನಃಸ್ಥಾಪಿಸಲಾಗಿದೆ.' . "\0" . '%s ಕಾಮೆಂಟ್ ಅನುಪಯುಕ್ತದಿಂದ ಮರುಸ್ಥಾಪಿಸಲಾಗಿದೆ','%s comment moved to the Trash.'=>'%s ಕಾಮೆಂಟ್ ಅನುಪಯುಕ್ತಕ್ಕೆ ಸರಿಸಲಾಗಿದೆ.' . "\0" . '%s ಕಾಮೆಂಟ್ ಅನುಪಯುಕ್ತಕ್ಕೆ ಸರಿಸಲಾಗಿದೆ.','The following themes have new versions available. Check the ones you want to update and then click &#8220;Update Themes&#8221;.'=>'ಈ ಕೆಳಗಿನ ಥೀಮ್ ಗಳು ಹೊಸ ಆವೃತ್ತಿಗಳನ್ನು ಲಭ್ಯವಿದೆ. ನೀವು ನವೀಕರಿಸಲು ಬಯಸುವವುಗಳನ್ನು ಪರಿಶೀಲಿಸಿ ಮತ್ತು ನಂತರ "ಅಪ್ ಡೇಟ್ ಥೀಮ್ಸ್" ಕ್ಲಿಕ್ ಮಾಡಿ.','User has been added to your site.'=>'ಬಳಕೆದಾರರನ್ನು ನಿಮ್ಮ ಸೈಟ್ಗೆ ಸೇರಿಸಲಾಗಿದೆ.','That user is already a member of this site.'=>'ಆ ಬಳಕೆದಾರರು ಈಗಾಗಲೇ ಈ ಸೈಟ್ನ ಸದಸ್ಯರಾಗಿದ್ದಾರೆ.','Invitation email sent to user. A confirmation link must be clicked for them to be added to your site.'=>'ಆಮಂತ್ರಣ ಇಮೇಲ್ ಬಳಕೆದಾರರಿಗೆ ಕಳುಹಿಸಲಾಗಿದೆ. ನಿಮ್ಮ ಸೈಟ್ಗೆ ಸೇರಿಸಲು ದೃಢೀಕರಣ ಲಿಂಕ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಬೇಕು.','The following plugins have new versions available. Check the ones you want to update and then click &#8220;Update Plugins&#8221;.'=>'ಈ ಕೆಳಗಿನ ಪ್ಲಗ್ ಇನ್ ಗಳು ಹೊಸ ಆವೃತ್ತಿಗಳನ್ನು ಲಭ್ಯವಿದೆ. ನೀವು ನವೀಕರಿಸಲು ಬಯಸುವವುಗಳನ್ನು ಪರಿಶೀಲಿಸಿ ಮತ್ತು ನಂತರ "ಪ್ಲಗಿನ್ ಗಳನ್ನು ನವೀಕರಿಸು" ಕ್ಲಿಕ್ ಮಾಡಿ.','This will remove the background image. You will not be able to restore any customizations.'=>'ಇದು ಹಿನ್ನೆಲೆ ಚಿತ್ರವನ್ನು ತೆಗೆದುಹಾಕುತ್ತದೆ. ಯಾವುದೇ ಗ್ರಾಹಕೀಕರಣವನ್ನು ನೀವು ಪುನಃಸ್ಥಾಪಿಸಲು ಸಾಧ್ಯವಾಗುವುದಿಲ್ಲ.','Only the active theme is available to you. Contact the %s administrator for information about accessing additional themes.'=>'ಸಕ್ರಿಯ ಥೀಮ್ ಮಾತ್ರ ನಿಮಗೆ ಲಭ್ಯವಿದೆ. ಹೆಚ್ಚುವರಿ ಥೀಮ್‌ಗಳನ್ನು ಪ್ರವೇಶಿಸುವ ಕುರಿತು ಮಾಹಿತಿಗಾಗಿ %s ನಿರ್ವಾಹಕರನ್ನು ಸಂಪರ್ಕಿಸಿ.','Author Template'=>'ಲೇಖಕ ಟೆಂಪ್ಲೇಟು','Tag Template'=>'ಟ್ಯಾಗ್ ಟೆಂಪ್ಲೇಟು','Visual Editor Stylesheet'=>'ವಿಷುಯಲ್ ಸಂಪಾದಕ ಸ್ಟೈಲ್ಶೀಟ್','Page saved.'=>'ಪುಟವನ್ನು ಉಳಿಸಲಾಗಿದೆ.','More information about %s'=>'%s ಬಗ್ಗೆ ಹೆಚ್ಚಿನ ಮಾಹಿತಿ','This user has super admin privileges.'=>'ಈ ಬಳಕೆದಾರರು ಸೂಪರ್ ನಿರ್ವಾಹಕ ಸೌಲಭ್ಯಗಳನ್ನು ಹೊಂದಿದ್ದಾರೆ.','Important:'=>'ಪ್ರಮುಖವಾದದ್ದು:','Grant this user super admin privileges for the Network.'=>'ನೆಟ್ವರ್ಕ್ಗಾಗಿ ಈ ಬಳಕೆದಾರ ಸೂಪರ್ ನಿರ್ವಹಣೆ ಸವಲತ್ತುಗಳನ್ನು ನೀಡಿ.','Update to version %s'=>'ಆವೃತ್ತಿ %s ಗೆ ನವೀಕರಿಸಿ ','Usernames cannot be changed.'=>'ಬಳಕೆದಾರ ಹೆಸರುಗಳನ್ನು ಬದಲಾಯಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','items'=>'ಅಂಶಗಳು','The menu has been successfully deleted.'=>'ಮೆನು ಯಶಸ್ವಿಯಾಗಿ ಅಳಿಸಲಾಗಿದೆ.','Site visibility'=>'ಸೈಟ್ ಗೋಚರತೆ','CSS Classes (optional)'=>'CSS ಕ್ಲಾಸ್ ಗಳು (ಐಚ್ಛಿಕ)','Save Menu'=>'ಮೆನು ಉಳಿಸಿ','Link Target'=>'ಲಿಂಕ್ ಟಾರ್ಗೆಟ್','Updating Theme %1$s (%2$d/%3$d)'=>'ಥೀಮ್ %1$s ನವೀಕರಿಸಲಾಗುತ್ತಿದೆ ( %2$d / %3$d )','You must provide a valid email address.'=>'ನೀವು ಮಾನ್ಯವಾದ ಇಮೇಲ್ ವಿಳಾಸವನ್ನು ಒದಗಿಸಬೇಕು.','The network already exists.'=>'ನೆಟ್‌ವರ್ಕ್ ಈಗಾಗಲೇ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ.','You must provide a domain name.'=>'ನೀವು ಡೊಮೇನ್ ಹೆಸರನ್ನು ಒದಗಿಸಬೇಕು.','You must provide a name for your network of sites.'=>'ನಿಮ್ಮ ಜಾಲತಾಣಗಳಿಗೆ ನೀವು ಹೆಸರನ್ನು ನೀಡಬೇಕು.','This resulted in an error message: %s'=>'ಇದು ದೋಷ ಸಂದೇಶವನ್ನು ಉಂಟುಮಾಡಿದೆ: %s','You can still use your site but any subdomain you create may not be accessible. If you know your DNS is correct, ignore this message.'=>'ನೀವು ಇನ್ನೂ ನಿಮ್ಮ ಸೈಟ್ ಬಳಸಬಹುದು ಆದರೆ ನೀವು ರಚಿಸುವ ಯಾವುದೇ ಸಬ್ಡೊಮೈನ್ ಅನ್ನು ಪ್ರವೇಶಿಸಲಾಗುವುದಿಲ್ಲ. ನಿಮ್ಮ DNS ಸರಿಯಾಗಿದೆಯೆಂದು ನಿಮಗೆ ತಿಳಿದಿದ್ದರೆ, ಈ ಸಂದೇಶವನ್ನು ನಿರ್ಲಕ್ಷಿಸಿ.','Notice:'=>'ಸೂಚನೆ:','Get Shortlink'=>'ಶಾರ್ಟ್ ಲಿಂಕ್ ಪಡೆಯಿರಿ','The update of %s failed.'=>'%s ನವೀಕರಣ ವಿಫಲವಾಗಿದೆ.','Updating Plugin %1$s (%2$d/%3$d)'=>'ಪ್ಲಗಿನ್ %1$s ನವೀಕರಿಸಲಾಗುತ್ತಿದೆ ( %2$d / %3$d )','The password you chose during installation.'=>'ಅನುಸ್ಥಾಪನೆಯ ಸಮಯದಲ್ಲಿ ನೀವು ಆಯ್ಕೆ ಮಾಡಿದ ಪಾಸ್ವರ್ಡ್.','User already exists. Password inherited.'=>'ಬಳಕೆದಾರ ಈಗಾಗಲೇ ಅಸ್ತಿತ್ವದಲ್ಲಿದೆ. ಪಾಸ್ವರ್ಡ್ ಆನುವಂಶಿಕವಾಗಿ.','WordPress updated successfully.'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ಯಶಸ್ವಿಯಾಗಿ ನವೀಕರಿಸಲಾಗಿದೆ.','Update Plugins'=>'ಪ್ಲಗಿನ್‌ಗಳನ್ನು ನವೀಕರಿಸಿ','Update WordPress'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಅನ್ನು ನವೀಕರಿಸಿ','You cannot update because <a href="%1$s">WordPress %2$s</a> requires PHP version %3$s or higher and MySQL version %4$s or higher. You are running PHP version %5$s and MySQL version %6$s.'=>'ನೀವು ನವೀಕರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ ಏಕೆಂದರೆ <a href="%1$s">ವರ್ಡ್ಪ್ರೆಸ್ %2$s </a> ಗೆ ಪಿಎಚ್ ಪಿ ಆವೃತ್ತಿ %3$s ಅಥವಾ ಹೆಚ್ಚಿನ ಮತ್ತು Mapatapಆವೃತ್ತಿ ಅಥವಾ %4$s ಹೆಚ್ಚಿನದು ಅಗತ್ಯವಿದೆ. ನೀವು ಪಿಎಚ್ ಪಿ ಆವೃತ್ತಿ %5$s ಮತ್ತು MapP ಆವೃತ್ತಿಯನ್ನು ಚಾಲನೆಯಲ್ಲಿದ್ದೀರಿ. %6$s','WordPress Updates'=>'ವರ್ಡ್ಪ್ರೆಸ್ ನವೀಕರಣಗಳು','Edit menu item'=>'ಮೆನು ಐಟಂ ಸಂಪಾದಿಸಿ','View All'=>'ಎಲ್ಲವನ್ನೂ ವೀಕ್ಷಿಸಿ','Please enter a valid menu name.'=>'ದಯವಿಟ್ಟು ಮಾನ್ಯವಾದ ಮೆನು ಹೆಸರನ್ನು ನಮೂದಿಸಿ.','Go to Dashboard'=>'ಡ್ಯಾಶ್ಬೋರ್ಡ್ಗೆ ಹೋಗಿ','Delete Plugin'=>'ಪ್ಲಗಿನ್ ಅಳಿಸಿ','Must-Use <span class="count">(%s)</span>'=>'<span class="count">(%s)</span> ಅನ್ನು ಬಳಸಬೇಕು' . "\0" . '<span class="count">(%s)</span> ಗಳನ್ನು ಬಳಸಬೇಕು','Drop-in <span class="count">(%s)</span>'=>'ಡ್ರಾಪ್-ಇನ್ <span class="count">(%s)</span>' . "\0" . 'ಡ್ರಾಪ್-ಇನ್ಗಳು <span class="count">(%s)</span>','You are about to remove the following plugin:'=>'ನೀವು ಈ ಕೆಳಗಿನ ಪ್ಲಗಿನ್ ಅನ್ನು ತೆಗೆದುಹಾಕಲಿರುವಿರಿ:','Are you sure you want to delete these files and data?'=>'ಈ ಫೈಲ್‌ಗಳು ಮತ್ತು ಡೇಟಾವನ್ನು ಅಳಿಸಲು ನೀವು ಖಚಿತವಾಗಿ ಬಯಸುವಿರಾ?','Yes, delete these files and data'=>'ಹೌದು, ಈ ಫೈಲ್‌ಗಳು ಮತ್ತು ಡೇಟಾವನ್ನು ಅಳಿಸಿ','Inactive:'=>'ನಿಷ್ಕ್ರಿಯ:','This timezone does not observe daylight saving time.'=>'ಈ ಸಮಯವಲಯವು ಹಗಲಿನ ಉಳಿಸುವ ಸಮಯವನ್ನು ಗಮನಿಸುವುದಿಲ್ಲ.','This timezone is currently in daylight saving time.'=>'ಈ ಸಮಯವಲಯವು ಪ್ರಸ್ತುತ ಹಗಲಿನ ಉಳಿತಾಯ ಸಮಯದಲ್ಲಿದೆ.','Custom maintenance message.'=>'ಸ್ವಯೋಜಿತ ನಿರ್ವಹಣಾ ಸಂದೇಶ.','Custom database error message.'=>'ಕಸ್ಟಮ್ ಡೇಟಾಬೇಸ್ ದೋಷ ಸಂದೇಶ.','File is empty. Please upload something more substantial.'=>'ಫೈಲ್ ಖಾಲಿಯಾಗಿದೆ. ದಯವಿಟ್ಟು ಹೆಚ್ಚು ಗಣನೀಯವಾದ ಯಾವುದನ್ನಾದರೂ ಅಪ್‌ಲೋಡ್ ಮಾಡಿ.','Executed before Multisite is loaded.'=>'ಮಲ್ಟಿಸೈಟ್ ಅನ್ನು ಲೋಡ್ ಮಾಡುವ ಮೊದಲು ಕಾರ್ಯಗತಗೊಳಿಸಲಾಗಿದೆ.','External object cache.'=>'ಬಾಹ್ಯ ವಸ್ತು ಸಂಗ್ರಹ.','Custom database class.'=>'ಕಸ್ಟಮ್ ಡೇಟಾಬೇಸ್ ವರ್ಗ.','Advanced caching plugin.'=>'ಸುಧಾರಿತ ಹಿಡಿದಿಟ್ಟುಕೊಳ್ಳುವ ಪ್ಲಗಿನ್.','You cannot install because <a href="%1$s">WordPr