mpatibility with WordPress %s: Unknown'=>'ವರ್ಡ್ಪ್ರೆಸ್ %s ನೊಂದಿಗೆ ಹೊಂದಾಣಿಕೆ: ಅಜ್ಞಾತ','Media file restored from the Trash.'=>'ಮಾಧ್ಯಮ ಫೈಲ್ ಅನ್ನು ಅನುಪಯುಕ್ತದಿಂದ ಮರುಸ್ಥಾಪಿಸಲಾಗಿದೆ.','Media file moved to the Trash.'=>'ಮಾಧ್ಯಮ ಫೈಲ್ ಅನ್ನು ಅನುಪಯುಕ್ತಕ್ಕೆ ಸರಿಸಲಾಗಿದೆ.','Media file permanently deleted.'=>'ಮಾಧ್ಯಮ ಫೈಲ್ ಅನ್ನು ಶಾಶ್ವತವಾಗಿ ಅಳಿಸಲಾಗಿದೆ.','Your WordPress database is already up to date!'=>'ನಿಮ್ಮ ವರ್ಡ್ಪ್ರೆಸ್ ಡೇಟಾಬೇಸ್ ಈಗಾಗಲೇ ಅಪ್ ಟು ಡೇಟ್ ಆಗಿದೆ!','Installing theme from uploaded file: %s'=>'ಅಪ್‌ಲೋಡ್ ಮಾಡಿದ ಫೈಲ್‌ನಿಂದ ಥೀಮ್ ಅನ್ನು ಸ್ಥಾಪಿಸಲಾಗುತ್ತಿದೆ: %s','Upload Theme'=>'ಥೀಮ್ ಅಪ್‌ಲೋಡ್ ಮಾಡಿ','Admin Color Scheme'=>'ನಿರ್ವಹಣೆ ಬಣ್ಣದ ಯೋಜನೆ','Type your new password again.'=>'ನಿಮ್ಮ ಹೊಸ ಪಾಸ್‌ವರ್ಡ್ ಅನ್ನು ಮತ್ತೆ ಟೈಪ್ ಮಾಡಿ.','Share a little biographical information to fill out your profile. This may be shown publicly.'=>'ನಿಮ್ಮ ಪ್ರೊಫೈಲ್ ಅನ್ನು ಭರ್ತಿ ಮಾಡಲು ಸ್ವಲ್ಪ ಜೀವನಚರಿತ್ರೆಯ ಮಾಹಿತಿಯನ್ನು ಹಂಚಿಕೊಳ್ಳಿ. ಇದನ್ನು ಸಾರ್ವಜನಿಕವಾಗಿ ತೋರಿಸಬಹುದು.','Display name publicly as'=>'ಎಂದು ಸಾರ್ವಜನಿಕವಾಗಿ ಹೆಸರು ಪ್ರದರ್ಶಿಸಿ','Enable keyboard shortcuts for comment moderation.'=>'ಕಾಮೆಂಟ್ ಮಾಡರೇಶನ್‌ಗಾಗಿ ಕೀಬೋರ್ಡ್ ಶಾರ್ಟ್‌ಕಟ್‌ಗಳನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಿ.','Available Widgets'=>'ಲಭ್ಯವಿರುವ ವಿಜೆಟ್‌ಗಳು','Error in displaying the widget settings form.'=>'ವಿಜೆಟ್ ಸೆಟ್ಟಿಂಗ್‌ಗಳ ಫಾರ್ಮ್ ಅನ್ನು ಪ್ರದರ್ಶಿಸುವಲ್ಲಿ ದೋಷ.','Inactive Widgets'=>'ನಿಷ್ಕ್ರಿಯ ವಿಜೆಟ್‌ಗಳು','Change role to&hellip;'=>'ಪಾತ್ರವನ್ನು ಬದಲಿಸಿ&hellip;','Other user roles have been changed.'=>'ಇತರ ಬಳಕೆದಾರ ಪಾತ್ರಗಳನ್ನು ಬದಲಾಯಿಸಲಾಗಿದೆ.','The current user&#8217;s role must have user editing capabilities.'=>'ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರ ಪಾತ್ರವು ಬಳಕೆದಾರರ ಸಂಪಾದನೆ ಸಾಮರ್ಥ್ಯಗಳನ್ನು ಹೊಂದಿರಬೇಕು.','There are no valid users selected for deletion.'=>'ಅಳಿಸಲು ಯಾವುದೇ ಮಾನ್ಯ ಬಳಕೆದಾರರನ್ನು ಆಯ್ಕೆ ಮಾಡಿಲ್ಲ.','[%s] Joining Confirmation'=>'[%s] ಸೇರುವ ದೃಢೀಕರಣ','Categories:'=>'ವರ್ಗಗಳು:','Drag widgets here to remove them from the sidebar but keep their settings.'=>'ಸೈಡ್‌ಬಾರ್‌ನಿಂದ ತೆಗೆದುಹಾಕಲು ವಿಜೆಟ್‌ಗಳನ್ನು ಇಲ್ಲಿಗೆ ಎಳೆಯಿರಿ ಆದರೆ ಅವುಗಳ ಸೆಟ್ಟಿಂಗ್‌ಗಳನ್ನು ಉಳಿಸಿಕೊಳ್ಳಿ.','Formatting'=>'ಫಾರ್ಮ್ಯಾಟಿಂಗ್','Users must be registered and logged in to comment'=>'ಕಾಮೆಂಟ್ ಮಾಡಲು ಬಳಕೆದಾರರು ನೋಂದಾಯಿಸಿಕೊಳ್ಳಬೇಕು ಮತ್ತು ಲಾಗಿನ್ ಆಗಿರಬೇಕು','Visual Editor'=>'ದೃಶ್ಯ ಸಂಪಾದಕ','Comment author must have a previously approved comment'=>'ಕಾಮೆಂಟ್ ಲೇಖಕ ಹಿಂದೆ ಅನುಮೋದನೆ ಕಾಮೆಂಟ್ ಹೊಂದಿರಬೇಕು','Verifying the unpacked files&#8230;'=>'ಬಿಚ್ಚಿದ ಫೈಲ್ಗಳನ್ನು ಪರಿಶೀಲಿಸಲಾಗುತ್ತಿದೆ & # 8230;','An automated WordPress update has failed to complete - <a href="%s">please attempt the update again now</a>.'=>'ಸ್ವಯಂಚಾಲಿತ ವರ್ಡ್‌ಪ್ರೆಸ್ ಅಪ್‌ಡೇಟ್ ಪೂರ್ಣಗೊಳಿಸಲು ವಿಫಲವಾಗಿದೆ - <a href="%s"> ದಯವಿಟ್ಟು ಈಗಲೇ ನವೀಕರಣವನ್ನು ಮಗದೊಮ್ಮೆ
ಪ್ರಯತ್ನಿಸಿ</a>.','Blog pages show at most'=>'ಬ್ಲಾಗ್ ಪುಟಗಳು ಹೆಚ್ಚು ತೋರಿಸುತ್ತವೆ','Crop thumbnail to exact dimensions (normally thumbnails are proportional)'=>'ನಿಖರ ಆಯಾಮಗಳಿಗೆ ಕ್ರಾಪ್ ಥಂಬ್ನೇಲ್ (ಸಾಮಾನ್ಯವಾಗಿ ಥಂಬ್ನೇಲ್ಗಳು ಪ್ರಮಾಣಾನುಗುಣವಾಗಿರುತ್ತವೆ)','PG &#8212; Possibly offensive, usually for audiences 13 and above'=>'ಪಿ.ಜಿ. & # 8212; ಬಹುಶಃ ಆಕ್ರಮಣಕಾರಿ, ಸಾಮಾನ್ಯವಾಗಿ ಪ್ರೇಕ್ಷಕರಿಗೆ 13 ಮತ್ತು ಅದಕ್ಕಿಂತ ಹೆಚ್ಚಾಗಿ','A comment is held for moderation'=>'ಮಿತಗೊಳಿಸುವಿಕೆಗಾಗಿ ಒಂದು ಕಾಮೆಂಟ್ ನಡೆಯುತ್ತದೆ','One Column'=>'ಒಂದು ಅಂಕಣ','Invitation email sent to new user. A confirmation link must be clicked before their account is created.'=>'ಆಮಂತ್ರಣ ಇಮೇಲ್ ಹೊಸ ಬಳಕೆದಾರರಿಗೆ ಕಳುಹಿಸಲಾಗಿದೆ. ತಮ್ಮ ಖಾತೆಯನ್ನು ರಚಿಸುವ ಮೊದಲು ದೃಢೀಕರಣ ಲಿಂಕ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಬೇಕು.','WordPress should correct invalidly nested XHTML automatically'=>'ವರ್ಡ್ಪ್ರೆಸ್ ಸ್ವಯಂಚಾಲಿತವಾಗಿ ಅಮಾನ್ಯವಾಗಿ ನೆಸ್ಟೆಡ್ XHTML ಸರಿಪಡಿಸಲು ಮಾಡಬೇಕು','You are about to delete this theme \'%s\'
  \'Cancel\' to stop, \'OK\' to delete.'=>'ನೀವು ಈ ಥೀಮ್ \' %s \' ಅನ್ನು ಅಳಿಸಲಿದ್ದೀರಿ  n \'ನಿಲ್ಲಿಸಲು\' ನಿಲ್ಲಿಸಲು, ಅಳಿಸಲು \'ಸರಿ\'.','Plugins extend and expand the functionality of WordPress. Once a plugin is installed, you may activate it or deactivate it here.'=>'ಪ್ಲಗಿನ್ಗಳು ವರ್ಡ್ಪ್ರೆಸ್ ಕಾರ್ಯವನ್ನು ವಿಸ್ತರಿಸಲು ಮತ್ತು ವಿಸ್ತರಿಸಲು. ಪ್ಲಗ್ಇನ್ ಅನ್ನು ಒಮ್ಮೆ ಸ್ಥಾಪಿಸಿದ ನಂತರ, ನೀವು ಅದನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಬಹುದು ಅಥವಾ ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಬಹುದು.','Hold a comment in the queue if it contains %s or more links. (A common characteristic of comment spam is a large number of hyperlinks.)'=>'ಇದು %s ಅಥವಾ ಹೆಚ್ಚಿನ ಲಿಂಕ್ಗಳನ್ನು ಹೊಂದಿದ್ದರೆ ಕ್ಯೂನಲ್ಲಿ ಕಾಮೆಂಟ್ ಅನ್ನು ಹೋಲ್ಡ್ ಮಾಡಿ. (ಕಾಮೆಂಟ್ ಸ್ಪ್ಯಾಮ್ನ ಸಾಮಾನ್ಯ ಲಕ್ಷಣವೆಂದರೆ ಹೆಚ್ಚಿನ ಸಂಖ್ಯೆಯ ಹೈಪರ್ಲಿಂಕ್ಗಳು.)','The update cannot be installed because WordPress %1$s requires PHP version %2$s or higher. You are running version %3$s.'=>'ಅಪ್ಡೇಟ್ ಅನ್ನು ಸ್ಥಾಪಿಸಲಾಗುವುದಿಲ್ಲ ಏಕೆಂದರೆ ವರ್ಡ್ಪ್ರೆಸ್ %1$s ಗೆ PHP ಆವೃತ್ತಿ %2$s ಅಥವಾ ಹೆಚ್ಚಿನ ಅಗತ್ಯವಿದೆ. ನೀವು ಆವೃತ್ತಿ %3$s ಚಾಲನೆ ಮಾಡುತ್ತಿದ್ದೀರಿ.','The update cannot be installed because WordPress %1$s requires MySQL version %2$s or higher. You are running version %3$s.'=>'ನವೀಕರಣವನ್ನು ಸ್ಥಾಪಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ ಏಕೆಂದರೆ ವರ್ಡ್ಪ್ರೆಸ್ %1$s %2$s ಅಥವಾ ಅದಕ್ಕಿಂತ ಹೆಚ್ಚಿನ Mappattapta tampptt. ನೀವು ಆವೃತ್ತಿ %3$s ಚಾಲನೆಯಲ್ಲಿದ್ದೀರಿ.','The update cannot be installed because WordPress %1$s requires PHP version %2$s or higher and MySQL version %3$s or higher. You are running PHP version %4$s and MySQL version %5$s.'=>'ಅಪ್ಡೇಟ್ ಅನ್ನು ಸ್ಥಾಪಿಸಲಾಗುವುದಿಲ್ಲ ಏಕೆಂದರೆ ವರ್ಡ್ಪ್ರೆಸ್ %1$s ಗೆ PHP ಆವೃತ್ತಿ %2$s ಅಥವಾ ಹೆಚ್ಚಿನದು ಮತ್ತು MySQL ಆವೃತ್ತಿ %3$s ಅಥವಾ ಹೆಚ್ಚಿನದು ಅಗತ್ಯವಿದೆ. ನೀವು PHP ಆವೃತ್ತಿ %4$s ಮತ್ತು MySQL ಆವೃತ್ತಿ %5$s ಅನ್ನು ಚಾಲನೆ ಮಾಡುತ್ತಿದ್ದೀರಿ.','Convert emoticons like <code>:-)</code> and <code>:-P</code> to graphics on display'=>'ಪ್ರದರ್ಶಕದಲ್ಲಿ ಗ್ರಾಫಿಕ್ಸ್ಗೆ <code>: -)</code>ಮತ್ತು <code>: - P </code> ನಂತಹ ಭಾವನೆಯನ್ನು ಪರಿವರ್ತಿಸಿ','Select both the sidebar for this widget and the position of the widget in that sidebar.'=>'ಈ ವಿಜೆಟ್ಗಾಗಿ ಸೈಡ್ಬಾರ್ನಲ್ಲಿ ಮತ್ತು ಆ ಸೈಡ್ಬಾರ್ನಲ್ಲಿರುವ ವಿಜೆಟ್ನ ಸ್ಥಾನವನ್ನು ಆಯ್ಕೆಮಾಡಿ.','To post to WordPress by email, you must set up a secret email account with POP3 access. Any mail received at this address will be posted, so it&#8217;s a good idea to keep this address very secret. Here are three random strings you could use: %1$s, %2$s, %3$s.'=>'ಇಮೇಲ್ ಮೂಲಕ ವರ್ಡ್ಪ್ರೆಸ್ಗೆ ಪೋಸ್ಟ್ ಮಾಡಲು ನೀವು POP3 ಪ್ರವೇಶದೊಂದಿಗೆ ರಹಸ್ಯ ಇಮೇಲ್ ಖಾತೆಯನ್ನು ಹೊಂದಿಸಬೇಕು. ಈ ವಿಳಾಸದಲ್ಲಿ ಸ್ವೀಕರಿಸಿದ ಯಾವುದೇ ಮೇಲ್ ಅನ್ನು ಪೋಸ್ಟ್ ಮಾಡಲಾಗುವುದು, ಆದ್ದರಿಂದ ಈ ವಿಳಾಸವನ್ನು ರಹಸ್ಯವಾಗಿಡಲು ಒಳ್ಳೆಯದು. ನೀವು ಬಳಸಬಹುದಾದ ಮೂರು ಯಾದೃಚ್ಛಿಕ ತಂತಿಗಳು ಇಲ್ಲಿವೆ: %1$s , %2$s , %3$s .','<strong><em>Note that password</em></strong> carefully! It is a <em>random</em> password that was generated just for you.'=>'<strong> <em> ಆ ಗುಪ್ತಪದವನ್ನು ಗಮನಿಸಿ </em> </strong>ಎಚ್ಚರಿಕೆಯಿಂದ! ಇದು ನಿಮಗಾಗಿ ರಚಿಸಲಾದ <em> ಯಾದೃಚ್ಛಿಕ </em>ಪಾಸ್ವರ್ಡ್ ಆಗಿದೆ.','Some database problems could not be repaired. Please copy-and-paste the following list of errors to the <a href="%s">WordPress support forums</a> to get additional assistance.'=>'ಕೆಲವು ಡೇಟಾಬೇಸ್ ಸಮಸ್ಯೆಗಳನ್ನು ದುರಸ್ತಿ ಮಾಡಲಾಗಲಿಲ್ಲ. ಹೆಚ್ಚುವರಿ ಸಹಾಯ ಪಡೆಯಲು 
 <a href="%s">ವರ್ಡ್ಪ್ರೆಸ್ ಬೆಂಬಲ ವೇದಿಕೆಗಳಿಗೆ </a> ಕೆಳಗಿನ ದೋಷಗಳ ಪಟ್ಟಿಯನ್ನು ನಕಲಿಸಿ ಮತ್ತು ಅಂಟಿಸಿ.','When a comment contains any of these words in its content, author name, URL, email, IP address, or browser&#8217;s user agent string, it will be put in the Trash. One word or IP address per line. It will match inside words, so &#8220;press&#8221; will match &#8220;WordPress&#8221;.'=>'ಅದರ ವಿಷಯ, ಹೆಸರು, URL, ಇಮೇಲ್ ಅಥವಾ IP ವಿಳಾಸದಲ್ಲಿ ಈ ಪದಗಳಲ್ಲಿ ಯಾವುದಾದರೂ ಒಂದು ಕಾಮೆಂಟ್ ಅನ್ನು ಕಾಮೆಂಟ್ ಮಾಡಿದಾಗ, ಅದನ್ನು ಅನುಪಯುಕ್ತದಲ್ಲಿ ಇರಿಸಲಾಗುತ್ತದೆ. ಪ್ರತಿ ಸಾಲಿಗೆ ಒಂದು ಪದ ಅಥವಾ IP ವಿಳಾಸ. ಇದು ಪದಗಳ ಒಳಗೆ ಹೊಂದಾಣಿಕೆ ಮಾಡುತ್ತದೆ, ಆದ್ದರಿಂದ & # 8220; ಒತ್ತಿ & # 8221; ವರ್ಡ್ಪ್ರೆಸ್ & # 8220; ವರ್ಡ್ಪ್ರೆಸ್ & # 8221; ಹೊಂದಾಣಿಕೆಯಾಗುತ್ತದೆ.','When a comment contains any of these words in its content, author name, URL, email, IP address, or browser&#8217;s user agent string, it will be held in the <a href="edit-comments.php?comment_status=moderated">moderation queue</a>. One word or IP address per line. It will match inside words, so &#8220;press&#8221; will match &#8220;WordPress&#8221;.'=>'ಕಾಮೆಂಟ್ ಈ ವಿಷಯಗಳಲ್ಲಿ ಯಾವುದಾದರೂ ವಿಷಯವನ್ನು ಒಳಗೊಂಡಿರುವಾಗ, ಲೇಖಕರ ಹೆಸರು, URL, ಇಮೇಲ್, IP ವಿಳಾಸ, ಅಥವಾ ಬ್ರೌಸರ್‌ನ ಬಳಕೆದಾರ ಏಜೆಂಟ್ ಸ್ಟ್ರಿಂಗ್, ಅದನ್ನು <a href="edit-comments.php?comment_status=moderated"> ನಲ್ಲಿ ಹಿಡಿದಿಡಲಾಗುತ್ತದೆ  ಮಾಡರೇಶನ್ ಕ್ಯೂ </a>.  ಪ್ರತಿ ಸಾಲಿಗೆ ಒಂದು ಪದ ಅಥವಾ ಐಪಿ ವಿಳಾಸ.  ಇದು ಪದಗಳ ಒಳಗೆ ಹೊಂದಿಕೆಯಾಗುತ್ತದೆ, ಆದ್ದರಿಂದ "ಪ್ರೆಸ್" "ವರ್ಡ್ಪ್ರೆಸ್" ಗೆ ಹೊಂದಿಕೆಯಾಗುತ್ತದೆ.','Compatibility with WordPress %s: 100%% (according to its author)'=>'ವರ್ಡ್ಪ್ರೆಸ್ %s ಹೊಂದಾಣಿಕೆ: 100%% (ಅದರ ಲೇಖಕರ ಪ್ರಕಾರ)','You cannot delete the current user.'=>'ನೀವು ಪ್ರಸ್ತುತ ಬಳಕೆದಾರರನ್ನು ಅಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','<strong>Error:</strong> Passwords may not contain the character "\\".'=>'<strong>ದೋಷ:</strong> ಪಾಸ್‌ವರ್ಡ್‌ಗಳು "\\" ಅಕ್ಷರವನ್ನು ಹೊಂದಿರದೇ ಇರಬಹುದು.','Please provide the following information. Do not worry, you can always change these settings later.'=>'ದಯವಿಟ್ಟು ಕೆಳಗಿನ ಮಾಹಿತಿಯನ್ನು ಒದಗಿಸಿ. ಚಿಂತಿಸಬೇಡಿ, ನೀವು ಯಾವಾಗ ಬೇಕಾದರೂ ಈ ಸೆಟ್ಟಿಂಗ್‌ಗಳನ್ನು ನಂತರ ಬದಲಾಯಿಸಬಹುದು.','<strong>Error:</strong> 