rackbacks'=>'ಟ್ರ್ಯಾಕ್‌ಬ್ಯಾಕ್‌ಗಳನ್ನು ಕಳುಹಿಸಿ','Custom field updated.'=>'ಕಸ್ಟಮ್ ಕ್ಷೇತ್ರವನ್ನು ನವೀಕರಿಸಲಾಗಿದೆ.','LiveJournal'=>'LiveJournal','Item updated.'=>'ಐಟಂ ಅನ್ನು ನವೀಕರಿಸಲಾಗಿದೆ.','Item deleted.'=>'ಐಟಂ ಅನ್ನು ಅಳಿಸಲಾಗಿದೆ.','Last edited by %1$s on %2$s at %3$s'=>'%1$s ನಿಂದ %2$s ನಂದು %3$s ನಲ್ಲಿ ಕೊನೆಯದಾಗಿ ಸಂಪಾದಿಸಲಾಗಿದೆ','Page restored to revision from %s.'=>'ಪುಟವನ್ನು %s ನಿಂದ ಪರಿಷ್ಕರಣೆಗೆ ಮರುಸ್ಥಾಪಿಸಲಾಗಿದೆ.','Post restored to revision from %s.'=>'ಪೋಸ್ಟ್ ಅನ್ನು %s ನಿಂದ ಪರಿಷ್ಕರಣೆಗೆ ಮರುಸ್ಥಾಪಿಸಲಾಗಿದೆ.','Changing to %s'=>'%s ಗೆ ಬದಲಾಯಿಸಲಾಗುತ್ತಿದೆ','<code>_top</code> &mdash; current window or tab, with no frames.'=>'<code>_top</code> &mdash; ಯಾವುದೇ ಚೌಕಟ್ಟುಗಳಿಲ್ಲದೆ ಪ್ರಸ್ತುತ ವಿಂಡೋ ಅಥವಾ ಟ್ಯಾಬ್.','%s comment restored from the spam.'=>'%s ಸ್ಪ್ಯಾಮ್‌ನಿಂದ ಕಾಮೆಂಟ್ ಅನ್ನು ಮರುಸ್ಥಾಪಿಸಲಾಗಿದೆ.' . "\0" . '%s ಸ್ಪ್ಯಾಮ್‌ನಿಂದ ಕಾಮೆಂಟ್‌ಗಳನ್ನು ಮರುಸ್ಥಾಪಿಸಲಾಗಿದೆ.','Could not update link in the database.'=>'ಡೇಟಾಬೇಸ್‌ನಲ್ಲಿ ಲಿಂಕ್ ಅನ್ನು ನವೀಕರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Could not insert link into the database.'=>'ಡೇಟಾಬೇಸ್‌ಗೆ ಲಿಂಕ್ ಸೇರಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','This will be shown when someone hovers over the link in the blogroll, or optionally below the link.'=>'ಬ್ಲಾಗ್‌ರೋಲ್‌ನಲ್ಲಿರುವ ಲಿಂಕ್ ಮೇಲೆ ಯಾರಾದರೂ ಸುಳಿದಾಡಿದಾಗ ಅಥವಾ ಐಚ್ಛಿಕವಾಗಿ ಲಿಂಕ್ ಕೆಳಗೆ ಇರುವಾಗ ಇದನ್ನು ತೋರಿಸಲಾಗುತ್ತದೆ.','FTP hostname is required'=>'FTP ಹೋಸ್ಟ್ ನೇಮ್ ಅಗತ್ಯವಿದೆ','When you click the button below WordPress will create an XML file for you to save to your computer.'=>'ನೀವು ಕೆಳಗಿನ ಬಟನ್ ಅನ್ನು ಕ್ಲಿಕ್ ಮಾಡಿದಾಗ ವರ್ಡ್ಪ್ರೆಸ್ ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್ ಗೆ ಸೇವ್ ಮಾಡಲು XML ಫೈಲ್ ಅನ್ನು ರಚಿಸುತ್ತದೆ.','Username/Password incorrect for %s'=>'%s ಗಾಗಿ ಬಳಕೆದಾರಹೆಸರು/ಪಾಸ್‌ವರ್ಡ್ ತಪ್ಪಾಗಿದೆ','Unpacking the update&#8230;'=>'ನವೀಕರಣವನ್ನು ಅನ್ಪ್ಯಾಕ್ ಮಾಡಲಾಗುತ್ತಿದೆ&#8230;','Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have children categories for Bebop and Big Band. Totally optional.'=>'ಟ್ಯಾಗ್‌ಗಳಂತಲ್ಲದೆ ವರ್ಗಗಳು ಕ್ರಮಾನುಗತವನ್ನು ಹೊಂದಿರಬಹುದು. ನೀವು ಜಾಝ್ ವರ್ಗವನ್ನು ಹೊಂದಿರಬಹುದು, ಮತ್ತು ಅದರ ಅಡಿಯಲ್ಲಿ ಬೇಬೊಪ್ ಮತ್ತು ಬಿಗ್ ಬ್ಯಾಂಡ್‌ಗಾಗಿ ಮಕ್ಕಳ ವಿಭಾಗಗಳನ್ನು ಹೊಂದಿರಬಹುದು. ಸಂಪೂರ್ಣವಾಗಿ ಐಚ್ಛಿಕ.','Removing the old version of the plugin&#8230;'=>'ಪ್ಲಗಿನ್‌ನ ಹಳೆಯ ಆವೃತ್ತಿಯನ್ನು ತೆಗೆದುಹಾಕಲಾಗುತ್ತಿದೆ&#8230;','Removing the old version of the theme&#8230;'=>'ಥೀಮ್‌ನ ಹಳೆಯ ಆವೃತ್ತಿಯನ್ನು ತೆಗೆದುಹಾಕಲಾಗುತ್ತಿದೆ&#8230;','Preview &#8220;%s&#8221;'=>'&#8220;%s&#8221; ಅನ್ನು ಪೂರ್ವವೀಕ್ಷಿಸಿ','Popup Comments'=>'ಪಾಪ್ಅಪ್ ಕಾಮೆಂಟ್‌ಗಳು','Search Form'=>'ಹುಡುಕಾಟ ಫಾರ್ಮ್','Comments Template'=>'ಕಾಮೆಂಟ್ ಟೆಂಪ್ಲೇಟು','.htaccess (for rewrite rules )'=>'.htaccess (ನಿಯಮಗಳನ್ನು ಪುನಃ ಬರೆಯಲು )','Application Attachment Template'=>'ಅಪ್ಲಿಕೇಶನ್ ಲಗತ್ತು ಟೆಂಪ್ಲೇಟ್','Popup Comments Template'=>'ಪಾಪ್ಅಪ್ ಕಾಮೆಂಟ್ ಟೆಂಪ್ಲೇಟು','No file was uploaded.'=>'ಯಾವುದೇ ಫೈಲ್ ಅಪ್‌ಲೋಡ್ ಆಗಿಲ್ಲ.','Failed to write file to disk.'=>'ಡಿಸ್ಕ್ಗೆ ಫೈಲ್ ಬರೆಯಲು ವಿಫಲವಾಗಿದೆ.','File upload stopped by extension.'=>'ವಿಸ್ತರಣೆಯಿಂದ ಫೈಲ್ ಅಪ್‌ಲೋಡ್ ನಿಲ್ಲಿಸಲಾಗಿದೆ.','Invalid form submission.'=>'ಅಮಾನ್ಯ ಫಾರ್ಮ್ ಸಲ್ಲಿಕೆ.','Specified file failed upload test.'=>'ನಿರ್ದಿಷ್ಟಪಡಿಸಿದ ಫೈಲ್ ಅಪ್‌ಲೋಡ್ ಪರೀಕ್ಷೆಯಲ್ಲಿ ವಿಫಲವಾಗಿದೆ.','Could not create temporary file.'=>'ತಾತ್ಕಾಲಿಕ ಫೈಲ್ ಅನ್ನು ರಚಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Could not retrieve file from archive.'=>'ಆರ್ಕೈವ್‌ನಿಂದ ಫೈಲ್ ಅನ್ನು ಹಿಂಪಡೆಯಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Could not extract file from archive.'=>'ಆರ್ಕೈವ್‌ನಿಂದ ಫೈಲ್ ಅನ್ನು ಹೊರತೆಗೆಯಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Could not copy file.'=>'ಫೈಲ್ ಅನ್ನು ನಕಲಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Hostname'=>'ಹೋಸ್ಟ್ ಹೆಸರು','Authentication Keys'=>'ದೃಢೀಕರಣ ಕೀಲಿಗಳು','Image data does not exist. Please re-upload the image.'=>'ಚಿತ್ರದ ಡೇಟಾ ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ. ದಯವಿಟ್ಟು ಚಿತ್ರವನ್ನು ಮರು ಅಪ್ಲೋಡ್ ಮಾಡಿ.','Flip vertical'=>'ಲಂಬವಾಗಿ ತಿರುಗಿಸಿ','Restore Original Image'=>'ಮೂಲ ಚಿತ್ರವನ್ನು ಮರುಸ್ಥಾಪಿಸಿ','Previously edited copies of the image will not be deleted.'=>'ಈ ಹಿಂದೆ ಸಂಪಾದಿಸಿದ ಚಿತ್ರದ ಪ್ರತಿಗಳನ್ನು ಅಳಿಸಲಾಗುವುದಿಲ್ಲ.','Crop Aspect Ratio'=>'ಕ್ರಾಪ್ ಆಕಾರ ಅನುಪಾತ','Thumbnail Settings'=>'ಥಂಬ್‌ನೇಲ್ ಸೆಟ್ಟಿಂಗ್‌ಗಳು','Current thumbnail'=>'ಪ್ರಸ್ತುತ ಥಂಬ್‌ನೇಲ್','Apply changes to:'=>'ಬದಲಾವಣೆಗಳನ್ನು ಇದಕ್ಕೆ ಅನ್ವಯಿಸಿ:','All sizes except thumbnail'=>'ಥಂಬ್‌ನೇಲ್ ಹೊರತುಪಡಿಸಿ ಎಲ್ಲಾ ಗಾತ್ರಗಳು','Cannot save image metadata.'=>'ಚಿತ್ರದ ಮೆಟಾಡೇಟಾವನ್ನು ಉಳಿಸಲು ಸಾಧ್ಯವಿಲ್ಲ.','Image saved'=>'ಚಿತ್ರವನ್ನು ಉಳಿಸಲಾಗಿದೆ','Error while saving the scaled image. Please reload the page and try again.'=>'ಸ್ಕೇಲ್ ಮಾಡಿದ ಚಿತ್ರವನ್ನು ಉಳಿಸುವಾಗ ದೋಷ. ದಯವಿಟ್ಟು ಪುಟವನ್ನು ಮರುಲೋಡ್ ಮಾಡಿ ಮತ್ತು ಇನ್ನೊಮ್ಮೆ ಪ್ರಯತ್ನಿಸಿ.','From Computer'=>'ಕಂಪ್ಯೂಟರ್ ನಿಂದ','Gallery (%s)'=>'ಗ್ಯಾಲರಿ (%s)','Uploads'=>'ಅಪ್‌ಲೋಡ್‌ಗಳು','WordPress'=>'ವರ್ಡ್ಪ್ರೆಸ್','Alt text for the image, e.g. &#8220;The Mona Lisa&#8221;'=>'ಚಿತ್ರಕ್ಕಾಗಿ ಆಲ್ಟ್ ಪಠ್ಯ, ಉದಾ. &#8220;ಮೊನಾಲಿಸಾ&#8221;','Location of the uploaded file.'=>'ಅಪ್‌ಲೋಡ್ ಮಾಡಿದ ಫೈಲ್‌ನ ಸ್ಥಳ.','Upload date:'=>'ಅಪ್‌ಲೋಡ್ ದಿನಾಂಕ:','Insert into Post'=>'ಪೋಸ್ಟ್‌ಗೆ ಸೇರಿಸಿ','Add media files from your computer'=>'ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್‌ನಿಂದ ಮಾಧ್ಯಮ ಫೈಲ್‌ಗಳನ್ನು ಸೇರಿಸಿ','All Tabs:'=>'ಎಲ್ಲಾ ಟ್ಯಾಬ್‌ಗಳು:','Link thumbnails to:'=>'ಥಂಬ್ನೇಲ್ಗಳನ್ನು ಇದಕ್ಕೆ ಲಿಂಕ್ ಮಾಡಿ:','Date/Time'=>'ದಿನಾಂಕ/ಸಮಯ','Gallery columns:'=>'ಗ್ಯಾಲರಿ ಕಾಲಮ್‌ಗಳು:','Update gallery settings'=>'ಗ್ಯಾಲರಿ ಸೆಟ್ಟಿಂಗ್‌ಗಳನ್ನು ನವೀಕರಿಸಿ','Filter &#187;'=>'ಫಿಲ್ಟರ್ &#187;','Preview Changes'=>'ಬದಲಾವಣೆಗಳನ್ನು ಪೂರ್ವವೀಕ್ಷಣೆ ಮಾಡಿ','Status:'=>'ಸ್ಥಿತಿ:','+ Add New Category'=>'+ ಹೊಸ ವರ್ಗವನ್ನು ಸೇರಿಸಿ','Visit Link'=>'ಲಿಂಕ್‌ಗೆ ಭೇಟಿ ನೀಡಿ','Show comments'=>'ಕಾಮೆಂಟ್‌ಗಳನ್ನು ತೋರಿಸಿ','Separate multiple URLs with spaces'=>'ಬಹು URL ಗಳನ್ನು ಸ್ಪೇಸ್‌ಗಳೊಂದಿಗೆ ಪ್ರತ್ಯೇಕಿಸಿ','Send trackbacks to:'=>'ಟ್ರ್ಯಾಕ್‌ಬ್ಯಾಕ್‌ಗಳನ್ನು ಇದಕ್ಕೆ ಕಳುಹಿಸಿ:','New category name'=>'ಹೊಸ ವರ್ಗದ ಹೆಸರು','Choose the target frame for your link.'=>'ನಿಮ್ಮ ಲಿಂಕ್‌ಗಾಗಿ ಉದ್ದೇಶಿತ ಚೌಕಟ್ಟನ್ನು ಆರಿಸಿ.','another web address of mine'=>'ನನ್ನ ಇನ್ನೊಂದು ವೆಬ್ ವಿಳಾಸ','neighbor'=>'ನೆರೆಯವನು','child'=>'child','kin'=>'ಸಂಬಂಧಿ','date'=>'ದಿನಾಂಕ','romantic'=>'ರೋಮ್ಯಾಂಟಿಕ್','sweetheart'=>'ಪ್ರಿಯತಮೆ','Popular tags'=>'ಜನಪ್ರಿಯ ಟ್ಯಾಗ್‌ಗಳು','RSS Address'=>'RSS ವಿಳಾಸ','Compatible up to:'=>'ಈವರೆಗೆ ಹೊಂದಿಕೊಳ್ಳುತ್ತದೆ:','Last Updated:'=>'ಕೊನೆಯದಾಗಿ ನವೀಕರಿಸಿದ್ದು:','(based on %s rating)'=>'(%s ರೇಟಿಂಗ್ ಆಧರಿಸಿ)' . "\0" . '(%s ರೇಟಿಂಗ್‌ಗಳನ್ನು ಆಧರಿಸಿ)','If you have a plugin in a .zip format, you may install or update it by uploading it here.'=>'ನೀವು .zip ಫಾರ್ಮ್ಯಾಟ್‌ನಲ್ಲಿ ಪ್ಲಗಿನ್ ಹೊಂದಿದ್ದರೆ, ಅದನ್ನು ಇಲ್ಲಿ ಅಪ್‌ಲೋಡ್ ಮಾಡುವ ಮೂಲಕ ನೀವು ಅದನ್ನು ಸ್ಥಾಪಿಸಬಹುದು ಅಥವಾ ನವೀಕರಿಸಬಹುದು .','Search Plugins'=>'ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಹುಡುಕಿ','You may also browse based on the most popular tags in the Plugin Directory:'=>'ಪ್ಲಗಿನ್ ಡೈರೆಕ್ಟರಿಯಲ್ಲಿನ ಅತ್ಯಂತ ಜನಪ್ರಿಯ ಟ್ಯಾಗ್‌ಗಳನ್ನು ಆಧರಿಸಿ ನೀವು ಬ್ರೌಸ್ ಮಾಡಬಹುದು:','One of the plugins is invalid.'=>'ಪ್ಲಗ್‌ಇನ್‌ಗಳಲ್ಲಿ ಒಂದು ಅಮಾನ್ಯವಾಗಿದೆ.','WordPress.org Plugin Page &#187;'=>'WordPress.org ಪ್ಲಗಿನ್ ಪುಟ &#187;','Quick&nbsp;Edit'=>'ತ್ವರಿತ&nbsp;ಸಂಪಾದನೆ','Quick Edit'=>'ತ್ವರಿತ ಸಂಪಾದನೆ','Warning! Wildcard DNS may not be configured correctly!'=>'ಎಚ್ಚರಿಕೆ! ವೈಲ್ಡ್ ಕಾರ್ಡ್ DNS ಅನ್ನು ಸರಿಯಾಗಿ ಕಾನ್ಫಿಗರ್ ಮಾಡದಿರಬಹುದು!','Just another %s site'=>'ಇನ್ನೊಂದು %s ಸೈಟ್','The plugin does not have a valid header.'=>'ಪ್ಲಗಿನ್ ಮಾನ್ಯ ಹೆಡರ್ ಅನ್ನು ಹೊಂದಿಲ್ಲ.','Could not fully remove the plugins %s.'=>'%s ಪ್ಲಗಿನ್‌ಗಳನ್ನು ಸಂಪೂರ್ಣವಾಗಿ ತೆಗೆದುಹಾಕಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ.','Reply to Comment'=>'ಕಾಮೆಂಟ್‌ಗೆ ಪ್ರತ್ಯುತ್ತರಿಸಿ','Missed schedule'=>'ತಪ್ಪಿದ ವೇಳಾಪಟ್ಟಿ','Upload file and import'=>'ಫೈಲ್ ಅಪ್ಲೋಡ್ ಮಾಡಿ ಮತ್ತು ಆಮದು ಮಾಡಿ','Maximum size: %s'=>'ಗರಿಷ್ಠ ಗಾತ್ರ: %s','Choose a file from your computer:'=>'ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್‌ನಿಂದ ಫೈಲ್ ಆಯ್ಕೆಮಾಡಿ:','Before you can upload your import file, you will need to fix the following error:'=>'ನಿಮ್ಮ ಆಮದು ಕಡತವನ್ನು ಅಪ್‌ಲೋಡ್ ಮಾಡುವ ಮೊದಲು, ನೀವು ಈ ಕೆಳಗಿನ ದೋಷವನ್ನು ಸರಿಪಡಿಸಬೇಕಾಗುತ್ತದೆ:','Add New Custom Field:'=>'ಹೊಸ ಕಸ್ಟಮ್ ಫೀಲ್ಡ್ ಸೇರಿಸಿ:','Comment by %s marked as spam.'=>'%s ನಿಂದ ಕಾಮೆಂಟ್ ಅನ್ನು ಸ್ಪ್ಯಾಮ್ ಎಂದು ಗುರುತಿಸಲಾಗಿದೆ.','Comment by %s moved to the Trash.'=>'%s ಅವರ ಕಾಮೆಂಟ್ ಅನ್ನು ಅನುಪಯುಕ್ತಕ್ಕೆ ಸರಿಸಲಾಗಿದೆ.','Submit Reply'=>'ಉತ್ತರವನ್ನು ಸಲ್ಲಿಸಿ','Disable accessibility mode'=>'ಪ್ರವೇಶಿಸುವಿಕೆ ಮೋಡ್ ಅನ್ನು ನಿಷ್ಕ್ರಿಯಗೊಳಿಸಿ','Install Themes'=>'ಥೀಮ್‌ಗಳನ್ನು ಸ್ಥಾಪಿಸಿ','Allow Comments'=>'ಕಾಮೆಂಟ್‌ಗಳನ್ನು ಅನುಮತಿಸಿ','Custom Fields'=>'ಕಸ್ಟಮ್ ಕ್ಷೇತ್ರಗಳು','Hide'=>'ಅಡಗಿಸು','co-resident'=>'ಸಹ ನಿವಾಸಿ','Permalink:'=>'ಪರ್ಮಾಲಿಂಕ್:','crush'=>'ಕ್ರಶ್','(Leave at 0 for no rating.)'=>'(ರೇಟಿಂಗ್ ಇಲ್ಲದ 0 ಕ್ಕೆ ಬಿಡಿ.)','Sort Order:'=>'ಆದೇಶವನ್ನು ವಿಂಗಡಿಸು:','Order images by:'=>'ಇಂದ ಚಿತ್ರಗಳನ್ನು ಆರ್ಡರ್ ಮಾಡಿ:','Menu order'=>'ಮೆನು ಕ್ರಮ','Order:'=>'ಕ್ರಮ:','Flip horizontal'=>'ಅಡ್ಡಲಾಗಿ ಫ್ಲಿಪ್ ಮಾಡಿ','my-hacks.php (legacy hacks support)'=>'my-hacks.php (ಪರಂಪರೆ ಭಿನ್ನತೆಗಳು ಬೆಂಬಲ)','If the link is to a person, you can specify your relationship with them using the above form. If you would like to learn more about the idea check out <a href="https://gmpg.org/xfn/">XFN</a>.'=>'ಲಿಂಕ್ ಒಬ್ಬ ವ್ಯಕ್ತಿಗೆ ಇದ್ದರೆ, ಮೇಲಿನ ಫಾರ್ಮ್ ಅನ್ನು ಬಳಸಿಕೊಂಡು ಅವರೊಂದಿಗೆ ನಿಮ್ಮ ಸಂಬಂಧವನ್ನು ನೀವು ನಿರ್ದಿಷ್ಟಪಡಿಸಬಹುದು. ನೀವು ಆಲೋಚನೆ ಬಗ್ಗೆ ಇನ್ನಷ್ಟು ತಿಳಿದುಕೊಳ್ಳಲು ಬಯಸಿದರೆ <a href="http://gmpg.org/xfn/"> XFN </a> ಪರಿಶೀಲಿಸಿ.','Unable to locate WordPress content directory'=>'ವರ್ಡ್ಪ್ರೆಸ್ content ಡೈರೆಕ್ಟರಿಯನ್ನು ಪತ್ತೆಹಚ್ಚಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ','Could not access filesystem'=>'ಫೈಲ್ ಸಿಸ್ಟಂ ಅನ್ನು ಪ್ರವೇಶಿಸಲು ಸಾಧ್ಯವಾಗಲಿಲ್ಲ','%s pattern not updated, somebody is editing it.'=>'%s ಪ್ಯಾಟರ್ನ್ ಅನ್ನು ಅಪ್‌ಡೇಟ್ ಮಾಡಲಾಗಿಲ್ಲ, ಯಾರೋ ಅದನ್ನು ಸಂಪಾದಿಸುತ್ತಿದ್ದಾರೆ.' . "\0" . '%s ಪ್ಯಾಟರ್ನ್‌ಗಳನ್ನು ಅಪ್‌ಡೇಟ್ ಮಾಡಲಾಗಿಲ್ಲ, ಯಾರೋ ಅವುಗಳನ್ನು ಸಂಪಾದಿಸುತ್ತಿದ್ದಾರೆ.','This format, which is called WordPress eXtended RSS or WXR, will contain your posts, pages, comments, custom fields, categories, and tags.'=>'WordPress ವಿಸ್ತೃತ RSS ಅಥವಾ WXR ಎಂದು ಕರೆಯಲ್ಪಡುವ ಈ ಸ್ವರೂಪವು ನಿಮ್ಮ ಪೋಸ್ಟ್‌ಗಳು, ಪುಟಗಳು, ಕಾಮೆಂಟ್‌ಗಳು, ಕಸ್ಟಮ್ ಕ್ಷೇತ್ರಗಳು, ವಿಭಾಗಗಳು ಮತ್ತು ಟ್ಯಾಗ್‌ಗಳನ್ನು ಒಳಗೊಂಡಿರುತ್ತದೆ.','Cannot load %s.'=>'%s ಅನ್ನು ತುಂಬಲಾಗಲಿಲ್ಲ.','Import'=>'ಆಮದು','&laquo;'=>'&laquo;','&raquo;'=>'&raquo;','You did not enter a category name.'=>'ವಿಭಾಗದ ಹೆಸರನ್ನು ನೀವು ನಮೂದಿಸಿಲ್ಲ.','g:i:s a'=>'g:i:s a','Item not updated.'=>'ವಸ್ತುವನ್ನು ನವೀಕರಿಸಿಲ್ಲ.','Draft saved at %s.'=>'ಕರಡುಪ್ರತಿಯನ್ನು %s ನಲ್ಲಿ ಉಳಿಸಲಾಗಿದೆ.','Someone'=>'ಯಾರೋ ಒಬ್ಬರು','Saving is disabled: %s is currently editing this page.'=>'ಉಳಿಸುವಿಕೆ ನಿಷ್ಕ್ರಿಯವಾಗಿದೆ: %s ಅವರು ಪ್ರಸ್ತುತ ಈ ಪುಟವನ್ನು ಸಂಪಾದಿಸುತ್ತಿದ್ದಾರೆ.','Invalid plugin page.'=>'ಅಸಿಂಧುವಾದ ಪ್ಲಗ್ ಇನ್ ಪುಟ.','You are about to delete the following comment:'=>'ಈ ಕೆಳಗಿನ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ನೀವು ಅಳಿಸಲಿದ್ದೀರಿ:','You are about to mark the following comment as spam:'=>'ಈ ಕೆಳಗಿನ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ನೀವು ಸ್ಪಾಮ್ ಎಂದು ಗುರುತಿಸಲಿದ್ದೀರಿ:','This comment is in the Trash. Please move it out of the Trash if you want to edit it.'=>'ಈ ಪ್ರತಿಕ್ರಿಯೆಯು ಅನುಪಯುಕ್ತದಲ್ಲಿದೆ. ನೀವು ಅದನ್ನು ಸಂಪಾದಿಸ ಬೇಕಿದ್ದಲ್ಲಿ ದಯವಿಟ್ಟು ಅದನ್ನು ಹೊರತೆಗೆಯಿರಿ.','Edit Comment'=>'ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ಸಂಪಾದಿಸಿ','Saving is disabled: %s is currently editing this post.'=>'ಉಳಿಸುವಿಕೆ ನಿಷ್ಕ್ರಿಯವಾಗಿದೆ: %s ಅವರು ಪ್ರಸ್ತುತ ಈ ಲೇಖನವನ್ನು ಸಂಪಾದಿಸುತ್ತಿದ್ದಾರೆ.','Sorry, you must be logged in to reply to a comment.'=>'ಕ್ಷಮಿಸಿ, ಪ್ರತಿಕ್ರಿಯೆಗೆ ಉತ್ತರಿಸಲು ನೀವು ಲಾಗಿನ್ ಆಗಿರಲೇಬೇಕು.','You are about to move the following comment to the Trash:'=>'ಈ ಕೆಳಗಿನ ಪ್ರತಿಕ್ರಿಯೆಯನ್ನು ನೀವು ಅನುಪಯುಕ್ತಕ್ಕೆ ಕಳುಹಿಸಲಿದ್ದೀರಿ:','Sorry, you are not allowed to edit comments on this post.'=>'ಕ್ಷಮಿಸಿ, ಈ ಲೇಖನದ ಪ್ರತಿಕ್ರಿಯೆಗಳನ್ನು ಸಂಪಾದಿಸುವುದಕ್ಕೆ ನಿಮಗೆ ಅನುಮತಿ ಇಲ್ಲ.','Comment %d does not exist'=>'%d ಪ್ರತಿಕ್ರಿಯೆಯು ಅಸ್ತಿತ್ವದಲ್ಲಿಲ್ಲ','Please provide a custom field value.'=>'ದಯವಿಟ್ಟು ಕಸ್ಟಮ್ ಫೀಲ್ಡ್ ಮೌಲ್ಯವನ್ನು ಒದಗಿಸಿ.','Go Back'=>'ಹಿಂದಕ್ಕೆ ಹೋಗಿ']];